_G.pg.base.ship_skin_words[100010] = {
	feeling1 = "You're pretty amazing to have gotten on my bad side! But I won't get angry just to appease you! Haha! Enjoy your emptiness!",
	feeling3 = "I'll let you in on a little secret. My little sister keeps telling people that she's smarter than me. But truth is, she's dumber! I try to be nice and let her feel good about herself, like a big sister should. Ha!",
	lose = "So why am I on the battlefield anyway, purin?!",
	propose = "As a simple Bulin, I'm meant to just help strengthen your other ships... But you gave me this ring... You're a strange one! I like you! Come, let's raise our hands together and say purin~ purin~!",
	expedition = "Yaaaay~! Commander! The girls who went out on a commission have come back! Let's drill something to celebrate!",
	win_mvp = "Purin~! I'm the strongest!",
	home = "Let's run around and relax! Purin~!",
	mission = "Purin~! The next mission has been chosen for you!",
	touch2 = "Purin~ purin~! (Prototype Bulin MKII continues to spin faster)",
	voice_key_2 = -1,
	skill = "My drill is the drill that will pierce the heavens!",
	drop_descrip = "Prototype Bulin MKII. Can be used to limit break all Super Rare ships.",
	mail = "Purin! Secret skill: Drill Translation!",
	touch = "Purin~ You can't catch me!",
	profile = "Hahaha! It's your lucky day now that you've met me! We can purin together from this day forward! What for? To make everyone stronger, obviously! How do you purin? Like this! Purin~! Purin~!",
	mission_complete = "I'm just heading out to fetch your rewards, purin! I promise I won't break them!",
	feeling4 = "Whee~! I'm flying! So~ high! Hey, don't move! You'll have to catch me if I fall!",
	unlock = "Purin~! The herald of good fortune has arrived! Are you ready? Raise your hands and follow me... Purin~ purin~!",
	feeling5 = "You're not an average commander if you managed to conquer my heart. But I won't be shy or blush! Instead I'll give you a growl! Graaaah!",
	main = "Purin~! It's so big in here! There's so much room to run around!|Oh right, it's not my job to just run around, is it? Purin~!|Purin~? I'm too loud? Hmph, who cares what you think!",
	battle = "Purin~! Don't stop until they kneel and cry!",
	upgrade = "[Cannot be enhanced]",
	voice_key = 10001,
	headtouch = "",
	feeling2 = "My sister is so dumb. When people talk about our colors, it's not about our hair, it's about ra... rari... ah, now I remember! Reality TV!",
	login = "Righty tighty, Lefty loosey, Stay calm and Purin on!",
	vote = "",
	hp_warning = "",
	id = 100010,
	detail = "Staring at me all day won't turn you into an expert!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[100020] = {
	feeling1 = "You've lost your way, but don't give up! Pull yourself together, bulin!",
	feeling3 = "As thanks for always hanging with me, I'll let you borrow my Kitty Kabam Hammer for an hour, bulin! But don't use it for any mean stuff, okay?",
	lose = "My batteries are out... My Kitty Kabam Hammer was never made for battle, bulin!",
	propose = "Woohoo! This shiny ring is proof of our love bond, bulin! Watch this! I'm gonna whack it to infinity with my hammer! ...Never, ever whack the ring? Okay then, bulin!",
	expedition = "Bulin! The commission team has returned with boatloads of rewards!",
	win_mvp = "My Kitty Kabam Hammer is the strongest around, bulin!",
	home = "Bulin? My gear and I both need to recharge, bulin!",
	mission = "A new mission? A good bonk with my hammer should finish it, bulin!",
	touch2 = "Oh nooooooo! I'm gonna overload, bulin!",
	voice_key_2 = -1,
	skill = "My hammer is the hammer that will bring down the stars, bulin!",
	drop_descrip = "Specialized Bulin Custom MKIII. Can be used to Limit Break all Ultra Rare ships.",
	mail = "Is it true that more mail comes in when I go \"bulin\"?",
	touch = "This bad boy is my \"raison d'etre\"! Be careful with it, or you'll get hurt, bulin!",
	profile = "A wrench, a drill, and a hammer... Wait a sec! Is there some kind of pattern here, bulin?!",
	mission_complete = "Look here! Smash that Collect All button, bulin!",
	feeling4 = "Are you sure you aren't hanging out with me too much, Commander? If this keeps up, the port will be in ruins soon, bulin!",
	unlock = "Bulin~! Aren't you amazed? Standing before you is the legendary secret unlockable character of the Bulin family, none other than me! Rejoice, for you have been blessed with supremely good RNG, bulin!",
	feeling5 = "I was made to upgrade fleets, nothing more, and yet you're being so kind to me... I love you, Commander! Let me give you a special type of bonk, bulin! Hm? You'd rather not?",
	main = "Sleepy, bulin? Then I'll charge you right up! I just need to plug in my... What? That doesn't work, bulin?|You might get a surprise when you collect 1 of each bulin! But I dunno what the surprise would even be!|My Kitty Kabam Hammer goes glimmer-glammer, sparkely sparkle, whooshy-kablam! Check it out, bulin!",
	battle = "I'm fully charged, bulin! Let's show them what a real bulin's made of!",
	upgrade = "Glad you asked, but I can't be enhanced, bulin!",
	voice_key = 10002,
	headtouch = "",
	feeling2 = "The other bulins are only one color, but I'm the whole rainbow! Which can only mean one thing: that I'm the strongest of the bunch, bulin!",
	login = "Commander, it's hammer time! You'll get super strong, bulin!",
	vote = "",
	hp_warning = "Oh heck! My health bar is glowing red, bulin!",
	id = 100020,
	detail = "If ever in doubt, just tell me to bonk it with my hammer, bulin!",
	couple_encourage = {
		{
			{
				10001,
				10000
			},
			2,
			"Bulin Brigade, busting through, bulin!",
			0
		},
		{
			{
				10126
			},
			1,
			"Let's make 'em taste the rainbow!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[101020] = {
	feeling1 = "You're scarier than any storm, Commander...",
	feeling3 = "Commander, I cleaned your office earlier. Wouldn't you say it looks more orderly now? I could clean your bedroom too, if you'd like!",
	lose = "I-I messed up...",
	propose = "Is this... for me? Am I really your most beloved...? Okay! I can't promise I'll be perfect, but I will support you in any way I can, be it at work or in private!",
	expedition = "The commission team has returned! They've brought with them exactly what we needed, so let's put it to good use!",
	win_mvp = "I did only what was expected of me. Everyone else deserves the rewards!",
	home = "Well done on the last mission! Allow me to take care of the after-combat report, and you can get some rest in the meanwhile.",
	mission = "If missions feel like a chore to you, let me take care of them!",
	touch2 = "Hm...? My chest doesn't hurt, so why'd you do that?",
	voice_key_2 = -1,
	skill = "I'll handle this!",
	drop_descrip = "Farragut-class destroyer – Dewey, Hull Number DD-349.",
	mail = "Commander, please check your new intel regularly. By staying up-to-date, you can prevent disaster from striking.",
	touch = "My hair is a little messy? Oh, thank you for pointing it out! Please let me return the favor by giving you a massage later!",
	profile = "I'm the Farragut-class destroyer, Dewey. I took part in many carrier convoys and support missions. I pride myself on my service history! Although... I sadly couldn't save two of my sister ships who were in trouble... Typhoons can be frighteningly strong...",
	mission_complete = "Isn't it wasteful to simply leave the mission rewards sitting there?",
	feeling4 = "Did you lose something, Commander? Then I'll search your room and try to find it!",
	unlock = "I'm Dewey, I'm a destroyer. If there's anything I can help with, please just say the word. Whatever I'm tasked with, I'll give it my all!",
	feeling5 = "Commander, does your freshly dried futon feel comfy? Keeping your living environment clean is good for your health. But I'll look after you if you should ever fall sick, so don't worry about that!",
	main = "I love listening to music. My favorite song is made by Lexington!|Eep! S-Sorry, Commander! Typhoons and thunder are just too scary for me...|The caring Yorktown, the cool Enterprise, the peppy Saratoga... The Eagle Union has good people left and right.",
	battle = "I'll do the best I can for everyone's sake!",
	upgrade = "No matter how tough the going gets, I will not let anyone down!",
	voice_key = 10102,
	headtouch = "",
	feeling2 = "Are you hungry, Commander? Then would you like me to cook some curry and rice for you? Just so you know, I can't guarantee you'll like it.",
	login = "Welcome back, Commander. Could we inspect the port's emergency relief supplies? You never know when disaster might strike.",
	vote = "",
	hp_warning = "I've taken significant damage... but I'm still in the fight!",
	id = 101020,
	detail = "Is there something on your mind, Commander? Something you need my help for...?",
	couple_encourage = {
		{
			{
				10702
			},
			1,
			"Could we perform together again?",
			0
		},
		{
			{
				10703
			},
			1,
			"I'll keep you covered, Sara!",
			0
		},
		{
			{
				10705,
				10706
			},
			2,
			"I never thought I'd get to fight with you again... I'll do my absolute best!",
			0
		},
		{
			{
				10105
			},
			1,
			"Gridley, just fire whenever you want.",
			0
		}
	}
}

