_G.pg.base.ship_skin_words[101040] = {
	feeling1 = "There's nothing I hate more than the listless!",
	feeling3 = "My body? Don't pay it any attention. I've only had half of it replaced. I can still eat and sleep just fine. Nothing's wrong!",
	lose = "Ow ow ow... My magazine's been...",
	propose = "...... I never thought I would see the day when I would receive this from you... It's not that I don't believe in you, Commander, it's that I don't believe... in myself. But now I can live without worries! Thank you, Commander!",
	expedition = "A commission has been completed... Hey, are there any commissions where we can blow stuff up?",
	win_mvp = "Weaklings, do you know Downes' power now?",
	home = "Everyone is back! When are we taking off again?",
	mission = "Looks like you've got some unfinished missions!",
	touch2 = "You looking to get bitten?",
	voice_key_2 = -1,
	skill = "Eat this!",
	drop_descrip = "Mahan-class destroyer - Downes, Hull Number DD-375!",
	mail = "Yo! You've got mail!",
	touch = "Ah, that's the spot, right there~",
	profile = "Yahoo! I'm the Mahan-class destroyer Downes! I've had to undergo some pretty serious repairs, and have had to replace half my body! I'm stronger than I ever was now! I promise, you won't be disappointed!",
	mission_complete = "Alright, let's go fetch those rewards!",
	feeling4 = "Although I really shouldn't care... I still worry if my love will accept me like this... Huh?! Commander! When did you get here? No, it's nothing. I was just... t-t... talking to myself!",
	unlock = "Hey! Are you the commander? I'm Downes. Nice meeting you!",
	feeling5 = "Commander, um... what should I say... I... my body may... be full of holes... but my heart is whole... and I give it all... to you...",
	main = "Tsk! I'm so bored~ I wanna blow something up!|My magazine's too easy to hit? It's fine, one day or another it'll blow up anyway!|Oh, Commander, what do you think of the phrase, \"I'm only half the person I used to be\"? Sounds kinda philosophical, doesn't it?",
	battle = "Let's go, girls! Show them what we've got!",
	upgrade = "Hey, I really want to make something violently explode right now!",
	voice_key = 10104,
	headtouch = "",
	feeling2 = "Hey, Commander, don't be such a slouch! How about going blast fishing with me?",
	login = "Yo~! Commander, the wind is nice today. Want to go with me and feed our enemies some torpedoes?",
	vote = "",
	hp_warning = "",
	id = 101040,
	detail = "Oh? Do you fancy girls with a bit of muscle? Girls like me?",
	couple_encourage = {}
}

