_G.pg.base.ship_skin_words[101070] = {
	feeling1 = "(McCall continues licking her popsicle and acts like she didn't notice you.)",
	feeling3 = "Tips for daydreaming? Empty your mind and don't think about anything. Don't forget about your popsicle before it melts, though...",
	lose = "Whoa, I got so scared I dropped my popsicle...",
	propose = "My life's changed ever since I met you, Commander... I'm sure we'll get to do many new things together. But there's one thing I hope won't ever change: that I'll be together with you...",
	expedition = "...Oh, everyone's back. I'll go get some popsicles.",
	win_mvp = "\"Slay the enemy while your blade is still warm\"... Is that true for popsicles as well? Oh, it melted...",
	home = "It's kinda hot in here, got anything to help me cool down?",
	mission = "Missions, huh? Whatever happens, happens.",
	touch2 = "Ah, it's so hot...",
	voice_key_2 = -1,
	skill = "Let's finish this before my popsicle melts!",
	drop_descrip = "Gridley-class destroyer - McCall, Hull Number DD-400!",
	mail = "*Sigh* There's no end to all this mail...",
	touch = "... Are you trying to encourage me?",
	profile = "I'm McCall, third ship of the Gridley-class. There isn't much special about me, except that I've lived as long as my big sisters. I'm just relieved know that they're doing well.",
	mission_complete = "Help me pack up these rewards... Hey, can we have them sent to my house?",
	feeling4 = "Want a taste of my popsicle, Commander? Ah, yeah, it'd be like an indirect kiss, but that's fine... Anyway, can I daydream for a bit and lean on your back?",
	unlock = "Hello, Commander. Just call me McCall. I like to sleep, daydream, and eat popsicles. Please assign me somewhere peaceful, will you?",
	feeling5 = "I used to hope that my days of just eating popsicles and daydreaming would go on forever. But after meeting you, Commander, I think I might have been wrong...",
	main = "We all get along around here, don't you think? Care for a popsicle?|Ahh... Hawaii was so hot. I felt like I was melting...|... Ah! Oh no! My popsicle melted.",
	battle = "We have to fight? Guess I couldn't avoid it forever...",
	upgrade = "Hm... It's nothing special.",
	voice_key = 10107,
	headtouch = "",
	feeling2 = "I heard those Sakura Empire girls sit around and drink tea all afternoon. I'd like to try that some day!",
	login = "Commander, can't I just sit around here for today instead?",
	vote = "",
	hp_warning = "",
	id = 101070,
	detail = "Sorry, can we keep it brief? I need a new popsicle.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[101080] = {
	feeling1 = "Sorry, I've got some training to do, so I gotta go!",
	feeling3 = "Want me to teach you how to run faster, Commander? There's quite a lot to it, actually.",
	lose = "... I need to get back before everyone starts worrying about me.",
	propose = "No matter how fast I run, I can't escape my feelings for you, Commander...",
	expedition = "I need to get some exercise... Commander, a commission just got completed, so could you send me out on the next one?",
	win_mvp = "Like I said, those guys can't keep up with me!",
	home = "Rest now so that we can sprint faster later!",
	mission = "You've still got some missions to finish up, Commander! Put your back into it, it's the final stretch!",
	touch2 = "...!! Hey! There's a line you shouldn't cross when giving massages.",
	voice_key_2 = -1,
	skill = "Faster... Faster...!",
	drop_descrip = "Gridley-class destroyer, Maury, Hull Number DD-401\n<color=#ffde38>Unlock build after receiving</color>",
	mail = "You've got new mail. It's about that celebratory party, isn't it?",
	touch = "Are you helping me recover? ... Thank you...",
	profile = "I'm Maury, the fourth ship of the Gridley-class destroyer squadron. Although I'm the youngest of my class, I'm also the fastest short-distance Union ship! I'm prone to getting hungry a lot? Well, they say that light meals make you live longer, don't they?",
	mission_complete = "Phew~ I'm exhausted... Save some Oxy-cola for me when the rewards arrive!",
	feeling4 = "I feel like I can run even farther when I'm next to you, Commander. What an incredible feeling!",
	unlock = "You can just call me Maury. As a track athlete, I hold the Union's speed record, reaching a maximum speed of 42.8 knots. Just don't make me run a marathon...",
	feeling5 = "Commander, how about going on a jog with me? I want to share the beautiful scenery I find with you.",
	main = "Commander, want to work out a bit? Sitting for so long is terrible for your body!|I thought we were going for some long distance trip at Wake Island again.|I swear it wasn't my tummy making that noise!",
	battle = "Lets finish this quick before I get hungry!",
	upgrade = "Not enough... I can still go faster...!",
	voice_key = 10108,
	headtouch = "",
	feeling2 = "Commander, is it really okay for you to sit around all day? Get outside and do some sports!",
	login = "Commander, want to do some warm-ups with me?",
	vote = "",
	hp_warning = "",
	id = 101080,
	detail = "Umm... Why are you always watching me do my warm-ups? Do you like watching me sweat?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[101090] = {
	feeling1 = "S-sorry, I have to go check up on my little sisters...",
	feeling3 = "Commander, can you help me a little bit? Thank you... You're stronger than me, after all... I'm a little jealous.",
	lose = "*Sob*... You bullies... My sisters will hurt you if they find out about this!",
	propose = "A family, huh? ... I already have so many sisters, but you're special to me after all, Commander!",
	expedition = "A commission has been completed! Let's see what's next... Wow, there's so many! Almost one for each of my little sisters...",
	win_mvp = "I've heard that if you collect fifteen stars then one of your wishes will come true~!",
	home = "I'm back~ Wait, huh? Did another one of my little sisters join the fleet while I was gone?",
	mission = "I can go on missions with my sisters again. Give the order whenever you're ready, Commander!",
	touch2 = "C-Commander, please stop! What if my sisters see this...",
	voice_key_2 = -1,
	skill = "My sisters, give me strength...!",
	drop_descrip = "Fletcher-class destroyer - Fletcher, Hull Number DD-445!",
	mail = "Who has been writing so many letters to you, Commander? I'm a bit curious...",
	touch = "My little sisters would probably like doing this too. Huh? Your hand would get sore from it?",
	profile = "I'm Fletcher, the big sister of all 175 Fletcher-class destroyers! As the main force of the destroyer fleet, I participated in all the important naval battles~",
	mission_complete = "I wonder if all my sisters can get an equal share of the rewards...",
	feeling4 = "Out of all of us in the fleet... Who do you personally like the most, Commander? ... Counting me as well?",
	unlock = "Hm? You think we've met before? I get it... You know, I have over 100 sisters who look like me! I'll be following your orders from now on, Commander.",
	feeling5 = "Hm? You want to help me take care of my little sisters? There's a lot of them, and I could use the help, but... Are you really, REALLY sure? In that case... Can I think about it for a bit first...?",
	main = "Last time someone tried to impersonate me, one of my little sisters told them to name EVERY Fletcher-class ship. That's when they gave up the act~|When I look at my little sisters, it makes me wonder... Maybe our parents were rabbits?|... Commander? Really... Are you thinking about one of my sisters again?",
	battle = "There's only a handful of enemies. Let's beat them with sheer numbers!",
	upgrade = "Now I can take better care of my sisters!",
	voice_key = 10109,
	headtouch = "",
	feeling2 = "Whew... I need to take care of my sisters so much that I don't really have time to think about anything else...",
	login = "Can you recognize me today, Commander? My sisters don't look like this!",
	vote = "",
	hp_warning = "",
	id = 101090,
	detail = "I can move quickly, so I probably won't get hit. Well... even if I do, I'll... probably be fine.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[101110] = {
	feeling1 = "You're the embodiment of evil itself, Commander!",
	feeling3 = "Being partners in justice is never easy. But you've got Ausburne by your side, so I'm sure we'll be fine!",
	lose = "I'll be back! Justice will prevail! *Sob*...",
	propose = "... Are you sure you want to give this... to me? You've really chosen me? Then I'll follow you until the end!",
	expedition = "A commission of justice has just been completed!",
	win_mvp = "See? This is the real strength of the Little Beavers!",
	home = "Good work, everyone!",
	mission = "Commander, let's finish it in one go! Now is the chance to deliver swift justice!",
	touch2 = "!!... Uh oh... You're evil, Commander!",
	voice_key_2 = -1,
	skill = "Accept your punishment in the name of justice!",
	drop_descrip = "Fletcher-class destroyer - Charles Ausburne, Hull Number DD-570!",
	mail = "Your mail? Of course! We need help from others if we want to make this world a just one. Reply as soon as you can!",
	touch = "Mmm, I feel the justice coming from you!",
	profile = "I'm Charles Ausburne of the Fletcher-class, and the world famous Captain of the Little Beavers! I showed my true colors at the Cape of St. George. Want to be my partner in justice, Commander?",
	mission_complete = "Your rewards have arrived. It's always nice to be rewarded for your hard work, don't you think?",
	feeling4 = "The path of justice is a lonely one. It's rare to have a partner on such a difficult path... What I mean is... I... D-do you want to read some stories about justice with me?",
	unlock = "Nice to meet you, Commander! I'm Charles Ausburne, Captain of the Little Beavers. Whoever picks on the hopeless and defenseless will receive their punishment in due time!",
	feeling5 = "In the stories I read, the hero always goes back to his normal life after defeating evil with his partners. I have to say, I feel a bit sad reading an ending like this...",
	main = "Become a friend of justice with me!|Justice is justice~!|My sonar shows... it looks like your heart is beating extra fast, Commander!",
	battle = "Little Beavers, full speed ahead at 31 knots! Keep an eye on your sides!",
	upgrade = "This is the power of justice!",
	voice_key = 10111,
	headtouch = "",
	feeling2 = "Commander, there's still much injustice in this world, so we can't just stand around and do nothing!",
	login = "Good day, Commander. Charles Ausburne, Captain of the Little Beavers, reporting in! Are there any naughty kids who need to be disciplined today?",
	vote = "",
	hp_warning = "Justice will prevail!",
	id = 101110,
	detail = "Weapons and gear are the iron fists of justice!",
	couple_encourage = {
		{
			{
				10112,
				10113,
				10114,
				10115
			},
