_G.pg.base.ship_skin_words[101120] = {
	feeling1 = "You're so boring now, Commander...",
	feeling3 = "Commander, I want to always be able to play tricks on you, but... Do you hate me for that?",
	lose = "Damn it! My prank failed! Ahh, Spence, get outta the way, I'll end up bumping into you!",
	propose = "Just so you know: you're totally wrong if you think my pranks will end just because I got this ring! My pranks are an expression of love. So, I'm expecting you to take~ good~ care~ of~ me~!",
	expedition = "Another commission complete! I sure hope the girls didn't run into any kamikazes.",
	win_mvp = "Pranking Tactics: super effective!",
	home = "Good work, Commander! Want me to help you relax? Don't worry, I won't play any tricks on you~!",
	mission = "The game isn't over yet. Don't be lazy!",
	touch2 = "Hoho? You wanna touch me there again?",
	voice_key_2 = -1,
	skill = "How's this~?",
	drop_descrip = "Fletcher-class destroyer - Thatcher, Hull Number DD-514!",
	mail = "You've got new mail! I-I'm not hiding it this time!",
	touch = "I know what it is you really want to touch, weirdo!",
	profile = "I'm Thatcher from the Little Beavers. I'm named after Rear Admiral Henry K. Thatcher. Awesome, right? Aren't you surprised?",
	mission_complete = "I'll take these rewards off your hands if you don't want them, Commander!",
	feeling4 = "What would you do if I told you I liked you? Hehe, I'm just joking~!",
	unlock = "Hi there, Commander! I'm Thatcher. Want to play a game with me?",
	feeling5 = "Close your eyes, Commander~... *Kiss* Did you feel that? That wasn't me... Okay, it was!",
	main = "Commander, don't just stand there, come play with me!|Hahaha, look! Spence's reactions are so hilarious!|Since I don't know when I'll do something wrong, I'll just go ahead and apologize now.",
	battle = "I missed the Turkey Shoot last time, but this battle is mine!",
	upgrade = "Aha! I came up with a new prank!",
	voice_key = 10112,
	headtouch = "",
	feeling2 = "You're still upset about that prank? You're no fun!",
	login = "What tricks should we play on the other girls today, Commander? Heehee~!",
	vote = "",
	hp_warning = "",
	id = 101120,
	detail = "Don't touch my radar! It's our most effective weapon against the enemy during the night!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[101130] = {
	feeling1 = "You think it's funny to call me by the wrong name?",
	feeling3 = "... After being called sweet for so long, I think I'm starting to get used to it. ... You call me sweet because that's what girls are? I-is that a compliment?",
	lose = "Why does everything have to hit me in the face?!",
	propose = "My Little Beaver sisters are for sure going to envy me now.",
	expedition = "The girls are back from their adventure!",
	win_mvp = "I'd never let you down, Commander!",
	home = "This place is great, Commander~ I've grown to like it more and more!",
	mission = "Commander, you've still got unfinished missions! You're being lazy, aren't you?",
	touch2 = "C-Commander...! You're naughty!",
	voice_key_2 = -1,
	skill = "It's Aulick, I'm telling you! A-u-lick!",
	drop_descrip = "Fletcher-class destroyer - Aulick, Hull Number DD-569!",
	mail = "You've got mail, Commander!",
	touch = "Aren't I so soft and squishy?",
