	expedition = "Commander, a commission has been finished!",
	win_mvp = "I'm number one? Um... as long as I can be of help to you, I'll be happy...",
	home = "Commander, good work~ Would you like to have a meal? I kept your food warm.",
	mission = "Work hard to finish your missions, Commander~",
	touch2 = "C-Commander... so you're also interested in the racy stuff...",
	voice_key_2 = -1,
	skill = "I'm ready to go!",
	drop_descrip = "Fletcher-class Destroyer - Mullany (DD-528)",
	mail = "Commander, there's mail for you. Don't forget to read it!",
	touch = "Uhh... the black smoke coming from that side of the kitchen? Ahaha... ha... I have no idea what you're talking about~",
	profile = "The Fletcher-class is pretty big, so it's not strange that you haven't heard of me. Though I had my fair share of dangerous moments, I managed to return peacefully. Right after that, I even went to live the Dragon Empery for a while! Is that why you think I look a bit bigger? Who knows~ ",
	mission_complete = "Mission rewards, huh... Should I also prepare something for you, Commander?",
	feeling4 = "Commander, are you keeping up with your schedule? If you feel like you can't manage everything alone, please let me handle your domestic affairs~",
	unlock = "Hello Commander, I am the Fletcher-class destroyer, Mullany. From today onwards, we'll be spending a lot of time together. Please take good care of me!",
	feeling5 = "You feel bad for always imposing on me? It's fine, it's fine! I'm happiest when I can be of use to the one I care about~ so feel free to rely on me even more from now on!",
	main = "Aww... I thought I followed the recipe perfectly, so how did it turn out like this...? |Commander, make sure to strike the right balance between work and leisure! It's not good to be lazy or overworked~ |Commander, do your best! Believe in yourself, you're the greatest!",
	battle = "I have to work hard for Commander today as well~",
	upgrade = "Ah! An inspiration for my new recipe!",
	voice_key = 10139,
	headtouch = "Being treated like a kid... feels a bit weird... ahaha...",
	feeling2 = "Commander, what are your interests? My hobby is cooking - though sometimes weird stuff come out, it usually tastes pretty good anyway. Mhm!",
	login = "Commander, have you eaten? Should I prepare something for you?",
	vote = "",
	hp_warning = "Oh no... ",
	id = 101390,
	detail = "Commander, please let me know if there's anything you need me for.",
	couple_encourage = {
