_G.pg.base.ship_skin_words[101400] = {
	feeling1 = "Commander, listen up. If this continues on, I'll be keeping my distance from you...",
	feeling3 = "Compared to Dewey, I'm only a tiny bit more... H-huh? I'm not chubby! Jeez, Commander, I'm not talking to you anymore!",
	lose = "Oops, guess I lost... Commander, can you give me some candy to cheer me up...?",
	propose = "Commander, I don't mind if you have a thing for Lexington. But you have to swear that you absolutely love me, okay? I try my best every single day to be your ideal girl, so don't take your eyes off me, okay?",
	expedition = "The military commission has been completed. Commander, why don't we head down together to welcome everyone back?",
	win_mvp = "Yay, I'm the MVP! Surely a wonderful commander like you would have something nice for me, right~",
	home = "Commander, you're finally back~! Did you bring back some some delicious treats for us? Thank you so much! I'll be helping myself~♪",
	mission = "New missions have been posted~ Let's hurry up and set sail! Just kidding, we still have plenty of time right now.",
	touch2 = "Jeez, Commander... That's a foul, you know?",
	voice_key_2 = -1,
	skill = "Looks like it's time for Aylwin to get serious!",
	drop_descrip = "Farragut-class destroyer – Aylwin, Hull Number DD-355.",
	mail = "Hm? There seems to be some new mail... Hrmm... Ah! Now, this seems like some good news!",
	touch = "Commander, do you need something~?",
	profile = "I am Aylwin, from the Eagle Union. During the war, I carried out many operations as well as training exercises, and had some ties with both the Royal Navy and Iris Libre. I admire elegant, mature women like Lexington. Commander, I look forward to working with you!",
	mission_complete = "Mission complete! It's a pretty good haul isn't it, Commander~",
	feeling4 = "Commander, you're the type who likes it when there's a bit more to love, right? ... I'll drink plenty of milk and eat lots of candy every day so that I can be your ideal type~",
	unlock = "Greetings, my name is Aylwin. I'm actually quite talented at nautical navigation, so please allow me to be your guide.",
	feeling5 = "Commander, what's different about me today? Have you noticed yet? ...You still haven't noticed it? Hurry, hurry, hurry up and notice it, okay?",
	main = "I had a dream that I would one day share the stage with Lexington. If I could sing and dance just like her, which one of us would you support? |*pouts* Another training exercise? You keep saying next time... I want to sortie and go on real missions with everyone else! |Dewey really looks after me. Maybe she's also one of Lexington's fans, hehe~!",
	battle = "Everyone, let's give it our all!",
	upgrade = "Hmm... I don't particularly feel any different. Whatever, a gain is a gain~",
	voice_key = 10140,
	headtouch = "",
	feeling2 = "Commander, you're not too busy right now, are you? Umm, I'd like to... here, I have a little bit of candy for you~♪ Some sugar is good for the brain!",
	login = "Commander, welcome back. It's the start of a bright new day!",
	vote = "",
	hp_warning = "I'm... I'm still okay... probably...",
	id = 101400,
	detail = "Commander, who do you like more - Lexington, or Saratoga? Or... perhaps some other girl has caught your eye?",
	couple_encourage = {
		{
			{
				10702
