	upgrade = "Thank you. My body feels lighter.",
	voice_key = 10142,
	headtouch = "",
	feeling2 = "Commander, how about getting some exercise?",
	login = "Commander, can I train in your office?",
	vote = "",
	hp_warning = "Should've worked out harder...",
