	main = "You wanna come to the party too, Knight? All right... you're coming, too!|Quite a few people have asked me for a dance, but I'm not a great dancer... Commander, could ya help me learn the basics of dancing?|*Phew*... You wanna go for something to eat when the party's over, Commander? I'll treat you, so don't be shy! I mean come on, we're friends~",
