_G.pg.base.ship_skin_words[102095] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Nice job, Commander! Sit down and have a break while I sort through photos to upload to my Juustagram! I can't wait to see how all my followers react~",
	mission = "",
	touch2 = "The mood is there, but there's onlookers around, so... yeah.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Isn't it real exciting visiting a place you don't normally get to go? We don't often get opportunities to travel like this, so let's go look for delicious food and spectacular scenery!",
	mail = "",
	touch = "Here's your bus ticket, Commander. Let's hop on and go to the next sightseeing spot!",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Isn't it real exciting visiting a place you don't normally get to go? We don't often get opportunities to travel like this, so let's go look for delicious food and spectacular scenery!",
	feeling5 = "",
	main = "The coral reefs and the huge rock formations are easily the highlights so far. They really make you appreciate the beauty of Mother Nature!|Koalas, kangaroos, quokkas... Hm? Why'd they name this bandicoot \"Crash\"?|Mmm, this place makes killer steaks! Better not post this on Juustagram though, or Yuudachi will get jealous and complain 'cause she doesn't get any.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Yo! Commander! Get over here! We don't have all day. If we wanna see as many things as possible, we gotta make the most of our time!",
	vote = "",
	hp_warning = "",
	id = 102095,
	detail = "What things influence your decision on where to travel, Commander? For me, it's the opportunity to see spectacular sights and exotic plants!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[102096] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Whew... Oh, you'll gimme a massage? My shoulders ARE pretty stiff after all that baton waving, so... Yeah, go on ahead! Heehee~",
	mission = "",
	touch2 = "Whoa, Commander! Stop frickin' distracting me!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Ahem... I, Cleveland, am your conductor for tonight! Whoa, the echo really IS faint! How did I not know we had such a fancy concert hall at the port? ...Oh, you wanna shout something too, Commander?",
	mail = "",
	touch = "You wanna feel how it's like to stand at the podium?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Ahem... I, Cleveland, am your conductor for tonight! Whoa, the echo really IS faint! How did I not know we had such a fancy concert hall at the port? ...Oh, you wanna shout something too, Commander?",
	feeling5 = "",
	main = "One, two, three, four... Nice! I think I've got quadruple meter pinned down. Now triple meter... Something like this?|Some conductors get so in the zone that their gestures get all crazy. Don't think I'd do that, though. Ahahahah...|If I wanted to make an orchestra out of the whole Cleveland class... Nahhh, there's not enough of us. If we add the Fletcher class in the mix... Then we'd get the opposite problem.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Came to watch me practice? Heh, alright, you can be part of my orchestra. Just take a seat right in front of me!",
	vote = "",
	hp_warning = "",
	id = 102096,
	detail = "Facing the full ensemble gets me feeling kinda nervous... Then again, I guess I have it easier than them, 'cause they have to face the audience for the whole performance.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[102098] = {
