	main = "Anything you wanna do, or anything on your mind? You can tell me anything♪|How happy you make me feel? Hmm, I feel as happy as the ocean feels big, I guess? Hehehe~|You're worried about people meddling with us? Hehe, there's no point worrying about that stuff when we have each other!",
