_G.pg.base.ship_skin_words[102110] = {
	feeling1 = "Seems like I have to find another place...",
	feeling3 = "Commander~ I only just joined this fleet and there's still plenty I don't know yet. So, could I ask you to accompany me on a short walk?",
	lose = "Oh no, we lost... Well that sucks~",
	propose = "That's right, I was talking about love! ... And the things that follow! I've never met a suitable candidate, at least until I met you~! When I accept this, it'll mean you agree to be my partner as well, right~?",
	expedition = "Commander, you can stare at me all day if you want, but just know that a commission has been completed.",
	win_mvp = "Teamwork makes the dream work! Yay!",
	home = "You look so cool coming right off the battlefield, Commander!",
	mission = "♪Mission here, mission there♪ Being a commander is so much work. Let me help you!",
	touch2 = "Com~man~der~",
	voice_key_2 = -1,
	skill = "Let me show you what a difference experience makes!",
	drop_descrip = "Omaha-class light cruiser - Richmond, Hull Number CL-9!",
	mail = "Commander, I checked the mail box and brought your mail along with my own~",
	touch = "Do you like getting physical too, Commander?",
	profile = "I'm Richmond of the Omaha-class. Because I'm an old model, I was mainly tasked with things like escorts and transport. Although my performance is nothing to brag about, you can say that I've seen a lot of action! Feel free to ask me anything whenever you have questions~!",
	mission_complete = "Teehee~ Our rewards have arrived, Commander! ... Or would you rather get a passionate hug from me instead?",
	feeling4 = "This fleet is great! And you're awesome too, Commander! Let me tell you about myself... First thing: after that World War just before this one, I was...",
	unlock = "Hi! Are you the commander? That's great~! I'm Richmond. Hit me up whenever you feel like~!",
	feeling5 = "Commander, I've seen a lot during my time in this world, but there's still one thing I haven't experienced yet since I don't have a partner...",
	main = "Commander, you've got something on your lips... Got it!|I'd love to be able to see everyone from all over the world~!|Lots of my sisters have survived through this war. Impressive, right?",
	battle = "Alrighty, let's do some warm-ups!",
	upgrade = "Teehee~ This feels good~",
	voice_key = 10211,
	headtouch = "",
	feeling2 = "I've been to a lot of places, but this is the first time I've ever seen a fleet with girls from all around the world. This is so interesting!",
	login = "Commander, did you do anything interesting while you were away for so long? You should bring me along next time~!",
	vote = "",
	hp_warning = "",
	id = 102110,
	detail = "Commander, do you need anything? You can always chat with me if you're free.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[102120] = {
	feeling1 = "So that's who you are, huh, Commander?",
	feeling3 = "I think people are jealous of me because mine are bigger than theirs… But personally I wish they were smaller. When they're big, you know, it's pretty inconvenient...",
	lose = "I don't want to go to Mare Island again...",
	propose = "This is really embarrassing, so could we just get this over with... Y-you can do whatever you want when it's just the two of us...",
	expedition = "What are you waiting for... A commission's been completed!",
	win_mvp = "Is that enough for you?",
	home = "Good work. What, are you not satisfied until I say something mean?",
	mission = "If you have the time to stare at me, how about you go finish your remaining missions?",
	touch2 = "*Sigh*... If you're gonna be this direct then I don't even feel like getting mad at you...",
	voice_key_2 = -1,
	skill = "This time things should go well...!",
	drop_descrip = "Brooklyn-class Light Cruiser – Honolulu, Hull Number CL-48!",
	mail = "Here, mail for you. What? I can at least do something this simple for you...",
	touch = "Do you just go around touching everyone you see? Do you need anything?",
	profile = "I'm Honolulu of the Brooklyn-class. I've basically only ever served in the Pacific. I was damaged pretty bad once, but somehow I managed to make it... At least I was luckier than Helena...",
	mission_complete = "What, you don't even want your rewards?",
	feeling4 = "I don't really have anything going for me outside of my body, but you're still being so nice to me... Do you like my body THAT much? Even if you don't, it's not like I... No, I'll stop myself right there, because otherwise you'll just get carried away.",
	unlock = "Brooklyn-class, Honolulu, reporting in. Hey, listen... could you stop staring at me like that? It's not like they're this big because I wanted them to be...",
	feeling5 = "... Didn't I tell you they're not this big just because I wanted them to be? Well, if you like them that much... then maybe they're not so bad...",
	main = "I don't seem very Hawaiian even though my name is Honolulu? Well gee, my bad...|Helena's always acting so gloomy... You should think of ways to make her smile too, Commander.|I was born with this personality. I don't hate you or anything like that...",
	battle = "All I need to do is get rid of these guys, right?",
	upgrade = "I didn't really ask you for this...",
	voice_key = 10212,
	headtouch = "",
	feeling2 = "Do I really need to chat with you...? But I guess I don't have anything else to do, so I'll keep you company for a while.",
	login = "Why do I have to wait for you here...",
	vote = "",
	hp_warning = "",
	id = 102120,
	detail = "Maintenance? Fine, as long as you don't do anything weird...",
	couple_encourage = {
		{
			{
				10213
			},
			1,
			"Louis... Keep poking fun at me and you'll regret it.",
			0
		},
		{
			{
				10205
			},
			1,
			"Don't you worry, Helena, I'm here to help!",
			0
		}
	}
}

