_G.pg.base.ship_skin_words[102160] = {
	feeling1 = "Hmph. If it's about me ignoring you, you brought this upon yourself!",
	feeling3 = "Who can blame you for being so captivated by me? Very well, I'll allow you to gawk a bit longer.",
	lose = "To think that I would lose... how unsightly!",
	propose = "Do you feel honored? You've managed to earn my recognition. From here on out, I'll have high expectations for you, so don't let me down~",
	expedition = "The commission fleet has returned. Don't forget to check the performance records later.",
	win_mvp = "Hmph! Did you witness that? That's the glory that only I can bring to bear~",
	home = "Hehe, not bad. But don't get too cocky. There are still many trials ahead of us.",
	mission = "If there are any missions left, take care of them right away. Don't procrastinate... Hey, I'm talking to you, Commander!",
	touch2 = "If you don't unhand me this instant, I'll make you regret it~",
	voice_key_2 = -1,
	skill = "Leave the escort duties to me!",
	drop_descrip = "Omaha-class light cruiser – Memphis, Hull Number CL-13.",
	mail = "Please go get the mail. I expect some good news.",
