	touch = "It's important to keep your energy up, Commander! Here, have a chocolate bar!",
	profile = "I'm the big sister of the Cleveland-class... but I guess that's obvious from my name alone. I may be a light cruiser, but I can match a heavy cruiser no problem! I am gonna dominate the seas, after all!",
