	feeling5 = "Heh... I was right to ask you, Commander! You always help me out. That's why I love you! From now on, I'm gonna come to you anytime I don't understand something. Sound good?",
	main = "I've got lots of little sisters, and I love each and every one of 'em! Lemme introduce you someday!|Hey, Commander, is there a blue-haired girl in the fleet, about yea big, always staring at herself in the mirror? You mind if I go play with her?|Being this small is kind of inconvenient sometimes. ... Like when? Like when I'm trying to help somebody with something...?",
