_G.pg.base.ship_skin_words[102232] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Apparently tying your hair up into buns like this is the norm in the Dragon Empery... Huh? It's not?",
	mission = "",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Happy Lunar New Year, Commander. I'm trying out Dragon Empery fashion for a change, though this dress will some getting used to. Hey, uh, do you want to join me under the umbrella? For cover against the snowfall, I mean.",
	mail = "",
	touch = "You want to... hold hands? My hands are a bit chilly, but if you don't mind that, then sure.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Happy Lunar New Year, Commander. I'm trying out Dragon Empery fashion for a change, though this dress will some getting used to. Hey, uh, do you want to join me under the umbrella? For cover against the snowfall, I mean.",
	feeling5 = "",
	main = "Princeton, I'm pretty sure that aerial maneuver you learned from Saratoga is only good for pranking people...|Ice cream doesn't melt so easily when the temperature drops. Is it weird to talk about ice cream in the middle of winter? ...Oh. Now I know...|The family all gathering to make dumplings while they chit-chat... I like the sound of this Dragon Empery tradition. It warms the heart.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Welcome back, Commander. There's snow on my umbrella? Oh, darn it. I got so absorbed in the wintry landscape that I forgot to shake the snow off.",
	vote = "",
	hp_warning = "",
	id = 102232,
	detail = "When snow falls over the farmlands, it kills off crop-eating insects and keeps the soil at a stable temperature. Then when the snow melts, it waters the earth... Now I can see why they call it \"fruitful snow.\"",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[102233] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Must've been because I lost my balance, huh... Looks like I still have a lot to learn.",
	propose = "",
	expedition = "That's the commission team! Commander, change course!",
	win_mvp = "Pfah! That felt awesome! I... Err, Commander, do me a favor and pretend you didn't see that.",
	home = "I saw you coming into the port. Great job out there, now get some rest. Your surfing lesson can wait.",
	mission = "A new mission? I think we'll– Oh crap! ...Thanks for the save, Commander.",
	touch2 = "Do you really expect you'll maintain your balance while doing this?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "The wind and the waves are great today. You wanna try windsurfing after this, Commander? It's a lot of fun and I can teach you the... Hang on, there's a good wind coming and I've got to catch it!",
	mail = "A letter? We'll check it later. Let's hope it's good news.",
	touch = "That's it, keep the sail leaned. You're getting the hang of this.",
	profile = "",
	mission_complete = "Mission rewards have arrived? Sweet. Nothing beats ice cream on a hot summer day.",
	feeling4 = "",
	unlock = "The wind and the waves are great today. You wanna try windsurfing after this, Commander? It's a lot of fun and I can teach you the... Hang on, there's a good wind coming and I've got to catch it!",
	feeling5 = "",
	main = "When you want to change course, move to a different position on the surfboard and... Crap! Are you okay, Commander?|Wish Biloxi and her gals would give this a shot... Actually, no, they've got their own hobbies. The reason I chose this one is because I'm true to myself!|Watersports at the academy don't seem particularly big, but that's probably because we see enough water as shipgirls. Or, I just don't know about it...",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Since you love learning, let's get right into it. We'll start on the beach. Don't worry, I wouldn't just throw you into the ocean from the start.",
	vote = "",
	hp_warning = "",
	id = 102233,
	detail = "The windsurfing speed record is apparently over a hundred kilometers an hour. It's wild that you can go that fast from just riding the wind... Hmm, I don't think Cleve has ever experienced that before.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[102240] = {
	feeling1 = "Sorry, I've got more important stuff to do. I don't have time for you.",
	feeling3 = "Maybe saying I grow bonsai as a hobby sounds too basic... Maybe it is... Gah, I'm at my wit's end! Commander, what do I write to make a decent self-introduction?",
	lose = "I can't show myself to my sisters like this...",
	propose = "I heard that in some places, idols aren't allowed to be in relationships. Well, I'm sure we'll be fine! Anyway, Commander... Hehe, please continue to take good care of me! ",
	expedition = "Commission complete! Don't forget everyone's got a schedule to follow, all right?",
	win_mvp = "Whew! So who's our next target?",
	home = "Oh, you tired? The dressing room is free right now. You could use that if it's too exhausting to walk to the office.",
	mission = "We've got job offers... I mean, commissions! Let's get 'em done!",
	touch2 = "Commander?! I'm trying to get by as an idol here! Th-Think of my image...",
	voice_key_2 = -1,
	skill = "Let's get hyped!",
	drop_descrip = "Light cruiser Cleveland, right here! I'm new to this whole idol biz, but I'll go with the flow and give it my all! Oh, and I'm counting on your support, Commander!",
	mail = "New mail's come in! I've already told you: it's for you, not for me! Come on already!",
	touch = "I've gotta train for the handshake meet-and-greet. Think you could \"give me a hand,\" Commander?",
	profile = "I'm Cleveland, the light cruiser. My sisters and I took part in the World War and... Well, let's just say we did pretty good for ourselves. This time around I'm wearing this special uniform, and I'm gonna fight with the power of song!",
	mission_complete = "Mission complete! Phew... We oughta start looking over our job offers.",
	feeling4 = "Dammit, Columbia... She's an expert at this stuff so I asked her to help. I'm shocked she wrote a bio for me that's half lies... Thank goodness you fixed it, Commander, or else I would've died of shame on stage...",
	unlock = "Light cruiser Cleveland, right here! I'm new to this whole idol biz, but I'll go with the flow and give it my all! Oh, and I'm counting on your support, Commander!",
	feeling5 = "Whew... You've really helped me out tons, Commander... I'm not the greatest when it comes to this stuff, and I never thought I could be a star on stage like you've made me... We really were meant to be together, Commander!",
	main = "Hehe~ It's time to break it down! Can you keep up? Just kidding~ Downes is a bit of a class act, isn't she? |Well, I'm not nervous at all because I've had a few chances to sing in front of everyone. Also, it helps that I'm not the lead vocalist, hehe. |Montpelier, Denver, what the heck are you wearing? That's embarrassing...! And Birmingham, you don't have to go waving that thing around!",
	battle = "Lights, on! Let's get this battle started!",
	upgrade = "All those lessons are paying off!",
	voice_key = 10224,
	headtouch = "",
	feeling2 = "I'm Cleveland, one of the fleet's idols! Nice meeting you, Commander!",
	login = "Hey! You all having a good time? ...All right, that should do it! Oh, hey, Commander! Heheh, I was just doing some practice!",
	vote = "",
	hp_warning = "I will keep drumming till the end!",
	id = 102240,
	detail = "What's important for concerts is having confidence! If you believe you're a star, then you are! Really! Hey, that actually sounded like a pretty cool one-liner.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[102250] = {
	feeling1 = "Look, if you wanna do nothing all day, do it without involving me.",
	feeling3 = "I sometimes enjoy talking with people about what we do on our off days... What? What's so weird about me bringing up people's hobbies? When I have time off, I enjoy myself. I'm no workaholic, you hear?",
	lose = "Argh... This isn't over yet, you hear?!",
	propose = "I used to think prestige meant dashing gallantly onto the battlefield... But now I see how being by your side is just as... No, it's *more* prestigious than that idea.",
	expedition = "Those commission team girls are back. Let's go check what rewards they've brought. They might have a surprise for us.",
	win_mvp = "Thanks for the backup, guys.",
	home = "Well done on that sortie. From this point on, I'm gonna assume you'll always return triumphant.",
	mission = "These missions just keep piling up. Laziness will not be tolerated, Commander.",
	touch2 = "One without manners is one garnering contempt. Is that really how you wanna be, Commander?",
	voice_key_2 = -1,
	skill = "No aircraft shall evade my sights! ",
	drop_descrip = "Cleveland-class light cruiser – Biloxi, Hull Number CL-80. ",
	mail = "You've got mail, Commander. Better check it ASAP. Might be good news, after all!",
	touch = "Check out my gear. Nobody's got better AA than I do. You bet your butt it'll shoot down bogeys like back in the Turkey Shoot.",
	profile = "I'm Eagle Union light cruiser Biloxi. I fought in heaps of battles and carried out many carrier escort missions. Sure, the Cleveland class has its hallmark anti-air fire, but everyone's gotta work together to win. So let's do just that, Commander.",
	mission_complete = "Reward recovery complete. Time to see what fruits you've earned for your labor, Commander.",
	feeling4 = "Guess it's just the two of us again. Heheh, let's forget about work and have a fun chat. You know, just relax. You wanna get some drinks and snacks? It's on me.",
	unlock = "I'm Biloxi. I hope we can work together and seize victory as fellow fleet members. Anyway, that's all for introductions. Nice meeting you.",
	feeling5 = "Zooming around from sea to sea can even get me feeling tired sometimes. But lately I've been having this thought... This thought that here, where you are, is my home.",
	main = "\"Big sis\"? Who, me? Ahh, you mean the lead ship. I respect Cleve just as a sister ship. Hahahah!|We *are* an improved model, but we didn't end up as carriers like Bataan, and our improvements aren't extensive enough to call us part of a subclass. The differences are more obvious through our looks and personalities, though.|A friend always deserves help, even if you yourself are in a tough spot. That's what \"no man left behind\" is all about. Ain't that right?",
	battle = "Victory will come to us nice and easy!",
	upgrade = "With great power comes great responsibility. That couldn't be more true.",
	voice_key = 10225,
	headtouch = "",
	feeling2 = "Whew... I'm still gonna be busy for a long time, but right now I need a break. You up for chatting about stuff, Commander?",
	login = "Mission status: all green. Eyes on the progress, Commander.",
	vote = "",
	hp_warning = "Tsk... This is nothing!",
	id = 102250,
	detail = "Yeah? If you need any help, just say the word. My schedule's pretty packed too, but I can always squeeze in some time to take on your orders.",
	couple_encourage = {
		{
			{
				10729,
				10722
			},
			2,
			"Here we are again, side by side. Let's do this!",
			0
		}
	}
}

