_G.pg.base.ship_skin_words[102252] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Argh! Interesting...!",
	propose = "",
	expedition = "",
	win_mvp = "\"Clear out the rest of these fools, will you?\" Hahah, guess there'll be no need for that.",
	home = "",
	mission = "",
	touch2 = "\"Looks like someone here doesn't know proper manners.\"",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "\"Hehe... Now that you've finally fallen into my hands, why don't we take the day to get to know each other real well, Commander?\" Oh my, was my acting a bit too realistic~?",
	mail = "",
	touch = "",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "\"Hehe... Now that you've finally fallen into my hands, why don't we take the day to get to know each other real well, Commander?\" Oh my, was my acting a bit too realistic~?",
	feeling5 = "I came here intent on enjoying the party, but I wound up slipping into acting instead... Although, there's fun to be had in that, too. Listen, Commander, I'm sorry to ask, but I wanna know: are you... enjoying yourself?",
	main = "Let's take a ride to the party. Don't worry about the Manjuu, I've seen how well he can drive... What, that wasn't your concern?|You oughta take today off at the very least. No need to be a busy bee and work day in, day out.|Mental clarity is the key to keeping your cool on the battlefield. My sisters, they all have the fortitude it takes.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "How's it going, Commander? It might be unprofessional of me to ask, but... Is something up?",
	vote = "",
	hp_warning = "",
	id = 102252,
	detail = "My feelings for you haven't changed, but yeah, these clothes make me act really intimidating... Maybe I'm getting into my role too much.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[102253] = {
	feeling1 = "",
