	expedition = "",
	win_mvp = "",
	home = "",
	mission = "",
	touch2 = "...You wanna make like a firework and go bang, or what?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "I heard that this place is famous for its festivals with beautiful fireworks, so I made sure to come dressed for the occasion... What do you think? ...I'm even more beautiful? Well, I couldn't let the fireworks be the only things leaving an impression upo",
	mail = "",
	touch = "Fancy my dress? You can have a closer look at it all you want later.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "I heard that this place is famous for its festivals with beautiful fireworks, so I made sure to come dressed for the occasion... What do you think? ...I'm even more beautiful? Well, I couldn't let the fireworks be the only things leaving an impression upon you tonight! Ahaha, just kidding~",
	feeling5 = "",
	main = "Even in the cold winter, the thrill of watching fireworks with your friends warms you up. Ahahahah!|Being here with my sisters, us all watching the fireworks together... It's actually pretty nice.|Seeing these stunning fireworks makes me hope next year will go smoothly. Fingers crossed, Commander!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "There you are, Commander! They're putting on a fireworks display tonight. Come with me and we'll check it out.",
	vote = "",
	hp_warning = "",
	id = 102253,
	detail = "Beauty is fleeting. Look away for one moment, and you'll miss it forever... It's not exclusive to fireworks, either. When you see a thing of beauty, keep your eyes on it, Commander.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[102254] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Welcome back, Commander. While coming home is a trying experience in certain love stories, I'm guessing everything went fine for you? That's good.",
	mission = "",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "The cast is all here. So, what do we rehearse first? The part where we elope and live happily ever after? Hahahah!",
	mail = "There's a letter for you. Be sure to read it. Who knows, it could be from someone dear to you.",
	touch = "Why are you holding my hand? Are you asking me for a dance? Sure, let's do it.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "The cast is all here. So, what do we rehearse first? The part where we elope and live happily ever after? Hahahah!",
	feeling5 = "",
	main = "\"O Commander, Commander, wherefore art thou the Commander?\" ...Surprised? See, this line actually has a tragic story to it...|\"What light through yonder window breaks? It is the east, and the Commander is the sun!\" ...I'm just reciting lines here. Don't take it at face value, all right?|Hmm. I think I can pull off either role... Commander, which do you think suits me best? I was thinking I'd let Cleve play whichever one I don't take in the end.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "What's the mask for? It's a prop used in musicals. Speaking of which, could you help me practice my part, Commander? All right, let's get to it... \"Let us soar above a common bound~\"",
	vote = "",
	hp_warning = "",
	id = 102254,
	detail = "You can't tell whether I'm playing the male or the female lead? Well, I've not decided on that yet, so I've read both their scripts. And don't worry, I can dress the part if I go for the male role. Hahahah!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[102260] = {
	feeling1 = "They say you should never meet your heroes. Now I know why... Sigh...",
	feeling3 = "There was a time when I was training really hard to become a superhero... But these huge things got in the way of my dreams... the flat girls don't know how good they have it...",
	lose = "They say it's always darkest before the dawn... Mm. We'll try harder next time.",
	propose = "So like, from now on I'm more than just your sidekick. I gotta learn how to be a partner to you too, for the rest of your life... I don't really know how to do that ♪ so you'll just have to speak up and tell me what to do~",
	expedition = "The commission came back. You want to go out and see them?",
	win_mvp = "Yeah! The good guys always win!",
	home = "Good fight out there, Commander. Here's a towel and a drink... Hm? Isn't this what a sidekick does?",
	mission = "We got a lot to do... But I'm sure you can knock it out easy peasy, Commander!",
	touch2 = "You think they're big too? They really get in the way...",
	voice_key_2 = -1,
	skill = "I am Reno！",
	drop_descrip = "Atlanta-class light cruiser – Reno, Hull Number CL-96.",
	mail = "Mail for you, Commander. Is it a fan letter?",
	touch = "I'm doing good work...? Oooh! My hero complimented me! Of course my face is gonna turn bright red!",
	profile = "I'm Reno, an Atlanta-class cruiser of the later Oakland subclass. We've got souped up anti-air power compared to the regular Atlanta-class. We only saw the last bits of the war, but we still fought hard. But I feel really bad about Princeton... Nnng, it's fine! We can do it!",
	mission_complete = "That's my Commander! You always get the best rewards!",
