	touch = "Commander, are you also running a bit hot...?",
	profile = "You'd like to learn more about what I did during that war? Well, I provided support for many landing invasions... The most memorable one? That'd be the one at Cape Esperance... Helena saved me back then.",
	mission_complete = "Umm, Commander, I reminded you earlier, but... please collect the mission rewards at some point. ",
	feeling4 = "I'm not as straightforward as someone like Phoenix, but... Commander, I want to look after you more... E-even if I have to start with the finer details.",
	unlock = "Huff... Puff... These Dragon Empery clothes look good on me? It's rather revealing and breezy, and makes me feel self-conscious... but if you like it, I suppose it's fine...",
	feeling5 = "Even if you can't see my face directly, I want you to know that as long as I'm by your side, I'll always be smiling from the bottom of my heart.",
	main = "Hiding one's face behind a fan is an established custom here... Huff...|I didn't expect Marblehead to be so familiar with Dragon Empery customs... She really knows her stuff... H-huh, she's just trying to sound smart?|Huff... Puff... The food sure smells amazing... Man, I'm totally starving... Oh, um, it's n-nothing!",
	battle = "Take a deep breath. The battle is starting...!",
	upgrade = "Strengthening complete. Preliminary inspection in progress...",
	voice_key = 0,
	headtouch = "You want to know more... about my mask...?",
	feeling2 = "There's nothing in particular that needs doing right now. Commander... why don't you relax for a bit...?",
	login = "Huff... Puff... The fragrance of herbs makes me feel great... Maybe they really do have healing properties...",
	vote = "",
	hp_warning = "Minimize... the damage...!",
