_G.pg.base.ship_skin_words[103010] = {
	feeling1 = "Hey, Commander, this isn't OK at all.",
	feeling3 = "Are we going out? OK, I'll let you decide where we're going. I'm fine with going anywhere, so just pick whatever you want!",
	lose = "Damn... This isn't OK at all...",
	propose = "Is this for me? O... wait, hold on a sec! Are you serious? No no, no way in… What I mean is, OK means OK, but… Ahh, screw it! If it's from you then it's totally OK, that's obvious!",
	expedition = "Hey, a commission's been completed! ... It's not OK to just ignore those hardworking girls, you hear?",
	win_mvp = "Easy peasy lemon squeezy~",
	home = "How about a massage, Commander? ... OK, just sit down and relax!",
	mission = "We have a new mission? OK, let's get it done together!",
	touch2 = "H-hey, that's not at all what this gesture means!",
	voice_key_2 = -1,
	skill = "Main guns: OK! Armor: OK! We're doing this!",
	drop_descrip = "Pensacola-class Heavy Cruiser – Pensacola, Hull Number CA-24!",
	mail = "I've got your mail... here! Here you go, Commander.",
	touch = "I'm always OK with heading out on a sortie~",
	profile = "OKOK, self-introduction time, right? I'm Pensacola, I have a little sister named Salt Lake City… Uh, what else do I even say when introducing myself? I helped out Hornet and Yorktown, but there's not much to say about that… Oh well, anyway, let me handle everything and it'll be OK!",
	mission_complete = "Commander? Don't forget about those rewards!",
	feeling4 = "Are you tired? OK, come over here and lie down. I'll wake you up in an hour! Good night~",
	unlock = "Are you the commander of this fleet? Why, I'd say you look pretty reliable! … OKOK, I'm Pensacola, from now on I'll follow your orders. Nice to meet you!",
	feeling5 = "You want to try my homemade cooking? OK, don't be shy, request anything you want and I'll make it for you!",
	main = "I've got the same nickname as Enterprise... Pretty cool, huh?|If you're tired, get some rest! Don't push yourself. If you ever want help, don't be shy to ask!|Though I may look like this, I've seen quite a few battles. Wanna hear about them? OK, then let's start from the beginning...",
	battle = "Against enemies like these it's OK to just use half your strength!",
	upgrade = "Now it's my turn? OK~",
	voice_key = 10301,
	headtouch = "",
	feeling2 = "If you have a problem, let me handle it and it'll be OK! I can help you whenever you need it!",
	login = "Anything you need help with, Commander? I'm OK with helping you out any time!",
	vote = "",
	hp_warning = "",
	id = 103010,
	detail = "Maintenance? OK, tell me if you notice anything weird.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[103020] = {
	feeling1 = "Commander, that look in your eyes kinda creeps me out...",
	feeling3 = "Commander, don't you ever get bored of lying around on the beach? Why don't we play some beach volleyball? Sun burn? No worries, Pensacola has already rubbed me down with sunscreen.",
	lose = "Wuah! I'm out of armor-piercing shells... damn!",
	propose = "It's a promise, Commander! Every day from now on you'll hang out with me and do the stuff I enjoy. Like surfing, beach volleyball, and... scuba diving, I guess? Of course, I'll hang out with you and do all the stuff you enjoy, too~!",
	expedition = "Whew, those girls went out on a commission in this blazing heat? They even completed it, too. Must be awful out there~",
	win_mvp = "This time it wasn't just all luck!",
	home = "Oh man, my skin is on fire... Sorry, Vestal, think I could ask for a spa treatment from you?",
	mission = "Who cares about missions, let's party!",
	touch2 = "Hey, don't do the same stuff Pensacola does...",
	voice_key_2 = -1,
	skill = "The best defense is a good offense!",
	drop_descrip = "Pensacola-class Heavy Cruiser – Salt Lake City, Hull Number CA-25!",
	mail = "New mail for you. Oh my, is this a love letter? ... Hmm... Okay, now where's the trashcan?",
	touch = "Oh, it's you, Commander. I thought it was Pensacola...",
	profile = "I'm Salt Lake City, second ship of the Pensacola-class. That's right, I'm a genuine heavy cruiser. My armor's thin because of that treaty thing, but my firepower holds up. Although, I participated in lots of battles in the Pacific and survived to the end of it, so maybe armor isn't that important. The battle of Attu Island? Luck is a power of sorts too, you know? ... No, no, I'm not arguing. Anyway, do you really want me to wear as much as Laffey does?",
	mission_complete = "Can we go join the party now?",
	feeling4 = "You can always rest on my lap if you get tired, Commander. Don't worry, I won't play any tricks on you. ... Hm? I've always been this kind to you!",
	unlock = "Commander, I'm Salt Lake City, a heavy cruiser! You think I'm exposing too much? Well, I gotta keep a close eye on my waist, you know?",
	feeling5 = "Welcome back, Commander! I was just about to finish drying your laundry. I cleaned up the books and other stuff that was lying around. How's it look? The tidiest it's ever been, right? And dinner will be... Hm? Why am I doing all this? Well, you know... just preparing for what comes later!",
	main = "If you don't know how to swim then I can teach you, Commander.|Shell Kiska Island? Ahaha... that'd be a new experience for me.|Enterprise is too strict. Please don't be like her, Commander.",
	battle = "Those aren't allies up ahead. Ready all weapons!",
	upgrade = "Us pretty girls need to take care to maintain our good looks.",
	voice_key = 10302,
	headtouch = "Your hand feels just like Pensacola's...",
	feeling2 = "Helena, could you go find something interesting with that radar of yours? Wait... that's San Diego? Great, let's go play in the water together!",
	login = "Commander, want to go swimming together?",
	vote = "",
	hp_warning = "",
	id = 103020,
	detail = "Sometimes good things happen when you're just coasting across the sea.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[103030] = {
	feeling1 = "I'm getting distracted here, so do you think you could be quiet for a bit?",
	feeling3 = "I have a buddy who's a bit noisy and little sisters who are pretty rowdy, so having a friend like you who's rather quiet feels pretty unusual...",
	lose = "I knew we couldn't win that easily...",
	propose = "You finally realized it, didn't you, you dense man... But to be fair, I never had the courage to put it into words either... A-anyway, from now on, let's work together as dense partners in love, shall we?",
	expedition = "Hey, you have a commission that's been completed.",
	win_mvp = "I never thought I'd be able to do something like this...",
	home = "Nobody got left behind, right? Then the fleet's safely made it back.",
	mission = "Looks like that mission hasn't been completed yet. Let me handle it!",
	touch2 = "... *Gasp* ...!",
	voice_key_2 = -1,
	skill = "This is it...!",
	drop_descrip = "Northampton-class Heavy Cruiser – Northampton, Hull Number CA-26!",
	mail = "Commander, I've left your mail on the desk.",
	touch = "Um, I'm a... little ticklish right there...",
	profile = "I'm Northampton, a Washington Treaty cruiser. I participated in the Doolittle Raid and the Battle of Midway, and I've earned 6 battle stars. I regret not being able to bring Hornet back home in one piece...",
	mission_complete = "Rewards have arrived. You should check them out.",
	feeling4 = "Smiling? I guess it's true that I rarely smile... I'm a pretty stubborn girl, and I don't have many friends... Hm... If you like girls who smile, then I'll try to do that every now and then...",
	unlock = "Hm? Oh hey, Commander. If you can accurately predict where I'm gonna show up, then maybe we're in sync with each other... If only Hornet and I could be like that... *Sigh*...",
	feeling5 = "... Someone I love, huh? Well, there is someone, but I don't think I can say their name just like that... Hey, Commander, aren't you a lot like me? Hornet always tells me I'm not good at adapting to new things, and neither are you...",
	main = "You'll start to calm down if you just sit and listen to the waves...|Houston, you're too loud! Pipe the hell down!|Hold on, I'm thinking about something...",
	battle = "The battle horn has sounded! C'mon, let's go!",
	upgrade = "Thank you. I'll have you rewarded for this later.",
	voice_key = 10303,
	headtouch = "",
	feeling2 = "I'm not really the talkative type, but if you're still willing to be my friend, then maybe...",
	login = "With proper training, I think we could make quite the team, Commander.",
	vote = "",
	hp_warning = "",
	id = 103030,
	detail = "My armor's gotten thicker, but it feels like I'm more exposed than before...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[103040] = {
	feeling1 = "You still have a lot to learn about women, Commander...",
	feeling3 = "Most people aren't very good at dealing with me. You have a peculiar taste in women, Commander...",
	lose = "Oh no, my clothes are torn~!",
	propose = "I've restrained myself for so long waiting for you to give me this. But now that I have it, there's no need for self-restraint, is there? That being the case... you should brace yourself, Commander. Cause you won't be getting away from me~",
	expedition = "Looks like the girls who went out on a commission have returned. How about we do something fun before we go greet them?",
	win_mvp = "I'm expecting some juicy rewards when we get back~",
	home = "Well done out there. Come here and use my body to recover your energy~",
	mission = "I put your new missions in order... Even I can actually do my job sometimes.",
	touch2 = "Aahh~ You're a naughty boy, Commander~",
	voice_key_2 = -1,
	skill = "Oh my, you're not getting away from me!",
	drop_descrip = "Northampton-class Heavy Cruiser – Chicago, Hull Number CA-29!",
	mail = "You've got new mail, but it seems to be stuck here... Come~ take~ it~!",
	touch = "I'll show you how to have a good time~",
	profile = "I'm Chicago, fourth ship of the Northampton-class. I've never really done anything noteworthy in battle, and I've never been particularly lucky. But I'll do my best for you, Commander. So be nice to me~ *Kiss*",
	mission_complete = "Our rewards are here. You're always out there pulling off great stunts, aren't you, Commander?",
	feeling4 = "I've been a little more moderate lately? Indeed. That's because, for the first time in my life, I've met someone dear to me. That's why I need to behave myself~",
	unlock = "So you're the commander? You're looking at me almost like you want me to feel you up. Things will get fun starting tomorrow.",
	feeling5 = "Oh dear, you don't look too good. Too much pent-up stress, perhaps? ... Then let me do the cooking. I have some responsibility of you too, after all~!",
	main = "Women can change as quickly as the wind in Chicago, Commander~|At this distance, nobody else can hear us~|Your shoulders are so stiff. How about a massage to help you relax?",
	battle = "What a pleasant breeze~",
	upgrade = "People are counting on me, so I'll need to work hard too~",
	voice_key = 10304,
	headtouch = "",
	feeling2 = "The night is still young, Commander. Why don't we have some adult fun together? ... Just kidding~!",
	login = "Don't get too into ignoring me, okay, Commander~?",
	vote = "",
	hp_warning = "",
	id = 103040,
	detail = "Don't just stare at boring numbers all day... how about staring at something with more meat to it for a change?",
	couple_encourage = {}
}

