	mail = "You've got a message, Commander. I really think you should check these more often.",
	touch = "Could you fetch me an Oxy-cola? Thanks... Ahhh! That hits the spot!",
	profile = "I'm Baltimore, the lead ship of my class of CAs. I was the first CA to be designed and constructed without the limitations of any naval treaties, thanks to which I could equip cutting-edge weaponry for the time. And within this fleet, I will fight for justice and freedom.",
	mission_complete = "There's our mission rewards. Good to have the money for retrofits and repairs.",
	feeling4 = "You want to go shopping with me? Sure, consider it done. You wanna make a date out of it? I mean, might as... H-hold on! When you say \"date,\" you mean THAT kind of date?!",
	unlock = "Heya. Are you in need of help? I'm Baltimore, a heavy cruiser just passing by... Okay, that's enough jokes for now... Baltimore, awaiting your orders, Commander.",
	feeling5 = "Man... I doubt I'll ever get used to this... Maybe I should act more girly when... No, this is a me-problem, not a you-problem! ... *Sigh*, I can't think straight when you're around, Commander...",
	main = "I'll get this work done in good time. I mean, that's what you should expect of your subordinate, Commander.|SHE'S Quincy?! L-looks pretty different from the one I know... But I guess it's not that unusual for ships to share the same name.|Power alone won't fundamentally solve all one's problems. This should go without saying, Commander, but please try to remember this fact.",
	battle = "All ships, enter formation!",
	upgrade = "Great! I'm getting fitter and fitter.",
	voice_key = 10316,
	headtouch = "",
	feeling2 = "As long as the will do to right exists, people will live righteously even without being ordered to. I pray that you will stay on the path of justice, Commander.",
