	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Heya, you here to watch the game? Heh, heavy cruiser Baltimore, the passerby solver of troubles, here to play it cool!",
	feeling5 = "",
	main = "Bremerton's got a real knack for psychological warfare. She often gives me good advice on how to present myself.|I'm an expert at tennis, as you'd expect. If anything, you'd be kinda hard-pressed to find a sport I *don't* excel at.|So Commander, are you free after we're done here? Hahah, what, is it *that* unusual of me to ask if you wanna hang out?",
