	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "All right, let's do like always and breeze through these tasks.",
	vote = "",
	hp_warning = "",
	id = 103162,
	detail = "I'm radiating unusually dark vibes? Thanks for the compliment. I guess these decal tattoos Bremerton recommended are doing their job. As in, they make people a little more cautious around me than they normally would be.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[103163] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "\"H-Hiii! You want to dance with me?\" ...Oh god, no, that's way too forced. I need to sound natural for– Eep! W-when'd you get here, Commander?!",
	mission = "",
	touch2 = "",
	voice_key_2 = -1,
