	mail = "",
	touch = "Woah?! Ah, thanks... Guess it's a real uphill battle, getting used to these high heels...",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Damn, that Bremerton... What did she make me wear this time... Even though I was the one to ask her for advice... Um... Ugh... This doesn't look too weird, right...?",
	feeling5 = "",
	main = "I should've gone with a less cumbersome outfit, shouldn't I? Maybe something like Cleveland's suit... Yeah, that would've worked...|I'll bet tons of girls want to share a drink with you tonight, right, Commander? Go on, chat with them before I get you wasted. Or you can just stay here, hahahah.|The mirror? It's so I can see my– Oh god!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Oh, you can sit here if you want to, Commander. I'll just... stand here for a while and accustom myself to this look.",
	vote = "",
	hp_warning = "",
	id = 103163,
	detail = "Bremerton said, \"When you change your look, your mannerisms usually change too\" and suggested this dress to me... She must be snickering at me actually wearing it right now...",
