	profile = "Yo! I'm the big sister of the Nevada-class battleships, Nevada! I served in both the Atlantic and Pacific fleets. The President was once on board me, I've changed kidneys, carried two atomic bombs, and even cleared out an entire battlefield!",
	mission_complete = "Mission rewards have been delivered!",
	feeling4 = "If you like someone, just say it up front. What use is there to hide it? ...It's just not like you at all, Commander!",
	unlock = "Are you the commander, young man? I'm Nevada. I'll be working with you from here on out.",
	feeling5 = "The idea behind priority defenses? That is to protect our most important areas... What, you want to know how important they are? W-well, if it's you...",
	main = "Gambling? I'm not usually interested, but I'll give it a shot with you if you're up for it!|Commander, go do what you want while you're still young!|Bantry Bay Squadron? I just missed my chance, you see...",
	battle = "How lively! Allow me to join in the fun!",
	upgrade = "Mmm, not a bad feeling!",
	voice_key = 10501,
	headtouch = "",
	feeling2 = "I'm quite confident in my own luck. Want to gamble a bit?",
	login = "Hey, get your spirits up!",
	vote = "",
	hp_warning = "",
	id = 105010,
	detail = "At times like these, I tend to like your mindfulness...",
	couple_encourage = {}
}

