	feeling3 = "*humming* Ah, Commander~ Just who I was looking for. I was thinking about taking you some place to have fun!",
	lose = "Oof... Big sis will lecture me for sure!",
	propose = "Commander, where are we going to play today? ...WHA! ...Seriously, I don't... I'm happy and all, but please don't pull this again. You surprised me...",
	expedition = "Commander, the girls from the commissions have returned. Let me do one next time, please~",
