	home = "You looked great just now, Commander!",
	mission = "Commander, don't forget to do your missions!",
	touch2 = "Wait-... Commander! Where are you touching? Big sis wouldn't do this!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Tennessee-class battleship –  California, Hull Number BB-44!",
	mail = "It's new mail. Wanna open it up right away?",
	touch = "This is comfy. Every time big sis scolds me, she comforts me with this afterwards as well.",
	profile = "Hello. I am the second of the Tennessee class battleships, California. I was once the flagship of the Pacific fleet, and was part of the Atlantic fleet as well. How about it? Bet you didn't expect that I was a popular one, did you? Hehe~",
	mission_complete = "Hahaha, this is good!",
	feeling4 = "We've already had fun throughout the docks. How about we go some place farther? Just the two of us... Heh heh heh...",
	unlock = "Hello, Commander. I am California. It's not good to brag, but I'm quite strong you know. Do look forward to it~",
	feeling5 = "Tennesee said to me, 'You must be careful who you choose as a partner.' 'Once you do, tell me', she also said. Well, if it's you, Commander, she won't say a word, I think...",
	main = "I feel different from big sister? That's not true. She might not look it but she's actually kind|Ah~ Big sis didn't say much today... Wha! N-nothing at all!|Ah, where did my undies go? Eheh",
	battle = "Don't panic...Calm down... Let's go!",
	upgrade = "Now I can reach for further waters~",
	voice_key = 10508,
	headtouch = "",
	feeling2 = "You don't know if you can be friends with someone unless you tried to make them. Commander, wanna hang out together?",
	login = "Weather, check. Wind, check. A fine sailing day, Commander.",
	vote = "",
	hp_warning = "",
	id = 105080,
	detail = "Commander, I will do my best to meet everyone's expectations",
	couple_encourage = {}
