_G.pg.base.ship_skin_words[105090] = {
	feeling1 = "Commander, please… don’t come any closer.",
	feeling3 = "Commander, why do you care about me so much? Many people are afraid of me and keep their distance from me. Perhaps I've been too used to this. But recently, I’ve suddenly felt... so lonely.",
	lose = "This is not the end of the line...",
	propose = "Unknowingly I’ve slowly become more dependent on you, Commander. With the power of the BIG SEVEN, I shall protect you until my dying breath.",
	expedition = "A lot of oil and supplies have been shipped in. Looks like we got plenty of both for the next mission.",
	win_mvp = "Huh? Am I the MVP? Such a piece of cake for one of the BIG SEVEN.",
	home = "Making sure everyone returns home safely is also one of my duties.",
	mission = "Whether you need fire support or fleet battle, please give the order Commander.",
	touch2 = "Shall I load the Commander into a 406mm gun and fire him?",
	voice_key_2 = -1,
	skill = "It's time to show you the true power of the BIG SEVEN!",
	drop_descrip = "Colorado class battleship— Colorado, hull number BB-45",
	mail = "You’ve got new mail. There may be news from my sisters...",
	touch = "Commander, please don't touch the main gun that I was just using, you will affect my shooting accuracy.",
	profile = "I'm the lead ship of the Colorado class. In order to gain an advantage in the decisive battle, I'm the first ship to be equipped with 406mm guns. BIG SEVEN... is the most honored title for us battleships.",
	mission_complete = "Commander, mission reward has been delivered.",
	feeling4 = "The Commander is willing to talk to someone as bad-tempered as me. Such a weirdo... I don't hate talking to the Commander, though.",
	unlock = "Are you the one calling me? Well, I've been waiting for this day for a long time. In the name of the BIG SEVEN, Eagle Union battleship Colorado, reporting in.",
	feeling5 = "The Commander's compliment after the end of each battle is something which I crave for. Commander, can you... praise me a little more?",
	main = "Commander, although aircraft carriers are really powerful, but battleships are not obsolete. They are indispensable! |Amelia... She was a great woman, though she still cannot be found. Perhaps she is flying freely in another world... |My poor sisters were hurt on that humiliating day. One day, I will have those invaders pay for what they have done!",
	battle = "I will not allow you to misbehave anymore... All guns, ready to fire a volley!",
	upgrade = "Emm, as one of the BIG SEVEN, my powers are unquestionable. Although, timely enhancements are still a necessity.",
	voice_key = 10509,
	headtouch = "",
	feeling2 = "I’m proud of my BIG SEVEN title. Unfortunately the battleship era is closing, and a new wave of ships are arriving...",
	login = "Commander, you’ve rested long enough. When shall we weigh anchor?",
	vote = "",
	hp_warning = "The bridge was hit? Damage control, now!",
	id = 105090,
	detail = "Commander... Can you take your eyes off me?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[105092] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "The fact that I can still be helpful to people makes me happy.",
	home = "I want to perform for people, not a crowd of trees in the barren wilderness. I'll keep fighting in order to keep it that way... together with my sisters.",
	mission = "Commander, there are still some missions left... Make sure you check on them later.",
	touch2 = "Don't I feel... cold to the touch?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Hmm-hum-hum... So very cute~♪ ...Commander? Um, about that... Please do me a favor and forget you heard anything.",
	mail = "So there's new mail. Maryland's as fast to act as always.",
	touch = "It's already been tuned, Commander. Leave it be. It's as delicate as my main guns are.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Hmm-hum-hum... So very cute~♪ ...Commander? Um, about that... Please do me a favor and forget you heard anything.",
	feeling5 = "Hm-hmm~♪ It's in pretty good condition today, just as you said. Um... would you mind if I played you one more song?",
	main = "The Big Five... Yet another name that we were proud to be called.|I'm not sure what I'll do if there ever comes a time when I can take off my rigging, along the title of the Big Seven... I'm sure that that girl from the Sakura Empire is thinking the same thing.|Where would I like to go? Well... if it's not too much to ask... that place where you can pet cats.",
	battle = "I can't let you get caught up in the battle... Shoo, hurry away!",
	upgrade = "",
	voice_key = 0,
	headtouch = "...Hehehe. ",
	feeling2 = "",
	login = "(If the Commander wasn't waiting for me, I'd have liked to stay like this for a bit longer...)",
	vote = "",
	hp_warning = "",
	id = 105092,
	detail = "Commander, um... your gaze is making me a bit uncomfortable. My sisters might be different, but I'm not really used to having people look at me...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[105100] = {
	feeling1 = "A saying that I recently heard from my sister, “Never protest your loyalty to the weak”.",
	feeling3 = "The war cannot be won by a single person. Without true sisters fighting alongside you and a reliable backline supporting you, no matter how strong you are, your defeat is inevitable!",
	lose = "If only Oklahoma was here...",
	propose = "You really treasure these strange rings, do you? ...But since it's your decision, I'll go with it! From now on, I will protect you!",
	expedition = "Even though commissions are an important part of the war, but I'm just not interested in them.",
	win_mvp = "Haha! This is just the appetizer before the main course!",
	home = "Sigh, staying in port is so boring...",
	mission = "If I don’t complete the mission, then I can’t get a battle star.",
	touch2 = "Commander, our fighting power is not in that area of expertise.",
	voice_key_2 = -1,
	skill = "No matter how many times it takes, I will sink you again!",
	drop_descrip = "Colorado class battleship— Maryland, hull number BB-46",
	mail = "When writing a reply back, should I carry an anti-aircraft gun with me...",
	touch = "Commander, are we going into battle?",
	profile = "Eagle Union Colorado class battleship, ship no. 2 “Maryland”. As one of the BIG SEVEN, I often attended various celebrations. I escaped the attack on Pearl Harbor from behind Oklahoma. After undergoing retrofit, I successfully completed counter strike attacks on the Sakura Empire Navy. I participated in Operation Magic Carpet and received a total of seven battle stars. Commander, I just saw gunfire over there...oh, nevermind it was the sunset.",
	mission_complete = "Mission rewards... Darn, what a waste of time.",
	feeling4 = "Not all problems can be solved by fighting? Well, I don't really believe that... but you always seem to find a way to solve things. After all, you are my favorite Commander.",
	unlock = "I am Maryland, a member of the BIG SEVEN. “Fighting Mary”, yes, that's what they call me! I heard there are many battles ahead. I look forward to them all!",
	feeling5 = "Look into my eyes, as my most trusted companions, is it even necessary to use words to express the feelings I have for you in my heart?",
	main = "Fighting beside my sisters is the happiest thing in the world! |I hate foul play, only fair duels are real battles! |Working? ...I don’t know much about that, I’ll just do whatever you tell me to do.",
	battle = "Dear opponents, do NOT disappoint me!",
	upgrade = "I really wanna try to shoot a volley from my main gun right now…",
	voice_key = 10510,
	headtouch = "",
	feeling2 = "I don't know who granted us the title of BIG SEVEN. But if those two keep mentioning it non-stop, then the title should have some special meaning to it.",
	login = "I think I smell gunpowder, has the battle started already? Pfft... turns out it was only Vestal cooking.",
	vote = "",
	hp_warning = "Now, this is a fun battle!",
	id = 105100,
	detail = "Celebration? Honor? Nothing else except for battles will draw my attention.",
	couple_encourage = {
		{
			{
				10502
			},
			1,
			"I will protect you this time!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[105110] = {
	feeling1 = "Commander's laziness is almost beyond my bottom line.",
	feeling3 = "I’m proud of my BIG SEVEN title. But aircraft carriers seem to be replacing us battleships in naval battles. I am losing myself in all this confusion: this strength that I possess... what is it for?",
	lose = "I don't want to recall the humiliation I suffered on that day...!",
	propose = "You’ve decided to perform a pledge ritual with me? Commander really made a bold decision... In that case, I will not let your expectation down. I'll guard you until the very end.",
	expedition = "The commission fleet is really efficient. I hope the Commander can learn a thing or two about efficiency.",
	win_mvp = "Have you seen this? This is the inevitably tragic ending of those who dare challenge the BIG SEVEN.",
	home = "What a peaceful port, it reminds me of Hawaii before the war.",
	mission = "Carrying out missions is an important part of enhancing the strength of the fleet.",
	touch2 = "Commander, it seems you’re rather close to getting lectured by me.",
	voice_key_2 = -1,
	skill = "Have a taste of my 406mm guns!",
	drop_descrip = "Colorado class battleship— West Virginia, hull number BB-48.",
	mail = "Could these be letters from my sisters?",
	touch = "This should be... a friendly gesture I suppose.",
	profile = "During a \"Naval Holiday\", my sisters and I were honored amongst the world's strongest battleships. We were granted the high-profile title of - BIG SEVEN. Although times are changing, the three of us still have the strength to fight any enemy fleet in a decisive battle, please don't forget that.",
	mission_complete = "The mission was nicely executed, good one.",
	feeling4 = "After joining your fleet, the answer to my question has been gradually answered... This power of mine is destined to protect everyone including you, Commander. My strength still has its value, even if I'm no longer the heroine of the battlefield.",
	unlock = "It’s finally my time to show my strength... Under the guidance of fate, the third ship of Colorado class, West Virginia, reporting in.",
	feeling5 = "Commander, you have become someone who can completely take charge on the battlefield. At last, my powers have found a worthy partner... What? A love confession? Don't you trick me to say that, you fool——",
	main = "The combat exercise didn’t go well… Is the Commander being lazy again? |I will never forget the humiliation I suffered on that day. |On the night of the Surigao Strait, I witnessed the last moments of the Sakura Empire fleet... They truly are a worthy opponent...",
	battle = "The humiliation I once suffered... I'll repay you double!",
	upgrade = "It seems the Spokane Cup this year will still be mine.",
	voice_key = 10511,
	headtouch = "",
	feeling2 = "I was once seriously injured, but then I was greatly enhanced during the process for my repairs…",
	login = "You’re late... the exercise has already begun, hurry!",
	vote = "",
	hp_warning = "Getting hit by a torpedo... it feels bad.",
	id = 105110,
	detail = "Do not doubt my combat performance, Commander.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[105120] = {
	feeling1 = "Commander, I'm gonna get angry.",
	feeling3 = "If you’re only going by appearances, every child in this fleet looks cute. But in terms of personality, they all have their unique quirks. To be honest, I am a bit envious of them. (strokes chin).",
	lose = "Not so successful... let's try again next time.",
	propose = "Well, your trust deserves to be rewarded... umm... Commander, do you like bunny girls?~",
	expedition = "The commission is over, they should be back soon~",
	win_mvp = "If the Commander gives me a few praises, then I will be very happy~",
	home = "Ah, hold on, your collar is all messed up. Stand still while I fix it... there you go~ (waves).",
	mission = "It’s not good to leave tasks unfinished.",
	touch2 = "Not good...",
	voice_key_2 = -1,
	skill = "Never let your guard down.",
	drop_descrip = "North Carolina class battleship— North Carolina, hull number BB-55.",
	mail = "You’ve got new mail~",
	touch = "Do you need help with something?",
	profile = "I am North Carolina class ship no.1. I can be considered the big sister battleship of the Eagle Union~ I don’t particularly like or dislike anything, so to speak. Even though I have fought in all kinds of engagements, I have not gained any fame... I am a little bit troubled by this.",
	mission_complete = "The mission rewards were sent out, are you not going to pick it up?",
	feeling4 = "I always believe there is nothing wrong with being ordinary. But after meeting you Commander, I want to change myself a little... after all, my sisters are all so charismatic~ Well.. Commander, are you fond of bunny girls?~",
	unlock = "North Carolina here, awaiting your dispatch. Although I may seem to have a bland personality compared to my sisters. But as the saying goes, no personality is still a personality, hehe. Anyways, awaiting your orders, sir.",
	feeling5 = "Do you want to eat something later Commander? And then you can accompany me to go shopping, if you want to get something then let’s go together. Then... hehe... let’s take a walk in the park? Commander, everywhere I go as long as I’m with you will be just fine~",
	main = "What do I wear inside? It's not something that’s so significant |If I think about it, I certainly have been to many places... seen many landscapes, and also parted ways with many people. |Sometimes I get so envious of my younger sister Washington and how she’s so energetic all the time.",
	battle = "Don’t be overconfident, and try not to be so nervous while focusing on winning~",
	upgrade = "I'll try to work a bit harder~",
	voice_key = 10512,
	headtouch = "",
	feeling2 = "Commander remembers me~ Not that I’m boasting or anything, but I still have confidence in my low sense of existence. (smiles wryly)",
	login = "Welcome back~",
	vote = "",
	hp_warning = "Sisters, hold on!",
	id = 105120,
	detail = "Being stared like that makes me a bit shy...",
	couple_encourage = {}
}

