	main = "In the darkness, my will was tempered. I fear nothing.|As long as I am of use to Commander, I am fine with handing my credit over to others.|Those who stand as Commander's enemies, are enemies all the same.",
	battle = "Come at me with all you got!",
	upgrade = "My shields have become stronger",
