	main = "Commander. Com-man-der. Commanderrrr~ Oh, I didn't need anythin'. Just felt like callin' for you. |I'd like to have a Turkey Shoot. Makes me wish I could fly... |Sure is nice outside. Commander, wanna go lie in the grass under the sun? I could stay like that all day...",
