	mission_complete = "It's satisfying to be rewarded for achieving the objective! Commander, check out the rewards!",
	feeling4 = "Commander! I, Bogue, am requesting special training! The reason is, whenever I hear your voice, I lose my strength so I want to know how to prevent that... That's all!",
	unlock = "*inhale*...HAA! Nice one... Oh, apologies. You're the Commander, I see. Fast pitcher, Bogue, here for duty!",
	feeling5 = "Co-Commander. If I win in the next league, I- I'll tell you something important! S- So please wait for it! I will become stronger. Stronger than anyone!",
	main = "With this ball, I can sink a submarine!|Commander, can you polish the B-25s?|Boring... You look tired anyway, Commander, so let's go and sink some subs?",
	battle = "Go, curveball!",
	upgrade = "My balls have become even faster!",
	voice_key = 10602,
	headtouch = "",
	feeling2 = "Someday, I hope to stand on the podium of the sea with your lead!",
