_G.pg.base.ship_skin_words[106550] = {
	feeling1 = "So... you were the greatest obstacle to the development of the fleet...",
	feeling3 = "I like movies and books. I adore stories with high and low points and emotionally touching scenes. As for my favorite genre, that would be... Umm, it's a secret!",
	lose = "There's only so much I can do on the front lines as an escort carrier...",
	propose = "Although love stories, with all their twists and turns, have a unique appeal, I personally would rather live a life of simple happiness. Do you think the same way, Commander? Then let us join in an embrace after you put the ring on my finger.",
	expedition = "I've finished checking the resources from the commission. Please confirm.",
	win_mvp = "First place... me? Hmph. Fighting on the front lines might be easier than I expected.",
	home = "Welcome back, Commander. The combat report is... Wh-what book?! *cough* *cough*... It's nothing, forget you saw anything.",
	mission = "You will surely be rewarded for your hard work. Please do your best, Commander!",
	touch2 = "Eek?! I... I've never read about stuff like this in my books before...!",
	voice_key_2 = -1,
	skill = "I will do everything in my power to protect everyone!",
	drop_descrip = "Casablanca-class escort carrier – Casablanca, Hull Number CVE-55.",
	mail = "I wonder if this message is from the Naval Headquarters... Commander, I think it'd be wise to check just in case.",
	touch = "Commander, what's the matter... Oh, is my necktie crooked?",
	profile = "Back then, roughly fifty other Casablanca-class sisters entered service over the course of just over a year. Although most of us saw our missions come to an end shortly after the war, I will do my best to fulfill my duties to this fleet, whether as an escort, air support, or a transport. It's a pleasure to work with you, Commander.",
	mission_complete = "Mission complete! All right, with these supplies, your fleet operations should be even smoother.",
	feeling4 = "Oh, Ilsa... You poor thing, you can only choose one person... I wouldn't be able to do that... I am so happy that I don't have to face such a dilemma on m– C-Commander?! When did you get here?!",
	unlock = "Good morning to you. Escort carrier Casablanca, reporting in. I shall support the fleet to the best of my abilities, so you may rest assured.",
	feeling5 = "Would you like to go watch a movie with me, Commander? My favorite kind, of course... A story of love and romance. Together with you...",
	main = "Commander, shall I help assess the state of the fleet's logistics? |Commander, where would you rather be, the thrilling, constantly-shifting front lines, or the humble, but critically important rear lines? |If possible, I'd like to hear about what happened at the Battle of Casablanca from Massachusetts.",
	battle = "A head-on battle, huh... All right, leave the air support to me!",
	upgrade = "Thank you very much, Commander!",
	voice_key = 10655,
	headtouch = "",
	feeling2 = "First Ameer, then Alazon Bay, and finally Casablanca. Isn't it nice when your name bodes good fortune? Hehe~",
	login = "Time is of the essence. Let us quickly begin the day's work.",
	vote = "",
	hp_warning = "Gah... This is starting to look impossible...",
	id = 106550,
	detail = "Although fighting on the front lines is not my specialty, I'll give it my all if needed!",
	couple_encourage = {
