	main = "I'm not as lively as my younger sister, though I'm confident in my own charms. What do you think~|Oh my, where is Saratoga hiding? She's such a handful...|My eyes are gorgeous? Well, for an idol, my eyes have to look like this~",
	battle = "Everyone! Let's claim victory for our Commander!",
	upgrade = "*giggles* I suddenly feel like singing. Wanna listen?",
	voice_key = 10702,
	headtouch = "",
	feeling2 = "Being an idol is a job that brings smiles to everyone. Of course, that includes you too, Commander. *giggles*",
	login = "Oh my~ Where are you heading, Commander? Don't worry. As long as I'm around, even the high flying crane won't get away",
