	win_mvp = "Ooh la la~ Big sis is busy, so it's fine that I get to come by once a while~",
	home = "We~ are back~",
	mission = "Commander, can't you complete even a mission?",
	touch2 = "...wha!",
	voice_key_2 = -1,
	skill = "Where are you looking? I'm right over here~",
