	touch2 = "OH! Commander, at least buy me a drink first!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Hey, Commander, are you lost? How about a drink? ... Huh? Drunk? Me? Oh, Commander, you're such a card. This is just grape juice... isn't it?",
