	touch = "Hey, Commander, you wanna hear some EMBARRASSING stories about Enterprise and Hornet? Oh, you'd rather hear mine? Hehe, THAT can be arranged.",
	profile = "",
	mission_complete = "Here's to a mission accomplished! CHEERS!",
	feeling4 = "",
	unlock = "Hey, Commander, are you lost? How about a drink? ... Huh? Drunk? Me? Oh, Commander, you're such a card. This is just grape juice... isn't it?",
	feeling5 = "I mean, it's only natural for a good couple to be a little clingy, right? After all I've been through, I'm WAY too shy to make the first move. So that means YOU have to do it. Got it?",
	main = "Enterprise is a good girl. So's Hornet. And Hammann. They all found their PLACE in this fleet. But me? The big sister? I'm HAPPY for them. And a teeeensy bit lonely.|You know, Commander, looking back, I have some regrets. Like if I knew you were THIS good? I'd've been more HONEST with myself.|Oh! Is that my cute little Hammann?! When did you get so BIG?! ...Oh, you're the Commander, aren't you? Have you seen Hammann?",
	battle = "Uhhh, where am I?",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "You're late, Commander. You know what THAT means. One penalty drink!",
	vote = "",
	hp_warning = "Urk. I feel... a little sick...",
	id = 107051,
	detail = "Come to think of it, Enterprise did tell me not to drink the blue stuff like A MILLION TIMES. But like, what's the dig beal, Commander?",
	couple_encourage = {}
}

