_G.pg.base.ship_skin_words[107067] = {
	feeling1 = "",
	feeling3 = "",
	lose = "This is why you never pop the champagne early...",
	propose = "",
	expedition = "Commission team's come back. Let's go say hi and give them some souvenirs while we're at it.",
	win_mvp = "Guess we're celebrating this victory with a full course dinner. I can't wait.",
	home = "Solid performance, Commander. You can go lie down for a bit while I work out our next plan.",
	mission = "Commander, be sure to check your mission progress before we head to the next tourist destination.",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "It feels odd taking an extended leave just to go on vacation... but I guess you need breaks to stay on top of your game. With that in mind, let's make every minute count, Commander!",
	mail = "",
	touch = "What's up? Our tickets are all in order, if that's what you're wondering.",
	profile = "",
	mission_complete = "Can we check out a gift shop now that you've claimed these rewards? I want to get something for my sisters that'll really make them smile.",
	feeling4 = "",
	unlock = "It feels odd taking an extended leave just to go on vacation... but I guess you need breaks to stay on top of your game. With that in mind, let's make every minute count, Commander!",
	feeling5 = "I've been all over the world on missions before, but this is my first time visiting another country as a tourist. Everything just feels so novel... I think now I get the appeal of vacationing. Here's hoping we'll see many more new places and people in future journeys to come, Commander!",
	main = "With so many museums and iconic buildings, it's no wonder this city is called the Capital of Art. I'd love to come here again with you at some later point.|I asked Vestal about places to visit, and she suggested this village where lavenders bloom en masse. Said we \"should definitely check it out.\"|After visiting all these places with you, I've realized something – the sights themselves aren't super important to me, what matters is seeing them together with someone dear to me.",
	battle = "No matter where my foes appear, I'll take them down all the same!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "There you are. I'm good to go whenever you are.",
	vote = "",
	hp_warning = "",
	id = 107067,
	detail = "Thank you for letting me experience the stillness you can only find away from the battlefield, Commander. It's shown me... what's really worth protecting.",
	couple_encourage = {}
}

