_G.pg.base.ship_skin_words[107070] = {
	feeling1 = "Northampton, where are you~? (Hornet doesn't seem to notice you)",
	feeling3 = "I'm a twintailed blonde but not a tsundere? Well sorry about that! That's because I, Hornet, am not a stereotypocal woman!",
	lose = "Will I meet a new me?",
	propose = "Is this your answer, Commander? ... Hehe, umm, well... I'm gonna go outside and run a couple of laps first!",
	expedition = "Commander, I'm a little sleepy~ Eh, comissions? Ah, that's right! Ehehe, let's go welcome them back, shall we?",
	win_mvp = "Ahahaha! That felt good!",
	home = "Commander, you were awesome back there~!",
	mission = "Nice weather~ It's a fine day for missions, Commander!",
	touch2 = "Even I can get embarassed...",
	voice_key_2 = -1,
	skill = "Let's finish this in a jiffy!",
	drop_descrip = "Yorktown-class aircraft carrier ー Hornet, Hull Number CV-8!",
	mail = "Secret technique - Doolittle Style Mail Delivery!",
	touch = "I am confident in my own self!",
	profile = "I am the Yorktown class' youngest, Hornet! Hmm? Yep, Northampton is my friend! But I don't get what she's thinking. I'm not like my sisters, but I'm strong as well!",
	mission_complete = "Hahaha, the mission rewards are here!",
	feeling4 = "Hey, Commander, are you really not treating me differently because of my sisters? Is that so...? No, I mean, I believe you!",
	unlock = "Yo! I'm Hornet! Ah.... I don't want to impose, but don't call me Big Wasp and we'll be fine~ My sisters are both legendary, but just wait and see what I can do!",
	feeling5 = "You see, I'm not as bothersome as my older sisters. The Hornet you see before you will say that she likes something if she likes it. That's why I'll say this directly: I like you, Commander! How about you?",
	main = "Commander, if you space out again I'm gonna hit you with a wooden stick~!|Wanna hear about my older sisters? Hmmhmm, now which of them are you smitten by?|Northampton? Well, she's a bit rigid, but she's not a bad girl~",
	battle = "Relax. I have fast hands!",
	upgrade = "Yeah! Now I'm feeling really great!",
