	expedition = "Wh-why is a commission fleet coming back now of all times? ...Commander, I'll— *hic*...! I don't think I should go like this after all...",
	win_mvp = "",
	home = "Everyone was greeting me one after another at the party, and there I was basking in their attention, so... I started toasting everyone, and... Ugh! Why am I so childish...?!",
