	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Commander?! Ah, um, no, I'm not drunk! ...I, uh, just had a bit too much to drink... just a bit! Please don't tell the others though!",
	mail = "",
	touch = "One more cup... Just one more! Commander, here! Cheers! Thanks for everything you're always doing for us. This is... a token of gratitude from me... *hic*!",
