	feeling4 = "",
	unlock = "Commander?! Ah, um, no, I'm not drunk! ...I, uh, just had a bit too much to drink... just a bit! Please don't tell the others though!",
	feeling5 = "The princess and the prince snuggled up to one another and sailed into the sea of stars above the castle~ ...Did you hear that?! Ah, forget it... Just write it off as me being drunk... and let me cling to you already! Hehe, ehehehe...",
	main = "I even got Mr. Eagle here all decked out~ Looks pretty sharp and spiffy, right?|Hey... Commander, um... Yeah, so... have you ever seen Enterprise get drunk before? Ah, no, I was just asking out of curiosity... I mean, it's almost impossible to picture that happening to her, right?|Commander, don't worry about me. Don't you think you should head back to the venue before the others start to wonder where you went?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Sorry, Commander, but could you give me a hand? ...Ugh, why is the hem of this dress so long...",
	vote = "",
	hp_warning = "",
	id = 107092,
	detail = "By the way, Commander, there's nobody else around, right? *sigh*... Thank god... If Enterprise or Shangri-La saw me like this, I'd die of— ...Eh?! Shangri-La?! Wait, no, stop! Please, no photossssss!!",
