_G.pg.base.ship_skin_words[107094] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "The commission team is back! Jamaica, sorry, but I'm going to borrow your bike for a sec! I need to greet– err, talk to the eyewitnesses!",
	win_mvp = "\"Don't assume someone's literally irrelevant just because of how they really look\" ...So that's what it means!",
	home = "Don't let your guard down when toasting in celebration. Remember your limits, and act accordingly...",
	mission = "It's a great day for an investigation, Commander!",
	touch2 = "Y-you're trying to pass down the WHAT...?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "My eagle has gone missing... Just as Enterprise said, there's something strange going on in this port–– Wait, I definitely smell a case in the making! Commander, let's get to the bottom of this together!",
	mail = "",
	touch = "Let's let Shangri-La analyze the photographs. We're more cut out for field work!",
	profile = "",
	mission_complete = "I just picked up the mission rewards. What the heck is up with this Matryoshka doll...? Pfft, ahaha, what a weird face~♪",
	feeling4 = "",
	unlock = "My eagle has gone missing... Just as Enterprise said, there's something strange going on in this port–– Wait, I definitely smell a case in the making! Commander, let's get to the bottom of this together!",
	feeling5 = "",
	main = "This piece of evidence is... the drink Enterprise left behind? And there's... a lemon here too? Oh, uhh, forget I said anything!|This piece of evidence is... the witness's photograph, but I have to glue it back together – speaking of which, where'd the glue go?|This piece of evidence is... The Manjuus that interrogated Cheshire seemed to mention something about an organization called the \"Republic of Essex\"... How strange, I'll have to look into this the next time I catch her.|This piece of evidence is... Wait, isn't this Bunker Hill?! Why were you so fired up to get a shot like THIS?|Let's go over the evidence we have... What?! You already managed to get conclusive proof? I knew I could count on you, Commander!",
	battle = "Open up! Detective-Carrier Essex is on the case!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "I hope my eagle didn't get eaten... But now's not the time to worry about that. Gotta focus on the investigation first!",
	vote = "",
	hp_warning = "",
	id = 107094,
	detail = "\"I am Detective-Carrier Essex, unraveller of mysteries, revealer of truths!\" ...Alright, that's a good-enough catchphrase... Gotta look cool in front of Intrepid and all.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[107095] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Just imagining all the paperwork that's going to come from this defeat... Uuurgh!",
	propose = "",
	expedition = "Shangri-La, please, put that down! Huh? You're just using it to let me know the commission team is back...?",
	win_mvp = "I'm better at fighting than I am at office work!",
	home = "Commander! Welcome baaack~",
	mission = "New missions... That means there's more office work to go with them... Ack!",
	touch2 = "Hey, Commander?!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "\"Anchors aweigh! Arr, pirate aircraft carrier Essex be ready for battle! Nothing in the seven seas will escape my grasp!\" Hic... Hehehe... I wanna be a piraaate...",
	mail = "The new mail? Where did I leave it, again...?",
	touch = "Commander, wanna ride my ship? Huh? That'd make you the captain, wouldn't it? Then I'd be...?",
	profile = "",
	mission_complete = "Mission rewards... Now this is what I need to motivate myself to work!",
	feeling4 = "",
	unlock = "\"Anchors aweigh! Arr, pirate aircraft carrier Essex be ready for battle! Nothing in the seven seas will escape my grasp!\" Hic... Hehehe... I wanna be a piraaate...",
	feeling5 = "You've got it rough, Commander... If I was gonna be stuck doing this every day, I'd run away and become a pirate... I'm kidding! If it means reducing your burden, I can handle it! Heheh.",
	main = "Mmm, the acidity of lemon works just right. I feel great! Now, let me get Enterprise to... Ah. You heard nothing!|Endless office work... So this is your everyday struggle, Commander. I underestimated you...!|Did you see that?! I, aircraft carrier Essex, have obtained the greatest treasure of all! I've overcome my elders—Shangri-La?! Hold it, hold it, hold it! I'll apologize! I'm sorry, I'm sorry!",
	battle = "Eagle Union's own Tempesta... Ack, that's not what I meant!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Commandeeer? Pssh, no, I'm not drunk! I just had two, MAYBE three beers during my break~",
	vote = "",
	hp_warning = "",
	id = 107095,
	detail = "Uuurgh, my head hurts... I feel like I did something crazy yesterday... Do you have any idea, Commander?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[107100] = {
	feeling1 = "This must be a trial... to see if I am able to stand on my own legs... That must be it, right?",
	feeling3 = "Um, ahem... Oh, no, I'm in perfectly fine physical shape. I'm just not sure how I should act around you now that I'm in this form... I'm really alright.",
	lose = "The dawn that the Commander brought us... must not be lost here!",
	propose = "I swear upon the freedom and peace borne within the name of Yorktown, upon the life of happiness that I so desire, and upon my pure love... That the warmth of my lips now belongs to you–",
	expedition = "The commission team has returned safe and sound. It's not good to keep them waiting, okay?",
	win_mvp = "Oh– Sorry, I wasn't watching my step... Thank you, Commander. I'll consider your embrace just now as reward for my MVP.",
	home = "Let us raise a glass to our Commander's triumphant return. Don't worry, it's just one glass. I'm glad you're worrying for my sake, but... Hehe, don't you think you're taking after Enterprise?",
	mission = "My, what's wrong, little eagle? I see, the mission has been completed... I will let the Commander know.",
	touch2 = "The mark you've carved into me will always be here.",
	voice_key_2 = -1,
	skill = "With this power, I'll open a path to the future!",
	drop_descrip = "Essex-class aircraft carrier – Yorktown II, Hull Number CV-10.",
	mail = "This is... a delivery from Hornet? I see. That means it's your mail.",
	touch = "Enterprise, I hope you're doing alright...",
	profile = "I am the resurrected Fighting Lady, Essex-class aircraft carrier, Yorktown. ...Heehee, I'm actually still the same Yorktown you've always known. To allow me to fight alongside my friends in this new form, you're just as amazing as ever, Commander. Hehehe.",
	mission_complete = "Thank you, little eagle, I see that the mission rewards have arrived. Oh, I can't actually understand what it's saying, but I do get the gist of it~",
	feeling4 = "It's not just you, but also Enterprise, Hornet, and Hammann. They're all looking after me as well. Commander, you're the one who has made my blissful life at this port possible, and the person I dedicate my entire life to.",
	unlock = "The second ship of the Essex class, \"The Fighting Lady\" Yorktown, has returned to your side. Even the darkest night must always give way to the resplendent dawn of happiness. Commander, let us step into the future together!",
	feeling5 = "As the light of the dawn of happiness, what should I do for the Commander who reached out to take my hand? Heehee, we'll live happily ever after, right? I understand now – that is how we can share this joy with everyone.",
	main = "Hammann? You look totally different... Oh, now that I think about it, I wonder if I've changed as well... Hmm...|I appreciate your concern, I truly do. But, I also don't understand why you're paying so much attention to me alone. Your time is valuable, Commander, so please make sure to look after our friends as well.|I see, so this is how you use this rigging... Thank you, Essex. We're all a part of the same class now, so there's no need for so much deference.|Lexington, when's your next performance? I'll bring Enterprise and Hornet along to cheer for you~|Just as how we are not here only to fight, Commander, you are not here only to work. If you're not making progress, take a break and come back refreshed later.",
	battle = "For freedom and victory!",
	upgrade = "Strengthening complete. I'm becoming more and more used to this power.",
	voice_key = 10710,
	headtouch = "Maybe I should try getting you to pamper me like a little child~?",
	feeling2 = "Commander, you showed me the light of dawn and offered me salvation. I've long stopped seeing our relationship as one between superior and subordinate... Instead, you're more like... Um, oh my, this is rather embarrassing...",
	login = "Good day, Commander. What's first on the agenda today? Don't worry, all of us have your back.",
	vote = "",
	hp_warning = "I can't let something like this keep me down!",
	id = 107100,
	detail = "Though diplomacy may be a show of etiquette before the war, it also is the only way to put an end to war. I'm sure that means you'll have your work cut out for you though...",
	couple_encourage = {
		{
			{
				10706
			},
			1,
			" Fight on, Enterprise!",
			0
		},
		{
			{
				10707,
				10712,
				10125,
				10150
			},
			1,
			" I'm doing perfectly fine. Heehee~",
			0
		}
	}
}

