_G.pg.base.ship_skin_words[107170] = {
	feeling1 = "I'd rather not talk to you right now.",
	feeling3 = "Don't think I'm upset just because I have little to say. If anything, I'm probably thinking about something, or about how to express myself.",
	lose = "Their power... surpasses even the \"Dragon's Jaws\"...?",
	propose = "Sorry... My mind has gone completely blank... I'm lost for words... Oh, that's right! \"I pledge loyalty and love to you until the end of time.\" ...How does that sound?",
	expedition = "Pardon, but I'll go greet the girls who are coming back from their commission. Just wait here until I report back.",
	win_mvp = "So this is the end that you all chose...",
	home = "You've returned? ...Very well. Why don't we prepare for the next sortie?",
	mission = "Missions... should best be completed in a timely manner.",
	touch2 = "By the looks of things, you won't learn your lesson without some harder-hitting \"experience.\"",
	voice_key_2 = -1,
	skill = "Resistance is futile!",
	drop_descrip = "Essex-class aircraft carrier – Bunker Hill, Hull Number CV-17.",
	mail = "The mail's here... Wonder if there's any new intel?",
	touch = "...Don't think I'm upset just because I have little to say. Just let me know if you need anything.",
	profile = "Essex-class, Bunker Hill. My name comes from a battlefield in the Revolutionary War. I've seen my fair share of battles... and know that war brings nothing but sorrow and pain. Let's not talk about it any more.",
	mission_complete = "There are a ton of rewards? Of course.",
	feeling4 = "Something strange has been going on with my thoughts recently. Whenever I start thinking about things, your face pops up in my head and makes it hard for me to stay calm...",
	unlock = "Bunker Hill, one of the Essex-class carriers, is joining the fleet under your command. Don't worry, you'll see the extent of my abilities soon enough.",
	feeling5 = "We were born as weapons of warfare, and I thought that is all we would ever be. But having spent time with you, I'm beginning to think... that there's more to our lives than war.",
	main = "Right now, another place out there is being engulfed by the flames of war...|Eldridge's ability? I'm not exactly sure, but... I feel like I've seen it somewhere... |All resistance is meaningless before the Essex-class's attack formation.",
	battle = "Why did they choose to become our enemy...?!",
	upgrade = "I grow stronger... yet again...",
	voice_key = 10717,
	headtouch = "",
	feeling2 = "There is no beauty in warfare. There is only ugliness in the suffering and loss of life we inflict upon each other.",
	login = "We're in a state of emergency. Be prepared to run the Holiday Express, even if it's a holiday.",
	vote = "",
	hp_warning = "Why now of all times...?!",
	id = 107170,
	detail = "Commander, why are you staring at me...?",
	couple_encourage = {
		{
