_G.pg.base.ship_skin_words[107223] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Feel like doing some stretches with me? I could use a hand with a couple of moves, like the forward bend for instance.",
