	mission_complete = "",
	feeling4 = "",
	unlock = "Whew... A bit of stretching helps keep the body flexible. Hm? I'm in loungewear, what about it? I'd appreciate it if you wouldn't stare too much, though...",
	feeling5 = "",
	main = "Who's the most dexterous among the Cleveland class? If I had to guess... Columbia. She does ballet, you know.|Even the most basic of stretches qualify as exercise. Though I'll admit, it's not very rigorous exercise.|Long Island claims mastering yoga gives you the power to breathe fire and extend your arms. I don't buy that idea, though.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Your health suffers if you don't move your muscles enough. Keep an eye on your posture in the office so you don't develop a hunchback, Commander.",
	vote = "",
	hp_warning = "",
