	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Commander, are you also here to swim? ...Ah, this here? I brought it with me to the ocean to get some practice in.",
	feeling5 = "",
	main = "Hehehe. With this, I'll be able to improve my sense of balance and my physical strength at the same time. Would you like to give this a try as well?|...It really will be a problem if my hair gets all messy from this. Um, Commander... do you think you could tie it down for me?|Independence and the others are calling for me? ...All right, I'll go.",
