_G.pg.base.ship_skin_words[107232] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Commander, where have you been all this... a premium Saratoga plushie?! W-Where in the world did you find this masterpiece!!!",
