	feeling5 = "",
	main = "Commander, what's your favorite flavor of ice cream? ...Oh, umm, it's just for reference...|Saratoga told me this outfit looks fine on me, but I wonder I really do look presentable in such cute clothing...|A shooting game? Alright, I'll show you how much I've improved thanks to Saratoga's special training sessions! Oh... it's a bit embarrassing to get all pumped up by myself...",
