_G.pg.base.ship_skin_words[107990] = {
	feeling1 = "Perhaps... You're the one who requires more learning, Commander...?",
	feeling3 = "Why do I want to become the strongest shipgirl? So that I can protect my friends, defeat our enemies, and put an end to this war. That's why!",
	lose = "I lost... S-so frustrating...!",
	propose = "Does this mean... you're proud of my achievements? ...But, I still have so much to learn... Until I become a true hero, you have to stay by my side!",
	expedition = "Commission complete! If we get enough supplies, the fight on the front lines will get that much easier!",
	win_mvp = "Yay, I got number one again!",
	home = "Commander, how was my performance just now? Is there anything, anything I could do better?",
	mission = "A new mission? Yes, let's get ready... Huh? It's just for you?",
	touch2 = "Huh...? I'm not sure I understand this order, Commander...",
	voice_key_2 = -1,
	skill = "You're finished!",
	drop_descrip = "Yorktown-class aircraft carrier – Enterprise, Hull Number CV-6.",
	mail = "Commander, I brought the mail!",
	touch = "D-did you have advice for me? Ah, please share it with me!",
	profile = "No matter how strong the enemy is, no matter how bad things get, fight with everything you have, and seize victory - that's the motto I strive for! As long as I keep working to get stronger, I know I'll be able to do it!",
	mission_complete = "Mission complete! It's an honor to be of help to you, Commander!",
	feeling4 = "Yorktown, Vestal, and Saratoga are all very nice to me... Wait, that's no good! What am I going to do if everyone tries to coddle me? Commander, you alone have to be strict with me!",
	unlock = "Hello, Commander. I am Enterprise, aircraft carrier from the Eagle Union. I want to learn as much as I can here to be a stronger warrior... Commander, will you help me?",
	feeling5 = "The hero in the story who protected everyone... ended up lonely and forgotten, right? But I have you, Commander, so everything will be okay! Someday... even if my mission has come to an end, will you still be there by my side? Will we still be able to play together?",
	main = "\"Grey Ghost?\" ...That's supposed to be me...? That sounds pretty awesome!|Yorktown, Hornet, and me... I just know we'll become great carriers for the Eagle Union!|I'm working hard in all sorts of things outside of battle! ...B-but lemons are out of the question!",
	battle = "Enterprise, engaging! ...Woah! My hat...!",
	upgrade = "One step closer to becoming the strongest!",
	voice_key = 10799,
	headtouch = "Okay, that's enough! If you pat my head any more, I'm not going to grow any taller!",
	feeling2 = "Commander, please help me train today as well! Remember what I said last time, no going easy on me!",
	login = "Commander, what will you teach me today?",
