	unlock = "Are you the Commander? My name is Jersey, and don't you forget it.",
	feeling5 = "Commander, I'm a straightforward person, and I'd like my partner to be as well. So be open-hearted and simply say what's on your mind. In return, I will be sincere with you as well.",
	main = "I hate it when others underestimate me because of my size!|No one knows what's on a person's mind if they don't say it aloud. I do not like people who are roundabout.|I wish you would compliment me for being honest, rather than for being \"cute.\" Not that I mind compliments like that.",
