	upgrade = "I will not let your efforts go to waste.",
	voice_key = 20125,
	headtouch = "",
	feeling2 = "Commander, while we're not that familiar with each other, I wouldn't take issue with having tea and chatting with you.",
	login = "Do you know how long you've kept me waiting, Commander? What's the meaning of this?",
	vote = "",
	hp_warning = "",
	id = 201250,
	detail = "Do you need anything? Or are you just here to chat?",
