	expedition = "Wooow! Look at those mission rewards! We could fill a bathtub with all this oil!",
	win_mvp = "I'm gonna punch a hole straight through your heart~! Heheh, I've always wanted to say that!",
	home = "Take a gander at my new marching act, Commander! Relax, I'm only using blanks this time!",
	mission = "Finish them all in one go!",
	touch2 = "It's not like I *dislike* it, but... Yeah, I actually don't dislike it!",
	voice_key_2 = -1,
	skill = "Locked and loaded~! Ready to fire!",
	drop_descrip = "M-class destroyer – Musketeer (G86.)",
	mail = "Heehee~! See? I told you something nice would happen today!",
	touch = "Hehehe~! You've reloaded me with energy!",
	profile = "I'm the Royal Navy M-class destroyer Musketeer! I was in the Battle of the North Cape! Commander, little Musketeer is gonna shoot straight through your dreary heart with a bang bang!",
	mission_complete = "Hehehe~ It's just human instinct to smile at the sight of money! Yeah, that's it! Smile, Commander~!",
	feeling4 = "We should all forget our worries and live to have fun! Don't you think so too, Commander?",
	unlock = "I am the M-class Destroyer, Musketeer! Hehe... I knew something good was going to happen today~ Commander, can you point me to where the port is? Here? Or over here?!",
	feeling5 = "So much has happened since we first met... But I haven't changed a bit!",
	main = "Something nice is gonna happen today~ That's what I'm feeling!|Why am I always smiling? Hehehe, because I've been having so much fun ever since I came here!|The injuries I've sustained from combat? Hehehe, they don't hurt at all.",
	battle = "How-dee-doooo! I'm gonna shoot yooou!",
	upgrade = "Take aim~! Fire! Bang!",
	voice_key = 20127,
	headtouch = "",
	feeling2 = "No matter what life throws at you, always be optimistic, happy, and positive! You just gotta be!",
	login = "Morning, Commander! Nice weather today! Click, click... bang! I'm not sure why, but I'm always brimming with energy!",
	vote = "",
