_G.pg.base.ship_skin_words[201330] = {
	feeling1 = "...If you keep this up, I'll be the only one left who's willing to keep looking after you, Commander...",
	feeling3 = "Commander, haven't you been working a bit too hard recently? You need to make sure to get some rest when you can... If you fly too close to the sun, your wings will melt, and you'll fall down, you know? ...Huh? What am I saying...?",
	lose = "If only I could have shot another volley of torpedoes...",
	propose = "Just as I've become unable to part with you, have you come to feel the same way about me? I'm so happy! From now on, I'll be sure... to ask you for lots of things♪ ",
	expedition = "Commander, would you like me to go greet the commissions team in your stead?",
	win_mvp = "We won! It's all thanks to you, Commander!",
	home = "Welcome back, Commander. I cleaned up the room while you were away. ...N-no, there's no need to praise me. It really wasn't a big deal!",
	mission = "There's a new mission. Let's do our best!",
	touch2 = "I-I'm not sure if we should be doing this...",
	voice_key_2 = -1,
	skill = "Loading complete... Let's go!",
	drop_descrip = "I-class destroyer – Icarus.",
	mail = "I've finished sorting out the new mail! Should I bring it over?",
	touch = "Was there something you wanted me to do?",
	profile = "My history as a ship...? I escorted Hood and Warspite, and also participated in anti-submarine missions... Basically, I've been here and there and done this and that. I guess you could say I have quite a bit of experience? That being the case, feel free to call upon me, whether in battle or otherwise!",
	mission_complete = "The mission's been completed! How wonderful!",
	feeling4 = "Mm... The more I stay by your side, the more I want to do your work in your stead... Do you think I'm getting a bit too attached to you...?",
	unlock = "Well met, Commander. I am Icarus, I-class destroyer from the Royal Navy. I specialize in escort and anti-submarine operations. I look forward to working with you.",
	feeling5 = "\"You, who are like the sun, make me feel your warmth just by being there. You, who are like the sun, make me afraid of being swallowed by your warmth.\" Commander, can I come... a bit closer to you?",
	main = "Commander, please let me know when you head out! Whether it's an umbrella or a coat, I'll be sure to have it ready for you.|Eskimo looks like she wants some attention... Commander, I'll do something about her, so please focus on your work. ...That's right, I can call Abercrombie over!|I guess destroyers really have their limits... If only I had bigger guns or torpedoes... Oh, I was just talking to myself. Please don't mind me!",
	battle = "Alright...! Let's go all-out!",
	upgrade = "Mmh~ One step closer to achieving overwhelming firepower... Err, I mean, I'll be more useful to the commander!",
	voice_key = 20133,
	headtouch = "Hehehe. You know, this feels kind of nice. ",
	feeling2 = "Commander, I've sworn to protect you and everyone else at the port. I'll use all my might to destroy anything that dares to hurt you!",
	login = "Commander, did you just arrive? Hehe. There are documents on your desk. I'll have your tea ready in just a moment, so please get started on your work.",
	vote = "",
	hp_warning = "My torpedoes still aren't ready... I can hold out for a bit longer...!",
	id = 201330,
	detail = "A change of clothes for the commander, the menus for tomorrow's meals... Oh, Commander. When did you get here? ...Don't mind me, I'm just doing some daily preparations~♪",
	couple_encourage = {
		{
			{
				20403
			},
			1,
			"Miss Hood, this time, I'll defend you properly!",
			0
		},
		{
			{
				20502
			},
			1,
			"It seems we're heading out together again!",
			0
		}
	}
}

