	win_mvp = "We have seized the day! Yaay!",
	home = "Commander, your office is much bigger than I expected... You know, this would be the perfect place to play hooky for a bit...",
	mission = "A mission, is it...? There's still a bit of time until the deadline. I think we can worry about it later... don't you? Hehehe.",
