	voice_key_2 = -1,
	skill = "I do what I must!",
	drop_descrip = "Southampton-class light cruiser – Southampton.",
	mail = "Who's the letter from this time?",
	touch = "Are you tired? Well then let's lie down for a nap, shall we?",
	profile = "I am the name ship of the Southampton-class. During the war, I was the only one of my sisters to be sunk. How lucky of me... Ugh. Let's not speak of such unpleasant memories...",
	mission_complete = "The mission rewards came in! Now there's no rush, but you'd better not forget to collect them.",
	feeling4 = "It's not like everything needs to be done one hundred percent perfectly all the time. Just take it easy. It's good enough for government work. You need to cut loose more often.",
	unlock = "Good day, Mast- ahem! My name is Southampton. Let me know if there's anything I might do for you. Oh and, not to be a bother, but is there a space here where I can make tea and enjoy some music?",
	feeling5 = "Commander, if you don't know how to relax, just let me be your guide. Hm? What will I do? Erm, well, wait a tick and let me think! Ehehehe~",
	main = "Commander, why don't we put a nice old phonograph right there in your office?|The maids would be running ragged right about now... I am terribly unsuited to that sort of work.|Honour guard? Bite your tongue! I am a Royal Knight under the command of King George V!",
	battle = "W-wait a tick! Don't go charging on ahead like that!",
	upgrade = "I've grown stronger! But I do hope you won't increase my workload. Hehehe.",
	voice_key = 20207,
	headtouch = "",
	feeling2 = "Commander, have you devoted yourself to the fleet once again today?",
	login = "Oho! Commander, let us combine forces to finish the day's work as soon as possible!",
	vote = "",
	hp_warning = "Aieeee! Pl-please settle down!",
	id = 202070,
	detail = "Naturally, I rather enjoy being a knight more than a maid. Losing myself in this music is such a delight. Commander, you simply must try it as well!",
	couple_encourage = {
