	feeling5 = "",
	main = "Making your maid be your partner is a difficult request that falls outside normal lines of business. As fair compensation, please bring me a cake later.|As your partner, I will naturally draw plenty of unwanted attention. I must steel myself mentally.|I can see other members of the Maid Team going about their business... What a strange fetish you have, Master, to make someone who should be working behind the scenes take center stage... ",
