_G.pg.base.ship_skin_words[202130] = {
	feeling1 = "I cannot acknowledge a commander like you!",
	feeling3 = "Don't get carried away! I came here because of a tasty cake! It's still too early for me to acknowledge you!",
	lose = "Ugh... How could I fall here... of all places...",
	propose = "You dummy. You're making this too formal! This... should've been done a while ago...",
	expedition = "The commission team is back. Hurry up and check the results from them, you idiot!",
	win_mvp = "Hmph! I will not acknowledge you just because you complimented me!",
	home = "You're so lacking at work that you're only good at returning here!",
	mission = "Idiot! Stop sleeping! There's a new mission!",
	touch2 = "Aaah! Pervert! Molester! Lewd! Go and die!",
	voice_key_2 = -1,
	skill = "If we keep doing this dillgently, it will all work out!",
	drop_descrip = "Arethusa-class light cruiser – Arethusa, Hull Number 26!",
	mail = "It's your mail so hurry up and get it. ...It's not like I'm concerned about who it's from! Hmph!",
	touch = "I-it's not like I'm fond of being touched by an idiot like you! ...I just feel sorry for you since you're so lonely!",
	profile = "I am the Arethusa class treaty cruiser, Arethusa: the first cruiser in the world designed with vertical armor! --Hmph! The fact that I'm amazing was decided from the beginning!",
	mission_complete = "Doesn't the reward suit you just fine? Hurry up and get it!",
	feeling4 = "You do have some positive qualities... Hmph! My opinion of you is slightly improved! There's still a lot for you to do!",
	unlock = "You can be at ease now that I, Arethusa, have come. If anything, Commander, don't you dare become my hindrance!",
	feeling5 = "Umm... Good work... I mean, it's nothing! I just made some snacks since I felt like it, so hurry up and eat them!",
	main = "Even if they are allies, I will not show mercy to any threat towards  my comrades!|...Leaving me alone like this... I-I'm not feeling lonely or anything!|Hmph! You suck, Commander, so stop making me worry about you!",
	battle = "Listen up! Our pride rides on this battle! Let's take this seriously!",
	upgrade = "Commander, don't get in my way!",
	voice_key = 20213,
	headtouch = "",
	feeling2 = "I do not acknowledge a Commander like you! Hmph!",
	login = "Commander, I'm gonna get angry if you don't take this seriously!",
	vote = "",
	hp_warning = "",
	id = 202130,
	detail = "...Idiot! Did no one teach you that it's rude to stare at a girl?!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[202140] = {
	feeling1 = "Do you understand? Even the red string of fate is not absolute. I no longer think about anything concerning you anymore, Commander~",
	feeling3 = "I like you Commander, but it's important for all of us to be together. I'm troubled~",
	lose = "Hmph! ...I curse you to be destroyed by my allies!",
	propose = "With this, the bond of fate has been formed~ There's still a long way ahead of us, so let's take care of each other, darling~",
	expedition = "Commander~ *arms folded* let's head to the docks and greet the girls who went off for commissions",
	win_mvp = "You cannot escape from me! Be good, and accept~ your~ punishment~",
	home = "Aaaah cease your attacks! I'm on your side!",
	mission = "Yes, let's see what today's missions are about~",
	touch2 = "Ah... You're daring, Commander --Well then, do you want to hear my wishes?",
	voice_key_2 = -1,
	skill = "This has nothing to do with my fate~",
	drop_descrip = "Arethusa-class light cruiser – Galatea, Hull Number 71!",
	mail = "Mail time~ I wonder what reward I'll get for bringing it to you~?",
	touch = "Hehe~ Commander, you really like to engage in skinship, don't you? Well, just this once, I'm allowing you to continue a bit more~",
	profile = "I am Galatea, the second ship of the Arethusa class. I may not look like it, but in my service in the Mediterranean, I achieved some results~ You'll regret it if you underestimate me~",
	mission_complete = "I'm gonna take your share of the rewards too, Commander.",
	feeling4 = "Commander, let me have your ear... *kiss*. I like you~ ... Yep. Such a thing would have to be done in reality, right~",
	unlock = "I am Galatea, the 2nd of the Arethusa class~ Do you believe in fate, Commander? It is fate that I meet with you~",
	feeling5 = "The red string of fate was what made me grow from a seed, and you, Commander, were the one who made me bloom~ You're so great~ *kiss*",
	main = "Commander, I'm wearing new clothes today! --Hmm? I didn't say I'm heading out!|Commander, are you free? How about taking a walk together? I want to link our arms and be seen by the other girls|Hmm? Did you not hear that? ...There's no helping it. Lie down over here and let me check your ears",
	battle = "Such disobedient kids~~ They must be punished~",
	upgrade = "This too is fate~",
	voice_key = 20214,
	headtouch = "",
	feeling2 = "It takes a long time for the bond to form after you tie the red string of fate. Do try hard, Commander~",
	login = "I'm going to do this and that again today. Please take care of it~",
	vote = "",
	hp_warning = "",
	id = 202140,
	detail = "Geez~ If you keep on looking at me like that, I'll be reporting you to the authorities~",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[202150] = {
	feeling1 = "Commander, please refrain from making a fool of yourself in public.",
	feeling3 = "The goddess, Aurora, was said to have \"rose-coloured fingers.\" Though the same can't be said for me, my fingers at least smell like roses. Commander, want to check for yourself?",
	lose = "It seems I have not yet become accustomed to the battlefield...",
	propose = "\"A rose by any name would smell as sweet.\" Whether I am called Aurora, the \"Goddess of Dawn,\" or even Chongqing, I am still the same me. Yes... I will always be at your side.",
	expedition = "Commander, it will be a problem if you keep staring at me and forget about the girls who have returned from commission.",
	win_mvp = "How wonderful, Commander, we won!",
	home = "Good work. Please take some time to relax.",
	mission = "Commander, a new mission dossier has been issued. I have already highlighted the most important parts, so please look over it.",
	touch2 = "Commander! I... I'm going to be mad! Jeez! I'll really get mad!",
	voice_key_2 = -1,
	skill = "Commander, helping you solve problems and leave worries behind is also part of my job~",
	drop_descrip = "Arethusa-class light cruiser - Aurora, pennant number 12",
	mail = "There's new mail, shall I read it aloud for you?",
	touch = "Commander, want to take a break and come water the flowers with me?",
	profile = "I am Aurora of the Royal Navy, fourth ship of the Arethusa-class. You are welcome to call me the \"Goddess of Dawn,\" but please forget any nasty-sounding nicknames you might hear like the \"Silver Phantom.\" Commander, perhaps you are familiar with some of the other names that I've been called?",
	mission_complete = "Some mission rewards had not yet been collected, so I retrieved them in your stead.",
	feeling4 = "Commander, come here for a moment~ ... Hehe, this rose suits you best after all! Eh? I'm not making fun of you... In that case, why don't you pick one out to put on me? I'm sure I'll love whatever you pick~",
	unlock = "Greetings, Commander. I am the fourth ship of the Arethusa-class light cruisers, Aurora. From now on, I shall serve as your secretary. Please feel free to ask anything of me~ ",
	feeling5 = "Lately, some girls have been grumbling that I've been monopolosing all your time... But, I'm not going to back down on this. Commander, you too should be prepared to deal with a bunch of sulking girls~",
	main = "Dragon Empery? Oh, it's a great place. Mm... for example... |Even though I don't mind if you stare at me, please do your work properly~ |Hold still, Commander, there's something stuck on your cheek... There! Now, please do your best at work~",
	battle = "May we be blessed with victory~",
	upgrade = "Commander, I'll be able to help with even more things now~",
	voice_key = 20215,
	headtouch = "",
	feeling2 = "Commander, would you like to see the roses that I planted? I have a lot of different kinds~",
	login = "My name symbolises the break of dawn. Ehehe~ Do you feel more energetic from seeing me?",
	vote = "",
	hp_warning = "Light of dawn, illuminate our path...!",
	id = 202150,
	detail = "Commander, is there anything I can help you with regarding equipment?",
	couple_encourage = {
		{
			{
				50203,
				50202
			},
			2,
			"Ping Hai, Ning Hai, are you two also practicing mask-changing opera? Eh, you're doing it to make money...?",
			0
		},
		{
			{
				30182
			},
			1,
			"If you can't decide, how about consulting a rose?",
			0
		}
	}
}

