_G.pg.base.ship_skin_words[202180] = {
	feeling1 = "You are more troublesome than a kitchen stain, Master.",
	feeling3 = "Do I feel nervous? Well, Master is a nice person, and none of the ladies here are merchant ships, so I have nothing to be nervous about.",
	lose = "A lady must be elegant, even in defeat... *Sob*...",
	propose = "Does this mean you \"approve of me\"? Thank you, Master. However... if I wear this ring, people may get the wrong idea about you... P-perhaps you should think this through more thoroughly?",
	expedition = "Master, the ladies have returned from their commission and are waiting for you.",
	win_mvp = "This isn't... anything to brag about. Isn't that right, Master?",
	home = "Are you hungry, Master? I'm feeling quite peckish. Shall we eat together?",
	mission = "Master, should you really let all these mission documents pile up...?",
	touch2 = "Don't worry, Master. Even if you go to prison, I will still bring you your meals.",
	voice_key_2 = -1,
	skill = "Dear enemies, this is going to be a liiiittle bit painful.",
	drop_descrip = "Edinburgh-class light cruiser – Belfast.",
	mail = "Master, would you like me to leave this letter here...?",
	touch = "Master, you'll end up a failure if you rely on others too often. Sometimes, you must— Mmh, you leave me no choice. I-I won't help you next time, okay...?",
	profile = "I am Belfast, born in Harland and Wolff. Yes, the same place as the Titanic. I actually have an older sister. She hasn't taken care of me very much, however... Umm, that's all I was going to say. Master, what type of person are you?",
	mission_complete = "The mission rewards are here. If I prove to be of service to you, will I receive rewards too?",
	feeling4 = "I now completely understand how you think, Master... Umm, is this what's known as \"empathy\"? No, perhaps it's just overly easy to understand you, Master...",
	unlock = "My Master is also a commander... Umm, so the commander is a captain of a ship? I don't quite understand, but... I will stay here for a while if you don't mind. I am Belfast, maid-in-training. It is a pleasure to serve you.",
	feeling5 = "Master, do you think I will be a lady worthy of you, when I grow up?",
	main = "You'd like whiskey and coffee... Umm, d-do you not drink tea...?|Master, is there anything you would like me to do?|Master, neglecting your commander duties is a big no-no!",
	battle = "It's a maid's duty to remove her Master's obstacles!",
	upgrade = "I'm not quite used to fighting, but please have faith in me.",
	voice_key = 20218,
	headtouch = "",
	feeling2 = "There are so many ships here... Master, does \"commander\" refer to an incredibly wealthy person who owns a shipyard?",
	login = "Master, would you like some tea?",
	vote = "",
	hp_warning = "Master, perhaps it would be a good idea to retreat...?",
	id = 202180,
	detail = "To perform a curtsy, a lady puts her feet across each other like— Forgive me, I failed to do it...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[202190] = {
	feeling1 = "I have trouble keeping people at a distance. I apologize if this has caused any misunderstandings between us.",
	feeling3 = "The weather report says rain today. Do bring an umbrella if you need to go out.",
	lose = "I've brought such trouble upon you once again... what a dreadful shame.",
	propose = "...It's remarkable how you've turned this ordinary, quiet life into something so unforgettable... Aah... I feel like my heart is about to beat out of my chest with happiness and satisfaction. How will I ever be the same again...?",
	expedition = "A familiar scent rolls in on the sea breeze... the girls are back. Shall we head out to greet them together?",
	win_mvp = "This victory drink is a bit strong for me... I think I'd better hand it off to you.",
	home = "Welcome home. Let me take your coat... You're unharmed, thank goodness.",
	mission = "It's work that must be done, but we can do it at your pace.",
	touch2 = "...You like my soft bits so much, do you? Now then, what if I were to give you a nice, soft, satisfying embrace?",
	voice_key_2 = -1,
	skill = "Glory to the ordinary, the commonplace!",
	drop_descrip = "Southampton-class light cruiser – Newcastle (HMS Newcastle.) ",
	mail = "Mail for you... Do you think perhaps it's from me?",
	touch = "It's like... a couple of small animals playing with each other. Hehe!",
	profile = "I am Newcastle of the Southampton subclass of Town-class light cruisers. While my record is one of the longest, I also somehow had the most free time... It would be nice if I could make it to retirement safely this time as well.",
	mission_complete = "Hard work is not always well rewarded... But it seems this time at least, luck was on our side.",
	feeling4 = "Your smile reminds me of the wind in my hometown... it's that warm, westerly breeze. Hehehe.",
	unlock = "I thought I had gotten lost, but how fortunate that I ran into you. I am the Town-class light cruiser, Newcastle. Thank you for looking after my sisters.",
	feeling5 = "If you take your eyes off me, you never know when I might take up my umbrella... and fly away with the wind♪",
	main = "While I may not have as many battle commendations as my younger sisters, I'm confident none of them know how to enjoy life quite like I do.|I'm no good at these cat and mouse games. Sigh... Why don't you just have a seat and we'll talk like normal people...?|Everyone comes into this world with all kinds of hopes and dreams... But not everyone will lead a life full of adventure and surprises.",
	battle = "Such a lovely day. Let's get this pointless fighting over with quickly.",
	upgrade = "Mmm... feels so warm.",
	voice_key = 20219,
	headtouch = "",
	feeling2 = "Rest assured. I will perform my duties to your expectations.",
	login = "Would you rather have a cup of coffee, a spot of tea, or a splash of pale ale before work?",
	vote = "",
	hp_warning = "Phew... It's a good thing I bought that insurance.",
	id = 202190,
	detail = "You'll have to get a bit closer if you want to share this umbrella.",
	couple_encourage = {
		{
			{
				20208,
				20211,
				20212,
				20216,
				20217
			},
			1,
			"There's no need to rush on ahead... I can't keep up with you like that.",
			0
		}
	}
}

