_G.pg.base.ship_skin_words[202220] = {
	feeling1 = "To think that there would be people who cannot comprehend Royal etiquette at all...",
	feeling3 = "Please do not blame me for being too strict. Royal etiquette is not something can be easily mastered.",
	lose = "It appears that I need to have higher expectations of myself.",
	propose = "Since I have already made my oath with you, it would be improper if I was the only one instructing you. What would I like you to teach me? ...Master, can you please... teach me the etiquette of \"love\"?",
	expedition = "Commander, a commission has returned. Please follow me to greet everyone who is returning. It's proper etiquette, after all.",
	win_mvp = "As long as you strive for excellence, victory will naturally follow.",
	home = "Good work, Commander. I've prepared tea today according to your instructions from earlier. Please enjoy.",
	mission = "A new mission has been posted. Please complete it as soon as possible - it's rude to keep others waiting.",
	touch2 = "C-Commander... what is the meaning of this...",
	voice_key_2 = -1,
	skill = "I shall correct your perversion!",
	drop_descrip = "Ceres-class light cruiser - Curlew (D42)",
	mail = "This mail is for you. Don't worry, I'll be sure to leave when you are ready to check it.",
	touch = "Please be mindful of your posture. Be confident and stand tall so that you can earn the respect of others.",
	profile = "I am Curlew, one of the Royal Navy's Ceres-class light cruisers. C-class light cruiser? N-no, that's not the correct classification, please don't use that term anymore...",
	mission_complete = "A mission has been completed, but don't over-celebrate in an undignified manner, Commander.",
	feeling4 = "Just like libations, there is a time and place for drinking black tea. What, you want to have tea right now...? F-fine.. since it's been so long since you've had a break, I suppose there's no harm to it...",
	unlock = "Greetings, I am your Royal maid, Curlew. The responsibility of supervising the master’s daily routine falls on the maid. I will help you become a Royal gentleman through and through, so please pay attention and work hard.",
	feeling5 = "Being with you reminds me of the time I used to live with my sister. She'd always instruct me on how to be a prim and proper maid. I wonder if I've managed to become... an excellent maid just like her...",
	main = "Royal etiquette is steeped in social and life philosophy. Please keep that in mind at all times. |I already am a perfect maid? Surely you jest... have you not met my elder sister yet? |Lately, your etiquette has improved greatly. However, don't get too proud, Commander.",
	battle = "Let's show our enemies what a Royal maid is capable of.",
	upgrade = "I am one step closer to becoming a perfect Royal maid. Thank you, Commander.",
	voice_key = 20222,
	headtouch = "",
	feeling2 = "The details make up the difference between success and failure, whether in etiquette or in battle. Commander, please remember to always be attentive to details.",
	login = "Welcome back, Commander. Your tie is crooked... let me fix it for you. Your otherwise refined attire cannot be taken seriously with such a flaw.",
	vote = "",
	hp_warning = "T-trigger the anti-air defence alarm!",
	id = 202220,
	detail = "No matter the time or place, as a maid or as a soldier, one must always remember to observe proper etiquette.",
	couple_encourage = {}
}

