_G.pg.base.ship_skin_words[202280] = {
	feeling1 = "Did I let you down, Master? What a despicable maid I am...",
	feeling3 = "I look good in my idol outfit? Thank you so much, Master...! Oh, does that mean I'm not a maid anymore?! Master, you aren't going to abandon me, are you...?!",
	lose = "I can't sing as well as the Head Maid...",
	propose = "It's unthinkable that a lowly maid could shine onstage with all of you... But I will redouble my efforts to be worthy of the honour! All for the sake of my dearest Master!",
	expedition = "Tashkent tells me the commission team is back.",
	win_mvp = "I know I can do it if I work hard. I'll become an idol you can be proud of!",
	home = "Master, are you hurt? Do you feel okay? I may be an idol for now, but if you need me, I can still service you anytime...",
	mission = "We have a gig offer, Master. Won't you take a look?",
	touch2 = "Nnng...",
	voice_key_2 = -1,
	skill = "As an idol, for the Master...!",
	drop_descrip = "I am the light cruiser, Dido, currently taking part in idol activities as part of the experimental Muse System. I learned more or less what idols are supposed to do from the others, so p-please... keep a close eye on me!",
	mail = "Looks like some important mail, Master.",
	touch = "You need only ask and I'll be happy to shake your hand, or whatever you may want!",
	profile = "I'm Dido, Royal Navy Light Cruiser. I'm but a lowly maid, and I never expected to be chosen to be an idol... But I'll do what I can!",
	mission_complete = "Master, here are the rewards. It's all thanks to their hard work.",
	feeling4 = "You mean you're excited to see me as a maid, and as an idol...? Sorry, I misunderstood...",
	unlock = "I am the light cruiser, Dido, currently taking part in idol activities as part of the experimental Muse System. I learned more or less what idols are supposed to do from the others, so p-please... keep a close eye on me!",
	feeling5 = "I'm doing well as a maid, and as an idol...? I'm honoured by your praise! I'll keep working hard as an idol... No, I'll keep working hard in everything I do for you, Master!",
	main = "Singing is more about conveying one's feelings than it is skill... So I will keep singing for you, Master...|Madam Illustrious focuses so much on her footwork during dance practice... is it because of the mirror?|My fellow maids, and the girls from the different camps come together to make a proper idol unit. It's truly amazing that you can bring all of us together, Master.",
	battle = "Now, to steal Master's heart... with my dance!",
	upgrade = "I wonder if Albacore's idea could actually work...",
	voice_key = 20228,
	headtouch = "",
	feeling2 = "No longer a maid serving her master, I'm now an idol.I've learned so much from the other maids, but I'm still not sure if I can do this right...",
	login = "Master, what would you have me do today? Idol things or maid things, I'll do anything you want!",
	vote = "",
	hp_warning = "I can't let the Master throw me away...!",
	id = 202280,
	detail = "Between my idol lessons and shows, training and my maid duties, all to be useful to you, Master... It's a lot of work? You want to reduce my workload...? P- please don't throw me away...!",
	couple_encourage = {
