_G.pg.base.ship_skin_words[203030] = {
	feeling1 = "I'm disappointed... We don't make a good team at all.",
	feeling3 = "Hey, Commander! Ah, nothing, nothing... Just keep doing you work. I'm happy just looking at you, Commander.",
	lose = "Ouch... Contestant Ken has been eliminated",
	propose = "Oh wow! Thanks, Commander! But something this important needs to be kept in a safe place. I can't afford to lose it.....",
	expedition = "Good! Your commission team has successfully returned!",
	win_mvp = "Yeah! Contestant Kent is number one!",
	home = "Welcome! I'm still full of energy!",
	mission = "Hmmm, a new mission, want to take a stab at it?",
	touch2 = "Oh... Commander... You big pervert...",
	voice_key_2 = -1,
	skill = "Contestant Kent is sprinting!",
	drop_descrip = "Kent-class heavy cruiser - Kent, Hull Number 54!",
	mail = "Warning! Radar indicates a paper plane folded with the new mail closing in at high speed!",
	touch = "Yoohoo~ Want to play, Commander?",
	profile = "I'm both one of the first County-class cruisers and the first ship of the Kent-class. Pretty impressive, right? Stuff like Armour can be made up with good motivation and a fighting spirit! Right?",
	mission_complete = "Mission rewards! Let's take a look!",
	feeling4 = "Staring...? Ah, it's nothing. I'm just wondering why you're so good looking, Commander. I'll never get tired of staring at you!",
	unlock = "Hey Commander! I'm Kent! How do you do? Good? Bad? Doesn't matter. Things will be better now that I'm here!",
	feeling5 = "Commander! Commander! Want to guess how many layers of armor I'm wearing? If you get it right, you get a prize! If you don't, then you'll have to count the layers yourself...!",
	main = "I forgot that Tigre isn't around...|Commander, do you wanna race against me?|I think I've seen ships from the Far East before... They look really strong!",
	battle = "Let's show the enemies our true strength!",
	upgrade = "Woah! Contestant Kent has become stronger!",
	voice_key = 20303,
	headtouch = "",
	feeling2 = "Commander, Let's play a game! No, it's not a catchphrase. I can change it anytime! Anyways, Let's play! Let's Play!",
	login = "Yo, Commander, let's go do something together!",
	vote = "",
	hp_warning = "",
	id = 203030,
	detail = "Errr, Graciously overlook my poor armour and firepower, please!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[203040] = {
	feeling1 = "... The sky is so blue...",
	feeling3 = "Reconnaissance is a very important task! Huh, I'm losing focus? W-what are you saying? I'm just o-observing the weather...",
	lose = "*Cries*... If only I had paid more attention...",
	propose = "Hmph, the Commander has finally noticed that under all that hazziness there is brilliance to be found! From now on I can be as lazy as I want. ... Huh? I can't?",
	expedition = "That cloud looks like cotton candy... hmm? Ah, Commander. The commission team is back~!",
	win_mvp = "That cloud looks like a.... Oh? We won?",
	home = "Good work, Commander! Care for a cup of tea?",
	mission = "The weather sure is nice... Oh? Commander! You've got some new missions.",
	touch2 = "... Ah! Commander! If you were here you should have said something.",
	voice_key_2 = -1,
	skill = "What a beautiful seagull...",
	drop_descrip = "Kent-class heavy cruiser - Suffolk, Hull Number 55!",
	mail = "Commander... hm... what did I want to say... Ah, right! New mail for you!",
	touch = "... C-Commander?",
	profile = "I'm the fifth ship of the Kent-class. Although I look like this, I can still pull it off when it counts. During the Battle of the Denmark Strait, I basically saved the day!",
	mission_complete = "Commander! How can you also be so forgetful and forget to collect your rewards?",
	feeling4 = "My big sisters are so strong, if only I could be of more help to them... Huh? I'm doing a good job as well? Hehehe... I received a compliment~",
	unlock = "Where am I...? Ah, excuse me! Do you kno....Oh! You're the commander? This is great! I'm Suffolk, I finally found you!",
	feeling5 = "Even though it's nice to receive compliments, I am much happier just being able to support you the best I can, Commander.... Why is that?",
	main = "My greatest accomplishments were done just watching the waves like this.|Commander, want to watch the clouds with me? I bet we'll see some wonderful things!|Don't look at me like that, I've been to plenty of places before!",
	battle = "The enemies look quite strong...",
	upgrade = "Now I can protect myself even if I get lost again!",
	voice_key = 20304,
	headtouch = "",
	feeling2 = "Hmm, clear skies, so a great day to scout out the waters~ Do you want to come with me, Commander?",
	login = "Commander, you're back! Me? I'm looking at the clouds.",
	vote = "",
	hp_warning = "",
	id = 203040,
	detail = "My post-retrofit performance is very impressive!",
	couple_encourage = {}
}

