_G.pg.base.ship_skin_words[203060] = {
	feeling1 = "I really can't compare to my sister...",
	feeling3 = "I'm fine the way I am? Aha, you really know how to give compliments, Commander. Compared to my sister though, I'm still but an ugly duckling.",
	lose = "Guh...! I can't fall here!",
	propose = "You sure are a weird person, Commander. To chase after me who is but a tiny star to the bright moon that is my sister. But I too am attracted to you, if you are okay with someone like me then I would be happy to accept.",
	expedition = "Ah, the commission team is back~! Commander, could you let me go on a commission with my sister next time?",
	win_mvp = "This gets me one step closer to my big sister~",
	home = "Good work, Commander! Come, sit and have some tea. I will tell you some things about my sister~",
	mission = "Missions, huh? Makes me think of all the time I spent with my sister.",
	touch2 = "You sure are weird, Commander.",
	voice_key_2 = -1,
	skill = "Sister, please lend me your strength!",
	drop_descrip = "Norfolk-class heavy cruiser, Dorsetshire, Hull Number 40\n<color=#ffde38>Unlock build after receiving</color>",
	mail = "Commander, there's mail for you~",
	touch = "So, Commander, you think I'm actually a bit too big?",
	profile = "The offshoot of the County-class, the Norfolk-class, includes me and my sisters. My proudest achievement was giving chase to Bismarck and not letting my sister's intel go to waste. I am still far from matching her, so I must become a sister she can be proud of!",
	mission_complete = "Here are your rewards! Please take good care of them.",
	feeling4 = "Ah, could it be that you've developed feelings beyond friendship for me? In that case I must properly respond to them.",
	unlock = "Hello, I'm Norfolk's little sister, Dorsetshire~! I look more mature than my sister? Surely you jest! She's my role model!",
	feeling5 = "I've never actually thought that I would see such a day coming... How should I react?... Commander, can you teach me?",
	main = "Is it not common knowledge that my big sister is the cutest in the world?| For allowing me to use the intel my sister gave me, Bismarck is such a generous person.|If it's about my sister, I could speak for three days and three nights and still not be done.",
	battle = "I'll do my best to not embarrass my sister!",
	upgrade = "I'll continue to do my best, with my big sister as my goal~",
	voice_key = 20306,
	headtouch = "",
	feeling2 = "It's not an exaggeration to say my sister is a world treasure, a gift from the heavens. It's an honor for me to have a sister like her.",
	login = "Welcome back~ What are we going to do today?",
	vote = "",
	hp_warning = "This is a bit of a struggle...",
	id = 203060,
	detail = "My big sister is definitely cuter, at least compared to me.",
	couple_encourage = {}
}

