	feeling4 = "",
	unlock = "The school has recently been consumed by a series of Mysteries... there must be some Mastermind lurking behind the scenes. Yes, another Tribulation awaits me! I shall part the veil and reveal all Truths!",
	feeling5 = "",
	main = "Eyepatch? Nay. This is a tool that is necessary to seal off a portion of my Force. |Difficult Words, annoying Formulae... Curses, will I be defeated by these things before I am able to reveal the Truth?! |Exeter struggles with her Tests on a daily basis, but that is for the best. The true Tribulations are mine alone to bear.",
