_G.pg.base.ship_skin_words[203080] = {
	feeling1 = "Please do not bring shame upon the royal family.",
	feeling3 = "Living with the royal family means I cannot decide my own fate. It is great to have met someone as excellent as you, Commander.",
	lose = "Curses... I shall have my revenge!",
	propose = "For better for worse, for richer for poorer, in sickness and in health, to love and to cherish, till death us do part, according to God's holy ordinance; and there to I give thee my troth, Commander.",
	expedition = "The girls who went out on a commissions have returned. It is my duty to at least receive them properly, Commander.",
	win_mvp = "I am the successor of a long line of royals, and shall embrace my destiny with countless victories to come!",
	home = "Exeter has returned to port! I will prepare the after-action reports right away!",
	mission = "Please make sure to fulfill your duties - in the name of the Crown!",
	touch2 = "...!! T-this kind of... please, don't... As a member of the royal family... if someone saw us like this...",
	voice_key_2 = -1,
	skill = "For the glory of the royal family!",
	drop_descrip = "York-class heavy cruiser - Exeter, Hull Number 68!",
	mail = "Mail for you, Commander. I hope it is good news!",
	touch = "Even though I'm a member of the royal family... you still treat me as an equal, Commander. I'm touched.",
	profile = "Exeter, York-class heavy cruiser number two, reporting in! I took part in chasing down Admiral Graf Spee. No matter how numerous the opposition, I shall never back down when fighting for the honour of the Royal Navy!",
	mission_complete = "Honours and rewards have been delivered.",
	feeling4 = "Commander... actually... I was thinking, if you were a normal person and not a commander, would I come to like you as well...?",
	unlock = "Exeter, York-class heavy cruiser number two, reporting in! In the name of the Royal Navy, I swear that I shall contribute to your cause, Commander!",
	feeling5 = "What's important is the present. If there is such a thing as fate in this world... I believe we were destined to meet.",
	main = "I can feel the honour of being in the Royal Navy no matter where I am!|York is talking nonsense yet again...|My skirt gets wet all the time... Should I change into something a bit more suitable for battle?",
	battle = "I swear upon the honour of the Crown that I, Exeter, shall fulfill my duties and my destiny!",
	upgrade = "For the honour of the royal family, I shall not be humiliated!",
	voice_key = 20308,
	headtouch = "",
	feeling2 = "Commander, don't be blinded by romance.",
	login = "As a royal elite, I shall not disappoint you, Commander!",
	vote = "",
	hp_warning = "May honour protect us!",
	id = 203080,
	detail = "I'm counting on you for the inspection, Commander.",
	couple_encourage = {
		{
			{
				20307
