	mission = "Hurry and finish the mission! Do not skip your work!",
	touch2 = "W-wait... You fool, what are you doing?! I-I'll sentence you to death!",
	voice_key_2 = -1,
	skill = "Kneel before the Queen!",
	drop_descrip = "Queen Elizabeth-class battleship - Queen Elizabeth, Hull Number 00!",
	mail = "I have no interest in the contents of your mail... Mmh...",
	touch = "Please do not touch our noble body so casually",
	profile = "I am the super-dreadnought of the Royal Navy. Make sure to remember my name! My military achievements? I let my subjects take care of those kind of things. I simply need to watch them do their work!",
	mission_complete = "Kneel before me and accept your mission rewards!",
	feeling4 = "H-hmph! You have been slightly exceeding in your duty, thus I will make an exception and promote you to captain of the Royal Guard! When I call for you, you will come hither immediately! Understood? Immediately! Swiftly! At maximum speed!",
	unlock = "Are you the commander? You are still 100,000 years too early to command me! Well, I shall be generous and give you a chance... From this day on, you will be one of my faithful servants!",
	feeling5 = "Hey, can't you just leave your work to your underlings? How can you be a proper consort if you aren't always by my side?! I-I would be so lonely...",
	main = "Being petite is a noble characteristic, understand?|You're saying I bumped into you? That's because you didn't make way for the Queen!|Do not touch my belly, it's rude!",
	battle = "Witness the might of a super-dreadnought!",
	upgrade = "I have no need to get any stronger! But... well, if you're going through to effort of doing it, then...",
	voice_key = 20501,
	headtouch = "",
	feeling2 = "Work hard for the great Elizabeth!",
	login = "Despicable, to have me wait on you for so long!",
	vote = "",
	hp_warning = "Why are you spacing out?! Hurry! Get them!",
