_G.pg.base.ship_skin_words[205016] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Grrr... Servant! We will devise a plan to get them back!",
	propose = "",
	expedition = "What's that, little ones? The commission team is back? Good! I shall go and greet them!",
	win_mvp = "Heheh!♪ George, be sure to record my accomplishments! And those of my servant, too!",
	home = "My, you've really given it your all! Heheh, I hereby permit you to rest! Take it easy by your queen's side, servant!",
	mission = "You still have missions? Mm, I suppose I am a little concerned about Valiant...",
	touch2 = "Th-that was an accident, right?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Servant, what do you think you're doing?! Instead of wasting your life working, go have some fun in the sea for once! We went out of our way to come to the beach, so do not disappoint me!",
	mail = "",
	touch = "How kind and perceptive of you to offer to refill my tea for me! Make sure you bring sweets, too.",
	profile = "",
	mission_complete = "The rewards have arrived! Hood, go take a look with the destroyers.",
	feeling4 = "",
	unlock = "Servant, what do you think you're doing?! Instead of wasting your life working, go have some fun in the sea for once! We went out of our way to come to the beach, so do not disappoint me!",
	feeling5 = "",
	main = "A beach party? Seattle, where is this coming from? ...Not that I mind, once my servant and Hiei arrive.|Richelieu, wait! Why are you bringing the Meowfficers?! And Jean Bart, don't just stand there and watch! Stop her!|You don't see the Royal Maids around? Well, of course not; I gave them the day off. My servant and the knights are here, and Neptune and Cheshire have always wanted to try maid work anyway! I see no cause for concern.",
	battle = "Servant, we go together!",
	upgrade = "",
	voice_key = 0,
	headtouch = "Wh-what are you doing?! A reward, you say? Well, this is hardly...",
	feeling2 = "",
	login = "I left Valiant with all the busy work so I could take it easy today! Why don't you leave your work to someone else for once?",
	vote = "",
	hp_warning = "",
	id = 205016,
	detail = "Hmph! A noble queen would never swim with the common folk! ...I-it's not because I can't swim! Fine. Let's race to that rock! I'll prove to you that I am a capable swimmer!",
	couple_encourage = {}
}

