	feeling5 = "Bah, being indirect is just not like me. I adore you, Commander. Both as the leader of the fleet, and as my beloved special someone. I wish to know... do you adore me as well?",
	main = "Wales and York are lovely ladies. At times, however, I struggle to keep up with their thought processes.|George has always been good to me. She often treats me to a cookie or two... But I wish she'd stop treating me like I'm still a child.|If you have a hard time making friends with an eccentric person, my advice is this: bake some cookies, and offer to share with them.",
	battle = "Heheh, there'll be no mercy for you!",
	upgrade = "Phew... I'll return your gesture with valour on the battlefield, Commander.",
	voice_key = 20509,
	headtouch = "Hm...?",
	feeling2 = "\"Shape the world into God's vision\" – if there is a God, what is his ideal world? It can't be one of perpetual war, that's for sure.",
	login = "How nice to see you. Now, let's get to work on today's tasks.",
	vote = "",
