	feeling5 = "",
	main = "Don't get any weird ideas. I'm only pouring tea for you because you're the patient!|When we're not training for this exercise, how about a game of chess? I already brought the board. I'll set it up, so just wait in bed!|As a patient, so you're supposed to listen to the nurse! Mm... Besides, shouldn't you already be heeding my every instruction? You're my attendant after all...|You're my patient today! Heheh, be grateful that you're now under the care of the charismatic nurse, Valiant, and heed my every command! ...It, it's not like I'm into this or anything, so don't expect me to do this every single time!|It's time to get your blood drawn, so stick your arm out! ...Geh... I can't handle this stuff like Vampire does...",
