	touch = "Let's take your temperature, just to be sure. Mind if I assist with that?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "This may be an exercise, but even so I will give it my all. Right now, I am not just a Royal Navy warrior, but a medical resident as well. If you ever feel ill, come see me, Commander.",
	feeling5 = "",
