	feeling4 = "",
	unlock = "I heard that the Sakura Empire's traditional attire was really hard to put on... but the Dragon's Empery's outfits are even more... Huh?! Commander, p-please look away!",
	feeling5 = "Commander, if you're tired, feel free to rest in my lap. Not only is it ideal for you to replenish your energy, but it is also my duty to provide you succor.",
