_G.pg.base.ship_skin_words[207130] = {
	feeling1 = "I-I'm sorry! I-I'll listen better from now on, so don't get mad at me...",
	feeling3 = "You want to know if ladies of the Royal Navy get tired? It's not so bad; we only have to constantly mind our manners and carry ourselves with elegance... Ugh, it's a hassle! I just wanna lie on the couch and eat candy—Ahem! F-forget you heard that!",
	lose = "Th-the Commander's gonna lecture me... Urk...",
	propose = "People tell me that you only give these to those you really care about... Does that mean I'm your best friend, too? Ehehe, I'm overjoyed! I'd better go tell big sis Illustrious about this!",
	expedition = "I heard there's tasty milk chocolate in the commission supplies... I-I didn't say anything. How about we go greet the commission team?",
	win_mvp = "Hmph. Do not underestimate Formidable!",
	home = "While you were away, a few of the older girls visited. They all left messages, which I wrote down on this sheet of paper for you... (whispering) The Commander's really suspicious...",
	mission = "Missions? Can we eat candy if we finish them all?",
	touch2 = "Just you wait! I'm gonna go tell big sis Illustrious aaall about all the bad things you did!",
	voice_key_2 = -1,
	skill = "Evildoers, begone at once!",
	drop_descrip = "Illustrious-class aircraft carrier – Formidable.",
	mail = "Commander, I brought your mail. I heard that's part of a secretary's job... I-is that right?",
	touch = "I-it is rude to touch a lady without her permission!",
	profile = "Illustrious-class aircraft carrier number three, with a promising future of becoming an armoured carrier. Commander, I humbly request your aid in training me to become a proper lady... Huh? What kind of sweets do I like? Why are you asking me... I like all kinds of sweets!",
	mission_complete = "Commander, the missions are all done now, so you should take a break. ...You're too busy? It must be hard being grown-up...",
	feeling4 = "You're a lot like me, Commander. Every day is so full of things you must do, you're only able to do what you want to do in private. Even grown-ups have it rough... But it's okay! I will do whatever I can to help you! Not that I know exactly what that entails...",
	unlock = "Hmm... Are you the so-called \"Commander\"? You don't look all that scary, but maybe this is what they call camouflage...? Hmm... I dunno... Oh! I'm the third Illustrious-class ship, Formidable. It's... a pleasure to meet you?",
	feeling5 = "I always thought you were a strict and scary person, so I acted cold to you... N-now I know that you're a good person and fun to be around! Commander, you're my best friend! Ehehe!",
	main = "I'm about to go to a tea party with the others... Commander, do you have a mirror? I want to make sure I'm looking sharp... No, you don't need to help me! I can do it myself.|Little Bel, how much longer are you going to be? \"It's only been three minutes\"? You mean you've ALREADY taken three minutes!|One of my Royal Maid sisters told me I'd turn \"plump\" if I ate too much cake. Does she think I believe these childish lies? ...C-Commander, that is a lie, right?!",
	battle = "Evildoers! I'm not scared of you!",
	upgrade = "Wooow. You can use airplanes for this, too?",
	voice_key = 20713,
	headtouch = "Hawawah! D-do not rustle the hair of a proper lady!",
	feeling2 = "Do you need something? Ladies of the Royal Navy are quite busy, I'll have you know—You say there's a party full of sweets? And we don't have to be all stuffy and formal? AND big sis Illustrious said I can go? Hmmm... O-okay, I'll go! I'll go!",
	login = "W-welcome back... I suppose I should start my etiquette training now, right? For example, practicing how I stand and sit...",
	vote = "",
	hp_warning = "Don't hit me, don't hit me! Ah...",
	id = 207130,
	detail = "I hear that you're an evil taskmaster who punishes shipgirls when they don't do exactly as they're told... Hwah? That's not true? I dunno, you're kinda suspicious...",
	couple_encourage = {
		{
			{
				20703,
				20704,
				20709
			},
			1,
			" F-for love and peace!",
			0
