_G.pg.base.ship_skin_words[213010] = {
	feeling1 = "Commander, if you fall into darkness, know that it will be me hunting your soul...",
	feeling3 = "Whenever I'm afraid, all I have to do is think of my little sister. It gives me the strength to push on. Even though my sister can't be without me, I can't be without her either.",
	lose = "Even if you manage to defeat me, you'll never escape the infinite darkness.",
	propose = "Shadows chase after light, and light embraces the shadows. I've heard of foolish lovers who erase each other, but who can judge another's love? Isn't that right, Commander?",
	expedition = "I'm not particularly interested in embarking on commissions... The other girls always say I see weird stuff. I suppose it can't be helped... Anyway, your girls are back!",
	win_mvp = "Allow me to harvest the souls of our enemies.",
	home = "The silence after a battle is divine. Take your time and rest.",
	mission = "You'll experience an eternity of restlessness if you die with incomplete missions.",
	touch2 = "... ... uh... ... I'm sorry, it seems like I was having an out-of-body experience.",
	voice_key_2 = -1,
	skill = "Want a taste of death?",
	drop_descrip = "Erebus-class monitor – Erebus, Hull Number I02!",
	mail = "Letters are what connect humans. Hold them dear.",
	touch = "Allow me to channel forth the whispers of the dead...",
	profile = "Erebus, my name, sounds surreal?\nMy predecessor was a ship which carried explorers to the North Pole and never returned... like a journey into the abyss.\nPlease pay more attention to my sisters!",
	mission_complete = "Rewards are but worldly possessions. It makes no difference to me whether you collect them or not.",
	feeling4 = "I'm afraid no longer. Being next to you, I'm willing to become the darkness to your light; And if that light were to swallow me... No, even if I was to be devoured, that would be fine too.",
	unlock = "Commander, is that you? I'm Erebus. I followed your voice and have come from afar.",
	feeling5 = "Where there's light, there's darkness. Wherever you are, I'll be near. This isn't fate but the law of this world... It's nothing, it's just something that I've wanted to say for a long time, if I ever found someone who I truly liked.",
	main = "Did you just have an out-of-body experience?|I'll always protect my little sisters.|I have to say, this warmth, I don't dislike it.",
	battle = "Please remain calm. The darkness will only make the stars shine brighter.",
	upgrade = "The purer the darkness, the calmer my mind.",
	voice_key = 21301,
	headtouch = "",
	feeling2 = "It was hard to take care of my sister at the beginning, but I got used to it... used to being alone? I'm just used to the fear of it.",
	login = "Commander, I'm always here, awaiting for your summons...",
	vote = "",
	hp_warning = "The darkness is with us.",
	id = 213010,
	detail = "I am not the harbinger of death... I am just..... guiding them after their times are up",
	couple_encourage = {
		{
			{
				21302
			},
			1,
			"Terror, stay close to me.",
			0
		},
		{
			{
				20123
			},
			1,
			"Vampire, please imbibe wine – I mean, blood – with moderation...",
			0
		},
		{
			{
				20502
			},
			1,
			"Lady Warspite, I shall support you.",
			0
		},
		{
			{
				10
			},
			5,
			"Saru Legion? What a fun name!",
			4
		}
	}
}

