	mission_complete = "",
	feeling4 = "",
	unlock = "\"I am the witch of Hallow's Eve, here to guide your soul into the ever darkness\"... that's what the concept of the Halloween witch is about, right?",
	feeling5 = "Forming a contract with a witch will allow one of your wishes to come true. In return, your souls will forever be bound, unable to separate from one another... Commander, tell me... what is your wish?",
	main = "Legend has it that real monsters come out on Hallow's Eve... Shall we search for them? |These festivities have diluted the ever darkness with noise and light... but it's not such a bad thing. |T-trick or treat...? Oh, right, you can have this special bewitched candy.",
