_G.pg.base.ship_skin_words[213020] = {
	feeling1 = "Terror is terrified of you, Commander.",
	feeling3 = "I remember my sister being with me, ever since the very first time I opened my eyes... She's always been there for me. She's my only family...",
	lose = "*Cries*... I'll try to hold out until you tow me back to port, Commander...",
	propose = "Times like these, should I laugh, or should I cry? I'm... I'm not really sure... but Terror knows... I know I've never been this happy before...",
	expedition = "Commander, commissions are finished... You know, I lost my hand during a commission. It took everyone quite some time to help me find it...",
	win_mvp = "Commander, I... I worked really hard. I didn't cause you any trouble, did I?",
	home = "Rub my head, Commander...",
	mission = "How about some missions for exercise...? Otherwise my knee may break again...",
	touch2 = "*Stares...*",
	voice_key_2 = -1,
	skill = "... Sink.",
	drop_descrip = "Erebus-class monitor – Terror, Hull Number I03!",
	mail = "A letter... Would anyone write a letter to me?",
	touch = "Can you feel... my warmth?",
	profile = "I'm the second ship of the Erebus-class monitors.\nThe Abercrombie-class ships are no match for me and my sister... We spent a lot of time in the Dardanelles strait. Bombardment missions... piece of cake.",
	mission_complete = "*coo, coo*~! Commander, I've got your rewards...",
	feeling4 = "It's warm next to my sister, it's warm next to the Commander too... I feel like I just got a new family member... I'm so happy...",
	unlock = "Monitor ship... Terror... Abercrombie-class ships are no match for me and my sister... We spent a lot of time in the Dardanelles strait. Bombardment missions... piece of cake.",
	feeling5 = "Commander... please touch my heart... It has never beaten this fast... it has never been this hot... This is all... because of you, Commander...",
	main = "Commander, could you put away those peas? And the lawnmower……|Is is that weird for me to have a 'heart'?|Commander……are you……a wind player?",
	battle = "Even Terror... is getting terrified...",
	upgrade = "I feel as if my body... is much more agile now.",
	voice_key = 21302,
	headtouch = "",
	feeling2 = "Aren't you afraid of me, Commander? My body feels cold... I am always depressed... I always feel.... like a corpse.",
	login = "Commander... I've been wanting to talk... to you... about...",
	vote = "",
	hp_warning = "Terror... is getting terrified...",
	id = 213020,
	detail = "Your eyes look just like those weirdo' eyes, Commander...",
	couple_encourage = {
		{
			{
				21301
			},
			1,
			"Sister, I'll do my best!",
			0
		},
		{
			{
				10
			},
			5,
			"Can I jump around like a monkey too?",
			4
		}
	}
}

