_G.pg.base.ship_skin_words[301090] = {
	feeling1 = "Commander, you must cheer up!",
	feeling3 = "Commander, do you perhaps wish to see my true right eye?",
	lose = "Damn... I-I shall get you next time...",
	propose = "A promise that binds us for eternity... I understand! Then I shall show you my true right eye, right this mo... T-there is no need for it? All I need to do is close my eyes instead? Re... really...?",
	expedition = "We may use my searchlight to find our way home! Huh? ... You have no need of it? R-really...?",
	win_mvp = "This is the true power of a ninja!",
	home = "Commander~ Did you bring back any shiny items? ... Hm?! N-not at all, I am not asking simply because I want such things!",
	mission = "The ocean at night is a little scary... N-nay, I am not scared! B-but may I propose we do missions during daytime? You must agree, right?!",
	touch2 = "S-should you touch me there again... then I will not be able to restrain myself!",
	voice_key_2 = -1,
	skill = "O darkness, be gone!",
	drop_descrip = "Type III {namecode:11}-class destroyer number one - {namecode:11}.",
	mail = "New mail for you! Uh... I will read it out loud for you!",
	touch = "{namecode:12}... I really miss her...",
	profile = "I am {namecode:11}, a special-type destroyer! Destroyer Division Six consisted of me and my sisters! I was the first to be built and the first to be sunk! The Battle of Guadalcanal? I-I was trying to cast my light on the enemy! I was by no means scared of them! ... Ahem, you shall witness how strong I truly am... that you will!",
	mission_complete = "Rewards~ rewards~!",
	feeling4 = "I cannot sleep well without my sisters by my side... T-that is not to say I am lonely! I-it is because I am concerned about them!",
	unlock = "I am {namecode:11}, the oldest ship of Destroyer Division Six! Well met, Commander. I sincerely hope you will let me rebuild Division Six! ... Huh?! You do not permit the formation of destroyer divisions?!",
	feeling5 = "We Division Six destroyers have always been together! And... um, surely you will be together with me forever as well, Commander?",
	main = "Sometimes I do not understand what {namecode:13} and {namecode:14} are trying to say...|Can {namecode:12} find her way here on her own? It has me somewhat worried...|W-w-what! Anyone would be shocked from suddenly seeing a person's shadow cast in the light in the middle of the night!",
	battle = "Destroyer Division Six, embark!",
	upgrade = "As the oldest of my siblings, I must work even harder!",
	voice_key = 30109,
	headtouch = "",
	feeling2 = "I am a little worried... about {namecode:13} and {namecode:14}...",
	login = "My name is {namecode:11}, I am the ninja who will banish all the darkness in the world! ... Whoa! Commander, w-when did you get here?!",
	vote = "",
	hp_warning = "",
	id = 301090,
	detail = "T-the reason I sleep with the lights on is because... i-it is not because I am afraid!",
	couple_encourage = {
		{
			{
				30112
			},
			1,
			"Together we shall shine a light on the darkness!",
			0
		},
		{
			{
				30111
			},
			1,
			"We will always be together!",
			0
		}
	}
}

