_G.pg.base.ship_skin_words[301100] = {
	feeling1 = "Commander, it seems like the only way to get you to open your eyes is to get a bit rough... *sigh*...",
	feeling3 = "Akatsuki, you've been pretty gung-ho about getting the 6th DesDiv back together... Well, the name's not that important as long as we're all together. That's what I think anyway~",
	lose = "Awww... Looks like I'll have to go back to port for repairs...",
	propose = "I've been waiting so long for this! Ehehe~ I love you, Commander! ...Ah, look at you getting all bashful~ But my turn's not over yet. I love love love you~! Ehehe~",
	expedition = "Ah, that's right, the commission fleet seems to have returned? Should I go with you to welcome them back?",
	win_mvp = "Heheh~ I'll be taking that gold star~!",
	home = "Good work out there~ Well, having that said, you still have a lot of stuff that needs to be done... Ahaha...",
