	skill = "Trust in me! ",
	drop_descrip = "Type III Akatsuki-class destroyer number two – Hibiki.",
	mail = "Mail? Show me as well! Show me!",
	touch = "Yo! Did you call me, Commander?",
	profile = "I'm Hibiki, from the 6th DesDiv~♪ I fought in many battles with my friends, and even saw the end of things. That's good and all, but... having to go in for repairs at that time was a bit awkward... Ahaha...",
	mission_complete = "Missionnnn... complete! ...Hey, Commander, you should get pumped up too!",
	feeling4 = "Ah, that reminds me! Commander, have you been taking care of yourself properly? We'd be in serious trouble if you got sick and collapsed or something... Well, even if that happened to you, Hibiki would tenderly nurse you back to health~♪",
	unlock = "Nihihi~ We finally meet at last, Commander! The name's Hibiki! Don't you forget it!",
	feeling5 = "Commander, why don't you tell me your story? I'm really interested! ...Why? No particular reason~ Haven't we exhausted all the other topics already? Ehehe~",
	main = "Verniy...? It has a nostalgic ring to it... |I'm so glad that we can all be together again~♪ |If you don't need me for anything, I'm going to go play with Ikazuchi and Inazuma~",
	battle = "Heheh~ Hibiki is super strong~! If you don't believe me, just take a look at this~♪",
	upgrade = "So this is that \"leveling up\" thing that Ikazuchi mentioned? Nihihi~",
	voice_key = 30110,
	headtouch = "",
	feeling2 = "I've been making Akatsuki worried all this time. I have to apologize to her properly, as well as thank her.",
	login = "Commander, did you just pop in~? All righty... Let's both get some good work done today!",
	vote = "",
