	win_mvp = "Missions involving breaking stuff are my specialty!",
	home = "Commander, Commander, wanna eat something together?",
	mission = "Another new mission? You adults sure are a pain...",
	touch2 = "Grr… I'll stuff you into guns and send you off to space, you damn molester!",
	voice_key_2 = -1,
	skill = "Turn to junk floating in the Solomon Sea!",
	drop_descrip = "{namecode:15}-class destroyer number four -  {namecode:16}.",
	mail = "Hey, mail for you. Is it a challenge for me? I won't lose!",
	touch = "Grr... Stop treating me like a kid.",
	profile = "I'm {namecode:16}! People call me the \"Mad Dog of Solomon\"! Heheh, I sound pretty strong, don't I? I'd never lose in a brawl! Hm? It's snack time? Commander, tell me where those snacks are!",
	mission_complete = "Commander, Commander, hurry up and check the rewards to see if there are any snacks!",
	feeling4 = "My sisters are still laughing at me and it's your fault! What are you gonna do to fix it? I won't let you off the hook with... *Giggle*... with just a... *Giggle*... headpat...",
	unlock = "I'm {namecode:16}, fourth ship of the {namecode:15}-class. I'll tell you this right now: I'm pretty loud at night, so brace yourself.",
	feeling5 = "Commander, rub my belly… Huh? I've heard you should show your belly button when you're apologizing to someone... Next time I mess up I'll let you rub my belly, so don't get angry at me... Th-that tickles, ahahaha!",
	main = "Commander, seriously, stop throwing that frisbee at me. I'm not a dog~!|*Sniff sniff* I smell meat! Where is it?! Tell me right now!|It's so boring when I don't get to fight... Commander, wanna have a go? Let's do it!",
	battle = "Awoo! I'm not gonna go easy on you all!",
	upgrade = "Commander, take me out to the sea already. I really wanna test out my guns~",
	voice_key = 30114,
	headtouch = "",
	feeling2 = "Got any food?!",
	login = "Ugh, Commander... \"Shake paws\"?! Are you making fun of me?!",
	vote = "",
	hp_warning = "I'll show you what the Nightmare of Solomon looks like!",
