	propose = "I once thought that absolute devotion to the mission was all there was to being a ninja, but I have learned so much from you, Commander... I, Kuroshio, from this point forward, am no longer your shadow alone, Commander, I am now your partner. And we will stand together until the end of our days.",
	expedition = "Your Grace, the fleet you dispatched on commission has returned as scheduled.",
	win_mvp = "I am Your Grace's shadow. I have no need of glory or acclaim.",
	home = "Your Grace, are you tired? Is there any way I can be of assistance to you?",
	mission = "Your Grace, a new mission has been issued.",
	touch2 = "As this body belongs to Your Grace, please do with it as you will... Nnng... Aaaah...",
	voice_key_2 = -1,
	skill = "Secret Technique - Heavenly Purification!",
	drop_descrip = "Kagerou-class destroyer number three – Kuroshio.",
	mail = "Your Grace, a letter has arrived.",
	touch = "Kuroshio, awaiting orders.",
	profile = "Third ship of the Kagerou-class, Kuroshio. As part of the 2nd Fleet and Destroyer Division 15, I joined in the Battle of the Java Sea, operations in the South Pacific, the Third Battle of the Solomon Islands, and other engagements until I was sunk during a transport mission. ... I will not let that happen again. I will commit all of my resources to ensure that I am of service to Your Grace.",
	mission_complete = "Your Grace, mission rewards have been issued. Inspect them at your leisure.",
	feeling4 = "Your Grace, I beg your pardon. Recently I find myself distracted from the mission, thinking again and again about Your Grace's \"communication.\" Please, you must punish me...",
	unlock = "Third ship of the Kagerou-class, Kuroshio reporting in... I am here to carry out my master's will.",
	feeling5 = "So this is an \"emotion\"... before such things I had no problem keeping a clear head, but even now it seems not so wicked... Yes, this \"emotion\" drives a powerful need to stand by Your Grace's side, and it grows ever stronger.",
	main = "Hm...? Your Grace? Did you want me to say something?|I am not sure what to say... But I would be happy to listen to anything Your Grace wishes to impart.|The flower in my hair? It was a gift from Oyashio. Oyashio, she's... very colorful.",
	battle = "Naught but death awaits those who oppose my master.",
	upgrade = "I stand ready to execute your will.",
	voice_key = 30127,
	headtouch = "",
	feeling2 = "A true ninja has no need of emotion. She needs only her master's will to execute.",
	login = "Your Grace, welcome home.",
	vote = "",
	hp_warning = "",
	id = 301270,
	detail = "Your Grace... Please don't stare at me so...",
	couple_encourage = {
		{
			{
				30109
			},
			1,
			"For the master...!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[301280] = {
	feeling1 = "No matter what you do, Commander, Kuroshio has no problem following you... But I'm not so forgiving. For her sake, Commander, en garde!",
	feeling3 = "As a ninja, my sister is always very serious... And since I'm a puppeteer, I always thought it would be nice to make her laugh sometimes. That's kind of a tall order though, ahaha...",
	lose = "Ugh! Commander! Quickly, take the others and run!",
	propose = "And so the Commander and Oyashio lived happily ever after for all the rest of their days... Ehehe, even if the audience might get sick of it, I'm hoping the rest of our story is a long, happy comedy♪",
	expedition = "Commander~ The commission's done.",
	win_mvp = "And thus, the Commander led our fleet to another victory! That's the end of this episode!",
	home = "Kuro, why don't you give the Commander a massage? Yes, I think hopping around the shoulders should do the trick?",
	mission = "Commander, let's go knock out one of those new missions~ I need to get some new material♪",
	touch2 = "Huh?! Grraagh! ... Oh, Commander, I'm sorry... that's just how we've been trained in this line of work...",
	voice_key_2 = -1,
	skill = "The fun has only just begun, right~♪",
	drop_descrip = "Kagerou-class destroyer number four – Oyashio.",
	mail = "Commander, guess which torpedo has your mail in it? If you're wrong... well, it probably won't blow up♪",
	touch = "Commander, isn't it amazing how nurturing Oyashio is? ... Er! I'm talking about the ocean current!",
	profile = "I'm the fourth ship of the Kagerou-class, Oyashio. I've always been close with Kuroshio. She can tell you everything you need to know, so just ask her~♪ Oh, unless...? You'd rather I act it out for you?",
	mission_complete = "Commander, the mission rewards are here~ Let me see if there's any props I can use in there♪",
	feeling4 = "Commander, you're awesome. Not only do you know what I'm thinking, but you help me get through to everyone else... One day, I'm going to make Kuroshio laugh, and I know you'll definitely be there to see it!",
	unlock = "My big sister is a ninja, and I'm a puppeteer. Isn't it amazing how diverse our world is~? I'm the fourth ship of the Kagerou-class, Oyashio. And with my puppet Kuro, I will dazzle you, Commander.",
	feeling5 = "Commander, I thought it would be great to be as clear-headed as Kuroshio... But there's no way I could. I like Kuroshio, I like you, and I like puppet shows. That's just who I am.",
	main = "Commander, will you come to watch my show when you have free time?|Kuro is my dear friend! Her namesake is obvious, isn't it? My oh so serious big sister!|Of course the strings are a puppetry thing. So why do I put torpedoes on them? Ahaha... Let's call it an old trade secret.",
	battle = "Come one, come all!",
	upgrade = "Oooh! I just came up with a new idea for a show!",
	voice_key = 30128,
	headtouch = "",
	feeling2 = "Commander, would you like to watch my show? By all means, come on over and take a seat~ The more the merrier, after all!",
	login = "Commander, how are you today? Would you care to enjoy one of my famous puppet shows? Come on! How about it?",
	vote = "",
	hp_warning = "",
	id = 301280,
	detail = "Commander, don't I look ninja-like when I do this with my hands? Ehehe, that's because Kuro taught me~",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[301290] = {
	feeling1 = "If you manage to right all your wrongs, then maybe you'll earn my forgiveness!",
	feeling3 = "People often say I'm too hasty, but isn't swift decision-making supposed to be a good thing? Plus, if you don't fight with all you've got, it could come back to haunt you! Hehehe!",
	lose = "I-I'll reflect upon my errors...",
	propose = "What is THIS?! Wasn't this meant to be an emergency mission briefing?! Wait, what's this ring...? I fell for it, hook, line, and sinker! But why trick me into coming? I would've agreed to it if you'd just told the truth!",
	expedition = "Hmm... Commission teams don't run into ambushes out at sea, do they...?",
	win_mvp = "All right! Another first-place finish!",
	home = "W-welcome back, Commander! ...No, it's nothing, really! I was just wondering when you'd return...",
	mission = "Aha! I spy with my little eye incomplete missions! Full speed ahead for those rewards! Right, Commander?",
	touch2 = "Eek! What has gotten into you?! If I didn't know any better, I'd think... Well, just this once, I'll turn a blind eye to it.",
	voice_key_2 = -1,
