	drop_descrip = "Shimakaze-class destroyer – Shimakaze.",
	mail = "Apropos of nothing, I think you should check your latest mail.",
	touch = "Huh? Have I done something incorrectly?",
	profile = "I'm Shimakaze, the sole Shimakaze-class destroyer! I boast the highest speed and best torpedo capabilities of all fleet destroyers – a pivotal part of any torpedo squadron! No type of operation is beyond my capabilities! Ha-hah!",
	mission_complete = "Mission completed! Quick, let's check what rewards we've earned!",
	feeling4 = "Commander, what things motivate you to keep fighting? I'm just asking out of curiosity. Whatever they are, I will fight for them alongside you! ...Yes, I know, I swear not to get ahead of myself this time!",
	unlock = "I am Shimakaze, the world's one and only Shimakaze-class destroyer! You must be the commander! Let us join forces and work towards our goals, together!",
	feeling5 = "Could we go somewhere together after finishing our work today? B-because, well, we hardly get any time for ourselves during office hours... Okay, look! I'm saying I want some alone time with you, Commander! Would you... oblige?",
	main = "My rigging calibration checks out. I'm fully prepared to sortie at your command!|My shoes? They're quite special. In fact, these shoes are what allow me to go faster than everyone else! Ha-hah!|The Sakura Empire is home to many sword-wielding shipgirls... If I ever get the chance, I'd love to borrow and swing someone else's sword for myself.|Any two people can come to an understanding as long they're both willing to listen! That's what I've always believed!",
	battle = "Shall I assume command? Understood! I won't disappoint you!",
	upgrade = "I can become even faster... even stronger!",
	voice_key = 30129,
	headtouch = "Mweeehhh... Please, d-don't touch my ears! It makes me shooo weak... Aaaahh...",
	feeling2 = "I am THE strongest destroyer! Or, so I'd like to think. But to truly become the strongest, I'll have to hone myself through my training and sorties!",
