	feeling5 = "\"Hey! Did you go out to meet that woman again today? ... Are you still trying to hide it from me?! You... you reek of adultery!\" ... Huh? I saw it on TV! ... What does it mean? I dunno!",
	main = "Co... main... der? I can't pronounce that... \"Mommy\" and \"daddy\" are easier to pronounce!|First apple, then mango... next time I'll buy one that tastes like strawberry!|One, two, three, four... I forgot... six... after that comes... eleven! Then nineteen! I did it!",
