_G.pg.base.ship_skin_words[301370] = {
	feeling1 = "I'll do my missions for real! No need to worry!",
	feeling3 = "All my sisters are so dumb and easy to trick... I'll prove it to you next time, Commander♪ But if someone else tries to tease them, I'll be angry!",
	lose = "Ugh... It huuurts...",
	propose = "Commander, you know something? I prank both people who don't get angry, and those who I like! Also... when I prank someone, I feel more open to talk about embarrassing stuff! *Giggle* Can you guess what I'm talking about now~?",
	expedition = "Oh no, Commander! Because you were spacing out and forgot to welcome back the commission team, their affection dropped to Upset! ... Just kidding~!",
	win_mvp = "Commander, let's have a punishment game for the losers!",
	home = "Commander, I ate all the snacks~ Just kidding... Ow ow, don't rub my head so hard!",
	mission = "Commander, wanna guess which of these missions... is actually new?",
	touch2 = "Commander, what you stubbed your finger on was this metal plate I hid~ Hey, tell me, how did it feel?",
	voice_key_2 = -1,
	skill = "Look! There's fuel in the sky!",
	drop_descrip = "Mutsuki-class destroyer number six – Minazuki.",
	mail = "Commander, there's a love letter for you!",
	touch = "Did you figure out my prank? *Giggle*",
	profile = "I'm Minazuki from the Mutsuki class! We used to do transport and escort missions! I love pranking people! Ah, but I take my missions seriously too!",
	mission_complete = "Commander, looks like we hit the lottery jackpot! ... Just kidding~!",
	feeling4 = "I'm not stupid, I'll obviously not prank anyone who'd get angry at me! That's why I do it to my sisters, and to you, Commander~♪",
	unlock = "Commanbe... Meow? Sorry, I bit my tongue~ I'm Minazuki! Let's be friends!",
	feeling5 = "Commander, when I've grown up, I promise I'll... pull many, many more pranks on you! *Giggle* Where you thinking I'd say something else? Come on, tell me♪",
	main = "Commander~ Meow~! If you pet me, you'll have better luck with money~! I'm not a cat, though!|Commander~ I added some black vinegar to your cola! Did you notice?|I wonder where everyone's gone... I wanna see them... and prank them!",
	battle = "Hm, I wonder how I'll prank the enemy♪",
	upgrade = "Hm... I came up with an idea!",
	voice_key = 30137,
	headtouch = "",
	feeling2 = "I gotta be sneaky, super sneaky... Oh no! You found me!",
	login = "Commander, did you miss it? I was pranking some other girls just earlier!",
	vote = "",
	hp_warning = "",
	id = 301370,
	detail = "Commander, I haven't pranked you just yet.",
	couple_encourage = {}
}

