_G.pg.base.ship_skin_words[301490] = {
	feeling1 = "In the end, you're just someone who can't exceed my expectations, Commander.",
	feeling3 = "Have you not experienced war, too? Then why do you still believe in fairy tales like justice, love, or harmony...?",
	lose = "I'm still... afloat. If that's good or bad, who can say...",
	propose = "I'm astonished that I'm doing this with you... We've been together so long that your wishful thinking has rubbed off on me... And for doing so, you'll take responsibility, won't you...?",
	expedition = "A commission's done. Don't forget to read the report.",
	win_mvp = "The Solomon Islands... they call for me...",
