	drop_descrip = "Shiratsuyu-class destroyer number nine – Kawakaze.",
	mail = "Mail for you. Me? Not a fan of the stuff...",
	touch = "How I feel about secretary work? Work is work, I don't have any preferences. Secretary or not, I don't care.",
	profile = "I'm Kawakaze, 3rd ship of the improved Shiratsuyu class, or simply the Umikaze class. Destroyer Division 24 comprised of my sisters and me during the war. Ah, Solomon... True, it is a place of many memories. The Iron Bottom Sound, Northampton, and the last thing I remember...",
	mission_complete = "Mission rewards are here. Let's see if they were worth the time. But first, accept them.",
	feeling4 = "I abhor the stupidity and naïveté of those who refuse to face reality and continue shouting about their hopes and dreams. But you're not like that... are you?",
	unlock = "The name's Kawakaze of the Shiratsuyu class. I have no intention of becoming your friend. Spare me your introduction.",
	feeling5 = "\"Your dreams will come true if you don't give up on them\"... Hmph, what a trite answer. But, if that's what you say...",
	main = "Shells are weapons to silence one's enemies with. That's all they are, no matter how you sugarcoat it.|If there's something you're wondering, ask Jintsuu. I'm... if I must say, I'd say I'm more like Sendai.|Pretty cheerful gang you've got going with this fleet...",
	battle = "War... war never changes.",
	upgrade = "Getting stronger... feels okay.",
	voice_key = 30149,
	headtouch = "",
	feeling2 = "In war, there is no right or wrong, no beauty or ugliness. This is true for both ally and enemy.",
	login = "Just another uneventful day.",
	vote = "",
	hp_warning = "This pain... isn't enough to distract me!",
