_G.pg.base.ship_skin_words[301498] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "The Commander, Lady Nagato, and all my friends depend on me. I cannot afford to lose now.",
