	feeling5 = "\"Your dreams will come true if you don't give up on them.\" They will, so let us make them real. I swear it to you upon all my being.",
	main = "The same sword that takes lives can also save them. It is my goal to become that: a sword that protects.|You must not fixate on only either brains or brawn. The ideal leader is both wise and strong. Ahahah, here I am, paraphrasing Naka.|You've got a cheerful gang going with this fleet. And you are a part of it, Commander.",
	battle = "I fight... for the one I love!",
	upgrade = "",
