	mail = "Your mail has arrived! Let's take a look at it, Commander!",
	touch = "Hoppy is cute, isn't he? Ehehe~ He's always there with me when I go to bed.",
	profile = "I'm Kiyonami, the eighth Yuugumo-class destroyer... I had improved anti-air capabilities, but neither Yuugure nor I could really deal with things in the air... Ugh... If only I'd done a better job back then... B-but even so, I did achieve a couple of things! Wh-what I'm getting at is that I'll do the best job I can...!",
	mission_complete = "A mission... Yes, it seems a mission has been completed! You're quite the go-getter, Commander...",
	feeling4 = "I have many more fluffy friends than just Hoppy... Commander, would you like to come visit my House of Fluffs sometime later...?",
	unlock = "Yuugumo-class destroyer Kiyonami, r-reporting for duty... And this is my friend, Hoppy... I-it's nice to meet you! ... Ugh...",
	feeling5 = "I'm not scared of the dark or planes when I'm with you, Commander... W-would you mind if, from now on, I walked ahead of you, rather than behind you...?",
	main = "I feel safe around Yuugure. I enjoy playing and having sleepovers with her. I wish I had more friends like her...|Oh no, a-another air raid?! ... Commander, please don't scare me like that!|I'm always doing my best, trying to catch up to everyone... S-so please, don't ever leave me behind, okay...?",
	battle = "I-I'm supposed to give orders?! ... Whuah?! C-come on, everyone!",
	upgrade = "Hoppy and I think we got a little stronger...",
	voice_key = 30154,
	headtouch = "",
	feeling2 = "Why do I like to hide behind you...? Umm, that's because... I feel more comfortable with you leading the way, Commander...",
	login = "Welcome back, Commander... Come on, Hoppy, say hi to the Commander.",
	vote = "",
	hp_warning = "I-I'm not going to give up!",
