_G.pg.base.ship_skin_words[301560] = {
	feeling1 = "I knew I probably wouldn't be of any use to you...",
	feeling3 = "I'm trying my best not to cause trouble for people, but I don't know how... So instead I ended up making a lot of mistakes...",
	lose = "I've failed yet again...",
	propose = "Even if they're a coward, even if they often make mistakes, what matters is telling your partner that you love them from the bottom of your heart, right...? This is the one thing I've believed ever since I was born... Okay, from now on I swear I'll always be with you, Commander...",
	expedition = "Commander... a commission's been completed... I didn't get the time wrong... did I?",
	win_mvp = "I hope I didn't cause any trouble for anyone...",
	home = "Commander... you're not hurt, are you...?",
	mission = "Commander, we have new missions. I'm certain it is a new one. I confirmed it myself...",
	touch2 = "Eek?! C-Commander... you're seriously going to make me cry...",
	voice_key_2 = -1,
	skill = "I-I'm not mistaken here, am I?!",
	drop_descrip = "{namecode:26}-class destroyer number five – {namecode:125}.",
	mail = "Commander, you have mail... Here... oh, wait, is it this one?",
	touch = "Commander? I'm worrying if I did something wrong today... I-I don't think... I have...",
	profile = "I'm {namecode:125}, I'm the fifth ship of the {namecode:26}-class, I was constructed as part of the Circle Four Plan. But... I might be the least useful ship ever constructed... *Sob*...",
	mission_complete = "Commander, I brought the mission rewards. I didn't make another mistake, did I...?",
	feeling4 = "Ever since I came to your base, I've started making considerably fewer mistakes... But even when I do, you don't get mad at me, so I've slowly but surely been able to get better... Also, when you encourage me by stroking my ears, your hand feels so warm...",
	unlock = "I'm {namecode:125}, the fifth ship of the {namecode:26}-class. I-I sincerely hope I can be of servish to... *Whimper*... I've made another mistake... Even though I practiced on it so much...",
	feeling5 = "I'm timid and I often make mistakes, so I doubt I'll ever be very helpful to you, Commander... But I'm okay with that. Because what matters is...",
	main = "I want to be useful to you, Commander, but if I cause you trouble instead... Then what will I do...|If I cause you any trouble, I'll let you touch my ears and my tail, so please don't get mad at me...|For this one you do this, then here you do... this... I think? I-I hope this will work...",
	battle = "A real battle... I'll give it my all...!",
	upgrade = "Commander, whenever I think about failing to meet your expectations... it almost makes me start crying... *Sob*...",
	voice_key = 30156,
	headtouch = "",
	feeling2 = "Commander, is there something you wish me to do? I-is it possible I might have caused you trouble without realizing it?",
	login = "Commander, I've sorted all your documents... You wanted your documents sorted... right?",
	vote = "",
	hp_warning = "",
	id = 301560,
	detail = "C-Commander, I haven't, um... disappointed you... have I?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[301570] = {
	feeling1 = "Commander, I wonder if you've been cursed...",
	feeling3 = "Aww.... m-my hair's all messed... Fusou's not here either, what should I do... Hm? You'd help me comb my hair? Thank you very much, Commander!",
	lose = "O gods, please save us!",
	propose = "O gods, thank you very much for allowing me to meet Commander. I truly am blessed right now! So, um, Commander... though I'm still inexperienced, please take care of me!",
	expedition = "Commander! E-Everyone has come home safely!",
	win_mvp = "Surely this must have been the gods' blessings.",
	home = "Commander, you're safe! Thank goodness... my prayers were heard...",
	mission = "C-Commander, umm... there are still missions left...",
	touch2 = "C-Commander! P-Please stop doing that... *sniffles*",
	voice_key_2 = -1,
	skill = "O gods, please watch over us!",
	drop_descrip = "Akizuki-class destroyer number nine – Harutsuki.",
	mail = "Commander, h-here... your letters...",
	touch = "Commander? Would you like to try the sakura mochi that I made?",
	profile = "I am the ninth ship of the Akizuki-class destroyers, Harutsuki. Due to various circumstances, I wasn't able to do much, but... I'll make up for it this time, Commander!",
	mission_complete = "Commander, I've received the rewards!",
	feeling4 = "Y-You'd like to watch my kagura dance? B-but, I still have a lot of practicing to do... Fusou said that rehearsals are just as important as practice...? I see! I... I'll do my best!",
	unlock = "I was guided here by the gods... Ah! M-My name is Harutsuki! Pleased to meet you!",
	feeling5 = "C-Commander, please accept this! This is a protective good luck charm! \"Marriage tie?\" What do you mean...? C-Commander... you're a big bully...",
	main = "O gods, please bless this port so that everyone may come home safely. |Yoizuki may seem cold, but she's very nice and is always thinking of everyone else! |Good luck! I'll... be supporting you!",
	battle = "My s-skirt is gonna get blown away! ",
	upgrade = "C-Can I truly become stronger like this?",
	voice_key = 30157,
	headtouch = "",
	feeling2 = "Back then, my sisters and I were all scattered to the winds... But, we are finally reunited again. It's a miracle...",
	login = "Commander, w-welcome back!",
	vote = "",
	hp_warning = "O gods, please give me guidance...!",
	id = 301570,
	detail = "Hyaa! C-Commander, when did you get here?",
	couple_encourage = {}
}

