	mail = "You've received mail. Shall we go see what it is, Commander?",
	touch = "Mmh... I try not to think about why we all got separated. Besides, we got to reunite here, so let's instead live our lives happily ever after.",
	profile = "I am Arashio, the fourth Asashio-class destroyer. I was part of Destroyer Division 8 along with Ooshio, Michishio, and of course Asashio. Lastly... I hope I can stay with everyone this time around.",
