	unlock = "Destroyer Arashio, here to join your fleet. I'll provide everyone with the support they need~",
	feeling5 = "We're all to ourselves now. My heart's been thumping for some time now... Commander, could we huddle up next to each other, just for a little while?",
	main = "Asashio and I have always been together. Yup, we even sleep in the same bed. She's so quiet when she's sleeping.|We might not always be able to stick together, but we'd never leave anyone behind... That's why this place feels like home to me.|I've made you some tea. Take your time to savor it. By the way, is my tea-making ability to your liking?",
	battle = "Everyone, try to avoid getting hurt if you can...",
	upgrade = "Now it'll be easier for me to avoid getting hurt. Thank you, Commander.",
	voice_key = 30166,
	headtouch = "",
	feeling2 = "I'd like to get to know you, Commander. *Giggle*, what should we start with?",
	login = "You don't find my appearance odd? I feel the best way to greet someone is with a smile!",
	vote = "",
	hp_warning = "You must remain calm in the face of danger. Don't worry about me.",
	id = 301660,
	detail = "I feel a little sad when I see planes in the air... But it's okay, that's all in the past. What's more important is keeping my chin up and smiling. Right, Commander?",
