	mail = "It'd be nice if Foo could get the mail...",
	touch = "Commander, would you like to talk to Foo?",
	profile = "I'm Kasumi, from the Asashio-class. During Operation Rei-go, my friends and I did our best to complete our missions. Without them, I would not have been able to accomplish anything alone.",
	mission_complete = "\"Mission complete~ Good job, Commander, Kasumi will give you a reward\" ...Foo, what are you saying...",
	feeling4 = "Commander, do you want to watch a movie with Kasumi? Kasumi likes movies with lots of friends that look like Foo... Let's watch one together?",
