	feeling5 = "Foo will chase away all the bad guys that Commander cannot see. Kasumi will also protect you. We'll always be together...",
	main = "Foo is my good friend. We're always together. |Kasumi... gets tired easily... Commander, your chest is really comfortable. |Foo is always scared around Shiranui... Commander, is there no way to help Foo not be afraid of her will-o'-the-wisps...?",
