	upgrade = "Foo, is Kasumi any different...?",
	voice_key = 30181,
	headtouch = "",
	feeling2 = "Foo can't handle being around lots of people, so Kasumi also dislikes crowded places...",
	login = "Hello, Commander. Foo, say hi to Commander too, okay?",
	vote = "",
	hp_warning = "Kasumi... is very strong when she gets serious!",
