	profile = "I'm Suzutsuki, Akizuki-class destroyer. I was a member of the 61st DesDiv along with Akizuki and Hatsuzuki, and escorted Musashi and participated in Noshiro's rescue mission! Not a shabby record, right? I had a close call at the Battle of Bou-no-Misaki when I got hit by two torpedoes, but I managed to survive until the end!",
	mission_complete = "Mission complete! Commander, don't forget about the rewards!",
	feeling4 = "Hmm... What would I like the commander to do for me? ...Make tea? Pack my lunch? Carry me back to the dorms after I fall asleep? ...Th-th-that's way too embarrassing!",
	unlock = "Ahaha, Pooky, listen up, we're gonna live here from now on! Uhh... Third ship of the Akizuki-class, Suzutsuki, reporting in! I'll be the one to protect my comrades and you, Commander! Just kidding~♪",
	feeling5 = "Commander, get over here! Hup~ ...Mmhmm, that's much cozier. Now it feels more like I'm relying on you, doesn't it? See, you'll also have to take good care of me from now on~ Just kidding~♪ Ahaha!",
	main = "\"The invincible Suzutsuki is here! Your attacks shall not put a scratch on me!\" How'd that sound? Hya hah!|Ahaha! You'd rather sit atop Commander's head instead of mine? Very well, go forth! Oh, but no pranks though!|Commander, you sure have a lot of work, don't you~ Look, Isokaze, Urakaze, being a warlord or a general is a lot of hard work. A better job would be to become Commander's retainers!",
	battle = "May the odds ever be in your favor! Go forth!",
	upgrade = "Give me more power, so that I may protect everyone!",
	voice_key = 30184,
	headtouch = "Look, fluffy and super pattable, right? ...Hey, I'm talking about Pooky, not my ears!",
	feeling2 = "I may come across as a braggart, but that's because I'm pretty reliable! \"Oh, Suzutsuki, you saved me! I don't know what I would've done without you!\" Yeah, I get that a lot~",
	login = "Welcome back! ...Got any new jobs? I'm down for anything!",
	vote = "",
	hp_warning = "The real fight's only getting started!",
