_G.pg.base.ship_skin_words[302080] = {
	feeling1 = "Cowards shall never control a demon.",
	feeling3 = "I've heard that Yuubari is responsible for developing new equipment. If possible, could you ask her to upgrade my equipment? For example, starting with my torpedoes...",
	lose = "Even I have become obsolete...?",
	propose = "Commander, you are the worthy one who has conquered a demon. Let us commemorate today's vow, and aim for greater strength together.",
	expedition = "The commission team must be getting impatient from waiting.",
	win_mvp = "Make an enemy of me, and your defeat is already ensured.",
	home = "You look like you're in a good mood. Are you the type that gets motivated the more you work?",
	mission = "Don't forget about your missions. A soldier must fulfill the orders of their superiors.",
	touch2 = "Really? Are you trying to get me mad?",
	voice_key_2 = -1,
	skill = "Don't even think about running!",
	drop_descrip = "Nagara-class light cruiser number five – Kinu.",
	mail = "I've already highlighted the important parts for you, Commander.",
	touch = "You want to duel me? Don't worry, I'll give you a handicap.",
	profile = "I am the Nagara-class light cruiser, Kinu. My name derives from Kinugawa, meaning \"furious and violent like a demon's wrath.\" I live up to my name, but trust me - that is not something that you would want to see.",
	mission_complete = "Accept these rewards. You've earned this privilege.",
	feeling4 = "How about letting me treat you to a couple cups of sake tonight? Hah, don't worry, I just want to have a normal chat. Having a heart-to-heart over some fine spirits... what greater comfort in life is there?",
	unlock = "I'm Kinu. If you want this demon to do your bidding, then you'd better show me what you're capable of!",
	feeling5 = "I feel like I can entrust myself to you. Is this where the demon finally finds her home...? Commander, if I was to become the blade you wield, how would you use it?",
	main = "Somebody I can't stand? I guess that'd be Nagara. She's the– Whuah, Nagara?! W-Wait, don't get any closer! MMPH, URMMMPHHH!|A new model of oxygen torpedo...? I say, do get me one of those. I promise I'll draw out every bit of its power. |My cloak's pretty cool? Heh~ you think so too, huh? ...Hey, stop trying to slack off! ",
	battle = "Just bring it on already!",
	upgrade = "I won't be able to test whether or not this strengthening worked outside of live combat.",
	voice_key = 30208,
	headtouch = "Don't go around touching my head.",
	feeling2 = "You may look like someone who is too gentle to hurt a fly, yet you have control over this entire port. I'm a little interested in you.",
	login = "Hurry up and make today's plans.",
	vote = "",
	hp_warning = "Ahaha! Now you shall witness the form of a true demon!",
	id = 302080,
	detail = "You're welcome to inspect the other stuff, but you'd be best off not casually touching my demonic raiments.",
	couple_encourage = {
