	main = "Violence is the only solution I know of for my problems. That's why I envy you and Jintsuu sometimes.|Whenever I try to be like Jintsuu and use logic to solve problems, I usually end up using my fists anyway. I dunno why, either...|Hardships don't get under my skin, but I'm scared that I'll one day lose my way...",
