	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Here, iced coconut water. Please have some.",
	mission = "",
	touch2 = "You can't concentrate on your work when I'm wearing a swimsuit, right? Hehe, just consider this a test of will then.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Hmm? Is it unusual? Hah. Even I require a change of pace to clear my mind every so often. Commander, why don't you come out and get some fresh air as well?",
