	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Hmm? Is it unusual? Hah. Even I require a change of pace to clear my mind every so often. Commander, why don't you come out and get some fresh air as well?",
	feeling5 = "",
	main = "If you relax too much, you'll become undisciplined. If you're too uptight, you'll only find yourself out of breath. |Every year when it is swimsuit season, I can't help but to be envious of Sendai... Commander, I'm not being negligent in my exercise, am I? |Commander, your mind has wandered off onto the beach, hasn't it? It’s written all over your face.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "After we finish work today, how about taking a break on the beach?",
	vote = "",
	hp_warning = "",
	id = 302131,
	detail = "I said I was taking a vacation, but even out here on the beach, I'm still thinking about the affairs of the fleet... I really am a workaholic, aren't I?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[302132] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
