	feeling5 = "Why'd I ask you to play a dating game? Well, if I teased you too much, wouldn't that only make you dislike me? But since I can't help it, I decided to make it up to you this way~ Do you think better of me now, Commander? ",
	main = "You haven't had anything to eat? If you'd like, you can have some of my crepe~ |\"Um... do you mind if I shift a bit closer to you? It's a bit chilly out here...\" What am I after? Jeez, way to spoil the mood... |\"Would you mind telling me more about yourself? I feel like... we have a lot in common~\" ...Hehe, in other words, I want to learn a lot more about you!",
