	touch = "",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "The blunt approach is not my style, but I cannot have Noshiro think I only inch my way to success... Oh, I was just talking to myself, Commander. Hehe, so anyway, would you mind being my partner for tonight's party?",
	feeling5 = "I am an... enigma to you? Why, I would say that you're the enigmatic individual between us, Commander. And yet, that makes one want to get to know you better, the sinful person that you are. Hehehe~",
	main = "Come to think of it, I haven't seen Noshiro around... Knowing her, she may be off on her own somewhere...|Say, Commander, would you care for a drink? Me? Well, I can hold my liquor at least as well as you. Heheh.|Please, Commander, you need not look so on-edge. I may enjoy teasing you, but I'm not so brash as to do it on this special occasion.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Well, well. Were you hoping to fluster your lady by arriving late on purpose, Commander?",
	vote = "",
	hp_warning = "",
	id = 302203,
	detail = "The competition tonight is considerably fiercer than I anticipated... This calls for a counterattack... Oh, it was nothing important. I was just thinking out loud about how, uh... fabulous that chandelier is.",
