_G.pg.base.ship_skin_words[302212] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "Though it might not seem that way, we're actually pretty close to the Port. Shall we go and greet the Commissions Team?",
	win_mvp = "In the face of well-crafted plans, resistance is futile. Accept your defeat.",
	home = "Once you've rested up, why don't we go and make our appearance at the party together?",
	mission = "",
	touch2 = "Excuse me... How about I give you a massage... with this?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Commander, what are you standing around for? Did you also need a change of pace? That makes two of us— Come, there's nothing to be afraid of here.",
	mail = "",
	touch = "Hehe. I think even Agano would take a liking to this place, too.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Commander, what are you standing around for? Did you also need a change of pace? That makes two of us— Come, there's nothing to be afraid of here.",
	feeling5 = "Hmm, I wonder what kind of scene this set is supposed to depict. A birdcage, crows, the sea, blue roses, and... you beside me... Um... Don't you think this is quite picturesque?",
	main = "Wah! ...Sorry. I can't believe I almost fell... Um... T-Thank you for catching me...|It's a given that I love the atmosphere here, but another reason I like this place is that I feel like I can finally get away from Agano's endless teasing here... Though, I'd rather she just stop worrying about me in the first place...|This is yet another massive set built right in the Port. Yes, it's incredibly gorgeous... Honestly, when I saw it for the first time, I forgot I was in still in the Port for a moment. Speaking of which, didn't you also stand and stare in awe when you first came here?",
	battle = "Freeze, and turn to ice... Your time is up.",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Phew... Go on, fly away, little ones. Mind the cage on your way out, now... I've been taking care of these guys. What have you been up to?",
	vote = "",
	hp_warning = "",
	id = 302212,
	detail = "Don't worry. There's nothing for you to worry about. All the preparations for the party and the related formalities have all been taken care of. All that's left for you to do is to enjoy the evening while savoring this beautiful scenery.",
	couple_encourage = {}
}

