	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Whew... Oh, are you cold by any chance? I have some hot tea for you if you'd like. If you want someone to chat with, I'd be glad to keep you company.",
	feeling5 = "Though the snow has piled up this much, it'll all melt with the coming of spring—becoming water that will nourish nascent life. I don't think I can remain cold like this for much longer, either. After all, before I was able to notice... spring has managed to start creeping into my life, too.",
	main = "You still haven't taken a sip yet. Is it too hot? ...Are you perhaps bad with hot things?|It's not like I'm opposed to going into battle as a warship, but... I'd really like to save people as well. Much like Hamakaze's always done.|The Manjuus' teapot is astonishingly authentic. I don't see any problems with adding one to the Office for daily use, either. Hehe.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "It's good to see you. How should we start the day off?",
	vote = "",
	hp_warning = "",
	id = 302213,
	detail = "I like staying in places that are quiet and peaceful. They make me feel relaxed. The whisperings of the wind, the sound of flowing water, the harbingers of spring, and Commander's... Ehem, I-I didn't mean anything by that.",
	couple_encourage = {}
}

