	home = "Commander, I tripped again... Do you have a band-aid somewhere?",
	mission = "A new mission, huh? Seems like it might be a bit tricky.",
	touch2 = "I never thought you'd take an interest in me, Commander... Frankly, I'm a bit happy~",
	voice_key_2 = -1,
	skill = "All right, here I come!",
	drop_descrip = "First ship of the {namecode:53}-class heavy cruisers, {namecode:53}.",
	mail = "Sorry, Commander... I tripped and fell while getting the mail and now it's all wrinkled...",
	touch = "What's up?",
	profile = "I'm the Furutaka-class heavy... Err, just call me Furutaka! I may not look it, but I participated in the First Battle of the Solomon Sea! I also helped my sister Aoba out a lot! In the end though, I rushed too far ahead and didn't make it back myself... Ehehe...",
	mission_complete = "I bumped into something while getting the rewards... Oww...",
	feeling4 = "Yeah... Being able to live with Kako and seeing my sisters from the Mikawa and 6th Fleet was always a dream of mine. Commander, you've made my dream come true. That's why... I'll do anything for you!",
	unlock = "Ah! Sorry for bumping into you... Huh? You're the Commander?! F-Furutaka, first ship of the Furutaka class, reporting for duty! Can you please forget what just happened? Ehehe...",
	feeling5 = "If you're okay with this... then I don't mind, Commander. But... I've never been in a relationship before, so I don't know what it's like. Can you teach me?",
	main = "Commander, Kako doesn't really hate you, so don't take it too personally.|Um... because I'm not very smart, maybe Kako should take my place at meetings instead...|Ouch...! Ahh, I'm fine... I just nodded off and bumped my head.",
	battle = "I have to do well in this battle!",
	upgrade = "Thanks, Commander!",
	voice_key = 30301,
	headtouch = "",
	feeling2 = "Kako acts like that because she holds herself as the role model for heavy cruisers, but she's actually very gentle.",
	login = "Commander, please be more careful when you open the door...",
	vote = "",
	hp_warning = "",
	id = 303010,
	detail = "I'm a bit bored...",
	couple_encourage = {}
