_G.pg.base.ship_skin_words[303030] = {
	feeling1 = "Maybe I should go conduct some interviews overseas...",
	feeling3 = "It's been a while since since I've been stationed here, so I've managed to get some good information from everyone. At first they thought you were a shady person, but you seemed to have earned their trust. Good for you!",
	lose = "I... Aoba... shouldn't be getting upset over this!",
	propose = "Just to be clear, I'm not good at this kind of stuff... so don't expect me to say anything romantic... ever! Well, maybe just once... Um... I... l-l-love... you!",
	expedition = "\"Come see a magnificent view of girls hard at work!\" ...Okay! Commander, let's pack some snacks and head to port to conduct some interviews!",
	win_mvp = "Okay, time to get a quick word from the losing side. Eh? Leaving already?",
	home = "Commander~ of the girls out on commission right now... who's your favorite?",
	mission = "Missions? I'm just here to record your heroic image, Commander. Oh? I need to go too?",
	touch2 = "Commander... It's not wise to mess with reporters.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "First ship of the {namecode:55}-class heavy cruisers, {namecode:55}.",
	mail = "Commander, you're way to careless with information... Take it, it's your mail!",
	touch = "Ah, a good idea, finally! This will definitely make the front page!",
	profile = "Hai hai! The name's Aoba! I spent most of my days in the 6th Fleet, took part in many battles with my sisters, and did my best to survive until the end. Let's drop this boring topic, shall we? I was a writer for the Navy once, so I've picked up a thing or two. Commander, anything juicy going on around you lately?",
	mission_complete = "Commander, stop lazing around. Go get your rewards and let me take a picture!",
	feeling4 = "I've made my fair share of mistakes, so I thought I could help by leaving something to commemorate everyone's hard work. Sorry for saying something so unlike me... but, you made me drop my guard. Now, you have to answer my questions!",
	unlock = "Hmm, hmm... I can smell it. This fleet is going to make the headlines! So you're the Commander, huh? Just let me, Aoba, gather all the information without holding back!",
	feeling5 = "Alright, I've decided. For all my precious friends here, I will record their lives! Does that include you? Oh you, don't you already know the answer to that?",
	main = "I believe that hard work pays off, you know. Eh? Why was I following you yesterday? I don't ever recall doing anything like that~|Say, Commander. If you let me interview you, I'll share some juicy gossip with you. Like... which girls might be looking your way~|It's sure hard getting a scoop... Maybe... I should make some news myself!",
	battle = "You're far too naive if you think  you can escape Aoba's eyes!",
	upgrade = "I think I'm getting closer to my next big scoop. Thanks, Commander~!",
	voice_key = 30303,
	headtouch = "",
	feeling2 = "Commander, could you tell me how it feels to have such a large har- I mean, fleet?",
	login = "Hehe~ Commander, I saw that~!",
	vote = "",
	hp_warning = "It's not very funny when I'm the one on the news.",
