	feeling3 = "Don't be too hard on my sister... She actually has a lot of guilt buried in her heart.",
	lose = "We need to call a meeting and review this performance...",
	propose = "Jeez, Commander. Your sleeves and collar are messy as always, even for such an important occasion. I'll lecture you later~ let's carry on with the ceremony!",
	expedition = "Commander, since you didn't go yourself, you should at least welcome back the girls who worked hard on the commission!",
	win_mvp = "Everyone, don't let your guard down just because we won!",
	home = "Commander, it's important to balance work and rest. Since you just got back, why not take a quick break?",
	mission = "Commander, work will only pile up if you keep putting it off!",
	touch2 = "Please take a seat, Commander. We're going to discuss fleet discipline.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Second ship of the {namecode:55}-class heavy cruisers, {namecode:56}.",
	mail = "Commander, do I have to tell you to check your mail every single time?",
	touch = "Commander, did you also come to wind down with some light stretching?",
	profile = "Good day, I'm Kinugasa! I was in the 6th Fleet with my sister Aoba before it was disbanded. We fought together in many battles, like Wake Island, the Coral Sea, and the Solomon Islands. I'm not as lucky as her though... Anyways, Commander, try not to overwork yourself! Rest is important too!",
	mission_complete = "Commander, leaving your rewards there won't make them grow.",
	feeling4 = "I don't really like lecturing people... but I've gotten used to lecturing my sister, and you don't seem to mind. Eh? You actually it? Then... I guess I'll keep it up...",
	unlock = "Pleased to meet you! I'm Kinugasa. Have you been eating and sleeping well,  Commander? Don't be like my big sis... Speaking of which, is she also here by any chance?",
	feeling5 = "Aoba is always so impatient! But she's my big sis, and she's very important to me. Just like you, Commander. You're precious to me as well!",
	main = "Did you rest well, Commander? Health comes first!|I'm not sure if Aoba is getting enough rest... Please make sure to check up on her!|Work hard, play hard! That's the secret to a happy life!",
	battle = "Everyone! Stay alert, protect yourself, and don't be reckless!",
	upgrade = "Being wasteful is no good, Commander.",
	voice_key = 30304,
	headtouch = "",
	feeling2 = "Did you clean your room, Commander? Did you lock the door? Have you forgotten anything?",
	login = "Welcome back, Commander! Did you get enough to eat? If you're still hungry, I can cook something for you!",
	vote = "",
	hp_warning = "Don't panic. Get into formation!",
	id = 303040,
	detail = "Health comes first!",
	couple_encourage = {
