	feeling5 = "I can't be honest with myself... because I can't stand the thought of people seeing me work hard... except for you, Commander. No matter who I become, surely you would...",
	main = "My sisters in the Fifth Fleet? I miss them a bit... err, just once in a blue moon!|Ghosts on the training ground? W-what are you, a kid? Who'd believe something like that?|Salt Lake City? I'm going to show her that Lady Luck doesn't bless the same person forever!",
