	touch = "I got this from Myoukou. I often record what she says, so I can listen to her words when I have free time. Eh? Is that weird?",
	profile = "I am Ashigara, third ship of the Myoukou-class heavy cruisers. I had the privilege and glory of representing the Sakura Empire in the Royals' Coronation Fleet Review. My habitability? W-well... some things must be sacrificed in order to survive on the battlefield.",
