	unlock = "Ashigara, reporting for duty. Commander, my blade shall cut down all your enemies.",
	feeling5 = "Sorry, Commander... when you weren't here, I started feeling uneasy and... before I knew it, I had already folded a hundred paper cranes... Um, that's weird, isn't it...",
	main = "\"Let your victories not be decided by the strength of your equipment, but by your abilities.\" That is what Myoukou taught me. |\"Let those who think of the Sakura Empire also think of your name?\" Hmm... Yes, that is a goal that I indeed have been working towards. |Commander, thank you for training with me every day. I'll continue to refine myself!",
