_G.pg.base.ship_skin_words[304060] = {
	feeling1 = "Kongou! I- I never want to see this Commander again in my life!",
	feeling3 = "Hrm... that's not right... Um.... Umm.... Commander? Can you help me with the parts I don't understand?",
	lose = "....urk.... 'tis- 'tis but a trifle! A single defeat! Doesn't bother me at all...",
	propose = "Surprised, aren't you? Hiei prepared this party just for you! After all, today is a very important day for me, because... welll... you're very important to me! There, I said it...",
	expedition = "Commission complete. I shall go to receive them.",
	win_mvp = "Such a victory goes without saying, 'tis but a trifle.",
	home = "That was a hard-fought sortie... Now then, I didn't make any mistakes, did I?",
	mission = "Completing a mission is a glorious thing.",
	touch2 = "Shameless pig!",
	voice_key_2 = -1,
	skill = "D- disappear with the waves!",
