	mail = "New mail... don't tell me... it's a summons!?",
	touch = "Do you have anything that needs doing? I must test myself yet!",
	profile = "Once my big sister Kongou comes back, we're going to shock the world! Until then, I need to work hard to become a leader worthy of her! But.... courtly etiquette is really hard.....",
	mission_complete = "Puff out your chest when receiving such honors!",
	feeling4 = "Can I prepare the next party? Really!? I won't let you down!",
	unlock = "Commander? When I grow up, I’m going to serve the strongest lord in the world! Oh... but for now, I don’t mind if you help me sharpen my skills.",
