	main = "Make merry? I'd love to! Where are we- oh, no. Now isn't the time for such things!|My sisters went to a place called \"Royal\" to study aboard... abroad? Study abroad. Hmph! I bet you don't even know what abroad is!|If you keep staring at me, I'm going to hit you with this! And it's going to hurt!",
	battle = "Hmph! I shan't lose to the likes of you!",
	upgrade = "Hiei won't let you down!",
