	feeling3 = "Ehehe... Commander, you look so cute after a few drinks~",
	lose = "{namecode:76}... Sister...",
	propose = "You should keep this kind of thing in your mind only... Seriously... how will people look at me if I wear this... Hehe... hehe... hehe!",
	expedition = "Mmm, well done!",
	win_mvp = "Phew... Let's work a bit harder!",
	home = "Done with warmups? Alright...",
	mission = "Commander, we'd be better off just not doing any pointless missions.",
	touch2 = "Commander, let's spar. If you win, I'll let you touch me as much as you'd like.",
	voice_key_2 = -1,
	skill = "Twelve main guns... FIRE!!",
	drop_descrip = "Second ship of the {namecode:76}-class battleships, {namecode:77}.",
	mail = "Is this your stuff? Make sure to keep it in a safe place next time.",
	touch = "A veteran swordsman should be able to detect her opponent's energy before they get too close... I still have a long way to go...",
	profile = "Hyuuga, second ship of the Ise-class, reporting in. Like my sister, I don't have many actual achievements. Then again, the same goes for most of us Sakura Empire battleships. That includes Na-whatever and Ya-whatever. It has nothing to do with our designs or capabilities! ...Hmph. Make fun of me all you want, Commander, but I'll show you what I'm made of.",
	mission_complete = "Commander, drinking a beer with a raw egg is just wrong... All you need is beer. Pure beer!",
	feeling4 = "Neither Ise nor I have any problems with exploding turrets.",
	unlock = "I'm the little sister of my stupid big sister... Ah! That doesn't mean that I'm a stupid little sister, alright?! Anyways, I'm {namecode:77}. Nice to meet you.",
	feeling5 = "Commander, let's have a duel! Don't worry, I won't use my weapon this time... You might actually stand a chance that way, right?",
	main = "Ise, please clean your room every now and then...|It sure would be nice to meet Hatsushimo here.|Though the Age of Aviation has come, it still isn't the Age of Aviation Battleships.",
	battle = "Speak your name! I'm not going to cut down some nameless rat!",
	upgrade = "Now my main gun sounds even better when it fires!",
	voice_key = 30504,
	headtouch = "",
	feeling2 = "B-big sis... do you have to cling to me every time you drink?",
	login = "Phew... Wouldn't you agree that it's better to train from dusk until dawn instead of from dawn to dusk?",
	vote = "",
	hp_warning = "",
	id = 305040,
	detail = "Want to practice combat techniques with me, Commander?",
	couple_encourage = {}
}

