_G.pg.base.ship_skin_words[305113] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Have you finished your work? Excellent, then feel free to spend the rest of your day as you please!",
	mission = "",
