	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Even I like to dress down and unwind from time to time. Oh? This is new and exciting for you? Well, you are welcome to come see more of it from now on! Hahaha!",
	feeling5 = "",
	main = "What should I do on this well-earned vacation...? Assembling model ships? Housework? Travel? ...Too many things to do...|Commander, do you think people would consider me slovenly if they saw me like this? No chance of that? Good, I see.|Nagato, do not excessively concern yourself with the opinions of others. Simply set your worries aside and enjoy yourself.",
