_G.pg.base.ship_skin_words[305114] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "Our commission team has returned. Get excited for some new menu items!",
	win_mvp = "Hahaha! Seems like we'll have to jazz up that celebratory menu, eh?",
	home = "Excellent; you've returned in one piece! Ah, I suppose girls these days say, \"Welcome home, Master!\" Hmm... Maybe that sounds a bit too forced...",
	mission = "I will take care of store management today. Commander, you focus on the mission.",
	touch2 = "Say, what kind of establishment do you think this is...?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Welcome to the Sakura Empire's pop-up café... Oh, Commander! Everyone's waiting for you. Now get your butt in here and experience the full extent of our fleet's hospitality! Don't be nervous, now! Hahaha!",
	mail = "",
	touch = "Maybe I ought to take your order myself. Hahaha!",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Welcome to the Sakura Empire's pop-up café... Oh, Commander! Everyone's waiting for you. Now get your butt in here and experience the full extent of our fleet's hospitality! Don't be nervous, now! Hahaha!",
	feeling5 = "",
	main = "People will get bored sooner or later if our menu is nothing but Sakura-style confections... Should we add some curry or Western snacks?|Mutsu, please! We all know you've got a sweet tooth, but the café's food is off-limits! We've got staff meals right over there.|Say, I ought to put my skills to the test. What would you like to eat, Commander? It doesn't have to be from the menu either.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Mhm, things are nice and tidy as always. On three, everybody! One, two, three... Welcome, Commander!",
	vote = "",
	hp_warning = "",
	id = 305114,
	detail = "",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[305115] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "Oh, the commission team's back? Don't forget to get them some souvenirs while we're here.",
	win_mvp = "",
	home = "Let's stop and take in the peace you've brought us. Getting proper rest between fierce battles is part of your job! Heheh.",
	mission = "You plan the missions, and I'll plan the trip! ...Uh, how do you use this tablet, exactly?",
	touch2 = "Hey! No touching the sash! ...Phew. That scared me, y'know.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "I was worried when you said you wanted to go on a trip with me, but... I do like getting to go sight-seeing and try on new threads. Commander, let's enjoy this to the fullest! Hahaha!",
	mail = "",
	touch = "Hm? You wanna hear the story behind this dress? Then get comfy and prepare for a lecture from your guide, Mikasa!",
	profile = "",
	mission_complete = "Finished your mission? Good timing! I just finished checking out this tourist spot.",
	feeling4 = "",
	unlock = "I was worried when you said you wanted to go on a trip with me, but... I do like getting to go sight-seeing and try on new threads. Commander, let's enjoy this to the fullest! Hahaha!",
	feeling5 = "",
	main = "Huh, so this is the \"Beauty Looking Back\"... It's really embarrassing to hear you say that about me, though.|They weren't kidding when they said \"no road is long with good company.\" I just hope you're having a good time, too... Hahaha, that's what I like to hear!|Hmm. So there are famous mountains, historical sites, and even temples and shrines... I dunno if we'll be able to see all of this now. I say this calls for a repeat trip!",
	battle = "Battleship Mikasa is here! Let's do this!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Even a nostalgic town feels different by your side, Commander. Go on; lead the way!",
	vote = "",
	hp_warning = "",
	id = 305115,
	detail = "\"It's a little different from the other girls, but that just makes it suit me more,\" huh? Is it just me, or are you getting smoother by the day? Hah!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[305118] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Are you telling me it's impossible, even with the Commander at my back...?",
	propose = "",
	expedition = "",
	win_mvp = "As long as you put your mind to it, there's no war you can't win! Redouble your efforts, and keep up the good work!",
	home = "You brought everyone back safely, without a hitch! Spectacularly done, I must say. Hahaha!",
	mission = "Oi! Don't doze off on me! I promise I'll let you rest after you read through the mission! ",
	touch2 = "You're working very hard, so I guess I'll allow this much...",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "I, battleship Mikasa, from now until eternity, pledge to you my undying love and devotion. May we help each other, encourage each other, and walk side-by-side on the same path. I hope to meet your expectations, as unworthy as I may be.",
	mail = "Hehe♪ These medals and awards... are things I obtained with you by my side. Go ahead, burn the sight into your mind~",
	touch = "Urgh, how in the world do you use this cellular phone thing? ...Grrrr...",
	profile = "",
	mission_complete = "Very good. Well done! We're done with the mission! You really should teach Zuikaku and the others how you do it.",
	feeling4 = "",
	unlock = "I, battleship Mikasa, from now until eternity, pledge to you my undying love and devotion. May we help each other, encourage each other, and walk side-by-side on the same path. I hope to meet your expectations, as unworthy as I may be.",
	feeling5 = "",
	main = "My Commander, don't slack on your studies. If you'd like, I'd be happy to teach you personally.|Tonight's menu... How about I make you naval curry that originates from a port I have an affinity with? Of course, it's simply exquisite.|So those are \"airplanes.\" The true potential of new things are often overlooked for quite some time. Do your best to not do the same.",
	battle = "Vanquish all evil! Crush the enemy!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "I can't get used to calling you \"Dear\" or you calling me \"Honey\"... Calling each other by what we already do would be easier? Very well, as long as you're fine with it...",
	vote = "",
	hp_warning = "",
	id = 305118,
	detail = "Well, perfect timing. Hm... It looks like this size should fit you... As the one in charge, you can't neglect stocking up on necessities. Once we're in the middle of battle, even your best clothes can get all torn up in the blink of an eye. Make sure you to get some spares while we're still in the lull of peace.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[305120] = {
	feeling1 = "I'm so tired of bosses that can't handle their subordinates, like you.",
	feeling3 = "Thought as much. I'll help you with your training, then! Come on, out of your room and into the fresh outdoors for some jogging! And later, we'll do some sparring!",
	lose = "Dammit... Not enough firepower for the job, huh?",
	propose = "I mean, we don't need to go that far. We're already dearly important to one another, aren't we? ...Don't worry, I'll still accept it! And of course, I'll keep on keeping you safe, just like I always have!",
	expedition = "That last commission was kinda mediocre... Still, they deserve a congratulatory moment. Want to come with me?",
	win_mvp = "Victory's ours. Heheh, now that was refreshing all right.",
	home = "I reckon we'll garner more fame by winning battles than by wasting time in port, don't you agree?",
	mission = "A new mission? If it's about turning hostiles to scrap, I'll get it done!",
	touch2 = "\"Friendly friskiness,\" is it? Hmm... Sure, I guess?",
	voice_key_2 = -1,
	skill = "Let's give 'em a dazzling show!",
	drop_descrip = "Kii-class battleship – Kii.",
	mail = "A letter, eh? If it's an open duel, then I accept their challenge! Oh, no duel, huh...",
	touch = "Something on your mind? I might be able to help you with it.",
	profile = "I am part of the Eighty-Eight Fleet Program: first ship of the Kii-class battleships, Kii. In short, I never got a chance to shine during the war because reasons... But now I have, and I'm going to use it to its fullest! If you have anything that needs doing, just say the word, Commander!",
	mission_complete = "We're wrapping up these missions nicely! Great!",
	feeling4 = "There's no fun in knocking a battle out of the park if nobody's there to witness it. Anyway, once this work is done, I'll go train with Hyuuga. After that, you, I, and Suruga will go for a drink with Ise! Sound good to you?",
	unlock = "Battleship Kii, reporting for duty! Is it true that I'd be able to fight without holding back over here? Heh, good stuff! I look forward to what the future has in store, and you should keep your eyes on me as well!",
	feeling5 = "People say you can push yourself harder if it's to protect someone. Then for everyone's sake, I, Kii, shall become the strongest battleship... Pfft, yeah right! Hahahahah!",
	main = "Tell me if anyone starts picking on you. I'll put them in their place! And I mean it, for the most part, you hear?|Mmghh! I'm feeling stiff after standing up for so long... What's up, Commander? Why are you blushing? ...My bra's coming off?|Hey, Suruga! What do you say to going drinking with me and the gang once work is done? Figures, always so antisocial... When people invite you, you should go with it!",
	battle = "Let's duke it out, fair and square!",
	upgrade = "Let's see how strong I've really gotten. Send me into battle!",
	voice_key = 30512,
	headtouch = "",
	feeling2 = "You okay, Commander? You've had this tired, stiff look on you for a while now... You're not getting rusty like Suruga, are you?",
	login = "Look who's finally clocked in, hahahah! My trigger finger's gotten itchy, so let's get on with a sortie already!",
	vote = "",
	hp_warning = "These guys are tougher than I expected!",
	id = 305120,
	detail = "Obviously I like being on the center stage with my massive cannons. Performance aside, their size alone boosts morale while intimidating the enemy. You get what I mean, Commander?",
	couple_encourage = {
		{
			{
				30405
			},
			1,
			"You're the brains, I'm the brawn!",
			0
		},
		{
			{
				30514
			},
			1,
			"Don't be shy! Let's do this with flair!",
			0
		},
		{
			{
				30503,
				30504
			},
			1,
			"Let's celebrate with a glass after we get back!",
			0
		}
	}
}

