_G.pg.base.ship_skin_words[305140] = {
	feeling1 = "*Sigh*... I set myself up for disappointment by expecting any decent treatment... Can I at least ask you to not go too hard on me?",
	feeling3 = "P-please! Offer your concern to other girls instead of me! You really don't need to constantly check how I'm doing just because I'm serving as your secretary!",
	lose = "Whatever, it's done and over now... Look, I don't want everyone to see this!",
	propose = "You have bizarre tastes in women, Commander... Anyway, this doesn't come as a shock to me; I've known for a long time that your feelings for me are sincere. I, Suruga, hereby accept your oath of love.",
	expedition = "The commission team has returned. Shall we set out to greet them?",
	win_mvp = "Fools! I've– I mean, we've won!",
	home = "Nicely done out there. Please don't mind me, go ahead and take some time to relax.",
	mission = "I'd like to suggest completing these missions. It is your job to do as the commander, after all.",
	touch2 = "Whuah?! What are you doing...?!",
	voice_key_2 = -1,
	skill = "I'm gonna smash you to pieces! ",
	drop_descrip = "Kii-class battleship – Suruga.",
	mail = "It appears you have new mail. I'll confirm it on your behalf.",
	touch = "I will do as you order me to, Commander.",
	profile = "I am Suruga, Kii-class battleship number three. I sadly wasn't constructed in time for that infamous war... It seems some threads of fate have led me to join this fleet, one I shall devote all my soul to. It is my pleasure to serve you.",
	mission_complete = "I've brought the mission rewards with me. Phew...",
	feeling4 = "Look, I do appreciate your concern, but you saying that in front of everyone is embarrassing! Could you not put me on the spot like that again? That'd be great!",
	unlock = "Battleship Suruga, reporting for duty. It would seem that some threads of fate connect me to this port... No, don't mind my rambling. Please disregard that.",
	feeling5 = "*Sigh*...! People have their eyes glued to me wherever I go now, thanks to you... There are plenty of other ways to express your love without embarrassing me, you know! Please, Commander, I'd rather not deal with that again!",
	main = "I believe I'm better suited for a desk job where I can analyze data and draft new plans. The reason being my strengths lie in quickly reading, memorizing, and writing documents.|Reckless hotheads and I don't get along particularly well. So I've learned first-hand through bad experiences with a certain someone... That is not to say I hate those kinds of people, however.|I'm deeply grateful that you've elected me as your secretary. However, I would absolutely welcome the addition of more people to the office, as we're rather short-staffed with just me here.|I'm not a fan of battling, but if anyone picks a fight with me, then a fight they'll get. We were made to wage war, and so that is our responsibility.|Life is so peaceful at this port. For that, we can thank the many girls here who I don't hold as much as a candle to.",
	battle = "The Suruga Fleet w-will not disappoint...!",
	upgrade = "It's meaningless to fight if you cannot win. As such, a few enhancements may prove necessary.",
	voice_key = 30514,
	headtouch = "I hope my horns were left alone... Phew, they were... Err, no! Never mind I said anything!",
	feeling2 = "I hope to leverage my meager secretary abilities for the betterment of the fleet. I'm always ready for your orders, Commander.",
	login = "Let's focus our attention on our work today. Don't be afraid to ask for my help, should you need it.",
	vote = "",
	hp_warning = "Oh, for crying out loud! Just my luck!",
	id = 305140,
	detail = "I've noticed those Priority ships are strikingly individualis– Pardon, I mean they have striking personalities. Not that I'm jealous, or anything of the sort.",
	couple_encourage = {
		{
			{
				30505
			},
			1,
			"Lady Nagato, I shall defend you!",
			0
		},
		{
			{
				30702
			},
			1,
			"Kaga, please... don't go overboard.",
			0
		},
		{
			{
				30405
			},
			1,
			"Amagi... I wish you could've been there for us...",
			0
		},
		{
			{
				39902
			},
			1,
			"If I wait just a little longer for my plan... No, I guess that's not happening...",
			0
		},
		{
