_G.pg.base.ship_skin_words[306010] = {
	feeling1 = "So filthy... What? I'm not talking about you...",
	feeling3 = "My eyepatch? Kinda just started wearing it on a whim. Plenty of people out there who dress like pirates, you know?",
	lose = "It's pretty hard to ignore the damage done to my planes...",
	propose = "You've been real good to me, Commander... So, how about I be your lifelong partner from this day onwards...?",
	expedition = "I was actually designed with these types of missions in mind...",
	win_mvp = "It was all thanks to my little planes.",
	home = "Planes, up on deck... It's time we all get ready.",
	mission = "A mission? As long as it ain't in the Marianas, I'll take it on...",
	touch2 = "D-didn't I tell you I was lightly armored?!",
	voice_key_2 = -1,
	skill = "Planes... take off!",
	drop_descrip = "Hiyou-class aircraft carrier number one – Hiyou.",
	mail = "Doesn't matter if it's a pigeon or a plane delivering your mail, does it?",
	touch = "I'm lightly armored, so, uh...",
	profile = "I'm Hiyou, Hiyou-class aircraft carrier number one. I'm a light carrier, but my damage control and loading capacity are just as good as a regular carrier's. After Midway, I was a key part of the Mobile Fleet and fought hard to my very last battle...",
	mission_complete = "If we keep earning honors, one day even I can become a full-fledged carrier...!",
	feeling4 = "My opinion of you has improved a little bit. Just a little bit, you hear!",
	unlock = "Light carrier Hiyou reporting in. Commander, I won't have you looking down on the Hiyou class just 'cause we're light carriers!",
	feeling5 = "I've sent out all my planes. Right now... there's just us two in here.",
	main = "Ah, Izumo... I'd like to meet her one day.|I'm pretty sure mine are larger than Souryuu's...|I'm slow-witted? Hmph, believe it or not, I'm a girl with a lot on her mind.",
	battle = "In the name of the wings of the sky: take off!",
	upgrade = "... Seems my technique's gotten more refined.",
	voice_key = 30601,
	headtouch = "",
	feeling2 = "Junyou is... I know I'm warning you about my own little sister, but she's really dangerous...",
	login = "Heheh... Let's get some good work done today, Commander.",
	vote = "",
	hp_warning = "",
	id = 306010,
	detail = "You gonna ask if I wanna go for lunch?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[306020] = {
	feeling1 = "Commander, don't tell me you want to break up?!",
	feeling3 = "I know all your favorite things, Commander.",
	lose = "We lost? What are you saying, Commander? Don't you know Junyou ❀always❀ wins?",
	propose = "Commander, you finally remembered... our ❀memories❀ and our ❀promise❀... Ahhh, I'm so touched... Hehe... Well then, just like we promised ❀back then❀...",
	expedition = "Hmph, those girls need to learn to read the room...",
	win_mvp = "Ahaha, when I feel the Commander's love for me, I can't help but go a bit overboard.",
	home = "I trust you brought my favorite, just ❀like always❀...?",
	mission = "Oh, did you want to go on a date with me ❀again❀, Commander? What can I say...",
	touch2 = "I know exactly what you're thinking, Commander.",
	voice_key_2 = -1,
	skill = "DIE!",
	drop_descrip = "Hiyou-class aircraft carrier number two – Junyou.",
	mail = "Commander? Didn't I tell you not to write so many love letters~?",
	touch = "Commander? We've known each other for so long, you can be a little more forward...",
	profile = "It's me, Junyou, your oldest friend! After those nasty girls tormented me so much, after all the fighting in the Aleutians, Santa Cruz, the Marianas, I finally got to see you again! I really don't know how you could have forgotten me... but please, hurry up and remember! Eheheh...",
	mission_complete = "That was a rich, full day. Now how about we go on a date somewhere?",
	feeling4 = "Our first time together? I know it was ❀back then❀, but how could you not remember...?",
	unlock = "Oh, Commander, it's gotten so late. You've kept poor Junyou waiting. Let's go home together, ❀like always❀.",
	feeling5 = "No! There's nothing wrong with me! I'm not sick! I'm not! It's just everyone else... why don't you remember!",
	main = "I wonder how I can make you remember, Commander...|Ryuujou... Where have I heard that name before...?|It's not funny anymore! You have to remember, Commander! We've been together ❀since the very beginning❀!",
	battle = "You're trying to get between me and the Commander... I'LL KILL YOU!",
	upgrade = "My planes too...",
	voice_key = 30602,
	headtouch = "",
	feeling2 = "The Marianas? I really... don't like it there...",
	login = "Commander, I will ❀always❀ be with you.",
	vote = "",
	hp_warning = "",
	id = 306020,
	detail = "Don't you think... we're bound to be together, Commander? Ahaha.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[306030] = {
	feeling1 = "Is something the matter, Commander?",
	feeling3 = "I look a bit like a courtesan? Hehe~ Well then, mister, it seems like tonight shall be our one and only night together. Let us feel the warmth of our embrace, then let the memories fade to nothing. How does that sound?",
	lose = "I'm so sorry, Commander...",
	propose = "My dream is to one day settle down with the person I love and open a small bar somewhere... Now, it doesn't seem like my dream is so distant anymore. Right, my dear?",
	expedition = "Commander, your girls have returned from commission. I'll welcome them back now, but you should hurry over as well.",
	win_mvp = "Commander, will this be enough?",
	home = "Good work, Commander! Would you like dinner? A bath? Or perhaps... a drink first? Hehe~!",
	mission = "You've got new missions, Commander. Care for a challenge this time?",
	touch2 = "Ahh! ... Commander, that's naughty. You can't touch me there.",
	voice_key_2 = -1,
	skill = "It's time for a feast!",
	drop_descrip = "Aircraft carrier, {namecode:89}.",
	mail = "Commander, there's mail for you!",
	touch = "Are you looking for me, Commander?",
	profile = "I guess you could say that I was the first aircraft carrier ever in the world. You could call me the eldest sister, or mother, of them all! Feel free to consult with me whenever you'd like, Commander. I'm always here for you.",
	mission_complete = "Commander is sure forgetful, always needing my reminder just to claim the rewards.",
	feeling4 = "A prominent person once praised my beauty, but to be honest, I am not so sure about myself. But if Commander was to acknowledge me, perhaps I could find my confidence. So... Commander, am I beautiful?",
	unlock = "Ah, it's the Commander... My name is Houshou, and I'll be in your care from now on. Please leave the children of the fleet in my care. I won't let you down!",
	feeling5 = "Commander, the moon is beautiful tonight, isn't it? I've prepared some drinks... would you like to stargaze together? I wouldn't do this for anyone else - this is a special service just for you, my dear.",
	main = "Having long legs isn't necessarily a good thing. A high center of mass makes it easy to tip over...|Commander, I prepared some snacks for us. Do you want to relax for a while?|It's amazing to see how much my younger sisters have accomplished, but sometimes it makes me a bit sad to see everything they've gone through...",
	battle = "I'm not very skilled in real combat... but I shall not betray your expectations!",
	upgrade = "Now I can help you even more, Commander!",
	voice_key = 30603,
	headtouch = "",
	feeling2 = "Want to take a nap, Commander?",
	login = "Commander, have you eaten yet? No? Let me make something for you. You can't head to work without first preparing your body and mind!",
	vote = "",
	hp_warning = "Looks like I can't afford to take it easy just yet.",
	id = 306030,
	detail = "You're like a kid sometimes, Commander... Come over here~",
	couple_encourage = {}
}

