_G.pg.base.ship_skin_words[306050] = {
	feeling1 = "Commander treats me like a li'l kid too... Yer makin' me sad...",
	feeling3 = "I have no regrets 'bout what happened at the Coral Sea. I read we oughta accept our failures, else we won't learn from our mistakes! Eh? You think I'm amazin'?",
	lose = "How could I lose to those guys?",
	propose = "Eh? Commander, are y'sure this is going to the right girl? Someone as immature as me? ... I see, I've earned yer respect and recognition... Commander, from here on out, I'll do my best, so please continue to care for me!",
	expedition = "A commission's all wrapped up~! Let's go welcome everyone back!",
	win_mvp = "I've got the God o' Fortune by my side! Of course I'm gonna win!",
	home = "Need a rest? How 'bout I give your back a nice thumpin'?",
	mission = "Commander, there's new missions here!",
	touch2 = "Nnh... Stuff like this... is better saved for night~",
	voice_key_2 = -1,
	skill = "It's show time, y'all!",
	drop_descrip = "First ship of the {namecode:87}-class aircraft carriers, {namecode:87}.",
	mail = "Commander! The mail's right above ya~",
	touch = "I don't really mind, but you shouldn't be doin' that to others.",
	profile = "I'm Shouhou, first ship o' the Shouhou-class! \nThe luck's a bit poor, but they ain't a thing I can do 'bout that.",
	mission_complete = "I brought the mission rewards!",
	feeling4 = "Commander, how do I become mature real fast? ...I'm fine as I am now? Really? But I'm always thinkin' I rely too much on you and my sisters...",
	unlock = "Commander, Shouhou's the name. I don't have a lotta firepower or planes like those regular carriers, but there's plenty o' stuff I can do that they can't! A real pleasure to meet ya!",
	feeling5 = "Mm... I got it now. Relyin' on others ain't such a bad thing! I won't be all jittery about growin' up faster now... Havin' that said though~ Commander, can I rely on ye even more now?",
	main = "Ah, Commander, I'm ready to give it my all t'day as well! Let's go stick it to those bad guys!|My big sis and Kaga are always lookin' after me, but one day, I wanna be more independent!|Commander, the weather's real swell today! What's with the gloomy mug? Let's play together!",
	battle = "Sisters, charge! Let's show 'em who's the star o' this show!",
	upgrade = "I'm a li'l closer to becomin' an adult!",
	voice_key = 30605,
	headtouch = "",
	feeling2 = "My children are all Shikigami - easy to store, but a pain to maintain! Y'all came at the right time - maintenance!",
	login = "I'll protect ya even if it means puttin' my own life at risk, Commander!",
	vote = "",
	hp_warning = "",
	id = 306050,
	detail = "Ahh~ the folks always tell me, I'm gonna be a real beauty when I grow up~",
	couple_encourage = {}
}

