_G.pg.base.ship_skin_words[306060] = {
	feeling1 = "No matter where you are, the top brass is all the same...",
	feeling3 = "Commander, feel free to rely on me as you please. Should you will it, I will execute any command.",
	lose = "Ugh... my body is all beat up...",
	propose = "From now on, no matter what perils we might face, I will protect you with everything I have! Even if I sink to the bottom of the ocean, I will not permit any harm to come to you!",
	expedition = "Worldly things are of little significance! The only things that matter are spirit and resilience!",
	win_mvp = "Despair... shall be your final destination!",
	home = "Don't break formation even when we head back to port! The glory of the Sakura Empire is in its meticulousness!",
	mission = "A new mission is here! Whether it's combat or training, let's knock it out at the speed of sound!",
	touch2 = "Eek!!! Oh, it wasn't Saratoga after all. However, you seem to be even more mischievous than she is.",
	voice_key_2 = -1,
	skill = "As long as I am here, nothing shall stand in my way!",
	drop_descrip = "Ryuujou-class Light Carrier - Ryuujou",
	mail = "A telegram? Oh, it's not a combat report from Headquarters. I suppose there might be some value to reading it then.",
	touch = "Milord, please be careful. I am just as top-heavy as Illustrious.",
	profile = "I am Ryuujou of the Sakura Empire, a seasoned warrior who has served in the First through Fourth Carrier Divisions, and participated in campaigns in the Phillipines, East Indies, Aleutian Islands, and Guadalcanal. I don't look the part...? Th-that must be because of that one incident at Iwate that stunted my growth! Milord, just you wait. I'll show you the extent of my capabilities!",
	mission_complete = "The mission rewards are here! A bagel? Is this a snack for me? Thank you, Milord. Well then, let's move out!",
	feeling4 = "Commander, did you prepare this meal for me by yourself? In that case, I'll be more than glad to dig in! Mm... thanks for the food! Eh? You'll continue to cook for me when I come back!?",
	unlock = "Milord, I am called Ryuujou, a ranger from the Land of the Rising Sun! I shall lay down my seven lives to mete out justice in your name!",
	feeling5 = "Just being able to see your face before I sortie fills me to the brim with energy and makes me feel like I can't lose to anyone!",
	main = "Odango... these delicacies will cause my heart to waver, so... Um, I suppose I can reward myself a little.... Mmmh! So delicious! |When you're stressed out, you should go watch the fish swimming around peacefully in the aquarium. I'm not sure why, but it always calms me down. |I fight for a just cause! No matter who stands before me, I swear to give it my all!",
	battle = "Now, count up your sins!",
	upgrade = "Thank you very much, Milord! Shall we go run a lap to test my new strength?",
	voice_key = 30606,
	headtouch = "",
	feeling2 = "Milord, when it comes to war, victory is more important than good or evil!",
	login = "A day off? Milord, my week only consists of Monday, Monday, Tuesday, Wednesday, Thursday, Friday, and Friday!",
	vote = "",
	hp_warning = "My life is burning bright!",
	id = 306060,
	detail = "Milord, we cannot survive unless we fight!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[306061] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "Milord! C-could you please consider rewarding me with some potato chips?",
	home = "Splendid work, Milord! If you so like, come take it easy with me!",
	mission = "",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "*yawn*... Finally, a good night's rest... Now, to pick up where I left off on that RPG... M-m-m-milord, why are you here?! I wasn't slacking off or anything, I w-w-was just... Ughh....",
	mail = "",
	touch = "Zzzzz... Milord?! Are we being attacked?! ...I lowered my guard and fell asleep? Forgive me for this shameful display!",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "*yawn*... Finally, a good night's rest... Now, to pick up where I left off on that RPG... M-m-m-milord, why are you here?! I wasn't slacking off or anything, I w-w-was just... Ughh....",
	feeling5 = "These games and snacks are a sort of trial for me! Rest assured, Milord! My devotion will not be swayed by the likes of these items!",
	main = "I cannot believe how addictive this technological marvel of a game console can be...! B-but that's not to say it has no merits whatsoever! After all, if we could settle wars through these games, nobody would have to get hurt!|nil|C-can we really allow foodstuffs as devilishly tempting as these deep-fried chips of potato to exist in our society?!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "*yawn*... O-one moment! I'll get myself in order!",
	vote = "",
	hp_warning = "",
	id = 306061,
	detail = "It's good to always be ready for battle, but this isn't... so bad either, wouldn't you agree, Milord?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[306062] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "Quest complete! And without using any continues, too!",
	home = "I always strive to do my best, be it with video games or whatever else! My ambition is to be like the legendary L.I.!",
	mission = "",
	touch2 = "Whuah! Oh no... Milord, your action just led to my death. Why did you have to do that?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "All right! Steady! Steadyyy! Gottem! Hahahah! Now I'll– M-Milord?! I-I'm just, umm... enjoying an after-school break!",
	mail = "A new electronic message? Could it be an invite to a party?",
	touch = "Do you wish to go on a hunt with me, Milord? Let me move over... There. Please, join me on the bench!",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "All right! Steady! Steadyyy! Gottem! Hahahah! Now I'll– M-Milord?! I-I'm just, umm... enjoying an after-school break!",
	feeling5 = "Through this game, I've deepened my bond with my friends, and made fun memories with you, Milord... I-I won't deny it came at some cost to my discipline, but even so, I am glad I got into this game!",
	main = "Yes! I dug up a rare material! Haha! It's true what they say about you bringing luck, Milord!|It's so convenient, being able to play a game anywhere you want, whenever you want... But I must have discipline! I must not let myself fall for temptation!|My homework? Rest assured, Milord, I completed it some time ago, as one should!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "You came at a time most opportune, Milord! I would like you to join me for this Master Rank quest!",
	vote = "",
	hp_warning = "",
	id = 306062,
	detail = "The character I've created is a brave and honorable samurai, much like myself!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[306070] = {
	feeling1 = "Commander, for some reason, you seem really unapproachable...",
	feeling3 = "Commander, are you interested in things like commendations or admonishments? ...N-No, it's nothing. I was just curious...",
	lose = "I-I shall let you win just this once!",
	propose = "I, Ryuuhou, vow to be at your side, through thick and thin... W-Well then, from now on, I will not hide any part of myself from you, so prepare yourself... okay?",
	expedition = "The commissions have been completed. I shall go ahead and greet them first. ...I hope their bounty is plentiful.",
	win_mvp = "Unperturbed by both victory and defeat. This is my pride as a member of the Sakura Empire... hehe!",
	home = "Good work, Commander. Let's take a short break. ...But you shouldn't rest for too long, because we're going to review some battles right after this!",
	mission = "A new mission... If it's a directive from the top brass, let's take care of it right away.",
	touch2 = "Wicked thoughts, begone!",
	voice_key_2 = -1,
	skill = "Victory is in my grasp...!",
	drop_descrip = "Ryuuhou-class light aircraft carrier – Ryuuhou.",
	mail = "A letter has arrived. I'm curious about its contents... Are you not?",
	touch = "Commander, are you able to fathom this majestic outfit that impeccably balances both beauty and dignity?",
	profile = "While I was able to set sail many times during my time both as a submarine tender and as a light carrier, in the end, I was unable to take even a single step away from port... No, nothing will happen if I just sit around like this. As I have stated many times, I, Ryuuhou, will bring you victory!",
	mission_complete = "We were able to handle the mission flawlessly thanks to your hard work, Commander.",
	feeling4 = "I take pride in the honor I have earned with my two hands. And that honor becomes fuel for further progress. ...Th-Thus, Commander, I implore you to send me out on sorties more often!",
	unlock = "Remodeled Taigei-class Submarine Tender, Zuihou-class Light Carrier Ryuuhou, reporting for duty. I will strive to bring you victory, Commander! Yes, this time, I won't be held back by failures on my path to victory!",
	feeling5 = "Commander, because I have been by your side, I have been able to demonstrate my true ability. Thus, would it be okay to be my true self when I am beside you...? M-My true self usually leaks out quite often? I-Is that so?!",
	main = "Looking after submarines is really rough... Th-This is from personal experience, so please believe me! | It's in my personality to not care what humans may think about me. This is the attitude that us warships ought to have as warriors.|From time to time, I become envious of the standard carriers... If only... I could be as strong as them...",
	battle = "I've been pent up for a while. You'd better believe I'm going to give you a piece of my mind!",
	upgrade = "I'm truly grateful for your kindness, Commander.",
	voice_key = 30607,
	headtouch = "",
	feeling2 = "The sea of the Sakura Empire is nostalgic, but I also have murky and mixed feelings about it... No, that's got nothing to do with me right now. Focus, focus.",
	login = "You have kept me waiting... No, it's nothing. I can deal with this.",
	vote = "",
