_G.pg.base.ship_skin_words[308020] = {
	feeling1 = "Commander? Never mind, must've been the wind. Hahaha!",
	feeling3 = "Commander, wanna see which of us can hold their breath longest? The winner gets a massage from the loser! How's that sound?",
	lose = "Oh, shoot... I messed up...",
	propose = "I was wondering when this day would come, but I never would've thought it'd be today... I feel so happy that I could swim 100 laps around the port! Yeah! In fact, let's go swimming right now, together!",
	expedition = "A commission's done! Put me on the team for the next one! Disrupting trade is what I do best! Hehehe~",
	win_mvp = "Surprise attack: executed flawlessly!",
	home = "Huh? Commander, I think your hairline's starting to recede... Ahahaha! I'm just kidding with you!",
	mission = "A new mission's arrived! Phew, this'll be a good chance to move around a bit!",
	touch2 = "What are you fantasizing about? C'mon, tell me~ Hehehe~",
	voice_key_2 = -1,
	skill = "Fooound you!",
	drop_descrip = "Type B1 cruiser submarine – I-26.",
	mail = "What about your mail? It was past the deadline, so I disposed of it... Juuust kidding! Here you go, read it~",
	touch = "Hm? Need any help doing your warm-ups?",
	profile = "Question! Which Sakura Empire submarine was the first to sink an Eagle Union merchant ship? You guessed it, this clever little cutie I-26 did! ... What happened after that, you ask? Let's leave the past behind us and focus on the present! *Giggle*",
	mission_complete = "When I see those ships coming in with our rewards, my heart shakes with the impulse to sink them... Just kidding~! I'd never do that! Hahaha, let's check out what we got!",
	feeling4 = "I wonder when you'll notice that... um... that... your suit has a button loose! What were you expecting me to say? Hehehe~",
	unlock = "Submarine I-26 has arrived to be your roommate from now on! Hehehe~ Let me guess: you've really been looking forward to meeting me, right?",
	feeling5 = "Hey, let me borrow your shoulders... Jumpity! Hehehe~ Light as a feather, right? Bring me to the office, if you will!",
	main = "\"What's up with my ears\"? Hm? Do you wanna feel them?|Sorting paperwork... Ugh, so boring... Hey, why don't we play beach volleyball instead?|Maybe I should go for a swim~ Oh, I know! Commander, wanna have a swimming competition to see who's faster? Hehehe~",
	battle = "Who might be our lucky girl today~?",
	upgrade = "I wish someone would enhance my figure, too...",
	voice_key = 30802,
	headtouch = "",
	feeling2 = "Commence dive! Target spotted! Fire torpedoes! Kaboooom! See? It's pretty easy! Why don't you give it a try too?",
	login = "Jumpity! ... Hehe~ Did I spook you, Commander?",
	vote = "",
	hp_warning = "Ahaha... This might be bad...",
	id = 308020,
	detail = "Tans are a sign of good health! So why not come with me and sunbathe a bit?",
	couple_encourage = {
		{
			{
				10207
			},
			1,
			"Don't be afraid! We're allies now!",
			0
		},
		{
			{
				10703
			},
			1,
			"Remember to do your warm-ups, or you'll get cramps, Idol of The Drydock~",
			0
		}
	}
}

