_G.pg.base.ship_skin_words[401010] = {
	feeling1 = "How disappointing, Commander. You’re no fun at all.",
	feeling3 = "Life is short, Commander, and I want to live life on the edge. If you are going to be my partner, you have to keep up. Now, let’s see that smile!",
	lose = "Not bad, fellas...",
	propose = "Once you are with someone, you can no longer only think to take care of yourself. Though I can no longer cry or laugh to my heart’s desire, I do not regret becoming yours at all, Commander.",
	expedition = "A commission has been completed. Straighten up, you have to greet the hardworking girls with your best smile.",
	win_mvp = "Hah hah hah! The great Z1 is unrivaled!",
	home = "Nice expression you've got there. Wasn't that battle simply exhilarating?",
	mission = "We have a new mission. How about we take it on together?",
	touch2 = "You want some \"hard love,\" is that it?",
	voice_key_2 = -1,
	skill = "Follow me to glory!",
	drop_descrip = "Type 1934-class destroyer, Z1 Leberecht Maass.",
	mail = "Hey, you have new mail. Don’t drop it!",
	touch = "Don’t be so wishy-washy if you’re greeting someone.",
	profile = "I’m not like the other so-called \"big sisters.\" I am Z1, the eldest of all Iron Blood destroyers, and bear countless resposibilities upon my shoulders. Rest assured, Commander, because the invincible Z1 is at your side.",
	mission_complete = "Our teamwork is unbeatable! Let’s go check out those mission rewards.",
	feeling4 = "Even if the world was coming to an end, I have nothing to fear. As long as you are at my side, I can continue to laugh.",
	unlock = "Rejoice, Commander! Allow me, Z1, to handle all your problems from now on!",
	feeling5 = "Now that I think about it, the apocalypse is often associated with wild romances, or couples who cling to each other until the bitter end. Commander, why don’t we become as Adam and Eve?",
	main = "Let's see who can do this paperwork faster~!|My full name is Leberecht Maass, but you can call me Z1.|Do your best, Commander. I'll always be by your side~!",
	battle = "Ride the wind and break the waves! Feuer!",
	upgrade = "Hah, this feels pretty good!",
	voice_key = 40101,
	headtouch = "",
	feeling2 = "What’s up, Commander? Are you enjoying your everyday life with me? I sure am.",
	login = "Come, let us brawl!",
	vote = "",
	hp_warning = "What are you all afraid of?",
	id = 401010,
	detail = "Fast and strong, that's me!",
	couple_encourage = {
		{
			{
