_G.pg.base.ship_skin_words[401180] = {
	feeling1 = "It doesn't look like my smile will reach your heart, Commander...",
	feeling3 = "A smile is always good, but when cruelty makes someone smile... it's kind of creepy...",
	lose = "I'll always smile, even when defeated~!",
	propose = "There's no higher praise for my smile than this~ Ehehe, just like always, I will smile for everyone in the fleet, and for you too, Commander!",
	expedition = "The commission team's done~ Shouldn't you go greet them?",
	win_mvp = "Gimme a smile, everyone~",
	home = "Nice work~! Replenish your energy with these snacks and my smile~",
	mission = "Commander, there's a new mission! Let's get to it~!",
	touch2 = "You can't do whatever you want just because I'm smiling! Hmph!",
	voice_key_2 = -1,
	skill = "My smile will reach even the enemy!",
	drop_descrip = "Type 1936 destroyer – Z18, Hans Lüdemann.",
	mail = "Commander, mail for you~ But first, give me a smile~",
	touch = "Do you need anything from me?",
	profile = "I'm the second Type 1936 destroyer, Z18~! You can call me Hans, although it sounds a little boyish... Hm? I'm really different from other Iron Blood girls? Heheh, a smile makes all the difference~",
	mission_complete = "Way to go, Commander! We got so many rewards from that~",
	feeling4 = "Has my smile reached your heart, Commander? My smile belongs to everyone, but I can smile a little more just for you~",
	unlock = "Nice to meet you, I'm Z18! I'm the girl whose smile will reach everyone's hearts~",
	feeling5 = "Your smile has reached MY heart, Commander! It makes me feel so warm and happy!",
	main = "Everyone from Iron Blood are either obsessed with war or say a bunch of stuff that doesn't make sense... and my mission is to make them all smile!|I prescribe a smile to anyone who's feeling afraid~|I believe that, deep down, there's a smile in everyone's hearts! Anyone can smile once they know that!",
	battle = "I'm rooting for you, everyone!",
	upgrade = "Now my smile can reach the hearts of more people!",
	voice_key = 40118,
	headtouch = "",
	feeling2 = "People feel sad and anxious when they lose, right? That's why I'll be there to cheer them up!",
	login = "Welcome back, Commander~ Have you smiled yet today?",
	vote = "",
	hp_warning = "This might not be so good...",
	id = 401180,
	detail = "Okay, Commander! Let's see aaaa... SMILE!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[401190] = {
	feeling1 = "Zero points for you, Commander!",
	feeling3 = "Commander, if I get MVP in the next battle, would you take me to a water park on your next day off?",
	lose = "Ugh... Mission... failed. Commander, I'm terribly sorry.",
	propose = "Can I really have this? Thank you very much... I'll do my best to be a worthy partner!",
	expedition = "Is it finally time for you to play with me?",
	win_mvp = "Z23! This time, I got a perfect score!",
	home = "Could you play with me for a while, Commander? Oh.. you're tired? I guess rest is pretty important too...",
	mission = "Ah, it's already time to get back to work. Commander, let's go complete some missions.",
	touch2 = "Please don't pick me up... I'm way too old for that...",
	voice_key_2 = -1,
	skill = "This is the result of all my hard work!",
	drop_descrip = "Type 1936-class destroyer, Z19 Hermann Künne.",
	mail = "There's new mail, Commander. Surely there's a commendation from the higher-ups!",
	touch = "Commander, your orders?",
	profile = "I am the Iron Blood Navy's Z-class 1936-Type destroyer, Hermann Künne.  I participated in Operation Weserübung, and met my end during the fierce engagements at Narvik. Things will be different this time around!",
	mission_complete = "Commander, the missions were done perfectly this time! Full marks!",
	feeling4 = "Commander, as long as I can see you, my mind is at ease even if you aren't doing anything in particular. Is this what it means to be reliant?",
	unlock = "Z19 Hermann Künne, reporting for duty! Commander, I'm prepared to fight until the very end!",
	feeling5 = "*yawns* Commander, why haven't you gone back to your room yet? You're sorry for waking me up? No, it's okay... but I only have this single bed here... You want to measure my finger size? Why not turn on the lights... Fuehhh?!",
	main = "I must be more strict with myself now that I'm your secretary.|Commander, if you're free, would you like to play with me?|Commander, I prepared some watermelon for you. Open your mouth~ aah~",
	battle = "All ships, at the ready! Aim for the enemy fleet ahead! Feuer!",
	upgrade = "Am I one step closer to being an adult?",
	voice_key = 40119,
	headtouch = "",
	feeling2 = "No matter what skill you have, I'm sure there's a place for it.",
	login = "Commander, skipping breakfast is bad for your body. I've prepared some cereal and toast for you; if you don't mind, would you like to eat together?",
	vote = "",
	hp_warning = "",
	id = 401190,
	detail = "Any inquiries, Commander?",
