	mission_complete = "I-I suppose you deserve a little bit of praise... but only for your hard work.",
	feeling4 = "I'm not following you! We just happened to be going in the same direction! Where am I going...? Why... why should I tell you?!",
	unlock = "I am Z21, Narvik Z-class destroyer flagship, Wilheim Heidkamp! Since you worked so hard to find me, I suppose I'll have to follow you home.",
	feeling5 = "Is there anything you'd like to tell me, Commander? Eh... nothing? I-i-idiot!",
	main = "You should be more careful if you want me to be your flagship... Don't misunderstand, I'm not actually worried about you.|I'm staying beside you, but only because its my duty as secretary ship!|If you're really tired, I suppose you could rest on my lap for a while...",
