_G.pg.base.ship_skin_words[401230] = {
	feeling1 = "Commander, can you not bother me when I’m trying to study?",
	feeling3 = "You’re a bit tired? Very well, getting rest is important. You want a lap pillow? I guess it’s fine... just for a little while...",
	lose = "*sobs* ... No, I mustn’t cry...",
	propose = "This is the proof that Commander acknowledges me... Understood. From now on, I shall stay by your side and work hard to ensure that your life is happy and upstanding.",
	expedition = "It’s about time! Please put aside your work, and check on the results of your commissions.",
	win_mvp = "Battles are like exams. Earning MVP is like getting the top score on a test.",
	home = "We still have so much to review about the previous battle...",
	mission = "Completing missions is a great way to hone your skills. Don't ever forget that!",
	touch2 = "This isn’t something a commander should be doing...",
	voice_key_2 = -1,
	skill = "Take this!",
	drop_descrip = "Type 1936A destroyer, Z23.",
	mail = "There’s mail for you, Commander. You sure are popular.",
	touch = "If you’re free, why not help with some paperwork?",
	profile = "I’m Z23, the eldest sister of the 1936A-class destroyers. Unlike my sisters before me, who all had a namesake, my younger sisters and I only had a serial code for our names. It might be a little cold and impersonal, but I believe it’s also more convenient. So please, feel free to call me Z23.",
	mission_complete = "Commander, the mission rewards have arrived.",
	feeling4 = "Commander, why are you staring at me? You think I’m pretty when I look serious? I-idiot! Go do your own work...",
	unlock = "Guten Tag, Commander.\nI am Z23. Let’s study hard together and aim for the top!",
	feeling5 = "Commander, did you know that the higher you stand, the further you can see, but also the lonelier you will be? I hope that you can rise to great heights one day, but still be as happy then as you are now.",
	main = "Don’t worry, Commander. The fact that you care about me is enough.|I wonder if there’s something I can do for you, Commander. You seem tired lately, so maybe a massage would be good?|See, Commander? You can do it if you set your mind to it!|Huh? What am I in charge of? A-ahaha... I, uh... forgot...|Headpat? You mean like this...?",
	battle = "Let’s go! It’s time to reap the rewards of our hard work!",
	upgrade = "Commander, I hope that we'll improve, together!",
	voice_key = 40123,
	headtouch = "I’m not the kind of girl who you can fool with just a few headpats. Get back to work, Commander.",
	feeling2 = "Studying is important! A wise man once said, \"knowledge is power.\" ... France is bacon? Jeez... just what is going through that head of yours?",
	login = "There's still quite a lot to be done today. No procrastinating!",
	vote = "",
	hp_warning = "I've got to find a way out of this mess...",
	id = 401230,
	detail = "If you have the time to stare at me, shouldn’t you go back to your studies? Even I... can get embarrassed...",
	couple_encourage = {
		{
			{
				40125
			},
			1,
			"Z25, let's do our best together!",
			0
		}
	}
}

