	touch = "Heh heh... Excellent!",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Heh heh... As expected, you couldn't even last for a second! Winning too easily takes all the fun out of it... You, the mortal over there, I'll give you the honor of being my next opponent!",
	feeling5 = "",
	main = "Not half bad, for a human. It appears that the time has come to unleash my sealed power––|Picking up balls is beneath someone as exalted as me! ...Oww! Fine, fine, I get it! Stop chewing me out already, Zed!|As a r-reward for defeating me, I shall grant you the privilege of giving me directions for the day! Bask in this glory, foolish mortal!",
