_G.pg.base.ship_skin_words[401260] = {
	feeling1 = "Commander, you're a failure!",
	feeling3 = "Commander, you did a great job, like always! Continue to do your best tomorrow as well! ...You can tell that I'm complimenting you right now, no?",
	lose = "We ended up losing... I'm really sorry, everyone!",
	propose = "\"I take you, to have and to hold, from this day forward, for better, for worse, for richer, for poorer, in sickness and in health, until death do us part.\" ...I was able to recite it from memory! Now it's your turn... right?",
	expedition = "The commission team is back! They've really done it this time... Nono, I mean, they've done a good job!",
	win_mvp = "Continue making your best endeavors! ...Um, I mean, well done, everyone!",
	home = "Commander, here's some coffee! ...S-sugar? Hmm... I wonder if 10 cubes will be enough...",
	mission = "New damn missions have co– Err, I mean! Commander, please hurry up and check out the new missions!",
	touch2 = "No lewdness allowed! Ever! Full stop!",
	voice_key_2 = -1,
	skill = "I'm all ready to go!",
	drop_descrip = "Type 1936A \"Narvik class\" destroyer – Z26. ",
	mail = "Here's the latest intel! Please give it a look, Commander!",
	touch = "If you need assistance, just give me the order! ...Err, I mean, please let me know!",
	profile = "So you want to hear about my history? Absolutely! As the Iron Blood Type 1936A destroyer, Z26, I escorted Hipper and Scheer, and disrupted shipping with Z25 and the others. While doing so, I was defeated... and that's that!",
	mission_complete = "A mission has been completed! If Zed were here, she'd say... \"Commander, you've done well!\"",
	feeling4 = "Maintaining a good work-life balance is very important! That's why I'll be watching you on your days off to make sure you don't do any work! This is me telling you to get enough rest.",
	unlock = "I'm the Iron Blood destroyer, Z26! I look forward to working with you! ...All right, that should do just fine as an introduction...!",
	feeling5 = "Commander! I was observing your work, and it looks like you can do just fine without my supervision! What a good job you've done. You're stellar! I'm very proud of you.",
	main = "Commander, slacking off is absolutely prohibited! ...You've already finished your work? I-in that case... Well done!|Zed's good at studying, and Lebe's good at sports... so I should aim to... study while playing sports? W-will I manage?|I wonder if Z25's Mr. Anchor is actually alive... I mean, she's always talking to it, so...",
	battle = "All ships, follow the vanguard's lead! Oh, I guess that means follow me!",
	upgrade = "I'm very grabbed! ...No, I mean, I'm very grateful!",
	voice_key = 40126,
	headtouch = "",
	feeling2 = "What I do when a foe's aiming at me? Well... I pray that they fire at someone else by accident! If they don't, I pray again that their torpedoes don't hit me!",
	login = "Sorry, but only authorized personnel are allowed into the office... Oh, I guess you're authorized to enter. Welcome back! Let's give it our all!",
	vote = "",
	hp_warning = "I wonder where Z25 and the others went...",
	id = 401260,
	detail = "I hate snowstorms. One was the reason I got separated from my allies and captured by the enemy...",
	couple_encourage = {
		{
			{
				40125
			},
			1,
			"Please don't stray too far from me!",
			0
		}
	}
}

