_G.pg.base.ship_skin_words[401350] = {
	feeling1 = "You're not the commander I was hoping for...",
	feeling3 = "Commander is a bit like the idol of the fleet. Just by being there, you bring hope to everyone. I want to become the same kind of idol!",
	lose = "Don't lose hope, everyone! We'll have another chance!",
	propose = "It's a promise, Commander. When I become an idol, you'll become my P, okay? Until I become the top superstar... No, even after that, always be my P~",
	expedition = "We interrupt this broadcast to bring you a special message... Commissions have returned, Commander~",
	win_mvp = "Großartig! Everyone did a great job!",
	home = "Commander, are you tired? You should come watch my performance to help you recover!",
	mission = "Another new mission, another new challenge~",
	touch2 = "Commander, I might be playing it cool, but you've already lost my affection points.",
	voice_key_2 = -1,
	skill = "I won't let you have your way~",
	drop_descrip = "1936B-class destroyer - Z35",
	mail = "Commander, there's mail for you~",
	touch = "Commander, what's the matter? Eh, I made a mistake on this document? ...Ah, it's true! Oops, sorry~",
	profile = "The lead ship of the 1936B-class is none other than me, though there were only three of us to begin with... I carried out many artillery and minelaying operations in the Baltic Sea, but in the end, accidentally ran into our own mines along with Z36. Yes, the same as this one down here... Eh? Why is it here?!",
	mission_complete = "As expected of you, Commander! What bountiful rewards~",
	feeling4 = "Now that I think about it... Commander, do you know what a produzent is? It's like the agent for an idol. Commander, if you have time to spare, I'd like you to become my P~",
	unlock = "Commander, my fellow fleetmembers, hello~! I am the singing and dancing Z35! Pleased to meet you!",
	feeling5 = "Commander, I am only able to perform my best when I am with you. Whether it's in combat or on stage, I am always at my best. That's why I can say... I can't be without you~",
	main = "Commander, look look, a bunny! Isn't it so cute? |Just before, I went to see the Lexington sisters' Konzert. You can definitely tell that they are professionals. |Commander, what kind of performance do you like? Tell me so I can go learn it~",
	battle = "Let's give it our all! We're the best~!",
	upgrade = "Commander, you sure are a person of great insight!",
	voice_key = 40135,
	headtouch = "",
	feeling2 = "When it comes to the Iron Blood, the cool one would have to be Z1. The sexy would definitely be Eugen. As for who is the most idol-like, that would be none other than me, the dancing and singing Ms. 35!",
	login = "Hallihallo~ Commander, did you dream of me last night?",
	vote = "",
	hp_warning = "Everyone, let's make another push!",
	id = 401350,
	detail = "Huh? Commander, why are you in my room? ...Eh?! I'm the one who got the room wrong?",
	couple_encourage = {}
}

