	main = "To compete with others and prove your worth, through different means than fighting battles... To be crowned \"champion,\" 'tis a great feeling. |Even in this little academy, there are so many things to do and see... |Whether your sweat is falling on the track, or your words are encouraging others, all of this is an unforgettable experience.",
