_G.pg.base.ship_skin_words[401463] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Have my lessons been so insufficient; or are my emotions simply deficient?",
	propose = "",
	expedition = "A commission fleet has returned to port. I wish for them to see me as I am now, as a beloved idol.",
	win_mvp = "Let us sing this song of celebration; For our friends' displays of dedication.",
	home = "The stage is yet another battlefield, where wars are fought not with steel and fire, but with our charm and earnest desire.",
	mission = "",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Dancing beams of light, shimmering on-stage; uplifted voices, joined as one by song... Upon this unknown stage, my heart doth flutter... Yet this sensation, is quite refreshing.",
	mail = "",
	touch = "My singing voice... is proof of my existence.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Dancing beams of light, shimmering on-stage; uplifted voices, joined as one by song... Upon this unknown stage, my heart doth flutter... Yet this sensation, is quite refreshing.",
	feeling5 = "Anxiety and nervousness gather along with the light upon this stage, and the colors of my heart cannot be concealed... O you who I love, are these feelings reaching you?",
	main = "The star-lit stage is another world of its own, an ajar door to the unknown that now beckons me...|My dear friend, there is no reason to worry about me. All of this was made possible by Z23, Z35, Graf Spee, Admiral Hipper... We are all connected by the bonds of the Iron Blood.|Take heed of where the other performers and your audience are looking? ...I see. I understand why such a thing is important, but can you explain to me why it is called the \"Evil Eye?\"",
	battle = "In front of tens and thousands of adoring fans... I must do my very best.",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "As long as your eyes are fixed upon me; Upon this stage I shall sing bravely.",
	vote = "",
	hp_warning = "",
	id = 401463,
	detail = "Countless days and nights of hard work congeal into a single flash of brilliance onstage. Like a shooting star, leaving only a fleeting trail of light—",
	couple_encourage = {}
}

