_G.pg.base.ship_skin_words[401465] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Hrmm... The more I clean, the more the dust grows. Will this battle never cease because dust yet remains on my tool's fleece?",
	mission = "",
	touch2 = "Oh, thank you. I was just thinking I needed a lift to reach that high spot.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Cast your eyes upon this bit of dust. As I was entrusted with the cleaning, I shall not allow this dust to remain. Will you also join me in this battle?",
	mail = "",
	touch = "The manjuus are doing their best to help out. I would appreciate it if you could do the same.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Cast your eyes upon this bit of dust. As I was entrusted with the cleaning, I shall not allow this dust to remain. Will you also join me in this battle?",
	feeling5 = "",
	main = "How does one eradicate something as infinitesimal yet as innumerable as dust? ...It's impossible? That, I cannot accept. To do so would invalidate my very existence.|The process of making things beautiful and pure through cleaning is wonderful indeed. Call upon me if there is some place you want cleaned.|\"If dust is allowed to remain, it will eventually become a mountain.\" Does this not mean that all the dust I sweep will also become a mountain? I cannot allow that, and that is why I must eradicate it all.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Upon my pride, this dust shall know no succor. Hm? Did I say something weird just now?",
	vote = "",
	hp_warning = "",
	id = 401465,
	detail = "Even Lord Bismarck's statue cannot be cleaned satisfactorily... Too ashamed am I to face my Iron Blood friends, but this war against dust, I shall not suspend.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[401990] = {
	feeling1 = "*sigh*... This is all you've got? You're nothing like the stories claim.",
	feeling3 = "I wish we shipgirls could all move underwater like submarines. Still, better to move freely on the water than to be stuck on land like you. Heehee~",
	lose = "How could I have messed up so badly?! This has to be some kind of mistake!",
	propose = "Whoa, whoa, whoa! This is WAY too sudden! I-I mean, not that I don't want to... No, that doesn't mean I don't mind! Ugh... You're obviously teasing me, but why am I fine with that?!",
	expedition = "The commission team has returned. Aren't you going to check what they brought back?",
	win_mvp = "I could do this with my eyes closed.",
	home = "How was your sortie? The breeze didn't get to your head, did it? Good to hear.",
	mission = "This mission should be a cakewalk for you, no?",
	touch2 = "W-wait, time out! Y-you can't be serious about this, right?!",
	voice_key_2 = -1,
	skill = "Think you can keep up with me?",
	drop_descrip = "Type 1937J-class destroyer – Otto von Alvensleben.",
	mail = "You're really so helpless you need your secretary to fetch your mail, huh... W-wait, didn't I get this just a minute ago?",
	touch = "Hmm? Wow, Commander, I never thought you wanted to do \"that\" with me~?",
	profile = "Feast your eyes. You're looking at none other than Type 1937J destroyer Otto von Alvensleben! Well, what do you think? Why are you being so silent? This is the part where you're supposed to heap praise upon me!",
	mission_complete = "You STILL haven't touched your mission rewards... It's nearly been a whole day now!",
	feeling4 = "Hey! Who left this thing lying in the corridor? Someone could trip and get hurt! ...I don't need your help! I'm not some klutz who stumbles everywhere she goes!",
	unlock = "Oh? I've heard no shortage of heroic tales about you, but you sure look spindly in person. Then again, I suppose it only makes sense for you chessmasters to be more brain than brawn. I'm Otto von Alvensleben, Iron Blood destroyer. Let's see what you can do.",
	feeling5 = "Hey, why don't we go on a date today? ...Did that really throw you for a loop? Hah, I knew it would... W-wait, you have a list of spots to go? You prepared all that in advance?! Ugh... Okay, you got me this time...",
	main = "Wrong document. Not this one either. Where is that damn... ARGHHH! Now they're all out of order!|You keep a bunch of spare uniforms around, don't you? 'Cause if you get splashed by a wave during a sortie, well... Heehee♪|Looks like some paperwork is too troublesome even for the legendary Commander~ Let me see at what's so hard about... Err, yeah, this is all nonsense to me...",
	battle = "I don't have time to waste on you small fry.",
	upgrade = "In a real rush to make me stronger, huh? Heehee♪",
	voice_key = 40199,
	headtouch = "What are you even trying to do?",
	feeling2 = "You're in luck, Commander. It's not every day someone as cute and talented as me joins your fleet. Heehee~♪",
	login = "Put your nose to the grindstone, Commander, and you may just impress your secretary.",
	vote = "",
	hp_warning = "Nobody warned me the enemy was THIS strong!",
	id = 401990,
	detail = "What's your deal? ...Oh, I know! You're madly in love, and now you can't take your eyes off me? You should've just said so~",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[401991] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Had your fun? Hmph, I can tell you've been messing around with a bunch of girls.",
	mission = "",
	touch2 = "Th-th-there's a line, and you've crossed it!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Hmph! You really think this brainless trap can keep me entangled forever? I don't need your help! I can break free by myself! ...Umm, what the hell? Why can't I do it?!",
	mail = "Yeah, you've got new mail... But do I look like I'm in any position to fetch it for you...?",
	touch = "St-stop shaking the vines!",
	profile = "",
	mission_complete = "You finished a mission? So? What's that got to do with my situation?",
	feeling4 = "",
	unlock = "Hmph! You really think this brainless trap can keep me entangled forever? I don't need your help! I can break free by myself! ...Umm, what the hell? Why can't I do it?!",
	feeling5 = "",
	main = "Why are you just standing there watching me? Is this funny to you– watching me struggle, trying to break free?|There's a sign outside, warning people to stay away because of traps? S-someone must've put that up AFTER I got ensnared! There's no way in hell I didn't see it!|Hmph. This isn't a problem if I imagine it's a quirky hammock. I'm resting here, that's all... Ugghh... G-get the sun out of my eyes...",
	battle = "No other choice– gotta fight like this!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Morning, Commander. I feel on top of the world today, so don't worry about me. Yeah, I... I'm totally fine...",
	vote = "",
	hp_warning = "",
	id = 401991,
	detail = "Grrr... Once I find out who's behind this prank, they'll have hell to pay!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[402010] = {
	feeling1 = "Alright, time for me to punish you.",
	feeling3 = "And I thought you were a good child, Commander... I guess you can still be trained... Hehe...",
	lose = "Tsk... Do we still not have enough anti-air?",
	propose = "Commander, you’re the best! The best what? Pet? Companion? Or maybe... lover~?",
	expedition = "The girls have returned from commissions. Please welcome them back in a timely manner.",
	win_mvp = "Hmph, so that’s all they amounted to.",
	home = "Good work, Commander. Let’s quickly review the previous battle.",
	mission = "Let's see what mission is up next.",
	touch2 = "Oh my? That’s not how you do it. Should I teach you the proper way to touch a girl?",
	voice_key_2 = -1,
	skill = "Hmm, do you want some lessons from me too?",
	drop_descrip = "Königsberg class light cruiser, Königsberg.",
	mail = "Remember to read new mail as soon as possible. It’s rude to make people wait.",
	touch = "Oh? You seem fairly energetic today. Let's do some more training.",
	profile = "I'm the first ship of the Königsberg-class light cruisers, Königsberg. I began serving in the Iron Blood Navy a long time ago.\nI've participated in far more training and transporting missions than actual combat, so feel free to refer to me as your teacher. Understood?",
	mission_complete = "Oh? Mission complete? Well done, Commander. Don't forget to collect your rewards!",
	feeling4 = "Hmm? I do you like you very much, in many different ways... I'm going to teach you all kinds of things from now on... Hehe...",
	unlock = "So you’re the commander? You have such a cute face! Hehe... let big sister take \"good care\" of you from now on~",
	feeling5 = "To train someone, the trainer must also give the trainee some love, otherwise... Yes, Commander, I love you. Come, let's continue. What should we try next?",
	main = "Making an expression like that... are you after some of big sister’s rough affection?|You should never ask about a woman’s age, Commander.|Whipping doesn’t actually hurt that much once you’re used to it. Want to give it a go?",
	battle = "It's time to see what we learned from our training... and make our enemies tremble before us!",
	upgrade = "I think I get the hang of it! Commander, come with me for a second!",
	voice_key = 40201,
	headtouch = "",
	feeling2 = "Hey! What were you trying to do? Don't be shy... just tell me.",
	login = "Now then, let us begin today’s training.",
	vote = "",
	hp_warning = "",
	id = 402010,
	detail = "Remember, it’s unwise to place too much faith into the numbers.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[402020] = {
	feeling1 = "I don't want to play with you anymore...",
	feeling3 = "I don't like being cooped up in the house, nor do I like that pesky Truant! When I look at it that way... isn't this my destiny?",
	lose = "Uu... I let my guard down...",
	propose = "I feel happy whenever I think about you, but I miss you whenever I can't see you. Overall, I'm still glad that I fell in love with you!",
	expedition = "The girls have returned from commission! Let's go welcome back our money- I mean... the girls!",
	win_mvp = "Eh? I won?",
	home = "Good work, Commander~! Why not take a break... and play with me!",
	mission = "Mission~ Mission~ It's time to make some money~!",
	touch2 = "Nya? Why do I feel so hot where you touched me...?",
	voice_key_2 = -1,
	skill = "I have a feeling this one's gonna hit!",
	drop_descrip = "Königsberg class light cruiser, Karlsruhe.",
	mail = "There's new mail! I wonder who it is?",
	touch = "Nyahaha! That tickles!",
	profile = "I am the second ship of the Königsberg-class light cruisers, Karlsruhe! I participated in battles as the flagship of an Iron Blood torpedo squadron. I hate cold weather, storms, and that pesky Truant...",
	mission_complete = "Mission complete! Hurry up, let's collect those rewards!",
	feeling4 = "My chest tightens whenever I think about you, Commander. Why is that?",
	unlock = "Hi, it's me, Karlsruhe! Please take good care of me, Commander.",
	feeling5 = "I asked my sister about it, and she said that this feeling is called \"love.\" It feels a bit painful, but it also makes me very happy.",
	main = "La~ la~ la~ When is the next battle?|Is.. is there a storm coming?|Boring~ boring! How do you expect me to stay quiet?",
	battle = "Let me show you my true power... Here I come!",
	upgrade = "I've found the strength to continue exploring afar. ",
	voice_key = 40202,
	headtouch = "",
	feeling2 = "Wow~! Are you here to play with me, Commander?",
	login = "Ehehe... I have a feeling something good will happen today!",
	vote = "",
	hp_warning = "",
	id = 402020,
	detail = "Ahaha~ Are you that interested in me,  Commander?",
	couple_encourage = {}
}

