_G.pg.base.ship_skin_words[402030] = {
	feeling1 = "Workplace harassment is a crime, Commander...",
	feeling3 = "I'm so glad that you are an approachable superior. I can't really handle short-tempered people.",
	lose = "Ugh... I failed again. P-please don't dismantle me...",
	propose = "With this... I can get much closer to Commander! A-ahem... it's nothing! Thank you, Commander, I won't let you down.",
	expedition = "Your fleet has returned from their commission. Should I join you for the inspection?",
	win_mvp = "Phew... This performance... should be acceptable?",
	home = "Good work, Commander. The next thing on the agenda is...",
	mission = "New missions have been posted. Shall I add them to today's schedule?",
	touch2 = "Commander... You realize that harrassing one's subordinates is despicable, right?",
