_G.pg.base.ship_skin_words[402070] = {
	feeling1 = "Oh dear. It seems Emden got carried away. Such a pity... Her only darling human, broken by her own hands.",
	feeling3 = "Insistent on being a disobedient little human, aren't you? \"I like seeing a sweet human struggle so. Heehee.\"",
	lose = "One can hardly call this a desired outcome, dear human. \"I get the impression you ordered a sortie without a moment of preparation.\"",
	propose = "Have you at long last learned your place? Heehee, as much as I enjoy seeing your cute struggling, you're more lovely when you submit♡ Now, lie in my cradle of love and embrace an eternal slumber. \"Emden will cuddle you forever and ever. You won't want to leave♥\"",
	expedition = "New supplies have arrived. A traveling swan needs sustenance – when her stomach growls, she has little choice but to \"borrow\" food from a passerby.",
	win_mvp = "The battle is over. All you who are out of Emden's range may now take your leave.",
	home = "You've returned to safety, now won't you close your eyes and rest? It's important that you get your beauty sleep, my darling human.",
	mission = "New orders from your superiors. Supposing that someday no one is left to give you orders, where will you go then, dear human?",
	touch2 = "Is this your way of saying that you long to be put in a cage? \"Do you wish to be flayed 'til your skin gives way to bone?\"",
	voice_key_2 = -1,
	skill = "Heeheehee♪",
	drop_descrip = "Dresden-class light cruiser – Emden.",
	mail = "You have a letter, dear human. Would you be good and read it aloud to Emden?",
	touch = "You would use force to subjugate a defenseless girl? Heehee, unfortunately for you, Emden stands on top, and you crawl down below, dear human. This is an unchangeable fact.",
	profile = "I am the Swan of the East, also known as Emden, the Dresden-class light cruiser. \"And I am Emden of the Königsberg class – member of the High Seas Fleet. We are Emden. Remember our name.\"",
	mission_complete = "Ah, mission rewards. Emden need not tell you how best to use them, right, my darling human?",
	feeling4 = "\"In truth, Emden has wanted to shackle you down from the outset, human.\" Obedience gained by force is worthless. I shall patiently wait for you to submit to me of your own accord, my darling human.",
	unlock = "Heehee, it is you that summoned Emden, isn't it, my darling human? I shall make real your every desire if only you surrender yourself. \"Heehee. Submit to Emden. Submit to us.\"",
	feeling5 = "One finds the world's greatest comfort not in a cage of steel, but in a cradle of love and submission. Have no fear, my darling human. Give your body and soul to Emden, and your woes and troubles will all disappear in due time♡",
	main = "Trying to make a human submit through force only gains you its resentment. Only by breaking the human's spirit can you make its whole being your own.|\"When you're at a loss, how about you get up and move instead of just sitting in your chair?\" Emden cannot bear to see you rack your brains all day, dear human. Heehee.|You, my dear hardworking human, deserve a reward. You are hereby granted the privilege of massaging Emden's shoulders. Use neither too little nor too much force, and henceforth, kindly do it without me telling you to first.",
	battle = "An entertaining battle awaits us♡",
	upgrade = "Thank you for this strength, my darling human. \"You make good decisions sometimes! Heeheehee♪\"",
	voice_key = 40207,
	headtouch = "Why do you stroke my head? That is something a master does to her pet. Perhaps what you did was the inverse of this idea?",
	feeling2 = "A lovable pet should not be unwaveringly obedient, but rather a source of continued delight to its master. \"Fawn on me in a way I enjoy, my sweet human♪\"",
	login = "Welcome home, my darling human. Where shall your conquest take you today, and what foes shall you smite?",
	vote = "",
	hp_warning = "If you wish to defeat Emden, you must use your every drop of strength♪",
	id = 402070,
