_G.pg.base.ship_skin_words[402080] = {
	feeling1 = "This is all my fault for wishing for a good Commander...",
	feeling3 = "None of my shells ever land. Even when I take another shot, it just misses. All I do is waste ammunition... *sigh*...",
	lose = "Sure enough, all battles I partake in end in defeat...",
	propose = "A promise ring?! B-but that'd make us both happy, when I explicitly... I see now. The wish must've come true because I wished for your happiness, not my own. Thank goodness... *sniffle*... I'm so glad it came true!",
	expedition = "The commission team is back. I'd better not retrieve the rewards, or some will magically disappear...",
	win_mvp = "I... I'm the MVP? You don't have to hold back for my sake... I just don't have what it takes to be the MVP...",
	home = "Welcome back. You came home safe and sound because I wished that you'd get battered and bruised. My wishes never, ever come true, you see...",
	mission = "Commander, here is the mission list. Whew...",
	touch2 = "Y-you flatter me...",
	voice_key_2 = -1,
	skill = "It won't matter if I can't hit them...!",
	drop_descrip = "Pillau-class light cruiser – Elbing.",
	mail = "I hope this letter has good news for you, and bad news for me...",
	touch = "Maybe I could help with... No, I'm good for absolutely nothing.",
	profile = "I'm Elbing, Pillau-class cruiser of the Iron Blood. I'm on the small side for a cruiser, and my service history is a disappointment. My armor is paper and my firepower is pathetic. My only redeeming traits are my speed and range...",
	mission_complete = "Mission rewards have come in. You should verify them, Commander. Making me do it is a bad idea...",
	feeling4 = "You've been kind to me this whole time not because I'm useful, but because you pity me, isn't that right? I only wish I could do anything in return...",
	unlock = "I'm Elbing, Iron Blood cruiser. I know you're going to shun me since I'm worthless in a battle... You're not going to do that? Ah, right... The only thing I have going for me is how disposable I am...",
	feeling5 = "Nothing I've sincerely wished for has ever come true. All I can do for you is this... I wish to be miserable! I wish to go through sorrows with you, Commander! ...This should bring you happiness.",
	main = "It could rain today. You see, when I say it's going to rain, the weather always turns sunny...|My rigging is so intimidating... Strong though it may be, it's no good in the hands of someone helpless like me.|After all my efforts, there's no less work than when I started... But if I give up, your workload might increase instead... Ughhh...",
	battle = "I'll take care to stay out of collision range!",
	upgrade = "Why strengthen me of all people...?",
	voice_key = 40208,
	headtouch = "Ahh...",
	feeling2 = "I'll state this upfront: I'm feeble, clumsy, cursed with terrible luck, and I doubt I'll be much of any use to you...",
	login = "No rain today, I assume? I see... So there was no point in me bringing an umbrella.",
	vote = "",
	hp_warning = "W-we're gonna collide!",
	id = 402080,
	detail = "Commander? Are you hurt? Not even a scratch? I just got worried you might have h-had an accident on the way here...",
	couple_encourage = {}
}

