	expedition = "You idiot! You still haven’t remembered what you forgot about yet?",
	win_mvp = "Hmph. Just today, I shall allow you to praise me a little.",
	home = "Idiot! If you had already returned, why didn’t you come to see me? Hah? Who would be worried about you?",
