	feeling5 = "Huh? Who would ever fall in love with you? I’m only here to drop off something I found during sortie, per regulations. Huh?! A ring? Who would wear something like that?!",
	main = "Blücher, I will definitely protect you this time.|Hah? A novice like you wants to challenge my cruiser-commanding skills?|Hah? Are the Schweinshaxe and beer ready yet? How many servings do we need? Idiot! Is your brain just an ornament?",
	battle = "Compared to Jutland, a battle like this is mere child’s play.",
	upgrade = "Hah? Did you think something like this would impress me?",
	voice_key = 40301,
	headtouch = "",
	feeling2 = "Huh? You can’t even do something like that? Are you an idiot?",
	login = "Idiot, so you rolled out of bed? Haah? What are you fantasizing about? I only happened to bump into you while patrolling the port.",
	vote = "",
	hp_warning = "",
