	voice_key_2 = -1,
	skill = "",
	drop_descrip = "W-well? Does this kimono look good on me? ...R-really? Duh, I know it looks GREAT on me! Who really cares what you think... C-can't be me... No, I didn't say anything!",
	mail = "There's a letter for you. Wow, that's a nice postcard... Never mind that, just read what it says already!",
	touch = "Huh?! Grabbing a girl's hand without warning is a great way to startle her! At least tell me first!",
	profile = "",
