	main = "I've heard this type of kimono is famous. Makes sense, considering how much skill an artisan needs to create patterns and colors this complex.|It's wonderful feeling the breeze on your skin after getting out of the hot spring. It's so soothing, so cooling. You know what I mean, right?|Hmph! Eugen can poke fun at me all she wants – this is NOT a date! She's not gonna be so smug when I gloat about how great the hot springs were. \"It was sooo good! I left feeling like a new person,\" and so on!",
	battle = "Thanks for making me work up a sweat!",
	upgrade = "Isn't this much to be expected?",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Which onsen do you want to go to today? I'd like to visit as many as possible so I can tell Eugen and the others all about the fancy places we've been to.",
	vote = "",
