	main = "Plebeian, fetch those two towels over there and wipe my body dry. |If your eyes wander any lower, they will get detached from their sockets. I say, there is no remedy for being uncultured swine~ |A lifebuoy? What would I use that for? Plebeian, were you not going to carry me on your back while swimming?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Way! Too! Slow! Are you trying to get my pristine skin sunburnt?",
