_G.pg.base.ship_skin_words[403043] = {
	feeling1 = "",
	feeling3 = "",
	lose = "I have a banquet to attend, so I have no time to let myself get dragged through the mud by you lot~",
	propose = "",
	expedition = "",
	win_mvp = "You should feel honored to have the privilege of being ravaged by the one-and-only Deutschland while she is in a good mood!",
	home = "Let's be clear here, I was not waiting for you. I simply can't show off the full extent of my grandeur as a master without the presence of my lowly animal.",
	mission = "Missions? What mission could possibly be more important than accompanying your master to the banquet?",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "I seem pleased? Of course I am. Why wouldn't I be when my sweet little sister will be joining us at the party? Now shape up and entertain your master, you lowly animal! Ahahahaha!",
	mail = "Getting mail right now sure spoils the mood. Let me see those!",
	touch = "Dancing? Aha~ I just knew you'd come to me with this request, so I prac... err, prepared beforehand!",
	profile = "",
	mission_complete = "Hmph... After seeing these rewards, I'll let you live.",
	feeling4 = "",
	unlock = "I seem pleased? Of course I am. Why wouldn't I be when my sweet little sister will be joining us at the party? Now shape up and entertain your master, you lowly animal! Ahahahaha!",
	feeling5 = "",
	main = "Lowly animal, you may offer your opinion about me and Graf Spee's dresses. Hmph, I bet your vocabulary doesn't include anything beyond \"cute,\" ahahaha! |Ehh? Graf Spee is actually talking to people from other factions...? I hope she's not being bullied... I'll have to give them a stern warning just in case... |Tell me, lowly animal, why does everyone greet me instead of cowering in fear? ...Because they like me? R-really... Hmph. As a spiritual leader, it's only natural to be respected by all!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Still sluggish as always. But because I'm in a pretty decent mood today, I'll forgive you!",
	vote = "",
	hp_warning = "",
	id = 403043,
	detail = "What belongs to my lowly animal also belongs to me. Therefore, the stronger my lowly animal's fleet is, the clearer the proof of my excellence is.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[403044] = {
