	expedition = "",
	win_mvp = "",
	home = "You lowly animal! For how long do you intend to ignore me?!",
	mission = "",
	touch2 = "Hahah, do you yearn for my punishment that badly, lowly animal?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Why are so many people out and about during a holiday? ...That's it! Lowly animal, was it your idea to prepare all this to surprise me...?! Heh... Hehe, that's right, don't you dare disappoint me!",
