	drop_descrip = "Huh? Why are you staring at me like I'm some weirdo? I'll have you know, it's not like I wanted to do this or anything!",
	mail = "Huh? Shouldn't you be in charge of vetting the fanmail?!",
	touch = "Haah? Who gave you permission to touch me?!",
	profile = "I'm the mightiest heavy cruiser in the world, Admiral Hipper of the Iron Blood. It's not like I wanted to do this or anything, I just had no say in the matter.",
	mission_complete = "Rewards, huh... It'd be better if Eugen wasn't constantly trying to get on my nerves...",
