	feeling5 = "So, what's next on the agenda? You should already know, right? ...If you know, then hurry up and spit it out! Screw you! Stop teasing me already...!",
	main = "Hey idiot, tell me what's next on my schedule! How long do you intend to keep me waiting? |Deutschland, it's fine to be proud of your sister, but have some self-control! ...Jeez, you're so lucky to have such a reliable sister... Meanwhile, look what I'm stuck with... |Huh? Who asked you to be my publicist? I'll earn my own fans!",
	battle = "I'm gonna show you what I'm made of!",
	upgrade = "Eugen, just you wait! I'll show you what I'm capable of!",
