_G.pg.base.ship_skin_words[403100] = {
	feeling1 = "You're such a lame-ass... I'm gonna go hang with someone else.",
	feeling3 = "Heya, Commander, I got those documents you asked for... Took longer than you expected? Yeah, uhh... I ran into Magdeburg and went jogging with her, then Heinrich and I played with Eisen, and after that... Yeah, I kinda lost track of time...",
	lose = "Retreating already? Guess I'll do the same...",
	propose = "Does this mean we're like, super duper besties? ...Even more than that? Huh... Super duper ultra mega besties then? Let's go with that, and promise each other we'll always be together~",
	expedition = "Hello? A commission's done. The girls brought back a ton of stuff, so I helped them out with it.",
	win_mvp = "K.O.! The enemies are all down for the count!",
	home = "Ever thought about setting up an outdoors office space, Commander? The warm sunshine and fresh air's waiting for you outside!",
	mission = "The mission list grows ever longer... I say we just put it through the paper shredder, honestly.",
	touch2 = "You can't go 'round doing this to girls, Commander.",
	voice_key_2 = -1,
	skill = "Adalbert, coming at ya!",
	drop_descrip = "P-class armored ship – Prinz Adalbert",
	mail = "Yo, your mailbox is full. Want me to empty it for you?",
	touch = "Mind helping out with my training, Commander?",
	profile = "Heya, I'm P-class armored cruiser Prinz Adalbert. All P-class ships are a force to be reckoned with, at least according to Heinrich. So yeah, if you need some nasties taken care of, just gimme a call~",
	mission_complete = "Hey, Commander, the mission rewards are piling up at the pier.",
	feeling4 = "Seeing other people happy makes me happy too~ That's why I love both helping people and hanging out with 'em equally. Other girls have said we're the same in that regard, you and I. You just love seeing people happy too, right?",
	unlock = "Made it safely to port! Time to have a look around. Question is, where to start... Hm? Are you the Commander? All right. 'ello, nice to meet you, and all that jazz. See you around~",
	feeling5 = "Sooo, how 'bout say we look around for people in need of a helping hand? There ain't no problem we can't solve together. And if nobody needs help, we can just hang out instead.",
	main = "This hourglass is real neat. Let's reset it and watch the sand go again. And again... Welp, that got old fast. Now 'scuse me while I go rummage through your desk for other cool gadgets.|Sheesh, that's a crazy amount of paperwork on your desk. Wait, can't we just feed 'em to the shredder and be done with it? ...No? Fine, I won't do it then.|Don't you ever feel fed up, doing the same task for hours at a time? I'd give up after like, thirty minutes.|You know how Heinrich nicknamed her rigging \"Eisen\"? I'm thinking about naming mine too.",
	battle = "Ho-kay! Warm-ups done, now let's do this thing!",
	upgrade = "Woo! Yeah! Feeling stronger already!",
	voice_key = 40310,
	headtouch = "Huh? I don't recall doing anything to earn a headpat, but okay.",
	feeling2 = "Let's start by checking out the depot. There's bound to be peeps there who need a hand or just wanna hang out.",
	login = "Come on. Time to get motivated, Commander.",
	vote = "",
	hp_warning = "My comeback is-a coming in round two!",
	id = 403100,
	detail = "Why're you always staring off in the distance, Commander? Got something on your mind? Maybe I can help you with it.",
	couple_encourage = {
		{
			{
				40309
			},
			1,
			"Smash through 'em, Heinrich!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[403101] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "Those girls you sent out are back? I'll whip up some drinks for them later.",
	win_mvp = "",
	home = "We're meant to be closed for the day, but I'm all ears if you've got any requests~",
	mission = "We've still got missions to do! See? You do need my help~",
	touch2 = "This stuff won't fly during open hours, ya hear?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Zzz... Huh? Did I doze off? I just meant to rest my eyes for a sec after closing up, but look how long I slept... Hang on, why are you still here, Commander?",
	mail = "Mail always finds its way to you wherever you go, huh?",
	touch = "I'm no marionette, ya hear!",
	profile = "",
	mission_complete = "Finished a mission, huh? I say you've earned yourself a drink.",
	feeling4 = "",
	unlock = "Zzz... Huh? Did I doze off? I just meant to rest my eyes for a sec after closing up, but look how long I slept... Hang on, why are you still here, Commander?",
	feeling5 = "",
	main = "Taking orders, moving dishes, and cleaning tables, that's this job in a nutshell. Never gets boring as long as you do 'em in rotation!|Honestly, not a fan of the liquor menu. All the drinks on there make my head spin...|Earlier today, I was caught gawking at my coworkers while they were mixing drinks. I was so distracted that Bismarck herself called me out for it.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Welcome, Commander! It's kind of odd saying \"welcome\" when I'm lying down, but hey.",
	vote = "",
	hp_warning = "",
	id = 403101,
	detail = "How'd I end up here, lying down on the counter...? Think I closed up shop then got all sleepy... *yawn*... Truth be told... I'm still pretty sleepy.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[403110] = {
	feeling1 = "Heehee. You may be a worthless, hopeless imbecile, but I still have use for you.",
	feeling3 = "There are certain things only you can do, so try not to become too dependent on me. Having said that... I wouldn't refuse if you offered to become my puppet.",
	lose = "How unfortunate... If only we had more backbone.",
	propose = "From planning the ceremony to sending out invitations, you left it all to me. Do I take that to mean you're ready to be mine? Say it, then. \"I take Yorck to have and to hold from this day forward.\" Let me hear that resolve, that desire of yours♥",
	expedition = "Those girls have returned from their commission. You commanded them wisely. Heehee.",
	win_mvp = "What will you do next? Keep advancing, or call it quits and pull back?",
	home = "Welcome back. Next time you bring me on a sortie, please make it as good as the one just now was.",
	mission = "It's of no concern to me if some missions sit and gather dust, but what's your plan for them, Commander?",
	touch2 = "Oh, I see... You want the same done to you, hmm♥",
	voice_key_2 = -1,
	skill = "Hope you like being chopped to pieces. Heehee♪",
	drop_descrip = "Roon-class armored cruiser – Yorck.",
	mail = "There's a letter for you. The most I can do is hand it to you, sadly. Heehee.",
	touch = "Hmm? Are you trying to chat me up, or issue an order?",
	profile = "I'm Yorck, Iron Blood cruiser. While I've hardly a single feat to boast about, I have many strengths I can offer you. It's your choice whether or not to accept them, though♪",
	mission_complete = "Letting the mission rewards pile up to collect them all in one fell swoop once is more satisfying, don't you agree?",
	feeling4 = "You really have a charismatic aura that draws people in. It's why you're deserving of my loyalty... or should I say, my love. Heehee.",
	unlock = "The name's Yorck – I'm a cruiser. As of today, I'm in your hands. State your orders, and I will make my goals and desires one and the same as your directives. A wonderful arrangement, no? Heehee.",
	feeling5 = "Isn't it high time you picked the location of our next date? You are the Commander, your job is to lead us shipgirls. Or would you rather I gave you a list of candidate locations, as per usual? ...W-well? Which will it be?",
	main = "Spee, if it's friends you want, I can be yours. We'll have so much fun together. Heehee♪|That I serve someone is all that matters, not whom I serve. It could just as well be Emden as it could be you. Though admittedly, very few are able to command me.|You look strapped for work, which I'm quite happy about. The more things I do for you, the easier your job becomes. Isn't that the best arrangement one could want?",
	battle = "Time to earn your paycheck, Commander.",
	upgrade = "Why, you... I must say, I'm pleasantly surprised. Heehee.",
	voice_key = 40311,
	headtouch = "",
	feeling2 = "Kindly tell me if there's something you want me to do. Likewise, I'll suggest new things I can do as I come up with them.",
	login = "Excuse me for being so early, heehee. Now, show me that leadership of yours and make me happy.",
	vote = "",
	hp_warning = "Seems like covering our rear is my only strong suit.",
	id = 403110,
	detail = "You're free to regard me as a tool – a means to exert your power. Heehee. I don't mind.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[403111] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "You expected anything different? Victory is par for the course when you're a Goddess.",
	home = "Oh my. You've returned with a small navy's worth of glory. That's my Commander.",
	mission = "",
	touch2 = "Oh. Oh my...",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "\"Foolish, pitiable creature. Kneel before your Goddess!\" Heehee! Hahahah, ahahahaha♥ You're the Commander, silly. You don't need to play along unless you want to.",
	mail = "",
	touch = "Should it not be you who decides what to do, not me?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "\"Foolish, pitiable creature. Kneel before your Goddess!\" Heehee! Hahahah, ahahahaha♥ You're the Commander, silly. You don't need to play along unless you want to.",
	feeling5 = "",
	main = "Let's put Deutschland to the test and see who compels the most people... No, I meant between her and you, Commander.|A vampire hunter, you say? I wonder whether Seydlitz could make it all the way here without your aid.|nil",
	battle = "There shall be left no trace of your existence.",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Your office chair pales in comparison to my throne. Don't you want to sit on it for yourself?",
	vote = "",
	hp_warning = "",
	id = 403111,
	detail = "Acting as though I control you is surprisingly enjoyable. Thank you for this one night of indulgence, Commander.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[403120] = {
	feeling1 = "Sigh... what an absolute disappointment.",
	feeling3 = "The Commander was still working when I got up from my nap. I wonder if they're getting enough rest... Well, it doesn't look that bad at least.",
	lose = "So this is what defeat tastes like... Don't expect this to happen next time...!",
	propose = "Do you really need to ask me about my response when you should know what it is already? \"The promised future I'd like to fulfill with you...\" ...I can't hear you. Come on, speak louder! Even louder than that!",
	expedition = "Looks like they're done with commissions. I wonder if they'll take me with them if I ask nicely...",
	win_mvp = "This doesn't feel half bad. Teehee☆",
	home = "Commander, don't you think it's about time for snack time? Hehehe, keep it coming.",
	mission = "Here's a new mission. Let me know when you want some help.",
	touch2 = "This is what people mean when they say, \"You can't judge a book by its cover.\" Hehehe~",
	voice_key_2 = -1,
	skill = "Hehe, seems like a good time to use this.",
	drop_descrip = "Admiral Hipper-class heavy cruiser – Prinz Eugen",
	mail = "There's some new mail. Make sure to check on it before you end up forgetting.",
	touch = "Whew... That shower left me feeling super refreshed... Yawn... Commander? Did you want to take a nap together?",
	profile = "I'm Prinz Eugen, third ship of the Admiral Hipper class. I like to read books all day since I'm still too young to go outdoors much. Uhh, I don't like beer... Is there anything else you wanna know?",
	mission_complete = "You're sharing the reward with me? Thank you.",
	feeling4 = "If nobody told you to stop working, you'd just keep working without rest, so I'll let you know when it's snack time. Got it? I want you to take a break, and I also want to eat some snacks.",
	unlock = "Are you the Commander? I'm Prinz Eugen, Iron Blood heavy cruiser. Let's shake hands and be friends~ I'm looking forward to having a lot of fun. Heehee~",
	feeling5 = "Thank you for telling me all these interesting stories. One day, I want to head out to the huge ocean, and see all kinds of sights. Of course, you'll be with me when I do, won't you? ...Hehehe, I'm looking forward to it.",
	main = "Alright, all that's left to do is put my finger on my lips like this... Tehehe, seeing your expression made putting this pose on completely worth it.|I can't wait until the day I can set sail with my friends... I mean, it's boring, spending all day stuck in here...|I don't get what people find tasty about alcohol. Even smelling the stuff makes me feel all dizzy.",
	battle = "I'm giving it my all!",
	upgrade = "That felt nice. I'll expect more from you next time.",
	voice_key = 40312,
	headtouch = "Treating me like a child... I see. Then come at me with all you've got.",
	feeling2 = "Commander, got anything to spill about the recent mission? I mean, it's been pretty boring only reading books these days. So, has anything interesting happened?",
	login = "Good morning. Good luck with your work. I'll be here reading a book until you finish.",
	vote = "",
	hp_warning = "It's not over yet...!",
	id = 403120,
	detail = "When I look at Hipper, I tend to get the feeling that I'm more mature than she is... Is it just me? Look, Hipper's getting all sulky again♪",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[403130] = {
	feeling1 = "Please, Commander... don't leave me all alone...",
	feeling3 = "Ajax is a good friend. We play together all the time. But Deutschland says she's a big meanie... Also, what does it mean when Ajax calls someone her \"piggy\"?",
	lose = "Ugghh... I wanna go home, Commander...",
	propose = "Weee! I'm flying! Now I'm even taller than you! ...There we go... Hehehe, um, can you keep hugging me? Also, you have to super-duper promise you'll always stay with me!",
	expedition = "Wow, look at all these rewards! Are these all from the commission team?",
	win_mvp = "We've taken out all the baddies, Commander. That means there's no one left to bully us.",
	home = "Zzz... Mgh... Commander... When will you be back...?",
	mission = "Will you stay with me after our missions are done, Commander? I-if there are still lots to go, then forget I asked...",
	touch2 = "Um, Deutschland said she'll tear you limb from limb if you touch me here... I-it's okay, I'll make sure she doesn't!",
	voice_key_2 = -1,
	skill = "Don't bully my friends!",
	drop_descrip = "Deutschland-class armored cruiser – Admiral Graf Spee.",
	mail = "Here's a letter for you, Commander. Darn it, the envelope is so small it's hard to hold on to...",
	touch = "Give me another hug, Commander! Hehehe...",
	profile = "I'm Admiral Graf Spee, Deutschland-class armored cruiser of the Iron Blood. I'm stronger than regular heavy cruisers because I've got a bigger bore than them!",
	mission_complete = "A mission's been completed? Alright! I wonder if I'll ever get to help with them one day...",
	feeling4 = "Thanks for always being here for me, Commander! I've made tons of friends, and I'm getting better at fighting... Life here is so much fun! Hehehe, can I give you a hug as thanks? Hehehe~",
	unlock = "Hi. I'm Admiral Graf Spee, from the Iron Blood. Umm... I hope I can make lots of friends here... Will you be my friend, Commander?",
	feeling5 = "You're my best friend and I love you, Commander! I wanna pinky promise with you that we'll be friends forever! But I guess that'd be hard since my hands are so big... Okay, how about shaking my pinky instead?",
	main = "You're so focused on work that we barely have time to play... *sigh*... But I know I shouldn't annoy you, because I'm a good girl!|Commander, put this on. There we go! Now you can use steel hands of your own!|Talking to my friends is fun! We talk about food, funny stories, and even... Hehehe, well, everything!|Oh, it's totally empty... Um, this bag of snacks, I mean. The crunchy cones. Can I go to Akashi's store and buy more? Please?|World's... Cutest...? Deutschland, why do you have this sign?",
	battle = "I'll do whatever it takes for my friends!",
	upgrade = "I'll use this new strength to protect my friends!",
	voice_key = 40313,
	headtouch = "Whuah! Y-you surprised me there...",
	feeling2 = "You're the first friend I've made since I came here. Hehehe, I thought you'd be too scared of my big steel hands. I try to only use them to scare bad people.",
	login = "Oh, welcome back, Commander. I'm glad I'm not alone anymore. Hehehe...",
	vote = "",
	hp_warning = "I, I can't take much more...",
	id = 403130,
	detail = "I'll keep you safe when danger shows up. That's just what friends do for each other!",
	couple_encourage = {
		{
			{
				40304
			},
			1,
			" You don't need to watch over me all the time...",
			0
		},
		{
			{
				20203
			},
			1,
			" You're not a meanie... right?",
			0
		},
		{
			{
				20404
			},
			1,
			" W-will you be my friend?",
			0
		}
	}
}

_G.pg.base.ship_skin_words[404010] = {
	feeling1 = "Cowards have no right to stand on the battlefield!",
	feeling3 = "You've got a pretty nice fleet here. Being here makes me feel like giving it my all.",
	lose = "I won't lose next time!",
	propose = "Don't worry. For the fleet, and for you, Commander, I'll learn to protect myself and be less reckless than before. But, as always, please continue counting on me for combat!",
	expedition = "A commission has been completed. Seriously, you ought to let me and my little sister handle this stuff.",
	win_mvp = "If there's anything worthy of my trust, it's my cannon!",
	home = "Not bad at all. Seems like you're getting used to battle.",
	mission = "Missions? Let's take care of them in one fell swoop.",
	touch2 = "Stand right there, Commander. If you can take a shot from me, I'll forgive you... ",
	voice_key_2 = -1,
	skill = "Anton, Bruno, Caesar... Cannons at the ready!",
	drop_descrip = "Scharnhorst-class battlecruiser, Scharnhorst.",
	mail = "You've got mail, Commander. You're quite the popular one, aren't you?",
	touch = "I'll never back down!",
	profile = "I’m Scharnhorst. I will stand until the last moment of any battle. This is my determination, as well as my pride. Leave all the fighting to me!",
	mission_complete = "Rewards? Hah, now that's what I'm looking forward to.",
	feeling4 = "Hey there, Commander! I just went to train with the other girls. Everyone is full of energy, all thanks to how reliable you are. I'm really taking a liking to this place.",
	unlock = "In Scharnhorst's dictionary, the word \"retreat\" simply doesn't exist! You're the Commander? Let me see what you've got.",
	feeling5 = "I've never retreated - not because I'm fearless, but because I've always had a reason to keep fighting. In the past, it was for the Iron Blood. Now, it's for your sake, Commander... I mean, your fleet's sake!",
	main = "Those lightweight aircraft carriers simply can't match our combat abilities!|Do me a favor and remind our friends not to sail directly in front of me... I might not be able to resist firing at them...|\"The Ugly Sisters\"? Hmph, it's not a bad name... Sounds like a good name for this war, too...",
	battle = "Let us trample the shattered remnants of our enemies!",
	upgrade = "I'm looking forward to the next battle!",
	voice_key = 40401,
	headtouch = "",
	feeling2 = "If only I didn't need to care about anything other than becoming stronger or defeating more enemies. But, reality isn't so simple...",
	login = "You're back? Good timing. I'm just about to test my guns.",
	vote = "",
	hp_warning = "I shall fight until the last bullet!",
	id = 404010,
	detail = "Only those who have not been scarred would laugh at someone else's.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[404011] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Looks like you're busy as ever, even during the holidays.",
	mission = "",
	touch2 = "Well, well, guess you're raring to play with my grimalkin.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "A festival, huh? Going for days without fighting is boring, not to mention not my style. C'mon, Commander, isn't there *something* exciting I can do during this \"Lunar New Year\" festival?",
	mail = "",
	touch = "If a *snowball* fight is all we're doing then I'll pass.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "A festival, huh? Going for days without fighting is boring, not to mention not my style. C'mon, Commander, isn't there *something* exciting I can do during this \"Lunar New Year\" festival?",
	feeling5 = "Whenever I stop and think about what I can *do*, besides charging into battle, it makes me feel just slightly uneasy... But I believe I'll find the answer someday, as long as I'm with you.",
	main = "Firecrackers? If you need something flashy and loud, why not do it with a cannon salute instead of those toys? It's more impressive, to boot.|I'm really fond of the intense gaze my grimalkin has. Hahah, relax, she's a good girl. Just don't get on her bad side.|The Royal Maids are helping out with the cooking? Hmph, that head maid sure has a finger in every pie.",
	battle = "Just so happens I'm bored. You maggots are gonna fix that!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Haahh... Guess it *is* true that sitting for too long makes you feel tired...",
	vote = "",
	hp_warning = "",
	id = 404011,
	detail = "Gneisenau \"convinced\" me to wear this dress and do \"something unrelated to fighting for once.\" She didn't really let me decline. That's the long and short of it. ",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[404020] = {
	feeling1 = "I assumed you were more intelligent, Commander...",
	feeling3 = "\"The Ugly Sisters...\" Though we were given that epithet for our achievements, it still hurts a little. Commander, do you think I'm ugly?",
	lose = "I let my guard down...",
	propose = "A promise, huh? Long ago, I would have despised the notion of being tied down to emotions... but it doesn't seem so bad now.",
	expedition = "A commission has been completed! Care to inspect the results?",
	win_mvp = "Sorry, this is war. There's no room for mercy.",
	home = "Welcome back. Please take it easy for a while.",
	mission = "A mission? Let me do some planning for you...",
	touch2 = "Commander, Anton is locked on, you can't escape now. ",
	voice_key_2 = -1,
	skill = "... Now you're in range!",
	drop_descrip = "Scharnhorst-class battlecruiser, Gneisenau.",
	mail = "Commander, there's mail for you. I'll leave it here.",
	touch = "Isn't it amazing how different people can come to different conclusions about the same topic?",
	profile = "I'm Gneisenau. Though I'm not as bellicose as my sister, I'm still confident about my combat capabilities. As some of the best ships the Iron Blood has to offer, we hold the record of being the only battlecruisers to sink a standard aircraft carrier. Your faith in us will not be misplaced.",
	mission_complete = "Rewards distributed. Please accept them when you have a moment.",
	feeling4 = "Without realizing it, I've come to enjoy supporting both my sister and you, Commander.",
	unlock = "Hello, Commander, I'm Gneisenau. Though my big sister is a bit reckless, we're actually an invincible team. I hope I will be able to sail with her as often as possible!",
	feeling5 = "The present flies by like an arrow, but the future always arrives too late. I hope that one day, I will be able to see the future that you and I create.",
	main = "You mustn't put off until tomorrow what you can do today. Please take that to heart.|One forgets the cruelty of war after being at peace for too long. The opposite... is true as well, isn't it?|Looking back at it, it's unbelievable that I would mistake that prideful princess as an old-fashioned knight.",
	battle = "Truth only exists within the guns' range.",
	upgrade = "It's fine as long as you haven't let power cloud your judgement...",
	voice_key = 40402,
	headtouch = "",
	feeling2 = "Is it urgent? I prefer simple and effective forms of communication.",
	login = "Welcome back. Ready to get back to work? I've prepared everything you need, Commander.",
	vote = "",
	hp_warning = "All ships, remember to stay alert!",
	id = 404020,
	detail = "My duty is to support my big sister who is always charging too far ahead. Admittedly, it gets a little irritating at times.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[404021] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
