_G.pg.base.ship_skin_words[404030] = {
	feeling1 = "This is all because I'm a worthless maggot... Commandant, I beg for your forgiveness!",
	feeling3 = "I have complete faith in your decisions. Except... the worry that my service isn't all you hoped for lingers in the back of my mind. But, rest assured, it will not hinder me in combat!",
	lose = "I failed by not following my orders... What a disgrace!",
	propose = "While I am overjoyed by your offer of marriage, I'm worried if my answer won't be to your– No! Of course I'm not turning you down! What I mean is, I don't know whether to say \"gladly,\" or \"I love you.\" You may decide if you'd like, Commandant!",
	expedition = "The commission team has returned to port! Commandant, please have a look!",
	win_mvp = "Commandant, your in-person commanding was a thing to behold! Frankly, however, I don't believe I can say the same of my own performance...",
	home = "A salute to your return, Commandant! Phew... I take it your battle was an honorable one, as always?",
	mission = "You have unfinished missions, Commandant! It may be wisest to do the newest ones first.",
	touch2 = "C-Commandant?!",
	voice_key_2 = -1,
	skill = "You will not sink me! I won't allow it!",
	drop_descrip = "Battlecruiser – Seydlitz.",
	mail = "Salute! I've brought your newly-arrived letter!",
	touch = "Salute! Your orders, Commandant!",
	profile = "I am Seydlitz, Iron Blood battlecruiser! My tenacity is my pride, my conquests are my glory, and executing your orders is my mission! I await your orders, Commandant!",
	mission_complete = "You have received mission rewards! Whew... I'm glad it went off without a hitch. Outstanding work, Commandant.",
	feeling4 = "Spend my day off however I want...? While that does sound nice, I'm not sure what I want to do is good in your eyes, Commandant... But if that's your order, I will follow it!",
	unlock = "Salute, Commandant! Iron Blood battlecruiser Seydlitz reporting in! Inexperienced though I may be, as of today I am proud to serve this port in the pursuit of honor and glory!",
	feeling5 = "Y-you wish to go on a date? With me, of all people? ...Forgive me, I should not question an order from you, Commandant! I will make every step towards ensuring a thoroughly enjoyable date!",
	main = "Lützow! Stop that before you distract the Commandant! ...Well, Commandant, I do believe getting distracted is a bad thing...|I've no grand ambitions of being hailed as a hero. My heart's only desire is to serve you faithfully, Commandant.|People who doubt their comrades deserve to be shunned. If they must doubt anyone, it should be themselves.",
	battle = "Achtung! Reduce them to scrap!",
	upgrade = "You've made me stronger, Commandant! You have my thanks!",
	voice_key = 40403,
	headtouch = "Salute! What are your orders?",
	feeling2 = "If you'll forgive my audacity, I have a request. Commandant, please give me more orders! I will do anything you require of me!",
	login = "Salute! I put my faith in your guidance as always, Commandant!",
	vote = "",
	hp_warning = "Miladies! Take cover behind me!",
	id = 404030,
	detail = "Commandant, I do understand our mission at this port, but I hope to one day move up and fight for humanity's– Forgive me, I should have held my tongue.",
	couple_encourage = {
		{
			{
				4
			},
			2,
			" Miladies! Allow me to protect you!",
			3
		}
	}
}

