	mission_complete = "Mission complete. Why're you giving me that look? You're the one who got it done, not me.",
	feeling4 = "Can't you, you know, ignore a schedule if there's a ton of work on it? ...No? A schedule sounds pretty awful then. Just do like me and do whatever you want~",
	unlock = "*yawn*... Hm? Who are you? Can you point me to the Commander? ...YOU'RE the Commander? Heehee, all right, saves me the effort of looking for you. I'm Lützow, Iron Blood battlecruiser. Since we're done here, I'm gonna take my leave~",
	feeling5 = "Hey, Commander, how about we run away together? ...I'm just kidding with you. Don't get all worked up. All I want is for you to forget all your troubles when we're alone together~",
	main = "Why won't you let me sleep in the office? Because that interferes with your work? Huh... And that's a bad thing?|Hey, show me what you're working on... It's just a bunch of random charts and numbers. 'Kay, have it back.|If you can't find me in the office, I'm likely out and about somewhere. Don't worry, I'll be back before you know it. Probably.",
	battle = "Ugh... What did I do to deserve this big-ass responsibility...",
	upgrade = "Hm? Am I stronger now? Doesn't feel like it, honestly.",
	voice_key = 40404,
	headtouch = "I'm not sleepy. That was just a li'l yawn... *yaaawn*...",
	feeling2 = "Don't feel like doing a dang thing today... Hey, Commander, what do you do to get through the day when you've got no energy?",
	login = "G'morning. Hey, can I sit down a li'l longer? This chair is just too comfy.",
	vote = "",
	hp_warning = "Nuh-uh, I don't feel a thing!",
