	feeling5 = "In front of my compatriots, I always had to be adamant, solemnly spearheading the march of the Iron Blood. To be the leader of the Iron Blood's indomitable fleet, I had to lock away the Bismarck that struggled to express herself... But when I'm with you, Commander, I can set aside that burden, just for a little bit...",
	main = "Commander, would you invite Tirpitz for me? Apologies, I'm... still not sure how to ask her myself. |I can keep a lot of people satisfied merely by sitting here with a smile... but only because of my status as the fleet leader of the Iron Blood. |As a leader, I must sometimes say and do things that I do not believe in. Commander, I hope you never lose sight of who you are.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "How's your work coming along, Commander?",
	vote = "",
	hp_warning = "",
	id = 405011,
	detail = "Apologies, Commander. Am I acting differently from usual? At times, I don't even know which is the real me...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[405012] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "Looks like the fleet has returned from their commissions... Thiele, I'll leave them to you.",
	win_mvp = "Data collection is complete. Take solace in the fact that you'll be useful after your demise.",
	home = "This cup is a prize for the hero who has graciously returned from the battlefield.",
	mission = "A new mission... I wonder who would be the best fit for it.",
	touch2 = "...*sigh*...",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Welcome, what would you like to order? ...If you want, we can drop this charade. I'm not used to being a waiter anyway, so I prefer it this way. Hehe.",
	mail = "Here's your mail. I... hope it's not an order of coffee from Mainz...",
	touch = "Eugen did tell me she wanted me to try this \"physical contact\" thing with you.",
	profile = "",
	mission_complete = "The remunerations for the missions we've completed are here. I'm sure Graf and the others will be ecstatic to hear.",
	feeling4 = "",
	unlock = "Welcome, what would you like to order? ...If you want, we can drop this charade. I'm not used to being a waiter anyway, so I prefer it this way. Hehe.",
	feeling5 = "I never thought I'd be standing in front of you in this outfit like this. Still, whether it was fated or not, I'm glad that you were able to see a different side of me... Hm. This cup's on me. Please, enjoy yourself, hehe.",
	main = "Truthfully speaking, this outfit feels more like that of a waitress than that of a maid... Though, I've been told there's not really much of a difference...|Tirpitz, compile today's sales data and send it to Friedrich. Figuring out what to do with the data we've collected is her specialty.",
	battle = "I can take on any number of them!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Oops, I almost wrote down \"the usual\" for your order... Ahem, what would you like?",
	vote = "",
	hp_warning = "",
	id = 405012,
	detail = "I feel far more at ease here than when I'm busy with research or the Iron Blood. I really hope that you feel the same way that I do.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[405020] = {
	feeling1 = "In the end... are you just another incompetent fool, unable to command me?",
	feeling3 = "Those who have nothing to lose also have nothing to fear... But is this kind of bravery really anything to be proud of?",
	lose = "So this is... the frustration that comes from failure and fear.",
	propose = "Ahh... so this is the warmth of one's beating heart... It's melting the cold and despair remaining within me. Danke sehr, Commander. The \"Queen of the North\" is no longer alone.",
	expedition = "The commission seems to be complete... Next time, why don't you let me go? I'm a little curious.",
	win_mvp = "So this... is the taste of victory.",
	home = "Commander, you should show your face on the battlefield more often. If you stay behind your desk for too long, you may one day forget the meaning of life.",
	mission = "Finish your missions properly. Perhaps you will one day realize the joy of having any purpose at all.",
	touch2 = "I'll think of how to deal with you later.",
	voice_key_2 = -1,
	skill = "Checkmate.",
	drop_descrip = "Bismarck-class battleship, Tirpitz.",
	mail = "More mail for you... Ah, I'm envious.",
	touch = "Are you cold?",
	profile = "It's a bit hot... Ah, sorry. I am Tirpitz. Because I was stuck in the north by myself for so long, people suddenly started calling me the \"Lonely Queen of the North.\" If you think it's a good nickname, then you do not fully understand... how soulless those words are.",
	mission_complete = "Mission rewards... how nice.",
	feeling4 = "The worst feeling in the world is not knowing whether to continue waiting or to give up hope. Commander, are you someone worth waiting for?",
	unlock = "I was imprisoned in the north for so long, unable to return home, and now you want me to follow you? ...Very well. It is up to you to show me the world.",
	feeling5 = "Ahh... I see. I thought I was used to the cold and embraced it, but that was just because I had forgotten the joy of human interaction and the warmth of being with someone... But now I remember...",
	main = "Big sister... Now that you mention it, I think I might actually have one... Ah... I've already started to forget.|Can you comprehend how it feels to watch the battlefield from afar, unable to do anything but lament the cruelty of war?|Strategic reasons? I was installed with cannons... but they were never meant to be fired. Ironic, isn't it?",
	battle = "Commander, I shall fight for your sake.",
	upgrade = "If you have no opponents, all the might in the world is meaningless.",
	voice_key = 40502,
	headtouch = "",
	feeling2 = "I have already grown used to the cold solitude of the North. At this point, it's natural for me to have no expectations.",
	login = "Once you get used to waiting, you lose sight of what you were waiting for.",
	vote = "",
	hp_warning = "No one would protect those who asked for their own destruction.",
	id = 405020,
	detail = "Choose your enemies carefully, Commander.",
	couple_encourage = {
		{
			{
				40501
			},
			1,
			"Sorrow is a mask unbefitting your countenance, sister.",
			0
		}
	}
}

_G.pg.base.ship_skin_words[405021] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "",
	mission = "Even I can't get fired up about doing missions during the summer... because it's too hot...",
	touch2 = "Even though it's summer... there are still some things you shouldn't do...",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Summer... In the past, it was always just a hot and stifling season... But now...? Doesn't my outfit tell the whole story? Let's get going, there's bound to be a lot of people on the beach.",
	mail = "",
	touch = "It's a bit stuffy... Commander, would you mind turning up the air conditioner?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "In the past, I never saw summer as more than a hot and humid slog... But now? My outfit probably says it all... Let's go, everyone's already waiting for us at the beach.",
	feeling5 = "",
	main = "As long as you're by my side, even looking off into the horizon is meaningful. |Some of my colleagues seem to mistake me for some unapproachable ice queen... Perhaps playing beach volleyball with them would help... |The sunset and the beach at night are wonderful views. When you're done with work, want to accompany me for a walk along the shore?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Commander, there's no need to rush yourself. There is meaning in simply waiting for you.",
	vote = "",
	hp_warning = "",
	id = 405021,
	detail = "Commander, enjoy yourself to the fullest. Our hard-fought battles are for the sake of peaceful moments like these... and our hard-earned breaks provide us with will to keep fighting.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[405022] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "Commander, it seems like another commission has been completed. Go ahead and take care of it; I'll be waiting for you right here.",
	win_mvp = "If she was here... how would she have fought this battle?",
	home = "Commander, do you wish to know how I feel about Bismarck?",
	mission = "Do we have new missions? Don't worry, Bismarck won't mind waiting a bit longer.",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "I bet Bismarck must've been thinking about how to invite me to the party, but ended up asking you to do it, Commander. Hehe... Let's get going soon. It's best not to keep her waiting.",
	mail = "We're getting all these requests to dance with you, Commander. Maybe I should put in one as well?",
	touch = "",
	profile = "",
	mission_complete = "Commander, we don't have too many of these banquets, so don't get too anxious about work. Let's have something to eat first.",
	feeling4 = "",
	unlock = "I bet Bismarck must've been thinking about how to invite me to the party, but ended up asking you to do it, Commander. Hehe... Let's get going soon. It's best not to keep her waiting.",
	feeling5 = "",
	main = "In the past, the word \"sister\" meant nothing to me. But the moment I laid eyes on her, I knew in my heart... Yes, she is indeed my sister. |Behold, she basks in everyone's adoring gaze as they orbit around her upon the resplendent firmament of the stage, as if she is the center of the universe... But you and I both know, that is not where she wants to be. |Waiting for her to find us instead of taking the initiative to find her might be a bit of my nasty streak showing, but I'm still the little sister here. I have that right, don't I?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "So you've come, Commander. Don't be anxious, the night is still young.",
	vote = "",
	hp_warning = "",
	id = 405022,
	detail = "Truthfully, I still have a hard time conversing with Bismarck... But at least now, time is on our side. There will be plenty of things for us to talk about in the future, wouldn't you agree?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[405023] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "",
	mission = "",
	touch2 = "*sigh*... Could you please mind your manners in public?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "They have a peculiar way of wishing a happy New Year in the Sakura Empire. In line with their traditions, I've put on this new outfit. I hope it doesn't... look strange on me. ...You like it? I see... That being the case, I'll keep wearing it for the time",
	mail = "",
	touch = "It feels warm... A nice change of pace.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "They have a peculiar way of wishing a happy New Year in the Sakura Empire. In line with their traditions, I've put on this new outfit. I hope it doesn't... look strange on me. ...You like it? I see... That being the case, I'll keep wearing it for the time",
	feeling5 = "",
	main = "I must give my regards to my sister... But how I should face her, I do not know. Could you come with me, Commander?|Alabama proposed playing a type of badminton enjoyed around New Year's. I suppose that could be fun. ...The loser will have ink rubbed on their face? On second thought, I will pass.|I've long been used to the cold, but sometimes, I find myself reaching out towards the warmth... Commander, can I... come a little closer? ",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "I waited for you, Commander. Now let us go and wish everyone a happy New Year, before aircraft come chasing after us.",
	vote = "",
	hp_warning = "",
	id = 405023,
	detail = "My Sakura Empire friends told me that the pine tree is like an anchor point for the gods. Much like what you are to me, Commander... Oh, just talking to myself. Hahah.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[405024] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "This ends now.",
	home = "Welcome back, Commander. While I'm used to being kept waiting, being kept in suspense is something I can scarcely put up with.",
	mission = "",
	touch2 = ".........",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "It's all right, I just got here myself. I will say, it's strangely reassuring to know I'm not the only one nervous on this day.",
	mail = "",
	touch = "You should sit down if your feet ache. It's true Bismarck overexerts herself, but that's no reason for you to do the same.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "It's all right, I just got here myself. I will say, it's strangely reassuring to know I'm not the only one nervous on this day.",
	feeling5 = "",
	main = "Having you all to myself fills my heart with joy, even when we're simply killing time.|I used to envy Hipper's and Eugen's closeness. Now Bismarck and I get along better than ever, thanks to you.|Indeed, this is a happy reunion. Having something to look forward to can warm the heart on even the most frigid winter nights.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "No need to rush, Commander – we have plenty of time. If there's one thing I'm used to, it's waiting.",
	vote = "",
	hp_warning = "",
	id = 405024,
	detail = "I cannot picture Bismarck going out on a date... I know I'm the one who asked you to come, but I didn't foresee she and I both would be so lacking in social grace.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[405030] = {
	feeling1 = "You sowed these seeds yourself. It's your mess to clean up, not mine.",
	feeling3 = "Working for you is not the same as trusting you. The fact that you can command so many people... Or rather, be adored by so many, means you of all people should understand.",
	lose = "I'll back off since we lost, but don't count on it happening again.",
	propose = "Embrace it, drown in it... Just as you put the curse of trust on me, I'll place it on you. Trust... Let the poison called affection consume you. Become just like me. Don't you know? You and I are already one.",
	expedition = "The fleet's returned from their commissions. Hurry up and decide whether you or I go and greet them.",
	win_mvp = "...Piss off, weaklings. Just thinking about the amount of ammo I've wasted on you sorry lot makes me want to vomit.",
	home = "Everyone made it back, huh? Not bad.",
	mission = "Missions, huh? Whether we do them or not is up to you. That is your freedom.",
	touch2 = "I'm not sure whether I should praise you or teach you your place...",
	voice_key_2 = -1,
	skill = "Get lost, you're in the way.",
	drop_descrip = "H-class battleship – Ulrich von Hutten",
	mail = "There's some mail. Looks like it contains confidential information... I see.",
	touch = "If you've got something to say, spit it out. I'll hear you out.",
	profile = "My name is Ulrich von Hutten. So long as you call me that, that is who I am. A name is nothing more than that.",
	mission_complete = "The rewards have arrived. Kick back and enjoy the moment. You're going to miss out on it if you don't, and all that'll be left is emptiness.",
	feeling4 = "You spineless fool who doesn't even know how to doubt others... I've come to realize that you've spread deeper and deeper through me, just like a poison. Tsk... I'll return the favor, mark my words.",
	unlock = "I am Ulrich von Hutten, the symbol of the Iron Blood's hopes and regrets. Whether my arrival is a cause for celebration or for despair is up to you to decide. I shall respond in kind.",
	feeling5 = "I told you I'd return the favor. Yep, I'll suck the poison out of you before it has a chance to spread throughout your body. This is my duty... my responsibility, for the person who did the same for me. But maybe I'm already too late? Hehehe...",
	main = "You want to know more about my rigging? Sure, I can move it like I want to, but there are times when it's pretty troublesome.|The Mysteries of the Port? Just leave it as it is. That's the only way it'll continue to keep your curiosity piqued, isn't it.|Think for yourself... Though you can't live selfishly, you need to live for the sake of something you really desire. That way, even if you die, it won't be in vain.|It might be a surprise for you, but I do have hobbies I enjoy. And it's not like I become a different person when I do.",
	battle = "...Tsk. This ammo is wasted on you lot!",
	upgrade = "In order to create a peaceful world where power is not needed, what you need is power. How paradoxical... Oh, don't mind me.",
	voice_key = 40503,
	headtouch = "Hmph. You don't make any damn sense.",
	feeling2 = "Trust is like a poison—once it enters your body, it destroys you. The only way to protect yourself is to be wary of others.",
	login = "You're here. See that massive pile of paperwork on your desk? The two of us will be spending lots of quality time here until that's taken care of.",
	vote = "",
	hp_warning = "If you don't plan on dying here, then focus up!",
	id = 405030,
	detail = "If you want peace of mind, just don't bother worrying about anyone else. We may be born into this world, but our keels and souls aren't at the mercy of others.",
	couple_encourage = {
		{
			{
				49902
			},
			1,
			"Looks like you and I are dancing to different tunes.",
			0
		},
		{
			{
				20705
			},
			1,
			"If you're interested in something, just face it head-on, young lady.",
			0
		}
	}
}

_G.pg.base.ship_skin_words[405031] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Tsk, they got me...",
	propose = "",
	expedition = "",
	win_mvp = "Looks like things worked out just fine.",
	home = "*Glug, glug* ...Ahh, that hits the spot. Tsk, it's already empty... Sorry, mind grabbing me another can?",
	mission = "So, you accept a mission and then immediately begin procrastinating...? What a piece of work you are. Want me to do the same thing to you?",
	touch2 = "Tsk... Again with that shit just 'cuz we're here? What a pain in the ass...",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "*sigh* Do you really have to bother me during my break? ...It's a joke, no need to take it so seriously. I was looking for someone to kill some time with anyway.",
	mail = "",
	touch = "\"Welcome back, Master. May I take your order?\" ...You happy with that?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "*sigh* Do you really have to bother me during my break? ...It's a joke, no need to take it so seriously. I was looking for someone to kill some time with anyway.",
	feeling5 = "",
	main = "I really need to head back, but the little'un just... *sigh* what a pain in the ass.|The fan outside is so frickin' loud, but I really need my alone time... Huh? Who put these damn stickers here...?|You already know what I'll do to people who start shit inside, don't you? ...Yep. I'll give them their one warning.|I'm not really worried about Elbe causing trouble. Surprisingly, she knows when to stop. ...Well, at least she's not my main source of worry.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "The little'uns really like when you do this to them.",
	feeling2 = "",
	login = "What's going on with you today? Spill it.",
	vote = "",
	hp_warning = "",
	id = 405031,
	detail = "",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[405040] = {
	feeling1 = "I'll serve my duties as your subordinate, but don't expect me to be all smiles while doing so.",
	feeling3 = "I might not approve of all of your decisions, but I do admire your resolution. You are exactly as a commander should be.",
	lose = "I'll be back with some payback. Nobody likes to stay a loser.",
	propose = "This kind of proposal works best when our feelings are reciprocal—basically, we accept each other as partners. When we have differing opinions, as long as we work together, hand-in-hand, we can overcome any obstacle that stands in our path! Ahaha!",
	expedition = "The girls have returned from their commissions. I'm sure the morale of the girls at the port will go up if you go out and greet them personally.",
	win_mvp = "Seems we've taken far less damage than I'd anticipated. How fortuitous.",
	home = "Good work out there. Will you take a break? Or are you planning on getting right back to another mission? Either way, I'll be here for you.",
	mission = "A new mission? I think it's a good idea to get started on it right now, but you're the Commander. I'll follow your plans.",
	touch2 = "Hmph! This is payback for your insolent behavior. There's no need for me to continue being a doormat for you.",
	voice_key_2 = -1,
	skill = "This is it!",
	drop_descrip = "Helgoland-class battleship – Thüringen.",
	mail = "Here's some mail. I'd like you to check on them as soon as possible... Later, you say? Well, I don't think there's anything urgent here, so that sounds fine with me.",
	touch = "The things I tell you are merely suggestions to you. Ultimately, you call the shots here.",
	profile = "Didn't I tell you I was the Iron Blood battleship Thüringen when we first met each other? You want to know more about me? Everything, even? Ahaha, then let's look for a nice place where we can sit and talk. I'll tell you everything, starting from my time in the High Seas Fleet.",
	mission_complete = "Mission complete. I'll let you decide who you want to send to pick up the rewards.",
	feeling4 = "Commander, how are your plans looking today? ...Ah, I'm not talking about work, but about your personal matters. Frankly, I simply wished to invite you to tea if we both happened to be free.",
	unlock = "It is a pleasure, Commander. I'm Thüringen, battleship of the Iron Blood. Before I formally sign on, there's one thing I want to ask – what role, exactly, do you have in mind for me? Hahah! No, I'm not testing you, I simply want a grasp of your moral compass.",
	feeling5 = "Maybe because we have good chemistry together, but I feel very comfortable being around you, whether for work or for personal matters. Even if we disagree on something, we come to understand each other's positions very quickly. I hope we can continue getting along just as well as we have.",
	main = "Be more confident with your opinions and openly state your opinions. If anyone dares to boo you down, I'll teach them something about manners.|Mm... I'll have to disagree on this. Of course, your word goes, but would you mind hearing my thoughts out first?|What's wrong? Got something against being watched? Ahaha, you don't have to be all tense. I wasn't keeping watch over you, I just wanted to observe your response.",
	battle = "Adequate preparation is half the battle.",
	upgrade = "Hmm. Much obliged.",
	voice_key = 40504,
	headtouch = "",
	feeling2 = "Nobody, not even I, can meddle with your thoughts. Of course, due to our differences in standing, values, and information, I may disagree with you from time to time. But I will never disparage your authority over me.",
	login = "Hm, I'm glad to see that you're as chipper as ever. Keep it up.",
	vote = "",
	hp_warning = "You're quite skilled, but I won't fall that easily!",
	id = 405040,
	detail = "All troubles that occur either have a reason or a trigger. Unless there are innocents tangled up in the problem, it's best to lay low and wait.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[405041] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Nice work. I was just about to take a break myself. Would you like me to help you with anything?",
	mission = "",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "You, mop the floor. You, take care of the windows. Once that's done... Ah, Commander. Excuse us, we're in the middle of cleaning the area. If you have need of me, I must ask you to wait.",
	mail = "",
	touch = "Though you shouldn't be helping me clean... if you insist, there's no way I'd turn you down.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "You, mop the floor. You, take care of the windows. Once that's done... Ah, Commander. Excuse us, we're in the middle of cleaning the area. If you have need of me, I must ask you to wait.",
	feeling5 = "",
	main = "Speaking of which, what is this set even used for... well, I guess it's fine. It's not something for me to worry about.|That poor-looking Royal Maid taught me how to clean things up... Ahaha, it's not the kind of cleaning that you're thinking about, just regular cleaning.|Lützow, I'm not telling you not to play with the manjuu, but make sure you carry those things to Akashi once you're done, you hear?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Welcome back, Commander. I'd like to warn you—the floor is wet, so please be careful.",
	vote = "",
	hp_warning = "",
	id = 405041,
	detail = "This set is unbelievably big... Ahaha, there's no way I'd have any complaints. However, I definitely want the girl who prepared this set to experience what cleaning this humongous space feels like.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[405050] = {
	feeling1 = "I thought you a brilliant leader and followed your example. I now see that I was misguided.",
	feeling3 = "There are times I wonder what I would do if you were ever to become my enemy. Of course, it's just a thought experiment, but it helped me realize– I'm glad we're on the same side.",
	lose = "I do not intend to shoulder all the responsibility myself... but I will ensure our safe retreat!",
	propose = "I know about your resolve, your feelings. What I don't know... is how to meet your expectations for this unforgettable ceremony. Let this be a rare case where I ask for a favor and say... could you take the lead? Heehee.",
	expedition = "Munitions have arrived. Come, let's not waste any time. Those girls would like nothing more than a warm welcome from you.",
	win_mvp = "Excellent, the path before us has been cleared. Forward!",
	home = "You're back. If you have the time, could you compile an after-action report? In the meantime... I'll put myself in our foes' shoes and see if I can't develop a better strategy.",
	mission = "A new mission? Let me have a look. I can lend you a hand.",
	touch2 = "Are you purposely trying to get under my skin?",
	voice_key_2 = -1,
	skill = "Truth can only be found within my range!",
	drop_descrip = "Bismarck-class battleship – Bismarck.",
	mail = "A letter for you, it seems. Give it a read, promptly. You wouldn't want to miss potentially vital information.",
	touch = "Has my sword caught your eye? You may hold it if you want.",
	profile = "My lust for power once dragged me down to the depths of hell. No matter how much I regretted it, it was already too late... I never dreamed that I would be given new life in this manner. Much seems to have changed during my slumber, but I am now ready to take on everything. Having you, a fellow leader, show me the way forward is the best thing I could ask for.",
	mission_complete = "Mission complete. Remember to claim your rewards. They belong in your hands.",
	feeling4 = "I'm comfortable discussing anything with you, from office matters to coffee break gossip. Being this sincere, this forthright, is something a leader conscious about appearances strives for. Heehee. I always enjoy my time with you.",
	unlock = "Guten Tag. I am Iron Blood battleship Bismarck. While this may not be our first meeting, perhaps you find my new attire surprising? As a fellow idealist, I'm happy to once more fight by your side.",
	feeling5 = "I hope you will remain by my side, as more than an ally and close friend you can talk to about... *sigh*, never mind. It's all good as long as you know what I'm trying to say. See, I'm... I'm still not used to speaking my heart...",
	main = "The two of us have much in common, as leaders who bear the expectations of their peers. If there's anything you have difficulty confiding to others, feel free to turn to me.|Geryon is being rather rowdy... Regensburg, how'd you manage to calm him down the last time? Mind showing me again?|While you could call Eugen my right-hand woman, she can often be frustratingly difficult to read... You think so, too? Heh, I'm glad we're on the same page.|With this new power, I finally have the opportunity to leave my regrets behind in the past. Wait, we're going to a café with Tirpitz? Right now? Umm... give me a moment to sort out my emotions...|I like slow classical music– it helps me relax. As for the war... Yes, there will come a day when that, too, is history.",
	battle = "That sheer courage to stand in my way is worthy of applause.",
	upgrade = "It's time for routine maintenance. Geryon, be quiet now.",
	voice_key = 40505,
	headtouch = "Want to try my cap on? ...Hehe, it suits you well.",
	feeling2 = "I do not want any preferential treatment. All I ask is that you treat me as you would any of our other colleagues. That's right, Commander. I look forward to working with you in the days ahead. I'm sure we'll become the best of friends.",
	login = "Let's get to work, Commander. A port this vast requires a leader's management.",
	vote = "",
	hp_warning = "None shall tarnish Iron Blood's honor!",
