_G.pg.base.ship_skin_words[407020] = {
	feeling1 = "Hmph. Stay away from me. I'll find a way home by myself!",
	feeling3 = "You fool, if you wanted my help, you should have asked... Since I'm able to eat delicious cake like this every day... maybe I wouldn't object to staying a little longer!",
	lose = "It's n-not my fault! I-I just didn't get enough to eat!",
	propose = "I hate you, you big dumb idiot! If you give me something like this, how am I going to say goodbye? Uwahh... *sniffle*... Th-then promise me this... If I ever have to go back, swear that you'll come find me, got it? It's a promise!",
	expedition = "Hey, I think you have people coming back into the harbor.",
	win_mvp = "Heheh, planes are the strongest after all!",
	home = "I didn't expect you to be this capable. Maybe you are worthy of being my commander!",
	mission = "Huh? You have to finish your work first. Isn't that common sense?",
	touch2 = "Filthy, taste my wrath!",
	voice_key_2 = 407023,
	skill = "Let's end this!",
	drop_descrip = "Aircraft carrier Graf Zeppelin",
	mail = "Huh, you're missing a piece of mail? R-really...?",
	touch = "Don't just randomly touch me! Taste my wrath!!",
	profile = "I am none other than Graf Zeppelin, the first carrier of the Iron Blood! Heh. Don't be so surprised. The next era of naval warfare will definitely be decided by aircraft, and I will stand as its most brightly shining star! So, let me go back! ...Huh, I can't? ...Taste my wrath!!",
	mission_complete = "Look at all the rewards!",
	feeling4 = "Hey Commander, what's for dessert today? Huh, it's about going home? Well, um... th-that's right! It will be a while until I'm grown up enough to realize my destiny, so I can probably keep the Iron Blood waiting a bit longer! Hmm, I'm sure they won't be angry!",
	unlock = "State your name! And this location! I see now... you’re also one of those goons conspiring against me! I’ll let you know, I am Graf Zeppelin, the one destined to become the first carrier of the Iron Blood! To think that you’d carry me off when I was distracted... taste my wrath!",
	feeling5 = "You turned out to be a pretty good person after all, and everyone here has treated me well... When I grow up to become a mighty carrier, I wouldn't mind coming back to live here~",
	main = "*sniffle* ... *sniffle*... Waaah... Why are you still working and ignoring me?! Taste my wrath! |Hmph. No matter how hard you try, I will never yield to you! ...Desserts? Gimme... |Hmm... this should go here... No, no, maybe like this...? Hey! Wh-what are you doing! I didn't ask for your help! |I like high places! That way, I can see really far! |Despair and hatred mean nothing to me! I believe that as long as you don't give up, you can make any dream come true!",
	battle = "Allow me to show you the true power of planes!",
	upgrade = "I-I won't be bribed so easily!",
	voice_key = 40702,
	headtouch = "",
	feeling2 = "What's with that expression? I'm only unable to find my way back home because this place is too big! Hmph, I'm sure you made it that way on purpose, you goon!",
	login = "Where did you suddenly run off to?! Taste my wrath!",
	vote = "",
	hp_warning = "Hm-hmph! Like hell I'd lose!",
	id = 407020,
	detail = "Why are there other Iron Bloods here, and why are they so... big? It's a bit scary...",
	couple_encourage = {
		{
			{
				40701
			},
			1,
			"I love all of this!"
		},
		{
			{
				20218,
				30406,
				30709
			},
			1,
			"I'm not like you bunch!"
		},
		{
			{
				40146
			},
			1,
			"Bow down to my superior engineering!"
		}
	}
}

_G.pg.base.ship_skin_words[407030] = {
	feeling1 = "Officer, you're not worth my time.",
	feeling3 = "Officer, the clock in your bedroom was off by two minutes. ...Oh, there's nothing for you to worry about, I've already taken care of it. You can't use the excuse that your clock is off anymore",
	lose = "Time is far better spent contemplating how to avoid being destroyed, rather than foolhardily charging into destruction again and again.",
	propose = "A ceremony to ensure the time I've spent doesn't go to waste... well, since you've said this much, I'll take your words as proof of your vow, Officer. We still haven't spent as much time and emotions on each other we want to after all, right...? Hehehe.",
	expedition = "The commissions have been completed. Yes, I'll have to praise them for their efficiency considering their station as your subordinates.",
	win_mvp = "Hah! Took care of them faster than I thought.",
	home = "The more complex the machine, the more time it takes to maintain it. All the more for humans. Make sure you don't forget to rest up.",
	mission = "Here are the new missions. Instead of rushing to finish everything at once, use your time wisely and plan out your endeavors properly.",
	touch2 = "Officer, if this helps raise your efficiency, I don't consider it time wasted.",
	voice_key_2 = -1,
	skill = "Your time is up!",
	drop_descrip = "Graf Zeppelin-class aircraft carrier – Peter Strasser. ",
	mail = "Officer, there's mail for you. Make sure to check it at your earliest convenience.",
	touch = "What is it? You've still got time left until your break ends.",
	profile = "I am Aircraft Carrier B, one of the Graf Zeppelin-class carriers that suffered an unfortunate fate, having had my construction halted without ever getting to set sail. But... doesn't the name \"Peter Strasser\" have a much nicer ring to it than \"Aircraft Carrier B\"...?",
	mission_complete = "I'm glad the rewards for the missions correspond to the amount of time it took to complete them. Hehehe.",
	feeling4 = "Devoting your time to one person is a waste of time. That is, unless you get something worth it in return... Don't you think so too, Officer?",
	unlock = "It is I, the never-completed Graf Zeppelin-class \"Aircraft Carrier B,\" otherwise known as Peter Strasser. There is much for us to do and little time to do it... No time to waste. Let's begin.",
	feeling5 = "Officer, you'll pay me back for all of the time I've spent for you...? Interesting. Let me check the details first, hehe.",
	main = "The more precise your plan is, the less time you'll have to waste hesitating on what you need to do. Why not give it a try, Officer?|Heinrich, your documents for your training program are here. Make sure not to forget them next time.|It's so nice to see all of the tasks be completed, just as planned. Hehehe.",
	battle = "Let me test this tactic on you.",
	upgrade = "Strengthening complete. Yes, it seems as if I've spent my time wisely.",
	voice_key = 40703,
	headtouch = "",
	feeling2 = "Time is a precious commodity. State what you need me to do as concisely as possible.",
	login = "Did you just get here? Heheh. Make sure you work efficiently on your duties today, as always.",
	vote = "",
	hp_warning = "Everything... is still under control.",
	id = 407030,
	detail = "The expression of the passage of time as the hands of a clock ticking—don't you think it's just fascinating?",
	couple_encourage = {
		{
			{
				40701
			},
			1,
			"Before you go and destroy the world, destroy the enemy in front of you first."
		},
		{
			{
				40309
			},
			1,
			"Don't just rush in. ...H-hey!"
		},
		{
			{
				40402
			},
			1,
			"Gently now. Hehehe."
		},
		{
			{
				20705
			},
			1,
			"Ehem... Time is not on your side."
		}
	}
}

