_G.pg.base.ship_skin_words[408020] = {
	feeling1 = "Give me some space.",
	feeling3 = "So like, I can't really help with your work at all... But you'll let me stay here... You don't mind?",
	lose = "So this is how it ends...",
	propose = "I'm meant for more than just voyaging through the cold, dark oceans. My place is here, at the port, by your side... When I'm with you, even just sitting in silence, I feel... happy.",
	expedition = "Looks like the commission team is back... There's a lot of them. I don't want to go...",
	win_mvp = "That's how it goes.",
	home = "So many people here now... It's so loud...",
	mission = "There's another mission...",
	touch2 = "You looking to take a nap at the bottom of Scapa Flow?",
