	feeling5 = "I've spent thousands of hours swimming through the dark depths of the ocean... But lately all I can think about when I'm out on a mission is the warmth and light of your office... I think... I think I need to be with you, Commander.",
	main = "Enemies nearby? Welp...|If you need someone to patrol, I'm good to go anytime.|Such a quiet office... I approve.",
