	headtouch = "",
	feeling2 = "Your office is very quiet. I like it here.",
	login = "Oh. You're back.",
	vote = "",
	hp_warning = "You can't be serious.",
	id = 408020,
	detail = "Are you sending me out? I can handle it by myself.",
	couple_encourage = {
