	main = "Commander, I recently started learning the trombone, hehe. I'm not very good at it, but it's still pretty interesting. Wanna listen~? |If I was able to play this thing underwater, I'd be able to perform for the fishes! Too bad, though... Guess I'll have to settle for the fish in the aquarium!|Even though we U-boats hang out together regularly, studying together at school feels rather special!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Commander, let's put on some music!",
	vote = "",
