	voice_key_2 = -1,
	skill = "Victory blitz!",
	drop_descrip = "Iron Blood Type IXC submarine – U-522.",
	mail = "Commander, got news for ya from headquarters~",
	touch = "You feelin' like some hide and seek? I'm game. I always win, y'see.",
