_G.pg.base.ship_skin_words[501010] = {
	feeling1 = "Commander, it's bloomring season for the hawthorne I grew around the Bohai Gulf. Can we go back and take a look?",
	feeling3 = "Even if the day comes when I am no longer needed on the battlefield, I still want to watch over the Bohai Sea. I want to always be able to see the waters, dyed a shimmering vermillion in the sunset.",
	lose = "Everyone, regroup. We can't retreat like this!",
	propose = "Commander, my body and soul, all of my life, belongs to you from now on. Make sure to take responsibility properly.",
	expedition = "Great, everyone returned home safely!",
	win_mvp = "Commander, being able to help you out is the greatest!",
	home = "Why don't you take a break? It's not good to be too stressed out.",
	mission = "Protecting the peace isn't just about fighting - you'll have to do these missions too.",
	touch2 = "Hey-! My sisters are going to see us...",
	voice_key_2 = -1,
	skill = "Let the protection of heaven surround the brave!",
	drop_descrip = "An Shan-class destroyer, No. 1 - Anshan (101)",
	mail = "Commander, you have new mail. Should I unseal it for you?",
	touch = "Commander... Hehe~ doing this occasionally is not all that bad.",
	profile = "I am the nameship of the An Shan-class destroyers, and one of the Dragon Empery's first-generation \"Four Unbreakables.\" As the flagship, I participated in many naval exercises, carried out surveillance, and engaged in confrontations, leaving behind lasting achievements that I can be proud of. Though I never participated in live combat, I am the destroyer with the most miles under her belt in the entire world!",
	mission_complete = "Keep up the effort, don't slack off just yet!",
	feeling4 = "Commander, rest assured that wherever you go, I will be there to protect you. Huh? Isn't it obvious, you're mine after all...",
	unlock = "Destroyer, An Shan, reporting for duty! I shall protect my sisters and you, Commander!",
	feeling5 = "I'm so blessed to have met you, Commander. I've made so many friends and so many memories... Hey, Commander, once I complete my duty as one of the \"Four Unbreakables,\" let's go travel around the world together!",
	main = "Woah, this is my first time seeing a battleship! |Where did Fu Shun run off to? Would it really kill her to do as I say every now and then? |My sisters - Fu Shun, Chang Chun, and Tai Yuan - are all my pride and joy!",
	battle = "What are you all fighting for?",
	upgrade = "Now I'll be better equipped to deal with ruffians like De Haven...",
	voice_key = 50101,
	headtouch = "",
	feeling2 = "Commander, we have to fight to protect the things we care about. This isn't really a question of personal preference.",
	login = "Wow! Today's schedule looks packed. Let's work hard today!",
	vote = "",
	hp_warning = "Commander, concentrate and be extra careful!",
	id = 501010,
	detail = "Commander, what would you like to know?",
	couple_encourage = {
