	win_mvp = "As the wind blows anew, I can feel my presence once more.",
	home = "Ahh, home is such a warm place.",
	mission = "New missions have been assigned! I have finished preparations and am awaiting your orders.",
	touch2 = "To do such a thing to a woman... Surely Commander is prepared to suffer the consequences.",
	voice_key_2 = -1,
	skill = "It ends now!",
	drop_descrip = "Cruiser, Yat Sen.",
	mail = "The mail? It's on your desk, Commander.",
	touch = "What's wrong? Please don't have any strange expectations of me.",
	profile = "Yat Sen of the First Fleet of the Dragon Empery, reporting in. I heard that my sisters have already arrived. This time, I promise that I will not leave your side.",
	mission_complete = "Mission rewards counted and ready for your review... me? No, there's nothing I want...",
	feeling4 = "My past? Those... are stories for your ears only, Commander.",
	unlock = "This is the moment I have long waited for... I am Yat Sen, from the First Fleet of the Dragon Empery. Please allow me to be at your service once more.",
	feeling5 = "When I look at your face, I sometimes forget to breathe... What a strange sensation.",
	main = "Ning Hai's steamed buns? Mm... they still have the same nostalgic flavor.|Only by remembering the lessons of the past can we move towards a brighter future.|Sometimes, I miss those days when I used to train together with all my sisters...",
	battle = "Ancestors... Yat Sen shall now do her part as well.",
	upgrade = "If only I was able to become this strong sooner, then perhaps...",
	voice_key = 50201,
	headtouch = "I am no longer the crybaby that I once was.",
	feeling2 = "Commander... Could you be... *that* person?",
	login = "We meet again, Commander. Do not worry, I shall stay by your side as promised.",
	vote = "",
	hp_warning = "I have already witnessed true hell.",
	id = 502010,
	detail = "Is there anything else you would like to know about me, Commander?",
	couple_encourage = {
		{
			{
				50202,
				50203
			},
			2,
			"I'm so glad I can be with everyone again, just as before.",
			0
		}
	}
}

