_G.pg.base.ship_skin_words[502040] = {
	feeling1 = "...I have nothing to say to you.",
	feeling3 = "Chao Ho has been complaining to you that I've been pushing my chores onto her, hasn't she? Don't listen to her. I've just been instructing my little sister, who has stubbornly been running away from her responsibilities, about the realities of being an adult. Hehe~",
	lose = "Do I not have enough power... to stop the enemy's advance?",
	propose = "Ink does not fade with the passage of time... I wrote my feelings down with the hope that they also may never fade. I now offer these words to you, along with myself.",
	expedition = "The expedition fleet is back. Don't forget to reward all our hardworking friends.",
	win_mvp = "I'll wait until I get back before declaring victory.",
	home = "I'm sure there are a lot of things you're dying to tell me. But that can wait until after you've rested up.",
	mission = "Commander, we've got new missions. If Chao Ho was here, I'm sure she'd be nagging you to kingdom come. Hehe~",
	touch2 = "Wouldn't it be a great time for me to tell everyone how much of a pervert you are? If you want me to reconsider, you'll have to make me a little promise first. Hehe~",
	voice_key_2 = -1,
	skill = "We shall never fade away...!",
	drop_descrip = "Chao Ho-class protected cruiser – Ying Swei.",
	mail = "You've got new mail... You know, stone-cold printed text doesn't have that same human touch as something handwritten.",
	touch = "If you're tired, you should go ahead and rest. Collapsing due to overwork is inefficient.",
	profile = "I am the second ship of the Chao Ho-class protected cruisers, Ying Swei. I'm also Chao Ho's sister. By the way, if you see the two of us bickering, don't be alarmed. It's nothing more than our way of expressing affection for one another. Hehe~♪",
	mission_complete = "Mission complete. Now, if I could just enjoy a meal, soak in the bath, and then get into bed... that would be the life. Hehe~",
	feeling4 = "\"Whenever I'm with the commander, I get all excited and can't figure out why... but, but...\" Oh, ahem... I'd appreciate it if you could act like I was just talking to myself.",
	unlock = "It is a pleasure to meet you, Commander. I am the elder of the Chao Ho sisters, Ying Swei. Hmm, Chao Ho said that she's the big sister? Hmm, I guess you're not as gullible as she is. Hehe~♪",
	feeling5 = "There are a lot of things I'd like to say to you, but whenever I'm in front of you, it's like the words just won't come out... I'm afraid I'll have to write my feelings out for you, so please don't laugh.",
	main = "Chao Ho, if you want to be seen as the big sister, you're going to have to do things yourself instead of relying on the commander. Heehee~♪|Reminder from Ying Swei~ You've had your head in the clouds for a while~|Are you interested in the Four Treasures of the Study? I'd be glad to instruct you. Hehe, not to boast, but I'm quite confident in my abilities.",
	battle = "Purge all evil. Become as a stalwart blade.",
	upgrade = "Indeed. You must be strong if you wish to protect what is dear to you.",
	voice_key = 50204,
	headtouch = "If you mess up my hair, I'll have you style it for me for a week starting tomorrow, you hear?",
	feeling2 = "Chao Ho should be doing her usual training just about now. Commander, why don't we go take a little field trip? Hehe~",
	login = "The ever-industrious commander, right on time today. Hey... have you seriously never thought about playing hooky?",
	vote = "",
	hp_warning = "We will not, cannot, back down here...!",
	id = 502040,
	detail = "Going by launch date, one could say that I am actually Chao Ho's older sister... But alas, since she wants that role so badly, she can have it. Besides, being the \"little sister\" comes with perks of its own. Hehe~♪",
	couple_encourage = {
		{
			{
				50205
			},
			1,
			"Sister, don't let the enemy get away with underestimating us.",
			0
		},
		{
			{
				50101,
				50102,
				50103,
				50104,
				50201,
				50202,
				50203,
				50205
			},
			2,
			"Let's do this, together!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[502041] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "A~ job~ well~ done~♪ ...Hehe, did you like that?",
	home = "In the warm spring breeze, snow melts and life blooms anew. Spring is the season of life.",
	mission = "",
	touch2 = "The excitement of the festival seems to have gone to your head. Hehe~",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Happy New Year, Commander. I've come to deliver you blessings for this coming year... Next, you're going to ask for a red envelope, right? Hehe, just teasing~",
	mail = "",
	touch = "Since it's the Spring Festival, how about taking a break?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Happy New Year, Commander. I've come to deliver you blessings for this coming year... Next, you're going to ask for a red envelope, right? Hehe, just teasing~",
	feeling5 = "",
	main = "Miss Yat Sen, I'll help you prepare the food for tonight's reunion dinner. What about the fish? I'll start it up if you'd like.|I never thought I'd be able to enjoy the company of my sister and all our friends like this... Yes, it's all thanks to you, Commander.|Fu Shun, if you throw any more firecrackers into the pond... I'll change your seat to be right next to that lotus~♪",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "The warmth of spring often lulls many into oversleeping... But, Commander, it seems like you're accustomed to waking up early?",
	vote = "",
	hp_warning = "",
	id = 502041,
	detail = "Chao Ho thinks up the couplets, and I write them down. Don't you think we make a good team? Besides, seeing Chao Ho's brows furrow in thought is super cute... Anyway, let's think up some lines together later.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[502042] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Nngh~ My legs sure are sore... Oh, Commander, you're back. Say... would you mind helping me out a little?",
	mission = "",
	touch2 = "Commander, are you sure you want to do this with Chao Ho watching? I never knew you had kinks like that...",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Commander, Happy New Year! Chao Ho and I are preparing for this year's Spring Festival, and as you can see... we're in the middle of a little \"intermission.\" Hehe, don't worry, there's nothing you need to help out with. Just take a seat over there and enjoy the show~",
	mail = "Got some mail for you, Commander, but it's not easy for me to move right now. I'll just leave it on the table for you.",
	touch = "You also want to try playing a prank on Chao Ho? Sure, but don't go too overboard~",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Commander, Happy New Year! Chao Ho and I are preparing for this year's Spring Festival, and as you can see... we're in the middle of a little \"intermission.\" Hehe, don't worry, there's nothing you need to help out with. Just take a seat over there and enjoy the show~",
	feeling5 = "I already apologized to Chao Ho about what happened today. Oh right, Commander, do you have some time to spare after the evening banquet? I have some things to tell you, but only if we're alone! Because, it's a little embarrassing... Ah, but I'll have to apologize to her again for making a move behind her back, heehee~♪",
	main = "What's the matter, Chao Ho? Still haven't been able to get your stuff back? ...I tricked you? What could you possibly be talking about?|We're almost completely out of ink for our Spring Festival couplets. Commander, mind helping me grind up the inkstick? I'm a bit busy right now, but I'll make a cup of tea for you later.|The goods Akashi sent over sure are convenient. There's the mechanical errand-running Manjuus, the automatic fireworks launchers, and the lion dancers as well... I'm sure Fu Shun and her gals would have an absolute blast with these.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "An old saying goes, \"it's better to be lucky than it is to be punctual.\" Since you've come at quite the fortuitous moment, why not come sit next to me and enjoy the show? As for what's going on over here, don't sweat the small details~♪",
	vote = "",
	hp_warning = "",
	id = 502042,
	detail = "This year, Hai Tien is in charge of coming up with the Spring Festival couplets, I'll be doing the calligraphy, and Chao Ho is handling the decorations. An all brawn, no brain job like that is perfect for my sister, isn't it? Heehee~♪",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[502050] = {
	feeling1 = "Don't talk to me like you know me!",
	feeling3 = "Commander! Ying Swei... Ying Swei... she threatened to not share Ning Hai's steamed buns with me! And said I have to clean the room today! H-hurry up and do something about her!",
	lose = "Guh... Am I still not strong enough yet...?",
	propose = "At a time like this, I'm supposed to say \"may we hold hands and hope to live forever with one another\" or something like that, right... Ahh, I can't remember this stuff! A-anyway, you have to take good care of me from now on! Got it?!",
	expedition = "The commission fleet's back? Y-yeah, we did send one out earlier, huh... Wh-what, I didn't forget about that!",
	win_mvp = "Hmph! I'll say this again! Don't you dare violate our oceans!",
	home = "All right, nobody's here, right? Maybe I'll practice my dance steps a little... Ehh?! Huh... Wh-when'd you get back?!",
	mission = "We've got new missions! Hurry up and take a look! Otherwise, Ying Swei is going to complain about me nagging again!",
	touch2 = "Eeek?! Y-y-y-y-you pervert! Degenerate!",
	voice_key_2 = -1,
	skill = "Be captivated by my song and dance!",
	drop_descrip = "Chao Ho-class protected cruiser – Chao Ho.",
	mail = "Commander, hurry up and check your mail before it starts growing moss!",
	touch = "...What are you trying to do?!",
	profile = "I'm the name ship of the Chao Ho-class protected cruisers, Chao Ho! As for my history... who the heck knows! Specs? Dunno about that either! Stop asking about this stuff already!",
	mission_complete = "That mission was a piece of cake! ...W-well, I suppose your efforts helped!",
	feeling4 = "Um, Ying Swei said you don't like short-tempered girls, so I'll try to act a bit mellower! So, um, please don't hate me... Hey, wh-what are you laughing for?! Don't get all uppity with me!",
	unlock = "I'm Chao Ho, lead ship of the Chao Ho-class cruisers! Don't you forget it! Oh, and no matter what Ying Swei says, don't let her trick you into thinking I'm the little sister!",
	feeling5 = "About my new dance, um... I want you to name it, since you'll be the first person who gets to see it. So... how about it? Y-you don't have to come if you don't want to! ...Ugh! I mean, you have to come! No matter what! Even if you don't want to! Jeez!",
	main = "Let Ying Swei handle the public side of things! I, uh, I'll support her from the sidelines! ...Wait, wouldn't that make me seem like the little sister then?!|H-how long are you going to keep dawdling around in front of me? Can you just sit down and get your work done?! Eh? ...What the heck are you saying?! It's not like I really care what you're doing or anything...!|Only through perseverance can we reach our desired outcome! ...Th-those are Ying Swei's words, not mine!",
	battle = "P-purge all evil... Ah, screw it, will you die already?!",
	upgrade = "H-hey, I look a bit more reliable now, don't I?",
	voice_key = 50205,
	headtouch = "Ahhhh!! You're gonna mess it up, so stop touching already!",
	feeling2 = "I still haven't practiced my dance today... Commander?! I, I won't let you peek!",
	login = "H-hey, you're late! I was worried about you, darn it!",
	vote = "",
	hp_warning = "It's time to get serious! I'll make them pay for underestimating me!",
	id = 502050,
	detail = "Why do people think Ying Swei is the big sister?! ...Am I that immature in comparison?! Commander, what's your take on this?",
	couple_encourage = {
		{
			{
				50204
			},
			1,
			"Let's do this thing!",
			0
		},
		{
			{
				50101,
				50102,
				50103,
				50104
			},
			1,
			"I'm glad we have such stalwart companions!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[502051] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Don't worry, this tree is real sturdy and won't break with just one person on it... Hey, wait, are you calling me fat?!",
	mission = "",
	touch2 = "Y-you're gonna get eaten up by the Nian beast!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Happy New Year, Commander! This red envelope is my gift to you... after all, that's my responsibility as a big sister! Anyway, hurry up and take it!",
	mail = "",
	touch = "...D-don't scare me like that!",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Happy New Year, Commander! This red envelope is my gift to you... after all, that's my responsibility as a big sister! Anyway, hurry up and take it!",
	feeling5 = "",
	main = "My performance for the Spring Festival banquet? ...I-i-it's not like I'm nervous or anything! I've practiced over and over!|I wish my sister was as demure and well-behaved as Tai Yuan... Yeah, Ying Swei, I'm talking about you! Stop laughing!|Commander, it's really cold tonight around the time of the banquet. If you catch a cold, um, I'm going to have to take care of you, and that would be a hassle... So, um, yeah!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "You're late, Commander! Jeez, we're all supposed to get together for the New Year, so stop running around!",
	vote = "",
	hp_warning = "",
	id = 502051,
	detail = "That Ying Swei... Even though she knows I'm not good with the literary stuff, she still made me think up spring couplets... If it wasn't for her sake... Commander, come here and help me think of lines as well!",
