_G.pg.base.ship_skin_words[506010] = {
	feeling1 = "Seems like I set the bar too high for you.",
	feeling3 = "War isn't fair. Backstab your enemy. Think two or three steps ahead of them, read their every move. Then... BAM! Victory comes just like that. Hehe.",
	lose = "Ugh, just one move behind... While I hate conceding defeat, there won't be a next time. Hehe...",
	propose = "What's this? ...Hehe, I didn't expect this sneak attack from you... Or rather, you're the only person who could pull something like this off. Looking at it that way, maybe I had predicted this all along... right?",
	expedition = "The commission fleet is back, huh... Increasing our stockpiles, replenishing our forces, adding another card to our hand. A good play indeed.",
	win_mvp = "The enemy has lost their will to fight. Heh, guess that's all they had to show.",
	home = "Good job on making it back in one piece. I went over your last battle, and while it was excellent overall, there are many areas that can still be improved... So let's review those right now?",
	mission = "Don't forget to finish up your missions. When it comes back to bite you in the ass, it'll already be too late.",
	touch2 = "You certainly have guts.",
	voice_key_2 = -1,
	skill = "Exploit their weaknesses, and catch them by surprise!",
	drop_descrip = "Seaplane carrier - Chen Hai.",
	mail = "A competent commander should never neglect potentially important information.",
	touch = "What's the matter? ...You're not here just to have a little chat, are you?",
	profile = "I am the Dragon Empery's first seaplane carrier, Chen Hai. I've received many other \"firsts,\" but those aren't exactly honors. I still have a long way to go before I can match up to real aircraft carriers.",
	mission_complete = "Mission complete. Now that you've removed another obstacle in front of you, what will your next move be?",
	feeling4 = "I'm starting to get bored of our regular old sessions of Go. Let's spice things up a little bit... I know just the thing. How about, if you can take a game off me, I'll grant you one wish.",
	unlock = "So you're the brains behind the operation here, huh? ...Hehe, I finally get to meet the legendary Commander face-to-face. It's an honor to be able to work with you. I trust you'll live up to your lofty expectations?",
	feeling5 = "Oh my, how could a seasoned strategist like me make such a silly blunder... Hehe, in any case, congratulations on your win. As promised, I'll grant you your one wish. Anything goes. Hehehe...",
	main = "Are you deep in thought about something? Or... just spacing out? Oh, I see. You're trying to look cute, hehe.|My eyes look a bit scary when I'm thinking about something? ...How do you know that isn't just one of my many faces?|Feign strength if you must, feign weakness if you must. Whatever the case, do not ever let your enemy see through your trump card.",
	battle = "The moment the enemies let their guard down–– is the moment you strike!",
	upgrade = "I prefer being the one pulling the strings, but fine.",
	voice_key = 50601,
	headtouch = "I must say... this behavior is rather unexpected.",
	feeling2 = "The more you win, the harder it'll be for you to review your own moves objectively. Even if you're winning, never forget to continue studying your past experiences.",
	login = "How's the port supposed to run when the decisionmaker's seat is vacant? C'mon, sit down already.",
	vote = "",
	hp_warning = "Nothing ventured, nothing gained...!",
	id = 506010,
	detail = "If you're not busy, then... come here, let's play a match of Go? No need to have a turn timer or keep track of winners and losers. Let's just kill some time, hehe.",
	couple_encourage = {
		{
			{
				50204,
				50205,
				50208
			},
			1,
			"My, some familiar faces.",
			0
		}
	}
}

_G.pg.base.ship_skin_words[506011] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "\"Yes, excellent. Just stick to the plan, just as I told you.\" Oh, welcome back. That phone call...? It's a secret~",
	mission = "Commander, you're currently my guest. The fact that you're still preoccupied with work does not impress me.",
	touch2 = "It would appear that you need a reminder as to who the host is here.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "You're here, Commander, just as promised. How do you like the atmosphere in here? Hehe, take a seat and enjoy the tea slowly. After all, we have plenty of time~",
	mail = "A letter arriving at a time like this? Talk about spoiling the mood...",
	touch = "Would you like to try this rotary dial phone? You might not be used to operating something like it, so try to be careful not to make mistakes.",
	profile = "",
	mission_complete = "Oh my, when did you complete your missions? Not too shabby, Commander.",
	feeling4 = "",
	unlock = "You're here, Commander, just as promised. How do you like the atmosphere in here? Hehe, take a seat and enjoy the tea slowly. After all, we have plenty of time~",
	feeling5 = "Do you know what I value most of everything inside this room? It's not the luxurious interior or my opulent collections – Indeed, it is none other than you, Commander~♪",
	main = "I already have a worthy opponent in front of me, but too bad we don't have a Go board and some pieces to play with... Ah, but worry not, I'll fetch them later.|Commander, what's your favorite collection here? Porcelain? Jade? Calligraphy? Or perhaps... this entire estate? Hehe~|Hai Chi's flower spear and Chao Ho's solo dance... Tonight's performance will be spectacular indeed. It would be nice to have someone accompanying me who has a fine eye for the arts... Do you understand what I'm getting at, Commander?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "Do be mindful of who the host is, and who the guest is~",
	feeling2 = "",
	login = "Now that you're here, please make yourself at home. Don't worry, Commander, this one's on me.",
	vote = "",
	hp_warning = "",
	id = 506011,
	detail = "Did my collection catch your eye? Hehe, very well, there's a lot more of that in the back room. I wouldn't mind showing you around if you'd like~",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[506012] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "You're completely soaked with sweat... I see, the sweltering heat outside must've taken its toll on you. Come in, and cool off.",
	mission = "",
	touch2 = "Oh my, Commander. You're a bit lacking in self-control~",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Oh my, if it isn't the Commander... Have you also come to escape the heat? What a serendipitous meeting... Or, did you perhaps have some other goal in mind? Heehee...",
	mail = "",
	touch = "What's the matter? If it's about work, let's save it for later, alright?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Oh my, if it isn't the Commander... Have you also come to escape the heat? What a serendipitous meeting... Or, did you perhaps have some other goal in mind? Heehee...",
	feeling5 = "...So, do you have any plans today? No games, no bartering. Just the two of us - alone on a day off. You have all the initiative in your hands, Commander. You're not going to let it go to waste, are you? Hehe...",
	main = "Come with an open heart, and leave fulfilled. Now that you've freed yourself from the shackles of the daily grind, clear your mind and enjoy this occasion to the fullest~|Hai Chi? I'm sure she's playing in the water with some friends she just met. Did you want to go look for her?|Ripples in the water, the glow of the autumnal sun, and the flickering of rainbows... If Hai Tien were here, I'm sure I would be hearing one of her poems.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "During this moment of respite, set aside all your plans and calculations. Once you've rested sufficiently, you can always pick up where you left off.",
	vote = "",
	hp_warning = "",
	id = 506012,
	detail = "Few things are more blissful than a refreshing soak on a sweltering day. Your clothes might get wet, but... don't you think it's well worth it?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[506020] = {
	feeling1 = "No matter what happens, life must continue on. Just let it go...",
	feeling3 = "So, not too long ago, I went to a haunted house with my friends for the first time. Pretty cool and all, but the best part was seeing the looks of panic on everyone's faces. Tell me, Commander, are ya 'fraid of ghosts?",
	lose = "I'll remember this humiliation... and pay it back twofold!",
	propose = "I don't expect to occupy the front and foremost spot in your heart; but seeing as how the two of us have exchanged vows, I will be very, very angry should you run around and desert me. So angry, in fact, that I have no idea what I might do. Heehee. But, it's simple, really. Just be good to me, Commander~",
	expedition = "The friends from the commission fleet are back. Wanna throw a little party for them?",
	win_mvp = "Heh. The character \"Jah\" in my name symbolizes number one. Quite apropos if I must say so myself.",
	home = "Hmm? Commander, what were you doing just now? Don't tell me you were off partying behind my back... Heehee, just kidding~",
	mission = "I've heard that some missions can be quite fun. Commander, mind if I tag along next time?",
	touch2 = "So basically, I'm allowed to exercise self-defense now, right?",
	voice_key_2 = -1,
	skill = "If you won't listen to reason, then you can talk to my fist!",
	drop_descrip = "Seaplane carrier – Hwah Jah.",
	mail = "New mail's in. Come to think of it, Commander, don't you get invited to all sorts of events? Think you can bring me along next time?",
	touch = "Meh, don't sweat it. Even if I slack off right now, nobody's gonna find out.",
	profile = "I am a seaplane tender of the Dragon Empery, just like Chen Hai. Unfortunately, my treasured blade was never completed, and I was condemned to a life of mediocrity... But let's not dwell on my dark past. Commander, didn't you promise that the two of us would find lots of fun things to do?",
	mission_complete = "Mission complete. So, does that mean I can shoot the breeze for a while?",
	feeling4 = "After hanging out with my buddies for a while, I've come to realize that it's pretty hard to stand out from the crowd... But, maybe there's some way of getting a head start– Hmm? Oh, I was just talking to myself, so don't worry too much about it. By the way, Commander, you interested in what the girls have been saying about you lately?",
	unlock = "Commander, it is an honor to meet you. I am Hwah Jah of the Dragon Empery. Now that it's just the two of us here, I'll get straight to the point – Ahem... Is there, um... anything, y'know, super exciting or fun going on around these parts?",
	feeling5 = "After knowing me for so long, you should already be aware that I'm not actually that well-behaved. As for the reason why... That'd be your fault, Commander. Aren't you the one who introduced me to so many ways of \"acting up?\" Heehee~ In other words, I'll need you to take responsibility~",
	main = "Commander, how do you normally reward yourself? Maybe binge out on a sumptuous meal? Or stay up late playing around? As for me, I... Err, I just wanted a point of reference, yeah!|Be courteous to others so that they will listen to you respectfully. As for those unwilling to give you that respect, there are always more \"direct\" methods you can employ~|Mapo tofu? There are hundreds of ways of preparing tofu, and there's no rule saying it has to be spicy. Besides, I'm not great with spicy food...",
	battle = "In other words, we can go all-out now, right?",
	upgrade = "I won't let you down, Commander. Not after the goodwill you've shown me.",
	voice_key = 50602,
	headtouch = "",
	feeling2 = "People are always gonna be hesitant to let someone barge into their group, no matter how cordial you try to be. Luckily, I know someone who can help me make some inroads with the folks here. Isn't that right, Commander? Help a buddy out, won'tcha?",
	login = "Commander, are you still working? ...C'mon, let's play hooky. A little bit of fun won't kill you~",
	vote = "",
	hp_warning = "Ugh, I let my guard down...",
	id = 506020,
	detail = "That reminds me, a while ago, I raised my hand to try to join one of the Eagle Union girls' parties, but they all looked at me like I was crazy... Is there anything wrong with that?",
	couple_encourage = {
		{
			{
				50601
			},
			1,
			" Would you please teach me how to use a seaplane?",
			0
		}
	}
}

