	detail = "Why does this store have to make dough from scratch instead of using premade wrappers? ...Why is this sort of commitment necessary...?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[520000] = {
	feeling1 = "指挥官，我在渤海湾养的山楂到花期了，可以回去看看吗？",
	feeling3 = "即使有一天不再需要我去战斗，我也想永远守望着渤海，永远眺望着被晚霞染红的海面……",
	lose = "整军再战，我们决不能就此退缩！",
