_G.pg.base.ship_skin_words[601020] = {
	feeling1 = "Commander, I don't think that... Nevermind, your subordinate shall follow your order.",
	feeling3 = "Commander, if you plan on going out, please let me be your bodyguard!",
	lose = "Ugh... th-this subordinate will accept any punishment!",
	propose = "From now on, this subordinate shall serve you for life! ...That's not what it means? Um, then... I see! B-but, can someone like me really be your partner?",
	expedition = "The commission team has returned! I'm so glad that everyone came back safely.",
	win_mvp = "Victory is ours!",
	home = "Commander, an inquiry arrived while you were gone. Do you want to look it over?",
	mission = "Commander, there are still tasks that need to be finished. Do you require anything of me?",
	touch2 = "P-please don't tease your subordinates like that!",
	voice_key_2 = -1,
	skill = "Locked on! ",
	drop_descrip = "Soldati-class destroyer – Carabiniere. ",
	mail = "Commander, the mailbox seems to be filling up.",
	touch = "Sì!",
	profile = "As a member of the Soldati-class destroyers, I served as the leader of the 12th Destroyer Squadron and led my compatriots through many battles. No matter when or where, I shall give it my all to complete any mission!",
	mission_complete = "The missions are done, and we have quite the rewards to show for it. If there were some non-material rewards though...",
	feeling4 = "Commander, I'm really flattered that you treat me so well... You feel safe when I'm by your side? Understood. Your subordinate shall work harder in that regard!",
	unlock = "Flagship Veneto's escort, Carabiniere of the Sardegna Empire, reporting for duty! As your subordinate, I will carry out your orders and complete any mission!",
	feeling5 = "Commander, are you heading out? Do you need a bodyguard... Oh, it's just a civilian errand? N-no! Even if it's just across the street, y-you never know what hazards lie in wait... S-so, let's go together!",
	main = "Royal submarines have always been elusive and mercurial. They've gotten the better of me in the past... |My gun? I'm telling you, it's real! I just don't have it loaded. |\"Don't disturb during work hours.\" I put this sign up so you can have your peace of mind!",
	battle = "In Commander's name, I sortie!",
	upgrade = "I shall definitely become a better subordinate!",
	voice_key = 60102,
	headtouch = "",
	feeling2 = "Rest assured, Commander. This subordinate shall always be loyal to you.",
	login = "Salutations! Carabiniere welcomes you, Commander!",
	vote = "",
	hp_warning = "This isn't how it was supposed to be...",
	id = 601020,
	detail = "Commander, I'm currently on patrol. Do you have any new instructions for me?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[601021] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Ugh... I s-suppose I'm not cut out for this after all...",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "",
	mission = "Wouldn't it be better to finish the missions first...",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Lady Veneto advised me to enjoy my time off by changing into something befitting the occasion... Um, Commander, I d-don't look strange, do I?",
	mail = "",
	touch = "Commander! Err, I mean, good day?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Lady Veneto advised me to enjoy my time off by changing into something befitting the occasion... Um, Commander, I d-don't look strange, do I?",
	feeling5 = "I once said I wanted to be your bodyguard, but when we're walking together like this, it feels like you're guarding me instead. Would this be dereliction of duty...? Ah! I wasn't saying that I disapproved of it! *sigh*...",
	main = "If you're thirsty, I brought some water. Here you go! |The warm sunlight, the gentle breeze, and an ice pop to beat the heat! That's the spirit of midsummer! |Commander, I heard from a friend that all girls have multiple facets... When I changed into this outfit that I'd absolutely never wear normally... it, it was as if something awakened within me...",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Welcome back, Commander. W-would you like to accompany me on a walk while we both have some time off? S-sorry, I hope I'm not being pushy...",
	vote = "",
	hp_warning = "",
	id = 601021,
	detail = "I can't help but to feel a little different when I put on these clothes. I know it's supposed to feel light and refreshing, but instead I feel defenseless and nervous...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[601030] = {
	feeling1 = "Sadly, there's no cure for your chronic hopelessness, Commander.",
	feeling3 = "I was born in the historic port of Livorno, a dreamy city on the gorgeous Sardegnian west coast! You should visit it with me if you ever get the chance, Commander!",
	lose = "Dangit... You won't discourage me so easily!",
	propose = "You want to... get engaged with me?! B-b-b-but I...! Calm down, GB! Don't get too excited, be cool and graceful like a big sister and respond with grazia! Okay, now... I say, Commander, would you be a darling and put the ring on my finger?",
	expedition = "The commission team has returned!",
	win_mvp = "Hehe, easy as pizza pie! Err, I mean... Of course, just as expected! Nothing to get excited over!",
	home = "How about a victory hug for everyone? Would that make me seem more mature?",
	mission = "Hm? New mission directives? But I'm not ready yet... Oh, they're not for me?",
	touch2 = "Whuah?! You're a real creep, Commander...",
	voice_key_2 = -1,
	skill = "I'm going all-out!",
	drop_descrip = "Alfredo Oriani-class destroyer – Vincenzo Gioberti.",
	mail = "Here, I brought your mail, Commander.",
	touch = "Huh? I've not done anything weird, have I?",
	profile = "I'm Vincenzo Gioberti, the second Alfredo Oriani-class destroyer. I stood shoulder-to-shoulder with valiant cruisers in many battles across– Huh? That's not quite right? Okay, my completion was a bit behind, but I was second to be launched among my siblings, so I do qualify as a bona fide big sister!",
	mission_complete = "Mission completed. Now where's the rewards report?",
	feeling4 = "You only find my floundering endearing and cute because you make me flounder so much! ...Th-th-that said, I'm perfectly fine with being called c-cute...",
	unlock = "I am Vincenzo Gioberti of Sardegna! ...Eh, my name's hard to remember? ...Hmm, how about just \"GB\" then? That's a bit easier, right?",
	feeling5 = "If you and I had met under different circumstances, like as classmates... then maybe we'd be in a typical romantic relationship... J-just thinking out loud, that's all!",
	main = "S-Simoom isn't around here, is she? Ahem! Not to imply I'm afraid of her, my question simply stems from a sincere desire for amity and courtliness.|Oh goodness! Seriously, could you not pull weird faces while I'm trying to work?|Commander, would you care for a delectable dessert? I personally recommend tiramisu!",
	battle = "Rest easy knowing I won't let you down, Commander!",
	upgrade = "One step closer to blooming into a gorgeous signorina!",
	voice_key = 60103,
	headtouch = "H-hey! I've grown out of headpats! They don't work on me, nuh-uh!",
	feeling2 = "Hmm... I wonder how long it'll be before I become a fine lady like Veneto...",
	login = "It's the start of a lively day! Keep at it, Commander! I-I'd better get ready for work too!",
	vote = "",
	hp_warning = "Oh no! Deploy smokescreens!",
	id = 601030,
	detail = "Anything GB can help you with? I'm the oldest among my siblings and can do absolutely anything! Go on, let's hear it!",
	couple_encourage = {
		{
			{
				60102
			},
			1,
			"You don't need to be so formal with me, you know.",
			0
		},
		{
			{
				20502
			},
			1,
			"*gasp*! W-we're on the same side now, right...?",
			0
		}
	}
}

_G.pg.base.ship_skin_words[601032] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "I'm a signorina – I do of course understand if you're too busy for pleasantries, Commander. Having said that... You should at least tell me before you go out, all right?",
	mission = "",
	touch2 = "You'll never receive another party invitation from me again!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "\"To refuse a fair signorina's invitation would be most uncouth\"... Hehe~ Now, Commander, would you like to partake in some refreshments? Rest assured, they're all non-alcoholic♪",
	mail = "",
	touch = "Fare un brindisi! Indeed, this is how a signorina raises a toast.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "\"To refuse a fair signorina's invitation would be most uncouth\"... Hehe~ Now, Commander, would you like to partake in some refreshments? Rest assured, they're all non-alcoholic♪",
	feeling5 = "",
	main = "This \"for adults only\" drink has gott my attention... Could I at least have a taste?|Commander, as this is an informal gathering, you are free to say whatever you please! I am a grown lady, and I can handle it!|We have some lovely tiramisu resting on the counter, Libeccio! Call over Maestrale and we'll all savor it together!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "A refill, if you would, Manjuu waiter! Likewise for the Commander's glass, please! Now let me just... Hup... Ugh, these bar stools are sure are tall...",
	vote = "",
	hp_warning = "",
	id = 601032,
	detail = "You may drink to your heart's content today! Worry not, just put it on my tab! ...Huh? The drinks were free to begin with?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[601040] = {
	feeling1 = "Keep your distance from me! Shoo, shoo...!!",
	feeling3 = "Commander... Please look over this. It's a table of our recent mission earnings... I hope it can be of help to you...",
	lose = "I've been defeated... What should I be saying...?",
	propose = "Wh-what should I be saying during a wedding ceremony? ...Um, I don't need to say anything at all? Well then... *kiss* Th-that's fine too, right...?",
	expedition = "A commission has been completed. The dockhead is looking rather crowded...",
	win_mvp = "My thoughts about getting MVP? ......Uh, umm, it's nice...?",
	home = "How to make tea... Um, take the teabag and steep it in hot water... Commander, p-please let it sit for a few minutes...",
	mission = "Are you going to... continue working on your high-priority missions? Err, I mean... let, let me help you!",
	touch2 = "...Wh-what is the meaning of this?!",
	voice_key_2 = -1,
	skill = "N-now it's my turn!",
	drop_descrip = "Maestrale-class destroyer – Maestrale.",
	mail = "The mail, where'd I put the mail...? Phew, I almost forgot it after all the time I spent organizing it...",
	touch = "D-did I say something inappropriate?",
	profile = "I am the name ship of the Maestrale-class destroyers, Maestrale. During that war, I remember hitting a naval mine and having to return to port for repairs... The rest of my history? Umm, I, I don't think there's anything else...",
	mission_complete = "Mission complete. Umm, should I go help you confirm the rewards after all...?",
	feeling4 = "...Commander? Why'd you come all the way... t-to talk to me? Um, right now, I'm a bit... err, I mean, yes, I'm available! I'm available, but I can't... Sorry...!",
	unlock = "Now lift the rim of your skirt and bow... Ahem! I'm Maestrale, d-destroyer from the Sardegna Empire. Greetings to you and your fleet, Commander. I hope I did that right...",
	feeling5 = "Um, Commander, please take this...! Libeccio told me that if there ever was something I'd never be able to say... to put it down in a picture book! P-please take a look...!",
	main = "What do I think of Libeccio? ...She's my precious little sister. She can be a bit of a klutz at times though, ehehe...|The documents I was just working on are over here, and the already-finished ones are here... Ah, it's not that I couldn't find them, I just thought it'd be more efficient to remind myself out loud... S-sorry... *blushes*|Commander, you must be tired... Ahh, just thinking about it makes me nervous...",
	battle = "As the flagship... I've got to boost everyone's morale... Roar...!",
	upgrade = "Shelling, torpedoes, and reloading... I must become stronger in all aspects...",
	voice_key = 60104,
	headtouch = "Wh-what's going on...?",
	feeling2 = "Libeccio, please don't bother the commander in the middle of work hours... Here, I'll make a syllabus of the times when the commander is available. Mm, that should be right... hopefully.",
	login = "Greetings, greetings... G-good morning to you, Commander...",
	vote = "",
	hp_warning = "What should I do...? What should I do?!",
	id = 601040,
	detail = "If only Libeccio was here... I wouldn't have to agonize over how to talk to the commander...",
	couple_encourage = {
		{
			{
				60105
			},
			1,
			"Libeccio, w-w-wait for me...!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[601041] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	couple_encourage = "",
	expedition = "",
	win_mvp = "",
	home = "Commander, did you come all the way here to see me? Th-thanks for your concern...",
	mission = "",
	touch2 = "P-please stop that...!",
	propose = "",
	skill = "",
	drop_descrip = "It's way too crowded on the beach... I'd much rather be– Oh, Commander? Are you not good with crowded places either...?",
	mail = "",
