_G.pg.base.ship_skin_words[602010] = {
	feeling1 = "You've proven yourself a spineless imbecile. Get out of my sight!",
	feeling3 = "Don't fret over each and every obstacle you face, Commaner. Your subordinates will do all in their power to help.",
	lose = "Alas, we must shamefully turn our backs on our foes...",
	propose = "This ring could only mean one thing. You want my support till death do us apart, no? Then I will oblige. After all, there is no greater joy than knowing you want me by your side forever. Hahaha.",
	expedition = "The commission team has returned to port. It is part of your job to acknowledge their efforts, is it not, Commander?",
	win_mvp = "I am the Empire's splendor – Duca degli Abruzzi! Etch this name into your memories!",
	home = "If you need rest, now is the time to get it, Commander. We will have much to do afterwards.",
	mission = "Say the word, and I will complete these missions for you.",
	touch2 = "What has gotten into you?!",
	voice_key_2 = -1,
	skill = "Witness my full potential!",
	drop_descrip = "Duca degli Abruzzi-class light cruiser – Luigi di Savoia Duca degli Abruzzi.",
	mail = "You have a letter. Whoever wrote it is brutishly uncourteous... It's what? From Naval HQ? I see.",
	touch = "What do you need, Commander? I can perform some of your duties in an official capacity.",
	profile = "I am the Condottieri-class light cruiser Luigi di Savoia Duca degli Abruzzi, from the Sardegna Empire. I fought valiantly alongside my esteemed allies during the war. My ambition now is to achieve lustrous feats as the Empire's splendorous flagbearer!",
	mission_complete = "Mission complete. It's time you looked over the rewards.",
	feeling4 = "I am not just a soldier at your disposal, Commander. I am someone with a desire to understand and support you to my utmost. This desire has nothing to do with rank or status.",
	unlock = "I am light cruiser Luigi di Savoia Duca degli Abruzzi, Sardegna's splendorous dignitary. I've waited for the day to fight under your banner, Commander.",
	feeling5 = "What do you want to discuss today, Commander? One cannot do much without the aid of loyal supporters, and I strive to be your biggest one. Hahah. It's the least I can do to return the recognition you've given me. ",
	main = "How can you sit idly like this, Commander? We dignitaries must set an example for others to follow.|It matters not how strong your adversary is as long as you are stronger. That is what war boils down to.|Hmm. Climb Mount Niitaka? I see I'm not alone in the desire to mountaineer... What? That's not what the message means?",
	battle = "To battle! My splendor shall be proven!",
	upgrade = "Now the question is, how to make the best use of my new abilities?",
	voice_key = 60201,
	headtouch = "",
	feeling2 = "My name is Luigi di Savoia Duca degli Abruzzi. You find that too hard to memorize? Then you may shorten it to Duca degli Abruzzi, but no less than that. My dignity won't allow it.",
	login = "Greetings, Commander. The Empire's splendor radiates as brightly as ever.",
	vote = "",
	hp_warning = "As long as I can still fight, I will!",
	id = 602010,
	detail = "I am the final development from a class of treaty cruiser. With the performance enhancements I recieved, victory is but guaranteed in any battle I partake in.",
	couple_encourage = {}
}

