_G.pg.base.ship_skin_words[603030] = {
	feeling1 = "A commander that acts in this manner is in need of some \"re-education.\"",
	feeling3 = "Commander, focus on what you need to do. I'll take care of any annoying little obstacles in your way.",
	lose = "My mantle's all dirty now. What a shame...",
	propose = "Commander, once you've become my chosen partner, you must be prepared to be bound with me for a lifetime. Are you willing to sign this \"contract\" with me?",
	expedition = "The commission fleet has returned. All your girls are such hard workers.",
	win_mvp = "MVP? Why, that's only natural. Enemies of this caliber aren't even worthy of staining my mantle.",
	home = "Welcome back, Commander. Bring back any juicy gossip for me?",
	mission = "You've got to stay motivated and finish your work... Or, were you expecting me to give you some \"motivation?\"",
	touch2 = "You surely didn't do the same kind of stuff to Zara, right?",
	voice_key_2 = -1,
	skill = "Let's have a little bit of fun~",
	drop_descrip = "Zara-class heavy cruiser – Pola.",
	mail = "Commander, there's mail for you from the Naval HQ. You might miss some important information if you drag your feet~",
	touch = "My rapier is not simply for show, you know.",
	profile = "I'm the fourth ship of the Zara-class heavy cruisers, Pola. My sisters and I have stronger armor rarely seen on heavy cruisers, which gives us an advantage in artillery battles. In terms of my abilities to serve as flagship... I might be a bit more suitable than Zara?",
	mission_complete = "All done with the missions, huh? That's what I want to see. ...I haven't forgotten about the reward. Mind waiting there for a bit? Hehe~",
	feeling4 = "So, between Zara and me, who do you like better? Well... you wouldn't know the answer to that unless you tried, right~? Hehe~♡",
	unlock = "I'm Pola, heavy cruiser from Sardegna. And you're the commander of this fleet? I see. Well, don't let me down, okay? Hehe~",
	feeling5 = "Because you're so kind, I worry about you too, just like with Zara. But... because of your kindness, we also know that we can entrust you with our futures.",
	main = "All these \"conventions\" and \"treaties\"... Things that do not consider the feelings of actual people should disappear from this world.|A true fighter does not fear any danger. I won't back down even in the face of a heavy storm.|The feeling of being enveloped by a searchlight... makes me a bit uneasy.",
	battle = "The small fry never seem to learn their place.",
	upgrade = "Oh? Some interesting developments.",
	voice_key = 60303,
	headtouch = "",
	feeling2 = "My gentle and compassionate Zara simply doesn't know how to say no to others. I wonder, what should I do...",
	login = "Hehe, you sure took your sweet time. The fleet exercises are about to start without you~",
	vote = "",
	hp_warning = "My turret won't move? Why... at a time like this...?",
	id = 603030,
	detail = "My Zara is always so gentle and lovely, I just can't take my eyes off her.",
	couple_encourage = {
		{
			{
				60302
			},
			1,
			"Zara, your hands are so warm...",
			0
		}
	}
}

_G.pg.base.ship_skin_words[603031] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Damn it... I'll remember this!",
	propose = "",
	expedition = "",
	win_mvp = "Much easier than a match against Zara. Heheh~",
	home = "Commander, don't expect me to save your life even if you're drowning~ ...Oh, Zara already taught you to swim? Hmph... Lucky you.",
	mission = "",
	touch2 = "Jeez, Commander... I know you're the impatient type, but are you sure you want to suffer the same fate as this manjuu?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Zara, how dastardly of you to spike the ball at such a time– Eek?! Commander?! Why are you in a place like that?",
	mail = "",
	touch = "What are you staring at? Hehe, spit it out already... Just what were you thinking about?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Zara, how dastardly of you to spike the ball at such a time– Eek?! Commander?! Why are you in a place like that?",
	feeling5 = "",
	main = "...Isn't this swimsuit... a bit too tight...?|This obstinate starfish... C-Commander, come give me a hand here... Eek?!|Littorio, how about a 2v2? Heheh, though having Veneto on your team would be too much of a handicap, so how about I lend you the commander?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "I do say, if you want to watch the game from over there, don't come crying to me when you get hit by a stray ball. Got it?",
	vote = "",
	hp_warning = "",
	id = 603031,
	detail = "Commander, you're not satisfied with this game being for your eyes only, right? Hehe~ In that case... You can be the referee as well. Any objections, Zara?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[603040] = {
	feeling1 = "Are you happy now? Sigh... I'm going to fix you. You WILL learn some damn discipline.",
	feeling3 = "Done with your job? Okay. Have a nice dinner, then treat yourself to a bath. You'll feel as good as new after a hard day's work, trust me.",
	lose = "This is all on me for being too damn lenient!",
	propose = "I figured you were dying to tell me something... Huh? Did you arrange all this to propose to me? You're sure this isn't some mistake? S-s-so this ring is for ME?! Have you had these feelings for me all along? That... makes me so happy! I just...",
	expedition = "The commission team has come back. Phew... I'm glad they're okay.",
	win_mvp = "Now do you get why I'm so strict, Commander? It's because discipline begets victory.",
	home = "I'll check through the after-action report. In the meantime, reflect on your battle with the girls. Go on, get to it.",
	mission = "Keep your nose to the grindstone. These missions won't finish themselves. Do a good job and I'll treat you to a home-cooked meal.",
	touch2 = "...Huh?!",
	voice_key_2 = -1,
	skill = "Keep an eye on your surroundings!",
	drop_descrip = "Trento-class heavy cruiser – Trieste.",
	mail = "Best to read your mail now before you forget about it.",
	touch = "Need a break, do you? Fair enough. I suggest doing some stretches.",
	profile = "I'm Trieste, second ship of the Trento class. I saw action in the Mediterranean and was to become a carrier, but... Never mind. Forget what I just said.",
	mission_complete = "You've done well. Here you are, as promised. It's a good thing I wrote that down.",
	feeling4 = "That sortie sure took its toll on you. You should probably take some time to rest. Rework today's timetable as needed and I'll relay the changes to the others... Huh? You want me to rest with you?",
	unlock = "I am Trieste, Trento-class heavy cruiser number two. My job is to help you with your work. Now, would you stop gawking and get back to it?",
	feeling5 = "I don't need to rest, though. Why do you want me to stick around? I suppose I could monitor to ensure you are getting enough rest... Okay, hang on, I'll be there in a moment!",
	main = "I'll schedule the resupply shipment. Better I do it than trust an underachiever to produce good results.|You made an error in this paragraph. Fix it yourself – it's tiring enough just pointing out mistakes. Don't make me dump more assignments on you.|People put pineapple on pizza?! That's disgusting! That's a war crime against Sardegnian cuisine!",
	battle = "Everyone do your part, or else I'm giving you detention!",
	upgrade = "A smart move on your part.",
	voice_key = 60304,
	headtouch = "",
	feeling2 = "No time to rest, Commander. You've done your job, but not the assignment I gave you. Start on it now, or you'll fall behind.",
	login = "Right on time. It's good to know you're punctual. Try to be here the same time tomorrow.",
	vote = "",
	hp_warning = "Well, this is a conundrum...",
	id = 603040,
	detail = "Why are you here and not in your office, working? Shoo with you. You're still on duty.",
	couple_encourage = {
		{
			{
				60301
			},
			1,
			" Show some restraint with the teasing.",
			0
		}
	}
}

_G.pg.base.ship_skin_words[603041] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "I think the commission team is back. Down there – isn't that them?",
	win_mvp = "",
	home = "This selection of dishes should work for half a year without feeling too samey. Tomorrow I think I'll... Oh, welcome back, Commander. I was just thinking out loud about our boxed lunches.",
	mission = "Don't neglect your missions. You're keeping me and Trento waiting.",
	touch2 = "Yup, I really don't know how to approach you...",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Oh my, are you done with your errands already? Surely, you didn't skip work just to eat lunch with... Ah, sorry for doubting you. Alright, let's go. Trento is waiting for us.",
	mail = "",
	touch = "You're THAT eager to have lunch with me? What am I to do with you...",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Oh my, are you done with your errands already? Surely, you didn't skip work just to eat lunch with... Ah, sorry for doubting you. Alright, let's go. Trento is waiting for us.",
	feeling5 = "",
	main = "I don't know how to approach you when I wear this uniform. Do I treat you as an upperclassman? Should I address you differently, or like normal?|What's for lunch today? You'll have to see for yourself. I'll tell you this: it's a dish both you and Trento like.|How do you hope to spend the prime of your life, Commander? Making great memories to look back on, and the like?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "",
	vote = "",
	hp_warning = "",
	id = 603041,
	detail = "It's perfectly normal to wear uniforms at school... Can you handle it though, Commander? You look worked up for some reason.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[603042] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Oh no... My head's going completely blank...",
	propose = "",
	expedition = "Is the commission team bathing after us? Hmm... I can't quite remember...",
	win_mvp = "The sea breeze is so refreshing... Thank goodness.",
	home = "Don't let yourself get cold. Keep your shoulders below the water. There, that's great... D-did I sound like Trento just now?",
	mission = "In a bit... Okay. Missions first, then I'll go back in.",
	touch2 = "Whew... Wh-what's gotten into you?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Whew... I'm getting dizzy... I'll rest in the breeze for a moment. You okay, Commander? Step out if it's too hot. See, someone will worry about you...",
	mail = "You've received a letter. Better check it after this bath.",
	touch = "Whew... This cool breeze is just what I needed.",
	profile = "",
	mission_complete = "Can't you ask someone else to get the mission rewards? Or would you rather do it yourself first, and continue your bath later?",
	feeling4 = "",
	unlock = "Whew... I'm getting dizzy... I'll rest in the breeze for a moment. You okay, Commander? Step out if it's too hot. See, someone will worry about you...",
	feeling5 = "Ugh... I'm sorry for making you worry when this was supposed to be a relaxing vacation for you... Can I make it up to you somehow? We're alone out here, so you can fawn on me all you want... Y-yeah, well, Trento lets you do it all the time!",
	main = "Didn't I tell you to focus on relaxing today? Come into the water – your work can wait. Whew... That's more like it.|Excited about dinner after this bath? So am I. I'll very eager to see what sort of food they serve here.|Mmph... I'm feeling a bit dizzy... I might have caught a fever, because I feel hot all over... Mmh...",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "*pant*... *pant*... This is much too hot for my liking. Can you handle it, Commander? Are you sure?",
	vote = "",
	hp_warning = "",
	id = 603042,
	detail = "I know I'm strict with you... Mmh... I just want to say, thank you. Like Veneto always says, it's a good time to be frank with people when you're bathing with them.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[603050] = {
	feeling1 = "Please stay away from us! You don't deserve any support from the girls with how you are acting now.",
	feeling3 = "You're still worried about me? I appreciate the concern... Zara may be right with what she said about me inadvertently distancing myself from people...",
	lose = "We... have failed. I knew I'm not cut out for this...",
	propose = "Um... I'm hesitant to say this after you've been so kind to me, but... are you sure I'm the one for you? I just sincerely hope you're not giving me this out of pity or concern. If not, then... Then I'll g-gladly accept!",
	expedition = "The commission team has arrived in port. Phew... I'm glad they're okay.",
	win_mvp = "Victory is ours. Let's move – our friends are waiting for us.",
	home = "The Commander has returned. All ships, prepare to repair and restock, then gather combat data on the mission.",
	mission = "We have been informed of new missions. Please stand by until all ships have received the sortie order.",
	touch2 = "Wh-what are you doing...?",
	voice_key_2 = -1,
	skill = "Bolzano, commencing bombardment!",
	drop_descrip = "Heavy cruiser – Bolzano.",
	mail = "There's a letter for you, Commander. Here you are.",
	touch = "Yes? I will do anything you deem me suited for.",
	profile = "I'm Bolzano, Sardegnian heavy cruiser. I took part in naval reviews before the war, then fought in live battles during it. A streak of bad luck left me irrepairable, so I was stripped of my rigging and ultimately sunk in a harbor. *sigh*...",
	mission_complete = "Mission complete. Mhm, this is good.",
	feeling4 = "You'd like to take me somewhere on your day off? If that's your order, then okay... Um, I'm afraid I don't have a favorite movie! I prefer things like books and theater over movies, you see...",
	unlock = "Sardegnian heavy cruiser Bolzano, reporting in. I am hereby under your command. Um, if that's all then I'll be taking my leave now.",
	feeling5 = "I'm sorry for ruining it by forgetting about you and bursting into tears from the performance... I've always been so easily moved by these kinds of stories... And that's despite how overjoyed I was that you invited me to see the play...",
	main = "Gorizia, you're not like me – you can keep fighting... I'm doomed to stay like this forever...|I've gathered the documents for your meeting. What would you like me to do next? Please don't hesitate to give me orders.|I should start thinking about how to spend my next day off... Maybe doing something where you can still call me in at a moment's notice...",
	battle = "Allow me to prove myself in combat!",
	upgrade = "I'm steadily becoming stronger. Thank you.",
	voice_key = 60305,
	headtouch = "",
	feeling2 = "I'll take my leave now if that will be all... Zara asked about me? Oh... Well, I'm perfectly fine. Forgive me for making her worry...",
	login = "I'm the secretary... Welcome back, Commander. Here is today's schedule.",
	vote = "",
	hp_warning = "I don't want to be locked up in the dock again...!",
	id = 603050,
	detail = "Anything... I will perform any task if you think I'm suited for it. Ah, I'm just saying IF! Please don't go out of your way for me if it's more trouble than it's worth.",
	couple_encourage = {}
}

