_G.pg.base.ship_skin_words[605022] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Let us have a grand toast to the triumphant return of our hero. Alla salute!",
	mission = "",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Welcome to Littorio's personal suite. Are you here to issue me a challenge of who can romance the most girls? Hahahah, I'm joking of course! There'd be no fun in a game I would win every single time.",
	mail = "",
	touch = "To be frank, I've been to so many parties that I've grown a bit tired of them. Let's do something interesting for a change, shall we, Commander?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Welcome to Littorio's personal suite. Are you here to issue me a challenge of who can romance the most girls? Hahahah, I'm joking of course! There'd be no fun in a game I would win every single time.",
	feeling5 = "Commander... you are an unlabeled bottle of fine riserva with more charm than meets the eye – your taste enchanting, maddening, and making one possessive over you. And I – Littorio – am no exception, tesoro mio.",
	main = "Now, who will be the lucky recipient of Littorio's rose this time? Oh, but of course, Commander. If you want it, maybe you'll get it?|There are two kinds of parties in the world: those with Littorio in attendance, and those without.|I personally picked out all the various furnishings in here. It is no exaggeration to call this suite \"La Littorio\" itself. How do you like the sound of that, Commander?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "None but you are permitted to keep me waiting, Commander.",
	vote = "",
	hp_warning = "",
	id = 605022,
	detail = "As proud as we are of our wonderful Sardegnian thermae, and as befittingly charming it is when Veneto conducts foreign relations from them, the fact remains that diplomacy should be left to the pros. Wouldn't you agree?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[605023] = {
