	voice_key_2 = -1,
	skill = "",
	drop_descrip = "You seem to have known that I would be here. Then stay and spend the night with me. Just the two of us.",
	mail = "You have a new letter. I believe it's a ballet invitation. Shall we attend, or are you too busy? I shall dispose of it if so.",
	touch = "This is what a pas de deux is like? How novel.",
	profile = "",
	mission_complete = "A mission has been completed. Strange, as I could've sworn you've been here from the start... Are you able to clone yourself? Heehee.",
	feeling4 = "",
	unlock = "You seem to have known that I would be here. Then stay and spend the night with me. Just the two of us.",
	feeling5 = "",
	main = "You wish to see me perform on the stage? I'd be happy to if it would spread Romulus' splendor... However, I ask that you be patient until I've perfected my dance.|While the cursed princess-turned-swan can only reassume her human form at midnight, I can dance whenever I please.|Garibaldi, despite the nonchalance she ordinarily displays, plays the black swan quite well. I sincerely acknowledge her skill.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Our march fades into the blackness on nights with dim moonlight. That is likely the reason I why couldn't detect your presence here.",
	vote = "",
	hp_warning = "",
	id = 605031,
	detail = "A bath is a great way to wash off the fatigue of dancing. I say that not just for myself, but for both of us.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[605050] = {
	feeling1 = "You will eventually pay the price for your arrogance.",
	feeling3 = "Commander, what do you think about when you gaze up into the night sky? I always think back to that night... when the skies were ablaze with what looked like countless meteors.",
	lose = "Ngh... Must I also bow my head to the passage of time...?",
	propose = "You're giving such an important thing to me...? I... this is... ahh! I'm sorry, I can't keep my composure, but I'll try my best to say it... \"I do!\" How's that? P-please let this embarrassing ritual be over already...",
	expedition = "The commission squad has returned to port. Were you sending this bunch to a parade or something?",
	win_mvp = "One will never tire of victory.",
	home = "A hard fought battle. Next, there are many missions that you must attend to... Oh my, it would appear that I've accidentally finished everything. Do have some tea and rest for a while.",
	mission = "Hmm... The number of missions you've completed seems to be lower than the number of missions you were given. Commander, may I ask why?",
	touch2 = "Just how little do you think of me?",
	voice_key_2 = -1,
	skill = "This volley... shall not be my last! ",
	drop_descrip = "Conte di Cavour-class battleship – Conte di Cavour. ",
	mail = "New mail has arrived... I'm not your butler, and you're perfectly capable of getting it yourself. Look, it's by your right hand.",
	touch = "Allow me to say this: judging people by their appearance will be your downfall.",
	profile = "I witnessed the ascendancy of the Imperial Fleet as well as its decay into powerlessness. Commander, I pray that you, as the leader of the fleet, will never repeat the tragedies of the past.",
	mission_complete = "One more name off my list... Oh, I was talking about the list of unfinished missions.",
	feeling4 = "Long live the glory of the Sardegna Empire... Forget it, it's all in the past now. I'm getting used to being in this fleet, so let's look ahead.",
	unlock = "I am the dreadnought, Conte di Cavour. There is much that I can do for you, Commander, but that depends on whether or not you are trustworthy.",
	feeling5 = "I said \"let's look ahead,\" right? In that case, I'll cover your back. That way, no matter what happens, you can always keep your eyes ahead of you and leave the rest to me.",
	main = "A gown? I have no interest in things like that. Nor will I ever. |Commander, if I ever get invited to one of those Royal tea parties, please tell them that I am too busy with secretary work. |Some people used to hold me to lofty expectations, but it feels natural to see the next generation surpass me.",
	battle = "It is time to clad yourselves in courage and wisdom!",
	upgrade = "Thanks for your consideration.",
	voice_key = 60505,
	headtouch = "",
	feeling2 = "As one of Sardegna's veterans, I have ample experience ranging from communication to fleet management. If you need any advice, feel free to ask me.",
	login = "Save your breath. Let's begin today's work.",
	vote = "",
	hp_warning = "Everyone, stay vigilant!",
	id = 605050,
	detail = "Leonardo da Vinci... had that tragedy not occurred, she surely would've fought to the last breath for the glory of the Sardegna Empire, just like Cesare.",
	couple_encourage = {
		{
			{
				20502
			},
			1,
			"A Royal Knight, huh? I never expected to fight alongside someone like you.",
			0
		},
		{
			{
				60506
			},
			1,
			"Cesare, follow me!",
			0
		},
		{
			{
				6
			},
			3,
			"The glory of Sardegna... yes, it used to shine brighter.",
			3
		}
	}
}

