	profile = "My \"history\"...? Hmm... I do feel a longing for something like that. If only I had been finished a little sooner during that war... My Commander, don't you think I would've had an enviable service history?",
	mission_complete = "My Commander, I just knew you'd complete your missions without a hitch! Thank goodness~",
	feeling4 = "My Commander, look out! ...Phew, thank goodness. By the way, why did you come visit me in the middle of my aircraft training? Did you... perhaps want to see me at my most vulnerable?!",
	unlock = "Good day to you, my Commander. I'm Aquila, aircraft carrier from the Sardegna Empire. Our meeting today is no mere coincidence. No, it must be a gift from Fortuna herself, I'm sure of it.",
	feeling5 = "There's been something on my mind recently... \"Just how should I make myself more appealing to you, My Commander?\" ...What do you think? Please, teach me all sorts of things~♪",
	main = "Sleeping on the job is not something that an excellent commander would do. My Commander... *poke* *poke*... Care to wake up?|My Commander, you should try using gentle words to get an emphatic point across. You'll find the results quite remarkable.|My Commander, will you allow me to organize the warehouse with the help of my planes? ...The previous accident? Well, that was just a one-off thing~ Ahaha...",
	battle = "Mm, hmm! Yes, this is how it's supposed to be... Fly, my aircraft, fly!",
	upgrade = "I feel more experienced now... As long as I do as I practiced in battle, I'm sure everything will be fine!",
	voice_key = 60701,
	headtouch = "",
