_G.pg.base.ship_skin_words[701030] = {
	feeling1 = "Comrade Commander, you're really quite an insipid person. You won't score any admirers that way.",
	feeling3 = "Ahaha... Comrade Commander, we're already friends, right? So, uh, when they come to collect debts, could you... Hey, wait, why are you running!",
	lose = "Woah, woah, time out! I'm not ready to retreat yet! Waaah!",
	propose = "This means we've signed off a lifelong contract! Comrade Commander, we'll always be together from here on out! Don't worry, don't worry, I'll be gentle!",
	expedition = "Commission complete! Hehe, first, we have to welcome everyone back!",
	win_mvp = "How's that? My power is surging! That's right, don't get jealous!",
	home = "I can't control my overflowing inspiration! Even though you just came back, I can't...",
	mission = "Comrade Commander, wait until you hear about the latest idea I got! Hey, wait, don't run away!",
	touch2 = "Eh...?! Is this revenge for something I did?!",
	voice_key_2 = -1,
	skill = "It's my turn! Fiiire!",
	drop_descrip = "Leningrad-class destroyer – Minsk.",
	mail = "Ah, um... Just give me a minute to come up with an explanation as to what I'm doing in this room full of mail...",
	touch = "Hm? Did you stumble into your own inspiration, Comrade Commander?",
	profile = "I'm the Project 38 destroyer, Minsk. I fought in the Great War alongside my sisters! Comrade Commander, expect great things from my inspiration... and my hard work!",
	mission_complete = "Long live the rewards! Err, so, where's my share?",
	feeling4 = "Comrade Commander, I thought you were a real hardass, but turns out, you're actually quite interesting! You have quite a lot of ideas of your own... and most importantly, you don't chew me out when I mess up! Hahaha!",
	unlock = "Ура! How's that, what'd ya think? Huh? Where I'm from, they said you're supposed to surprise the people you're greeting! What, I'm the one being welcomed?! Sorry, I mixed something up!",
	feeling5 = "All right, I finally understand now! I've finally reached a conclusion as to why I'm always thinking about you! So here's my hypothesis: I'm in love with you! Hehe, does that sound right?",
	main = "Gangut...? Err, I mean, Comrade Gangut? Hmm, she kind of scares me... |My fighting spirit, just like my inspiration, is unbreakable! That's right, I'll stand back up again! |When I mess up, I make sure to apologize profusely! That way, everyone will forgive me... hopefully.",
	battle = "Can you keep up with me? Ура!",
	upgrade = "Woahh! I'm getting inspired again!",
	voice_key = 70103,
	headtouch = "",
	feeling2 = "Comrade Commander, if you want people to like you, you've gotta be an interesting person yourself! In other words, what you need is a dose of inspiration!",
	login = "Comrade Commander, you came at just the right time! I just had a flash of inspiration and came up with a new strategy! Come test it out with me!",
	vote = "",
	hp_warning = "Looks like it's time for me to get serious!",
	id = 701030,
	detail = "Heheh~ Comrade Commander, have you come to participate in my new inspired experiment?",
	couple_encourage = {
		{
			{
				70201
			},
			1,
			"Woah, Avrora, you're totally inspir... I mean, shining today!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[701031] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Prisoner, exercise time is over! Hurry up and get back into the office!",
	mission = "",
	touch2 = "Congratulations, you've earned yourself a one-way ticket to a Siberian potato-digging trip! Sign right here, and enjoy~!",
	voice_key_2 = -1,
