_G.pg.base.ship_skin_words[701050] = {
	feeling1 = "I can do this by myself... I don't need your help.",
	feeling3 = "Dear comrade, are you concerned about our teamwork? Heh, there's no need for concern. This kind of cooperation is second nature to us girls from the Northern Parliament.",
	lose = "Were we out of step? But why...?",
	propose = "Heheh~ You're still too naive, dear comrade. There's no way I'd be satisfied with just being one star in a constellation. I'll shine the brightest of them all! That's why you shouldn't take your eyes off me even for a second~♪",
	expedition = "The commission has been completed. Even if I'm an idol, I can't neglect my normal line of duty.",
	win_mvp = "This victory is a testament to my abilities, not just that of the Muse System!",
	home = "Cola and tea, chocolate milk, juice, and vodka... Everyone's back all right... Dear comrade, what would you like?",
	mission = "Dear comrade, there's work to do. Come on, let's get to it.",
	touch2 = "D-dear comrade?!",
	voice_key_2 = -1,
	skill = "Don't even think about looking away!",
	drop_descrip = "Dear comrade, what do you think about this outfit? Is that so... I went out of my way to become an idol and that's your reaction? Hmph, I'll rock your socks off soon enough.",
	mail = "Looks like work from the agency. Dear comrade, let's look it over before showing it to Baltimore's group?",
	touch = "Chocolate for me? Is that so... Thanks for the support, dear comrade.",
	profile = "I'm Tashkent, destroyer from the Northern Parliament, and now an idol participating in the experimental Muse System. I'll show you the tenacity of the Northern Parliament.",
	mission_complete = "That should wrap things up! You did pretty well!",
	feeling4 = "It really is hard to express our individuality while performing as a group... Even though my dear comrade was concerned, I still... Oh, what is it? Did you come to help me...?",
	unlock = "How do you like my outfit, dear comrade? ...Is that so? After all of Tashkent's work to become an idol, that's how you react? Hmph. Just you wait. My next concert will rock your socks off.",
	feeling5 = "Dear comrade, what do you think of me now? ...Is that so. Look, I've taken lessons with the others and performed on stage. You don't need to worry about me anymore, for real this time. Hehe~♪",
	main = "The other experimental ships all have instruments? Is that so? I don't plan on losing to anyone, no matter who they might be.|That Albacore really is something... She's got ideas for everything from costumes to choreography.|It's hard to keep your dance steps in sync... If you're just singing, you can pretty much hear how things are going. But if you're focused on dancing, you can't always be looking at the others.",
	battle = "Ура! Let's get this show on the road!",
	upgrade = "Guess it's time to get serious. Hehe.",
	voice_key = 70105,
	headtouch = "Are you seriously giving me the kiddie treatment? Hmph!",
	feeling2 = "Are you looking forward to my idol debut? Is that so... Well, considering this is an armament test and whatnot, I guess I can put in a little effort.",
	login = "Dear comrade, please go over our daily itinerary with us.",
	vote = "",
	hp_warning = "My dear comrade is watching me...!",
	id = 701050,
	detail = "I've always been good at dancing, and I trust that my vocal skills won't disappoint either... Still worried about me, dear comrade? ...So, you're too much of a worrywart. I can handle this.",
	couple_encourage = {
		{
			{
				90112
			},
			1,
			"That girl... is it even possible to dance like that?!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[701060] = {
	feeling1 = "I hate you! Stay away! One step closer and I'm gonna pummel you with snowballs!",
	feeling3 = "Secret technique! Snow down the back of your neck! That oughta freshen you back up, or so Minsk said! ...Um, Commander... You're not upset, are you?",
	lose = "Ehhhhh?! How could I lose?!",
	propose = "Hauuu... My face is burning hot, like I'm gonna melt for real! But... if I can melt right into your heart like this... that wouldn't be half bad. Ehehe~",
	expedition = "I'll go greet the friends coming back from their commission! ...I'm not going to throw snowballs at them!",
	win_mvp = "Hehe, victory! Commander, I want a prize!",
	home = "My sisters said that I'm not allowed to drink vodka because that stuff melts snowballs or something... Uhh, somehow that doesn't sound quite right...",
	mission = "Commander, are you letting your missions pile up like snow on the branches?",
	touch2 = "Now I'm angry! Take this! And this! And this!",
	voice_key_2 = -1,
	skill = "Behold my might!",
	drop_descrip = "Gnevny-class destroyer - Stremitelny.",
	mail = "Your mail's here! Catch~! ...Eh, I'm not allowed to throw it...?",
	touch = "Do you like playing with snowballs too?",
	profile = "So, I'm Stremitelny of the Gnevny class. My friends and I did some escort missions as well as coastal support operations! Commander, if there's anything I can help with, just say the word!",
	mission_complete = "Mission complete! Wooooohoo~!",
	feeling4 = "Are you cold, Commander? C'mere! Come stick your hands here where it's nice and fluffy! ...Hehe, aren't I super nice?",
	unlock = "Way! Too! Slow! Why'd it take you so long to find me?! That's right! I'm Stremitelny of the Gnevny class, but you can also call me by my nickname, Snezhok! Anyway, here's a snowball to commemorate our meeting, catch~!",
	feeling5 = "Come build snowmen with me, Commander! You'll make one, I'll make one, and then we can have them hold hands, just like we're doing now! Ehehe~",
	main = "Chang Chun and I were looking into a way to retrofit our naval guns into snowball launchers. Eh, that's not allowed..?|Why am I called Snezhok? Well, it means \"Little Snowball,\" and I'm a little cutie who likes snowballs.|During the winter, you can have snowball fights, build snowmen, and wear fuzzy clothing! Winter's the best!",
	battle = "Stremitelny, setting sail!",
	upgrade = "Snowball fight or gunfight, I feel like I can't lose!",
	voice_key = 70106,
	headtouch = "Geh, you meanie! You're gonna make my hat come off!",
	feeling2 = "My snowballs are gentle! There are no rocks or bits of ice inside, only softness!",
	login = "Hurry up and come play in the snow with me!",
	vote = "",
	hp_warning = "I hate airplanes! Shoo, go away!",
	id = 701060,
	detail = "Everyone in the Northern Parliament likes calling each other \"comrade.\" Comrade Commander! I'm Comrade Stremitelny! ...Buuuut, that's a heck of a mouthful, so I'm just gonna call you Commander!",
	couple_encourage = {
		{
			{
				70102
			},
			1,
			"C'mon, just give me a little taste!",
			0
		}
	}
}

