	main = "Comrade Commander, you musn't slack off! I swear, I'll get mad at you!|For troublesome issues, let us all gather to face it together! That's the way we do it at the Northern Parliament, after all!|Comrade Commander, if your hands are cold, feel free to use my sleeves! They're nice and warm, aren't they~",
