	upgrade = "As long as I can be of more use to everyone...!",
	voice_key = 70108,
	headtouch = "Hehe, Comrade, did you also want to play with my little buddy?",
	feeling2 = "Comrade Commander, how were you able to build such a cohesive fleet? Please teach me your ways!",
	login = "Woah! Comrade, you sure are early today! You know, you can get a bit more rest if you'd like...",
