_G.pg.base.ship_skin_words[703012] = {
	feeling1 = "",
	feeling3 = "",
	lose = "...Tsk. You little rats!",
	propose = "",
	expedition = "It's your duty as the Commander to show your gratitude to a returning commission team. Go on, don't keep them waiting.",
	win_mvp = "We won. Given enough training, victory is par for the course.",
	home = "Wow, you solved that one quick. Keep it up.",
	mission = "Missions and inquiries alike deserve our undivided attention. Wherever you are, this still rings true.",
	touch2 = "Huh...?! Now you're really asking for it...",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "You've reached the Bureau of Investigation... Oh boy, another case. Commander, finish up your paperwork ASAP. We've got witnesses to interview.",
	mail = "",
	touch = "What is it? I already told you – you're not ready to be a phone operator.",
	profile = "",
	mission_complete = "You've completed a mission, now go claim your rewards. Chop-chop, we're on the clock here.",
	feeling4 = "",
	unlock = "You've reached the Bureau of Investigation... Oh boy, another case. Commander, finish up your paperwork ASAP. We've got witnesses to interview.",
	feeling5 = "",
	main = "This case is going to be a pain... It may be time to ask Chapayev for assistance.|Look, little Manjuu, I can't understand you through your sobbing. Take a deep breath, calm yourself, and then speak.|Well done, Commander. Care to go for a drink? I know a place that specializes in mulled beer.",
	battle = "Hmph. I'll just have to teach you how pointless it is to struggle.",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "You're cutting it very close here. Five minutes early to everything – that's something you should practice.",
	vote = "",
	hp_warning = "",
	id = 703012,
	detail = "Always work at flank speed – the momentum you build up will keep you going. If you ever forget that, I'll remind you as many times as it takes.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[703020] = {
	feeling1 = "Stay away from me.",
	feeling3 = "I'm not so much a lone wolf, I just choose not to get involved with people. I operate on efficiency and ruthlessness, so I steer clear of cowards and weaklings for their sake, not mine.",
	lose = "Urgh... My hunt can't end in a place like this...!",
	propose = "...You serious? You want ME, the lone wolf of the tundras? Heheh. Let's see if you have what it takes to tame me.",
	expedition = "Commission completed. Enjoy the job-well-done party yourself – I'll pass.",
	win_mvp = "Ahh... The smell of gunpowder and victory. Just what I like.",
	home = "Oh, you're back... Did you win?",
	mission = "You need my help with this new mission? Fine, you rest in the meanwhile. I'm not a team player.",
	touch2 = "What are you trying to do?",
	voice_key_2 = -1,
	skill = "I'll rip you to shreds!",
	drop_descrip = "Heavy cruiser – Kursk.",
	mail = "Left a letter for you on the desk. I don't care what it's about, so check it yourself.",
	touch = "Something urgent? I'll do it, if you want.",
	profile = "I'm Kursk, a hunter from the snowy tundras of the North... That's too brief? Ugh, what a waste of time... I hate socializing. If you want to get along with me, then keep your distance.",
	mission_complete = "Mission rewards have come in. Go check 'em. Everything that's there, you've earned.",
	feeling4 = "People say I'm cold, but I just don't feel the need to pay attention to every little shift in other people's moods. Getting caught up in emotions is a waste of everyone's time.",
	unlock = "You're the boss around here? Good. Don't bother trying to tell me what I can and can't do; I'll prove my worth to you my own way. That's all I wanted to say.",
	feeling5 = "Even though I've adapted to solitude, I somehow don't feel repulsed when I'm around you. Maybe... Maybe you've rubbed off on me.",
	main = "Hunters are loners by nature – only helpless prey form groups. I walk a solitary road for that reason.|Tactics? Those are a chore. I follow my gut instincts. Nothing can tamper with that.|Snow, huh... I love when it snows. Makes it easy to cover up my tracks. It's as though it was made for ambushing.",
	battle = "The hunt is on!",
	upgrade = "The thrill of gaining power... makes me crave more.",
	voice_key = 70302,
	headtouch = "Why are you acting like we're that close? I don't get you people...",
	feeling2 = "Swords become dull if not sharpened. It's why I still go back to the tundra and hunt like I used to – skills, like swords, need to be maintained.",
	login = "Morning, boss. I was going to leave you a note before I left, but decided to just tell you in person after all.",
	vote = "",
	hp_warning = "The thrill of walking the line between life and death... Give me more, more!",
	id = 703020,
	detail = "I'm used to working solo. Even if it doesn't snow here, I can still cover up my tracks... if I want to.",
	couple_encourage = {
		{
			{
				49901
			},
			1,
			" You smell of danger... Interesting.",
			0
		},
		{
			{
				10313,
				20120
			},
			1,
			" There won't be enough prey to go around with this many hunters.",
			0
		}
	}
}

_G.pg.base.ship_skin_words[703021] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Seems I'm still wet behind the ears...",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Where have you been? ...You didn't want to pass out from dizziness? Don't worry about that. Worst case scenario, I'll just carry you back home.",
	mission = "A new mission just got handed down. Go ahead and take a look – we'll have plenty of time to relax later.",
	touch2 = "You want to get up close and personal, huh? Heheh.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "This steamy hot spring... is a rather novel experience. I left a spot for you, so come sit down already – Wait, why haven't you taken your clothes off yet?",
	mail = "I left your letter in a less humid spot. Don't want your important papers getting wet, do we?",
	touch = "While I hate rubbing shoulders... I can tolerate you being around.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "This steamy hot spring... is a rather novel experience. I left a spot for you, so come sit down already – Wait, why haven't you taken your clothes off yet?",
	feeling5 = "",
	main = "Seems the Sakura Empire has the most hot spring enthusiasts. Not that I don't want to bathe with them, but as you know... I'd rather be alone.|The hot steam causes the cold air to fog up, impeding visibility and making this an ideal place to set up an ambush... Heh. Don't worry. I'm right here.|How's the temperature? If you want, I can turn up the heat using my rigging.",
	battle = "There's no reason I cannot go into battle like this. The hunt is on!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Hmh... The water's nice. What are you waiting for, Commander? Get in.",
	vote = "",
	hp_warning = "",
	id = 703021,
	detail = "...Am I cold? Not really. If I can handle an ice bath, a hot spring is nothing. You, on the other hand, should be careful of the night breeze.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[705010] = {
	feeling1 = "There is no future for those who mistake recklessness with courage, comrade.",
	feeling3 = "I hope you don't take this the wrong way, comrade, but this fight is not just for all of us. It's also yours. Never settle with the status quo, and always seek to keep improving.",
	lose = "Comrade, consider this not a defeat, but rather a warning. A sign that we are losing sight of our revolutionary spirit.",
	propose = "A pledge, huh? While this act is symbolic in nature, it is also undeniable proof of the bonds we've formed. A toast, comrade. Please continue to guide me in the future.",
	expedition = "Hopefully our comrades will return bearing good news, unlike that bitter Ice Cruise. Come on, let's go welcome them back.",
	win_mvp = "Rejoice, for we have earned this privilege! May this celebration become the bread that sustains us until our next victory!",
	home = "O comrade, do you return bearing news of glorious victory? Ah, but it matters not, for the thing that matters most is that you fought with all your strength! ",
	mission = "Missions exist for the sake of preserving the order. We should complete them as soon as possible.",
	touch2 = "What are you doing, comrade? Are you not aware of how we handle lawbreakers in the Northern Parliament?",
	voice_key_2 = -1,
	skill = "The revolution blesses you!",
	drop_descrip = "Gangut-class battleship – Gangut.",
	mail = "You have a letter, comrade. It would be best to open it soon.",
	touch = "What about my rigging? Isn't fully utilizing everything at your disposal a wonderful and pragmatic ideal? Why would I consign myself to weakness for the sake of showmanship?",
	profile = "I am Gangut, a dreadnought from the Northern Parliament. My equipment may be outdated, but don't underestimate me. Both humans and ships are alike in their quest for greater power, to protect what they otherwise would not be able to. That is революция, the revolution I strive for! From the Bering Sea to Leningrad, only by rising up in the face of humiliation was I able to become a beacon for the light of glory!",
	mission_complete = "Excellently done! This reward will help pave the next step of our revolution!",
	feeling4 = "Ahahahaha! Well done, comrade! No matter how strong the enemies we may face, we now join each other courageously, prepared to give everything in pursuit of greater challenges! What could be more revolutionary than that?",
	unlock = "Hahaha! Not bad, comrade! Come, let us fight for the safety of these azure lanes! Fight until your last breath!",
	feeling5 = "Let's get to the point! Comrade, I was struck by your brilliance, and thus I fell for you! And now, I face the challenge of how to express my feelings for you! Here, comrade, accept my embrace!",
	main = "Comrade, how about a few drinks? ...What? Don't tell me you can't even handle a swig of vodka! |O comrade, aren't those stories about the exploits of sailors absolutely riveting? You see, that is the very spirit of revolution, humanity in all its glory! |An easy victory? What a stupid thing to say, comrade! How are you supposed to draw out your full power if you have nothing worthwhile to fight? Send me to a more dangerous battle next time!",
	battle = "Show me your mettle!!",
	upgrade = "Comrades! You are also strong! Let our souls shine out brilliantly!",
	voice_key = 70501,
	headtouch = "",
	feeling2 = "I am Battleship Gangut, also known as Oktyabrskaya Revolyutsiya. However, my name is less important the what I've achieved. Don't dwell too much on it and just call me what you want.",
	login = "Comrade, what sort of strong enemy will we face today? I, Gangut, shall stand with you!",
	vote = "",
	hp_warning = "Ahahahaha! At last, this is a battlefield that I am meant for!",
	id = 705010,
	detail = "Know this, comrade. Even if I am battered and bruised, muddied by defeat, I will rise each time to reclaim the glory of mankind! Yes, that is the революция I desire, the only heaven that exists for me!",
	couple_encourage = {
		{
			{
