	win_mvp = "You'll find that the speed of the Le Fantasque-class is not easily matched!",
	home = "That was a hard-fought battle, Commander. Would you like to have a cup of tea before you resume work?",
	mission = "New missions have been issued.",
	touch2 = "Eek! To think that you're even faster than the Le Fantasque class... you're not one to be taken lightly, Commander.",
	voice_key_2 = -1,
	skill = "Pour la liberté!",
	drop_descrip = "Le Fantasque-class destroyer – Le Triomphant.",
	mail = "It feels nice to be celebrated by someone you don't know, doesn't it?",
	touch = "Commander, you'll be missing out if you treat me and my sisters as regular destroyers.",
	profile = "I am Le Triomphant, a Le Fantasque-class Destroyer from Iris Libre. It is an honor to meet you. My sisters and I were in the 8th Light Division before the fateful Battle of Jutland. After that, our paths diverged...",
	mission_complete = "Commander, here are the fruits of your labor.",
	feeling4 = "Familiarity with hardship and suffering cultivates an appreciation of life and death. At least that's what I think...",
	unlock = "Oh my, Commander, what a pleasure it is to meet you. I am Le Triomphant, an elegant large destroyer from Iris Libre, yours to command. The power of the Le Fantasque-class shall exceed your wildest fantasies.",
	feeling5 = "Commander, as long as we're together, I feel like I can easily overcome any adversity... that's what I truly believe.",
	main = "My sword and shield? Oh, they stop feeling heavy after a while. Well, I also am quite strong. |If I was with my sisters at that time... would things have happened differently...?|Whether someone is friend or foe... is not something set in stone.",
	battle = "In the name of Iris Libre, let us break their lines!",
	upgrade = "I feel strength rippling from my sword and shield... Commander, thank you.",
	voice_key = 80101,
	headtouch = "",
	feeling2 = "Don't you think Noblesse Oblige is an elegant idea?",
	login = "My, I see you've returned? What shall your orders be today? I am ready to accept any assignment - commission or sortie!",
	vote = "",
	hp_warning = "The outcome... still isn't set in stone!",
	id = 801010,
	detail = "If you have any questions, feel free to ask away. I will respond to each one.",
	couple_encourage = {
