	touch = "Commander, did you know that there are many different kinds of swords? For example, there are rapiers, sabres, flamberges, and so on...",
	profile = "I'm Forbin, a L'Adroit-class destroyer from Iris Libre. For various reasons, I was stuck in port for two years, but after returning to service, I was able to get a lot done and make up for some of that lost time on the battlefield.",
	mission_complete = "Don't let these mission rewards go to waste, Commander.",
	feeling4 = "Commander, did you know that I've always had two dreams? The first was to become a worthy knight like my seniors. The second was to find someone worthy of swearing fealty to... I never expected that my second dream would come true first~",
	unlock = "I am Forbin, a squire from Iris Libre. I may not match up to the stature of my seniors, but please offer me your guidance!",
	feeling5 = "Commander, please believe in me. The only time someone will be able to hurt you is when the last shell has been spent and I am no longer able to lift my sword.",
	main = "Iron Blood or Royal Navy, I don't care who it is, I just want to learn more about them! |When will I become as strong and cool as the knights? |I don't want my life to end without having accomplished anything... so this time, I'll give it my all!",
	battle = "All right! I'll surely be able to win in this condition!",
	upgrade = "My odds of victory have improved!",
	voice_key = 80102,
	headtouch = "",
	feeling2 = "There are all kinds of amazing people gathered here. There's just so much to learn... Ahh, I've gotta work even harder!",
	login = "Hooo! Haah! Oh, Commander, let's do our warm-up exercises together!",
	vote = "",
