_G.pg.base.ship_skin_words[805011] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "We have a really good view from up here. I can even see a commission group starting to return out there.",
	win_mvp = "",
	home = "I don't wish for my absence to become a burden on you, Commander. If there's anything I can help with, please let me know.",
	mission = "",
	touch2 = "If you know what's good for you, I wouldn't assume that a girl is defenseless just because she's in a swimsuit.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "This swimsuit... Yes, the one Émile picked out for me, seems a bit skimpy... I didn't think she'd be the type to trick me into wearing something like this, but... Commander, where are you looking?",
	mail = "",
	touch = "My... Where are you taking me, Commander?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "This swimsuit... Yes, the one Émile picked out for me, seems a bit skimpy... I didn't think she'd be the type to trick me into wearing something like this, but... Commander, where are you looking?",
	feeling5 = "Walking together on the beach like this while basking our ears in the sounds of the sea... Agréable. Hehehe, this is quite a rare experience. Commander ... Thanks for being with me. I'll cherish this moment.",
	main = "Commander, I'll be heading to the beach for a bit. ... Hehe. Indeed, this is a bit different from how I am usually. Would you like to come along with me? | Frozen treats are most effective against hot and humid weather like this... Shall we ask Dunkerque to prepare some more next time? | Jean Bart... Perhaps it's better to spend some more time with her... Sigh... |nil|nil",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Scenery that calms the heart... Commander, you've got good taste.",
	vote = "",
	hp_warning = "",
	id = 805011,
	detail = "Iris' teachings do not go as far as to forbid its followers from spreading their wings. Let us enjoy today with everyone to our heart's content. Consider this as yet another of Heaven's many blessings.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[805012] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "It seems the commissions team made it back safely. This counts as good fortune, doesn't it?",
