	home = "Please calm down and ponder what we should do. I'll be waiting right over here.",
	mission = "",
	touch2 = "Is this a greeting... for the New Year?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Commander, I wish you a Happy New Year. May you avail yourself of the period of repose that follows the culmination of the year's duties. I pray that you and everyone else may receive the blessing of the Heavens.",
	mail = "So this is what the Sakura Empire's New Year's greeting cards look like... How interesting. Hehehe.",
	touch = "You'd like to sit by my side? Up we go... Good kitty... Alright, here you go, Commander.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Commander, I wish you a Happy New Year. May you avail yourself of the period of repose that follows the culmination of the year's duties. I pray that you and everyone else may receive the blessing of the Heavens.",
	feeling5 = "Settle down. Let us pray together. If I listen to your prayers and you listen to mine, you will come to understand that we are heading toward the same goal. Let us walk toward the light. You and I, together...",
	main = "nil|nil|What these fortunes tell may be your fate. Even so, is it not mankind's strength to overcome fate?|Shh. Lower your voice. I'm trying to get this one to warm up to Jean Bart.|Béarn, is it already time? ...Yes, I made a promise earlier to visit the shrine with everyone else. How would you like to come with us?",
