_G.pg.base.ship_skin_words[807010] = {
	feeling1 = "\"You are the most outstanding, exceptional commander I have ever met.\" – You can only hope to hear me say these words in your most outlandish dreams.",
	feeling3 = "A \"grimoire\"? Hmm... And you say L'Opiniâtre told you this? It's certainly an amusing allegory. Now, I'm afraid I must take my leave for a while, as I have business to attend to.",
	lose = "I sincerely apologize, Commander. I take full responsibility for this defeat.",
	propose = "If there are sacraments that can emotionally move and unite people, then this so-called \"marriage\" must be the most powerful of its kind. Ah, this bliss, this feeling of butterflies in my stomach... Now I understand how it feels to take an oath. It's quite enjoyable, actually. Hehehe~",
	expedition = "Transport commissions and cargo escorts are vital, of course, but let's not forget the important safety of our docks.",
	win_mvp = "How would you say I did? Was my performance satisfactory?",
	home = "You would like something sugary in preparation for your mental labor? It so happens I have a list of our stock of confectionaries. Please have a look.",
	mission = "Commander, I have received word of new mission directives from headquarters. I shall go and make some arrangements.",
	touch2 = "Do you lack the knowledge of what being a decent person entails, or are you simply unable to control yourself, Commander?",
	voice_key_2 = -1,
	skill = "Let's proceed as planned.",
	drop_descrip = "Aircraft carrier – Béarn.",
	mail = "Reporting in. I have a newly arrived letter for you, Commander.",
	touch = "I am right here, Commander. Do not hesitate to give me your orders.",
	profile = "My name is Béarn, I am the Iris Libre's first aircraft carrier, converted from the unfinished 5th Normandie-class dreadnought. I lived to see the end of the strife between Iris and Vichya... A tragedy I pray will never happen again.",
	mission_complete = "A mission has been completed. That's one burden off our minds.",
	feeling4 = "This \"grimoire\" topic again? I do not appreciate your insistence on it. \"A sacrament from the Iris Libre can perform all sorts of miracles\"... Assuming that were even true, how would you utilize such great power, Commander?",
	unlock = "Béarn, Iris Libre's very first aircraft carrier, reporting for duty. It is an honor to fight by your side. I eagerly await your orders, Commander.",
	feeling5 = "Commander, all of today's clerical tasks have been completed right on schedule. This is a good opportunity to... Indeed, as you've requested, I will teach you about the so-called \"sacrament of love.\"",
	main = "If I may be so blunt, Commander, it would be very unwise of you to read my book. I am not exaggerating or joking about this.|Are you daydreaming, Commander? You may continue to fantasize if you so wish; we have enough free time in today's schedule to accommodate for it.|I shall attend to our official business and schedule management. You need only focus on the work on your desk, Commander.",
	battle = "Now, as outlined in our briefing, prepare for combat!",
	upgrade = "Your kindness will not go unrewarded, Commander.",
