	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "Who wants to have some crullers? I made more than enough for everyone~",
	home = "Commander, would you like some ice cream? I brought several different flavors of syrup.",
	mission = "",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
