	feeling4 = "",
	unlock = "I've been waiting so long for summer... and it's so worth it - the sun, the sand, the waves, and everyone's laughter. Commander, why don't we take this opportunity to enjoy some crullers together?",
	feeling5 = "",
	main = "Ice-cream based desserts are delicious, but they melt too easily... I might have to bring a cooler with me next time...|It's been a long time since I last was able to enjoy scenery like this without any worries...|Commander, are you done changing? The others are calling for us, let's go play with them!",
	battle = "Enemies...? Way to spoil the scenery...",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Commander, are you done changing into your swimwear~?",
	vote = "",
	hp_warning = "",
	id = 904011,
	detail = "Everyone looks like they're having so much fun... I couldn't ask for anything more.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[904012] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "Commander, the commission is complete... Hehe, no matter the time or place, I suppose I'm still your secretary ship.",
	win_mvp = "",
	home = "No need to rush, Commander, I don't mind waiting for you.",
	mission = "Is it a very important mission? Well then, I'll go with you.",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Don't you simply adore the atmosphere in this place? It's one of my favorites. The desserts here are to die for. Would you like a taste?",
	mail = "We have new intelligence? Well, don't worry about me. Please, check it at once.",
	touch = "Just relax, Commander, we still have plenty of time. ",
	profile = "",
	mission_complete = "Commander, some mission rewards are available. Shall we head back to the office?",
	feeling4 = "",
	unlock = "Don't you simply adore the atmosphere in this place? It's one of my favorites. The desserts here are to die for. Would you like a taste?",
	feeling5 = "The warm sunlight, the peaceful atmosphere, the soothing music, all embracing me as I relax and chat with one so dear to me. If this is a dream, I hope to never wake up...",
	main = "......der, Commander! Look at you, staring at me and spacing out again, am I really so captivating? Did the ice in your drink melt?|Commander, shall we go for a stroll? How often do we get to go out on a date? Let's not waste this one sitting around chatting.|When I sit here like this, I sometimes forget I'm a warship... But, to fight for these little moments, that's not such a bad motivation, is it, Commander?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Here you are, Commander. Oh? Don't worry, I've only just arrived myself.",
	vote = "",
	hp_warning = "",
	id = 904012,
	detail = "What's your favorite dessert? I can make it for you, Commander.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[905010] = {
	feeling1 = "Seems you've mistaken a wolf for a dog... Hmph, don't start crying if you get bit cause of it.",
	feeling3 = "Stop looking so intimidated. Long as you won't betray me, I won't betray you.",
	lose = "My payback comes with interest... Before long, you'll know how much!",
	propose = "The path I walk is an unforgiving, dirt-ridden path where you can't even see the future lying ahead of you. But ya still wanna go with me? ... Hmph, your stupidity amazes me. And for your foolishness, I offer you the rest of my days.",
	expedition = "Guess your rackety team's come back.",
	win_mvp = "Your endeavors were touching... but when you pick the wrong fight, that's all they'll ever be.",
	home = "You finished plundering? Coulda gotten it done in no time if you'd brought me.",
	mission = "A job's a job. Whining won't make it go away.",
	touch2 = "... You better not regret this later.",
	voice_key_2 = -1,
	skill = "Playtime's over!",
	drop_descrip = "Richelieu-class battleship – Jean Bart.",
	mail = "Got some mail for ya. Picked it up on the way here.",
	touch = "Stop trying to hit on me.",
	profile = "I'm Jean Bart, the battleship. I was named after a certain \"renowned\" privateer... You what? Never heard of privateers? They're pirates with legal permission to pillage, fighting for a just cause.",
	mission_complete = "... Pish, them's some shabby rewards.",
	feeling4 = "I can't stand hearing those babies cry when you get hurt... So use me as a shield. I don't mind.",
	unlock = "I'm Jean Bart, the Vichya Dominion's last cutting-edge battleship. Guessing you'll be plotting my course from now on... Hmph, I'll see for myself how good a job you'll do.",
	feeling5 = "It's like the mood eases up when you're with me... I'mma get some rest right here... And don't you leave me...",
	main = "The era of battleships is over? Hah, the hell you mean? MY era is just getting started!|Insincere preaching about faith and beliefs is no different from idle sleeptalk.|Idiots just don't ever wisen up, do they... What drives 'em to pray to a made-up being that won't even respond?",
	battle = "Don't bother with courtesy! Just bunch up and come at me!",
	upgrade = "Feeling great. Wanna give it a shot?",
	voice_key = 90501,
	headtouch = "",
	feeling2 = "Your smile makes me think of her... She's someone I wanna hate, but can't bring myself to.",
	login = "Go figure... you're busier than I expected. If ya need a hand with something, just gimme a shout.",
	vote = "",
	hp_warning = "That all ya got?",
	id = 905010,
	detail = "If some dumbass sticks their nose where it doesn't belong, they got only themselves to blame when they're hanging from my cannons.",
	couple_encourage = {
		{
			{
				80501
			},
			1,
			"That's enough praying. Prepare to fight!",
			0
		},
		{
			{
				10519
			},
			1,
			"You're not gettin' ahead of me a second time!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[905011] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Hmph. Still better than going to that banquet...",
	propose = "",
	expedition = "A commission fleet has returned? Let's head down to greet them together then. I needed some fresh air anyway.",
	win_mvp = "Mmm... the wind on the battlefield... now that's what I'm used to.",
	home = "Did you just come back from battle? Here, cheers.",
	mission = "You still have missions to do even now? ... Need my help?",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "The guest of honor shouldn't be wandering around looking for girls drinking alone... Hmph, might as well have a drink while you're here anyway.",
	mail = "",
	touch = "Cheers... Hmph. I never asked for the \"blessing\" of being someone's sister, but I've already gotten used to what that entails.",
	profile = "",
	mission_complete = "C'mon, put all that stuff aside and have a drink with me.",
	feeling4 = "",
	unlock = "The guest of honor shouldn't be wandering around looking for girls drinking alone... Hmph, might as well have a drink while you're here anyway.",
	feeling5 = "I loathe red tape, nor do I have any desire to stand here like a flower vase for people to stare at... But I'm doing all of this for you, because you make me feel like it's all worth it. You've committed quite the serious offense, mon amour...",
	main = "Letting go of everything and losing yourself to the merriment of song and dance... that is what a banquet should be about. Not this pompous farce that makes even wine taste bad. |The one thing that this banquet has going for it is the fact that everyone's smiles are genuine and heartfelt... Look, I'm praising you, can't you tell? |Commander, I'm not going to exchange pleasantries with you. C'mon, it's not like we just met for the first time, right?",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "You... look awfully bored, Commander. Hmph, what a coincidence. That makes two of us.",
	vote = "",
	hp_warning = "",
	id = 905011,
	detail = "I'm more willing to listen to Dunkerque than a lot of others. She's a lot more in touch with the masses.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[905012] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "Would you stop comin' here right after returning to port? Don't want people catching wind of this place and turning it into a playground.",
	mission = "",
	touch2 = "You're not the only one who can do whatever ya want just 'cause nobody else will come here. I can, too. Understand?",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "You damn scalawag... You don't just sneak into someone's hideaway without consequences, ya know. Though, I found this place by pure chance too. Don't go tellin' anyone else about it!",
	mail = "",
	touch = "Ack! Don't put your damn ice-cold soda on me! You're on thin ice, buddy...",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "You damn scalawag... You don't just sneak into someone's hideaway without consequences, ya know. Though, I found this place by pure chance too. Don't go tellin' anyone else about it!",
	feeling5 = "Man... The sun's crazy bright out today... What, you're still here? How long are ya gonna hang around? Hmph, you're real good, both at making me happy AND making me mad, you know that?",
	main = "Sorry, but this hammock's only big enough for one of us. Ya wanna relax, get your own. I ain't your personal servant.|Just how much damn work do you have if you're even bringin' it up here...? You just like being with me...? Tsk...|Wha–? Is... Is that Surcouf? The hell... How'd she end up dozing off in here? That girl's a real piece of work.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Don't you go touchin' my stuff without permission! I'll knock ya out cold.",
	vote = "",
	hp_warning = "",
	id = 905012,
	detail = "You wanna go lookin' for treasure? There's no damn treasure 'round here. But one day... Hmph, one day, when we've achieved a boring peace, I'll give you a taste of what a real treasure hunt is like.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[905013] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "I'm not the type to underestimate anyone.",
	home = "You're back? Seems you've got girls queuein' up to meet you. Me, not so much...",
	mission = "",
	touch2 = "Umph! What now?!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Bonne année... Or rather, I should say \"Happy New Year\" here, yes? A year of peace and prosperity passes, and we are here to welcome another... and I must thank you for making that possible.",
	mail = "",
	touch = "What, you wanna see me brandish one of these?",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Bonne année... Or rather, I should say \"Happy New Year\" here, yes? A year of peace and prosperity passes, and we are here to welcome another... and I must thank you for making that possible.",
	feeling5 = "Not to say I've grown soft, but I have gotten too used to you bein' around. I don't mind it – hell, I like it. I'm all but dependent on you, that's just how important you are to me.",
	main = "Sakura Empire-style badminton? Sounds fun. I'll knock that shuttlecock beyond the horizon!|I hate it when people approach me to either give or get a hug. Never asked for their damn compassion.|Wagashi, for me? Thanks. Dunkerque sure is considerate as always. ",
	battle = "Forward! Quarter them!",
	upgrade = "",
	voice_key = 0,
	headtouch = "Hmh...",
	feeling2 = "",
	login = "Work, same as always, huh? Tell me if there's anything I oughta know.",
	vote = "",
	hp_warning = "",
	id = 905013,
	detail = "Aid with getting dressed? This is nothing compared to a ceremonial Iris dress. Not to mention it suits me better. Don't ya agree?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[905030] = {
	feeling1 = "Master evaluated as unbeneficial to the improvement of Gascogne's idol talents. Activating autonomous learning module. Please step away from Gascogne.",
	feeling3 = "Emotional activity was detected during musical performance on stage. Requesting investigation into origin of this phenomenon.",
	lose = "Gascogne requesting immediate termination of current protocol and enabling of default combat mode.",
	propose = "Being an idol means to have hope for tomorrow, an unfading smile, vigor, and passion. Now I see how much fun can be had beyond the battlefield... Thank you so much, Master.",
	expedition = "Gascogne proposes greeting commission team with a singing performance.",
	win_mvp = "Assessing version protocol as effective. Gascogne will continue engaging in singing.",
	home = "Report: Gascogne has completed a lesson. Requesting reviewal of results.",
	mission = "Requesting approval for Gascogne's undertaking of photoshoot, performance, or radio show.",
	touch2 = "Warning: unsolicited physical contact with idols is unnecessary. Likelihood of others interpreting said contact as sexual harassment is high.",
	voice_key_2 = -1,
	skill = "Please listen to my song!",
	drop_descrip = "Gascogne module change process complete. New directive: sing for the world. Master's order is my will.",
	mail = "Requesting Master's response to received invitation of competition.",
	touch = "Gascogne is currently practicing.",
	profile = "Gascogne has received an alternate functionality mode and undergone minor rigging upgrades to allow for singing in combat. Numerous incorrect parametric values caused by current mode have been detected. Referring to Gascogne's default form for basic information is advised.",
	mission_complete = "Report: working as an idol has improved Gascogne's capabilities.",
	feeling4 = "Idol career evaluated as holding strategic significance. Requesting permission to proceed with idol work after today's operations have been completed.",
	unlock = "Gascogne module change process complete. New directive: sing for the world. Master's order is my will.",
	feeling5 = "Gascogne understands the meaning of being an idol and requests system alteration to uninhibit emotions. \"I am counting on you, Master.\"",
	main = "Concept in database detailed as \"saving the world by singing\" was analyzed and logically equated to Gascogne's ultimate goal.|\"Emotion-packed singing can truly touch people's hearts\"... Unable to infer meaning of said statement. Requesting assessment of Gascogne's singing ability.|Detecting factual conflict between promotional materials' claim of Gascogne being \"inexpressive\" and existence of installed emotion module.",
	battle = "Activating idol version protocol.",
	upgrade = "Action has no observable beneficial effect on idol abilities.",
	voice_key = 90503,
	headtouch = "",
	feeling2 = "Gascogne has finished compiling idol data sets and has developed a new definition of an idol's capabilities. Assessment: an idol stops wars by singing. This holds strategic significance.",
	login = "To do: vocals, dancing, band aesthetics. Requesting establishment of Gascogne's schedule for today, Master.",
	vote = "",
	hp_warning = "Combat protocol engaged.",
	id = 905030,
	detail = "Information request: what is Master's favorite song?",
