_G.pg.base.ship_skin_words[900007] = {
	feeling1 = "Keep your distance. You are not qualified to command me...",
	feeling3 = "You never know how many plans, hopes, and efforts would sink into the sea with you, Commander. Don't die too easily.",
	lose = "A horse may stumble even though he has four legs. Let's try again next time.",
	propose = "To me, the ritual isn't as important as the fact that you've already recognized our love... However, receiving such a wonderful gift still makes me happy. Thank you, Commander... I'll keep this with me forever!",
	expedition = "Commissions complete! Please welcome the fleet home.",
	win_mvp = "Success is gratifying every single time.",
	home = "Sometimes victories come down to nothing but luck. Don't get too full of yourself, Commander.",
	mission = "It's time to test your resolve, Commander.",
	touch2 = "You know what this touch means, don't you?",
	voice_key_2 = -1,
	skill = "It's a showdown!",
	drop_descrip = "King George V-class battleship, Prince of Wales. Hull Number 53.",
	mail = "You have a new message, Commander.",
	touch = "Let's have chat, Commander.",
	profile = "I'm the second ship of the King George V-class battleships, the Prince of Wales. I once escorted the Prime Minister to sign the Atlantic Charter. I turned a new page in the history books of weaponry? Hmph, how dare you mention that in front of me.",
	mission_complete = "Rewards delivered! You performed beautifully.",
	feeling4 = "Fighting with honor is my motto. I wish it could be the same when it comes to love. So... can you stay with me a bit longer? I have something important to tell you, Commander...",
	unlock = "You're the Commander? Very well. I, Prince of Wales, shall let you witness my true strength.",
	feeling5 = "I had a dream, a dream of that time which makes me feel hopeless even now... But when I open my eyes and see you by my side, it feels like life... like life isn't so bad after all...",
	main = "Expensive isn't always better, but it's your job to maximize our combat capability, Commander.|I don't want to suffer the pain of losing comrades...|Would you like to have some tea? I have a sandwich as well. I'm a big fan of pickles, you know!",
	battle = "Acts of bravery beget success... All ships, open fire!",
	upgrade = "Let's not repeat failure again...",
	voice_key = -1,
	headtouch = "",
	feeling2 = "I heard that my current name was chosen because my original one could bring misfortune, but... judging by how things turned out... it seems I'm unable to escape my fate...",
	login = "Welcome back. Shall we have tea before getting back to work?",
	vote = "",
	hp_warning = "Get up! We're looking for a fight!",
	id = 900007,
	detail = "Fate can be easily derailed, Commander.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[900040] = {
	feeling1 = "I don't really want to get any closer.",
	feeling3 = "Commander, you're always saying that my ears are cute... But why won't you touch them?",
	lose = "It's okay... I'll recover quickly.",
	propose = "Rest assured... This time, no matter what happens, I'll survive and return to you... because I'll always want to see you again...",
	expedition = "Commander, a commission has finished.",
	win_mvp = "MVP? I don't really get it, but... thanks.",
	home = "Commander, you're a little like me on the battlefield... That's... pretty cool.",
	mission = "Commander, we've been notified of new missions.",
	touch2 = "Commander... please... don't touch there so much... It's making me feel weird...",
	voice_key_2 = -1,
	skill = "Bear witness to the true power of the \"Demon\"",
	drop_descrip = "First ship of special Type II {namecode:6} class destroyers, {namecode:6}.",
	mail = "There's... new mail...",
	touch = "Uuu... it tickles...a bit.",
	profile = "I am Ayanami, an improved Fubuki-class destroyer. I am not afraid of combat. Though just a destroyer, I can fight any enemy...",
	mission_complete = "The rewards for the previous mission are here.",
	feeling4 = "If there's one thing that worries me... it would be when you are not at my side.",
	unlock = "I'm... Ayanami. I am often called the \"Demon.\" Pleasure to meet you.",
	feeling5 = "I don't particularly... like or dislike combat. I just do what must be done. But if it's for you, Commander... maybe I can get a bit stronger.",
	main = "{namecode:6}'s ears... are they cute? I don't understand... As long as you're happy, Commander!|I've been having nightmares of all the girls getting lost... I'm certain that it's my fault, too...|Commander? No, nothing. I just wanted to see if you were here or not.",
	battle = "Want to go... to Solomon?",
	upgrade = "My power is overflowing...",
	voice_key = 30105,
	headtouch = "I don't really get it but... I'm a bit happy...",
	feeling2 = "Ayanami's impressions of Commander? I don't really know.",
	login = "Commander, have you eaten yet? Here's some snacks.",
	vote = "",
	hp_warning = "I don't want... to be alone...",
	id = 900040,
	detail = "I've inspected the communication equipment. It won't cause any more problems...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[900041] = {
	feeling1 = "A sword has no eyes. It would be wise to avoid approaching me casually.",
	feeling3 = "It might be pretty nice to just set aside my duties and have a relaxing conversation with you every once in a while, Commander.",
	lose = "I was careless... I definitely will not fail next time!",
	propose = "For you to acknowledge me like this, Commander, is the greatest honor. From now on, this blade shall serve only you. Please continue to treat me kindly.",
	expedition = "Your fleet has returned from commission. Want to welcome them back?",
	win_mvp = "Hm... Once again, I've cut a worthless object.",
	home = "I'm glad that you came back safe and sound.",
	mission = "New tasks have been assigned - would you like to confirm them?",
	touch2 = "Kyaa! You scared me... how shameless!",
	voice_key_2 = -1,
	skill = "Swift death unto evil!",
	drop_descrip = "First ship of the {namecode:66}-class heavy cruisers, {namecode:66}.",
	mail = "Commander, there's new mail. Shall I bring it for you?",
	touch = "E-enemies?! Oh... It was you, Commander? Apologies - my eyesight isn't the best.",
	profile = "I am {namecode:66}, first ship of the {namecode:66}-class heavy cruisers. I may not look like it, but I have already crossed through countless battlefields. Please place your faith in my firepower and armor, and be at ease.",
	mission_complete = "Mission accomplished! Are we going to collect the rewards?",
	feeling4 = "Recently, I haven't been able to keep my composure during training.. Just from thinking about you, my form becomes sloppy. If I am like this, would you still want to keep me by your side?",
	unlock = "Are you the Commander? Please allow this lowly {namecode:66} to offer you what little strength she has.",
	feeling5 = "No matter how badly I'm injured, I will make sure to always return to your side. So... Commander, could you always stay with me as well?",
	main = "Even back in port, we must not lower our guard. Danger lurks around every corner.|Commander, not even you could withstand my blade.|Daily refinement means to continually strive towards your goals. Commander, may your focus never falter.",
	battle = "Please leave combat to me. I shall not shame my title of being \"The Strongest!\"",
	upgrade = "Power... flows through my blade!",
	voice_key = 30311,
	headtouch = "",
	feeling2 = "Do you need anything? If not, I'm going back to work.",
	login = "{namecode:66} standing by. What are your orders?",
	vote = "",
	hp_warning = "Be still as water...!",
	id = 900041,
	detail = "Small strokes fell great oaks, constant drops pierce through rock. Those who train through the most humdrum of days shall seize victory in the most critical of moments. That is my belief.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[900042] = {
	feeling1 = "You've been naughty, Commander. Do you want to be punished so badly? *giggles*",
	feeling3 = "Commander, would you like me to clean your ears? Come on, don't be shy. Just leave it to me~",
	lose = "Oh my... this is a bit troublesome...",
	propose = "Oh my, you've caught me, Commander. Or should I say, I've finally caught you? Hehe~ I'll never let you go now!",
	expedition = "The commission fleet is back! Let's go give them a warm welcome.",
	win_mvp = "Combat operations... complete! It's all thanks to your leadership, Commander!",
	home = "Welcome back, Commander. Are you tired? Come bury yourself in big sister's bosom~!",
	mission = "Missions have been updated. Don't forget to take a look!",
	touch2 = "You can touch me even more if you'd like... but there's no saying what might happen next... *giggles*",
	voice_key_2 = -1,
	skill = "Oh my, how should I torment you today?",
	drop_descrip = "Second ship of the {namecode:66}-class heavy cruisers, {namecode:67}.",
	mail = "Ara~ new mail? I wonder who it's from.",
	touch = "Oh my~ Are you going to give me a massage?",
	profile = "I'm {namecode:67}, the second ship of the {namecode:66}-class heavy cruisers and flagship of the Second Fleet. Many of my sisters have followed my banner into battle. No matter the mission, just leave everything to big sister here~!",
	mission_complete = "Mission complete! I wonder what rewards we will get~?",
	feeling4 = "It's all your fault, Commander... If you make such a cute face, I won't be able to keep my hands off of you...",
	unlock = "Oh my, what a cute commander! Please allow your big sister {namecode:67} to take good care of you from now on!",
	feeling5 = "It's no good... I can't control myself anymore! Commander, won't you become mine? You don't have to worry about anything... All you have to do is listen to me, and I'll satisfy all your needs...",
	main = "It seems like... my shoulders are always sore...|Commander~ I can see you ogling me in a daze, you know?|Hup! A little bug got into the room. You didn't see it? I'm confident in my good eyesight.",
	battle = "Naughty children need to be punished~",
	upgrade = "My whole body feels... hot... Commander, can you stay with me for a bit?",
	voice_key = 30312,
	headtouch = "",
	feeling2 = "If you don't express your thoughts clearly, Commander, nobody will ever understand you.",
	login = "Welcome back! What should we do today?",
	vote = "",
	hp_warning = "Looks like big sis needs to get a little serious.",
	id = 900042,
	detail = "You shouldn't ask about a maiden's weight so casually~ *giggles*",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[900043] = {
	feeling1 = "I think I just saw a future in which you were cut down by {namecode:91}, Commander.",
	feeling3 = "Do I hold a grudge against the First and Second Carrier Divisions? Of course~ For them to leave us behind like that, wouldn’t anyone complain in that situation?",
	lose = "Hiryuu-senpai may be willing to fight until the bitter end, but... that’s not my style. What a shame~",
	propose = "The melody of my flute is like a flowing river, requiring an inspiration that usually can only be found atop a mountain. Just being by your side, however, inspires me even more.",
