	headtouch = "",
	feeling2 = "Seniors and juniors... they’re all such a pain.",
	login = "Where are we going today? Pearl Harbor? Or perhaps the Coral Sea?",
	vote = "",
	hp_warning = "Shoukaku... Is Shoukaku all right?",
