_G.pg.base.ship_skin_words[900045] = {
	feeling1 = "You Showa-born brat!",
	feeling3 = "If you don't have a plan to end a war, then you'd better not start one to begin with!",
	lose = "So this what it must have felt like to suffer through the Battle of Dan-no-ura...",
	propose = "You still got a long way to go to earn my respect! ... Hehehe, so that's why I better stick by you♪ 'Til you're too good even for me.",
	expedition = "Without robust logistics, even the mightiest fleets will turn into a disorderly mob.",
	win_mvp = "Through righteousness comes prosperity. Such is the will of the heavens.",
	home = "Excellent! The scales of war are tipping in our favor!",
	mission = "Hmm, I'm in charge of today's fleet operations? Very well... the fate of our country rests... mmf! ... Why aren't you letting me speak?",
	touch2 = "You'd like me to be your dance partner at the next banquet? ... I-I suppose I have no choice...",
	voice_key_2 = -1,
	skill = "Let every ship do her utmost!",
	drop_descrip = "Shikishima-class battleship number four – Mikasa.",
	mail = "No matter how many medals and honors I receive... Ehehe~♪",
	touch = "Even the most hardworking people sometimes have lapses of judgment. It is my duty to admonish you in times like these.",
	profile = "I am Mikasa, a Shikishima-type battleship, and last of the Six-Six Fleet shipbuilding program. I served as the flagship of the Combined Fleet, and won a glorious victory that honored the name of our country across the world.",
	mission_complete = "Very well. I shall plunder... I mean, receive the spoils of victory!",
	feeling4 = "Yes, I can tell you've been working hard. B- but! That doesn't mean you get to start goldbricking now!",
	unlock = "I am the one who braved a hail of bullets and shells to return to my homeland with glory and victory. I am Mikasa, pre-dreadnought battleship of the Sakura Empire and flagship of the 1st Fleet, awaiting your command!",
	feeling5 = "You can't fire on all four boilers all the time. Listen, I'm going to look the other way while you take five... You've been wanting to nap on my lap? I-I guess that'd be okay...",
	main = "The victory at Tsushima did not occur by chance. |Royal cuisine? I'll pass... I've had enough of that. |Those things flying through the sky... Err, they're called \"ear-playings,\" right?",
	battle = "The fate of our country rests upon this battle!",
	upgrade = "Only the battlefield can separate the wheat from the chaff. ",
	voice_key = 30511,
	headtouch = "",
	feeling2 = "Thinking about how I won't see old friends from back in my day ever again, it's... Well, never mind. I have people who look up to me now, and I can't let them down!",
	login = "Until we've reclaimed our former glory, we must never stop pressing forward!",
	vote = "",
	hp_warning = "Keep calm! This battle is far from over!",
	id = 900045,
	detail = "A flagship must lead from the vanguard. This is a self-evident truth.",
	couple_encourage = {
		{
			{
				70201
			},
			1,
			"We fight together for humanity itself!",
			0
		},
		{
			{
				30706
			},
			1,
			"Steel yourself! And press the attack!",
			0
		},
		{
			{
				30505
			},
			1,
			"Never fear, the Sakura Empire is your ever steadfast ally.",
			0
		},
		{
			{
				30701
			},
			1,
			"Be careful. Misuse that power and we're worm food.",
			0
		}
	}
}

_G.pg.base.ship_skin_words[900046] = {
	feeling1 = "What a pity...",
	feeling3 = "That Kirishima... She's actually quite the popular one...",
	lose = "Was I bested...?",
	propose = "So this means... \"We'll always be forever?\" Thank you very much. I'll gladly accept it - however... If anything was to happen to us, I hope that you would consider yourself first...",
	expedition = "Welcome back, everyone. Hopefully, none of you encountered any suspicious people?",
	win_mvp = "It was no big deal~",
	home = "Welcome back. The tea has just been brewed to the right temperature.",
	mission = "Let's finish while we still have the momentum!",
	touch2 = "Hehe. Commander, have you not gotten enough sleep yet?",
	voice_key_2 = -1,
	skill = "Be swept away by the raging waves!",
	drop_descrip = "Kongou-class fast battleship number two – Hiei.",
	mail = "Are all of these new letters? Thank you for your hard work.",
	touch = "I can take you anywhere the ocean reaches.",
	profile = "I am Hiei, the first Kongou-class battleship born in the Land of the Rising Sun. As an Imperial Ship, I witnessed the growth of our mighty fleet, and led our forces into the Battle of the Solomon Sea. Commander, have you finished your preparations? The banquet is about to begin.",
	mission_complete = "Hehe, shall we celebrate by holding a banquet tonight?",
	feeling4 = "Being able to see everyone's smiles at the banquet makes all the hard work and preparation worth it.",
	unlock = "I am the Imperial Ship Hiei, second of the Kongou-class, reporting for duty. Commander, where shall we go next?",
	feeling5 = "Commander, after tonight's banquet... will you be free? Hehe, please look forward to it~",
	main = "*Sigh*... Whenever Kirishima comes to a banquet, all those kids that tag along with her usually end up making a mess of things... |When it comes to warfare, wisdom and courage are equally important. We can't count on another miracle if we discard proper planning and rely on blind courage. |Commander, I'll be able to protect you, no matter the situation. Hehe, I am called an \"Imperial Ship\" because I have that capacity after all~♪",
	battle = "Hehe, shall we go enjoy the festivities?",
	upgrade = "Today's breeze feels more pleasant than usual.",
	voice_key = -1,
	headtouch = "",
	feeling2 = "Ehehe~ Commander, is there something on your mind?",
	login = "There is nothing more relaxing than a banquet following a battle... By the way, Commander, I'm free after this...",
	vote = "",
	hp_warning = "Commander... It's too early to give up just yet!",
	id = 900046,
	detail = "Hehe~ Which do you prefer: matcha, or black tea?",
	couple_encourage = {
		{
			{
				30126
			},
			1,
			"Are you still waiting for your sister?",
			0
		}
	}
}

_G.pg.base.ship_skin_words[900132] = {
	feeling1 = "SG, protect me...",
	feeling3 = "My expression? Ah... it's because I left while we were on the losing end of the war... I might just not be so used to peace and happiness. But don't worry, I'll be fine!",
	lose = "... Please, save me... Ignore the enemy, just let them go...",
	propose = "A promise... from you, Commander? I see... I'm so happy...",
	expedition = "Hey, Commander, could I lend my SG radar to my sisters this time?",
	win_mvp = "... We actually won?",
	home = "Did everyone make it back safe and sound? Good. But there's spare parts lying around in the docks now... I wonder why...",
	mission = "Bit by bit we'll build the foundation for victory. We'll start by doing missions.",
	touch2 = "If this makes you feel good, then... I'm fine with it.",
	voice_key_2 = -1,
	skill = "SG, give me your power!",
	drop_descrip = "Brooklyn-class Light Cruiser – Helena, Hull Number CL-50!",
	mail = "You've got new mail. It's important to stay in touch with your loved ones.",
	touch = "Hm? I'm fine. I'm just... a little distracted.",
	profile = "I was designed to be on par with heavy cruisers, but just my power alone isn't enough to save everyone... Commander, can you help me?",
	mission_complete = "Resources are no good if they just pile up. We should make use of them.",
	feeling4 = "I think I've been more at ease lately... No, I was just too tense up until now. It's all thanks to the courage you've given me by being beside me.",
	unlock = "Nice to meet you, Commander. I'm Helena. My strong suit is enemy reconnaissance. Please... guide us towards victory.",
	feeling5 = "I believe that you will bring us hope, Commander. This time, I'll fight to the end... Just the thought of saying goodbye to the person I love makes me feel like my heart will tear in half...",
	main = "Are you trying to hide, Commander? No matter where you hide, I know where you are.|Commander, what should we do after the war?|If only my guns could be as strong as my radar...",
	battle = "The enemy can't hide from me.",
	upgrade = "I'll use this power to protect everyone!",
	voice_key = -1,
	headtouch = "",
	feeling2 = "If only my recon could help the others...",
	login = "... Ah, welcome back, Commander. Sorry, I was just brooding over something.",
	vote = "",
	hp_warning = "SG, lock on the enemy position!",
	id = 900132,
	detail = "I can't rely on this thing alone...",
	couple_encourage = {
		{
			{
				10503
			},
			1,
			"Penny, cover me!",
			0
		},
		{
			{
				10502,
				10504,
				10508
			},
			2,
			"SG, full area scan! I will never let that tragedy repeat itself!",
			0
