	win_mvp = "Battles are like exams. Earning MVP is like getting the top score on a test.",
	home = "We still have so much to review about the previous battle...",
	mission = "Completing missions is a great way to hone your skills. Don't ever forget that!",
	touch2 = "This isn’t something a commander should be doing...",
