_G.pg.base.ship_skin_words[900244] = {
	feeling1 = "In the end... are you just another incompetent fool, unable to command me?",
	feeling3 = "Those who have nothing to lose also have nothing to fear... But is this kind of bravery really anything to be proud of?",
	lose = "So this is... the frustration that comes from failure and fear.",
	propose = "Ahh... so this is the warmth of one's beating heart... It's melting the cold and despair remaining within me. Danke sehr, Commander. The \"Queen of the North\" is no longer alone.",
	expedition = "The commission seems to be complete... Next time, why don't you let me go? I'm a little curious.",
	win_mvp = "So this... is the taste of victory.",
	home = "Commander, you should show your face on the battlefield more often. If you stay behind your desk for too long, you may one day forget the meaning of life.",
	mission = "Finish your missions properly. Perhaps you will one day realize the joy of having any purpose at all.",
	touch2 = "I'll think of how to deal with you later.",
	voice_key_2 = -1,
	skill = "Checkmate.",
	drop_descrip = "Bismarck-class battleship, Tirpitz.",
	mail = "More mail for you... Ah, I'm envious.",
	touch = "Are you cold?",
	profile = "",
	mission_complete = "Mission rewards... how nice.",
	feeling4 = "The worst feeling in the world is not knowing whether to continue waiting or to give up hope. Commander, are you someone worth waiting for?",
	unlock = "I was imprisoned in the north for so long, unable to return home, and now you want me to follow you? ...Very well. It is up to you to show me the world.",
	feeling5 = "Ahh... I see. I thought I was used to the cold and embraced it, but that was just because I had forgotten the joy of human interaction and the warmth of being with someone... But now I remember...",
	main = "",
	battle = "Commander, I shall fight for your sake.",
	upgrade = "If you have no opponents, all the might in the world is meaningless.",
	voice_key = 40502,
	headtouch = "",
	feeling2 = "I have already grown used to the cold solitude of the North. At this point, it's natural for me to have no expectations.",
	login = "Once you get used to waiting, you lose sight of what you were waiting for.",
	vote = "",
	hp_warning = "No one would protect those who asked for their own destruction.",
	id = 900244,
	detail = "Choose your enemies carefully, Commander.",
	couple_encourage = {
		{
			{
				40501
			},
			1,
			"Sorrow is a mask unbefitting your countenance, sister.",
			0
		}
	}
}

_G.pg.base.ship_skin_words[900245] = {
	feeling1 = "You again...?",
	feeling3 = "Does prayer really work? Will God ever respond? Nein. Gods are called as such because they are merciless.",
	lose = "Next time, I shall grant you despair even worse than death.",
	propose = "Oh? Have you finally decided to make the entire world your enemy? What? You just want to be with me? Hmph, very well. Eradicating everything that stands in our way doesn't sound bad either.",
	expedition = "Ah, so they have returned... Just seeing those faces filled with joy...",
	win_mvp = "My enemies belong in their graves.",
	home = "All your fights, all your struggles, are nothing more than fodder for the End.",
	mission = "Is the person who gave you this mission really who you want to fight for?",
	touch2 = "Quite brave, aren't you? As expected of the one I chose.",
	voice_key_2 = -1,
	skill = "Die... Funebre!",
	drop_descrip = "Aircraft carrier, Graf Zeppelin.",
	mail = "Treasure the time you have to speak with your loved ones, for that time is about to draw to an end.",
	touch = "I despise everything.",
	profile = "I am Graf Zeppelin. Though this name is worth little, you may call me by it if you wish. My only desire? To end the world. I shall not ask for your help though... as you are already a part of my plans.",
	mission_complete = "Rewards... take them away.",
	feeling4 = "I have never been one to believe in fate, but if meeting you was also predestined... Hmm... How ironic. For the gods to have given me the worst past but also the best future... what purpose does my hatred then serve?",
	unlock = "You're my Commander? I am Graf Zeppelin. Since it appears that all the conditions have been met, let the final movement begin.",
	feeling5 = "As long as you are here, the world does not feel so insipid and detestable. Rest easy; even if the world was to become your enemy, I would happily fight by your side. As a matter of fact, I eagerly await this day.",
	main = "",
	battle = "Let us begin our symphony of destruction.",
	upgrade = "Ah, if only strength alone was enough to determine everything.",
	voice_key = 40701,
	headtouch = "",
	feeling2 = "Ahh, so sweet. Sweet things cannot last for long. The only thing that endures forever is ice-cold hatred.",
	login = "The black goat's horn has already sounded. Quell your anxiety and wait at ease.",
	vote = "",
	hp_warning = "The smell of steel and blood...",
	id = 900245,
	detail = "If gods truly exist in this world, let us begin our slaughter with them.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[900246] = {
	feeling1 = "I assumed you were more intelligent, Commander...",
	feeling3 = "\"The Ugly Sisters...\" Though we were given that epithet for our achievements, it still hurts a little. Commander, do you think I'm ugly?",
	lose = "I let my guard down...",
	propose = "A promise, huh? Long ago, I would have despised the notion of being tied down to emotions... but it doesn't seem so bad now.",
	expedition = "A commission has been completed! Care to inspect the results?",
	win_mvp = "Sorry, this is war. There's no room for mercy.",
	home = "Welcome back. Please take it easy for a while.",
	mission = "A mission? Let me do some planning for you...",
	touch2 = "Commander, Anton is locked on, you can't escape now. ",
	voice_key_2 = -1,
	skill = "... Now you're in range!",
	drop_descrip = "Scharnhorst-class battlecruiser, Gneisenau.",
	mail = "Commander, there's mail for you. I'll leave it here.",
	touch = "Isn't it amazing how different people can come to different conclusions about the same topic?",
	profile = "",
	mission_complete = "Rewards distributed. Please accept them when you have a moment.",
	feeling4 = "Without realizing it, I've come to enjoy supporting both my sister and you, Commander.",
	unlock = "Hello, Commander, I'm Gneisenau. Though my big sister is a bit reckless, we're actually an invincible team. I hope I will be able to sail with her as often as possible!",
	feeling5 = "The present flies by like an arrow, but the future always arrives too late. I hope that one day, I will be able to see the future that you and I create.",
	main = "",
	battle = "Truth only exists within the guns' range.",
	upgrade = "It's fine as long as you haven't let power cloud your judgement...",
	voice_key = 40402,
	headtouch = "",
	feeling2 = "Is it urgent? I prefer simple and effective forms of communication.",
	login = "Welcome back. Ready to get back to work? I've prepared everything you need, Commander.",
	vote = "",
	hp_warning = "All ships, remember to stay alert!",
	id = 900246,
	detail = "My duty is to support my big sister who is always charging too far ahead. Admittedly, it gets a little irritating at times.",
	couple_encourage = {}
}

