_G.pg.base.ship_skin_words[900253] = {
	feeling1 = "It would appear... that I must get a little more violent...",
	feeling3 = "How thy visage tempts me so with each passing moment... I must ask of thee, just how sweet is thy blood?",
	lose = "Ahh... why dost thou obstinately refuse to obey me...",
	propose = "Even the most ingenious poet cannot describe the beauty of this moment. Hehe, close thy eyes, feel my warmth, and listen to the beating of my heart. This is the one who shall be thy lifelong partner...",
	expedition = "O mesmerising Narcissus, do remember my warning when greeting those who return. Be misled not by the illusions swirling in the water.",
	win_mvp = "There exists no living being that can resist the embrace of death.",
	home = "Oh, triumphant nightingale that has overcome death itself, what plagues thee enough to silence thy song?",
	mission = "Such fair weather is rare indeed. 'twould be a pity to return to port so soon.",
	touch2 = "Ahh, how beautiful... thy eyes, normally placid, burning with the fires of lust...",
	voice_key_2 = -1,
	skill = "All ye, weep at your own demise!",
	drop_descrip = "King George V-class battleship - HMS Duke of York.",
	mail = "Thy visage when reading and concentrating, unbudging and focused, resembles one of Michelangelo's sculptures. I do not dislike such determination.",
	touch = "The night is both lengthy and brief. Come, blow out the light burning within thee, and accompany me into the dark.",
	profile = "I am King George V-class' Duke of York. Scharnhorst? An interesting one indeed, but now, thou art the one who captures my interest the most... My... if thou displays such an expression to me, I won't be able to contain myself...",
	mission_complete = "Only the moon and sweet liquor fail to disappoint. We shall share the most unforgettable of nights.",
	feeling4 = "How unfathomable... looking at thy sleeping visage hast made me replete with calmness... Now, pray that thou dost not wake, for I know not what I would do to thee...",
	unlock = "I see. So the scent that has been driving me crazy... emanates from thy soul. O sinful Commander who tempts me so, engrave my name upon thine heart - Duke of York, of the Royal Navy.",
	feeling5 = "O ignorant snake, hast thou only realised now, how long I have hopelessly been in love with thee? Therefore... would thou give thy everything to me?",
	main = "",
	battle = "Sinful roses of blood, bloom around me! Bloom!",
	upgrade = "Did thou hear? A sound that makes my blood boil, like wind passing through the forest in the dead of night.",
	voice_key = 20507,
	headtouch = "",
	feeling2 = "What a nice gaze. Through thy pupils, I can see another world.",
	login = "O unclean snake, who is it thee lusts after today?",
	vote = "",
	hp_warning = "Perhaps I have indulged myself too much...",
	id = 900253,
	detail = "Dost thy heart cry restlessly in my absence?",
	couple_encourage = {
		{
			{
				20506
			},
			1,
			"Karma shall find thee one day.",
			0
		},
		{
			{
				40401
			},
			1,
			"Stop struggling in futility, my~ little~ kitten~",
			0
		}
	}
}

_G.pg.base.ship_skin_words[900254] = {
	feeling1 = "I'm fed up~! I'll knock you out stone cold!",
	feeling3 = "My part in the pursuit of Bismarck and Operation Tungsten? I was just in the mood to help, I wasn't at all trying to earn any honours.",
	lose = "Remaining dignified even in defeat: this is how one should lose a battle!",
	propose = "Don't think too hard about it. Just follow my lead at your own pace. ...Come on, this is a day to celebrate, don't be so nervous~ From this day on, you'd better work hard to always please me!",
	expedition = "Stop loafing around! I promised the commission team that I'd use my planes to photograph the moment they entered the port!",
	win_mvp = "When my foes have been this thoroughly defeated... not even I, the symbol of victory, can truly be glad.",
	home = "To celebrate your victory, why not wear this olive wreath? I'm certain it'll suit you.",
	mission = "Only I have the privilege of being selfish. Don't even think about pushing missions onto me.",
	touch2 = "Y-you just did \"that,\" didn't you?! B-by \"that,\" I mean...",
	voice_key_2 = -1,
	skill = "O beautiful world, sing to me a song!",
	drop_descrip = "Illustrious-class aircraft carrier – Victorious.",
	mail = "Handwritten letters are so much better than typed ones. Don't you think it's interesting how you can deduce the author's emotions based on their handwriting, Commander?",
	touch = "When you feel down, I also do. Come on, you have someone as beautiful as me beside you, so why not be happy?",
	profile = "I'm Victorious, Illustrious-class aircraft carrier number two! From the Atlantic Ocean to the Indian Ocean, and even the Pacific... where the ocean breeze goes, I follow!",
	mission_complete = "Fine, but just this one time! I won't help you with your missions a second time!",
	feeling4 = "I'm not in such a great mood... Are you free, Commander? Great! Then let me dress you in something fabulous! Seeing beautiful things makes me feel better, you see!",
	unlock = "I am the one called Victorious, Aircraft Carrier of the Royal Navy. Yes, sing my name as you herald the coming of the symbol of victory. As long as I am here, our endeavours shall be smooth!",
	feeling5 = "I wonder what the future you will be like, Commander~ Of course, I already quite like the way you are right now. ...Goodness, you're blushing ear to ear. How utterly adorable you are~",
	main = "War is ugly. And this olive wreath is the symbol of peace and beauty.|Tirpitz, if you won't come out and have fun with me then I'll bomb your room again!|I don't like violence, but using it is often the quickest solution to many problems...",
	battle = "Sigh, all that cannons and gunpowder can do is make is war even uglier...",
	upgrade = "Words are not needed to praise me! It's not people's words that touch the heart, it's their actions!",
	voice_key = 20704,
	headtouch = "",
	feeling2 = "You know about me from the Battle of Trafalgar? Umm, aren't you thinking of somebody else? Please, Commander~ Who you're thinking of is totally unrelated to me.",
	login = "The quiet sea, the cool sea breeze... Even in this moment, the birth of new, beautiful things blesses us.",
	vote = "",
	hp_warning = "Oh dear, I've let my guard down.",
	id = 900254,
	detail = "In both love and war, one should be brave~ So, be brave, and if you need support, I shall be there!",
	couple_encourage = {
		{
			{
				10703
			},
			1,
			"Pleasure to meet again, little Ms. Flat-As-A-Pancake.",
			0
		},
		{
			{
				20703
			},
			1,
			"Illustrious, y-your bust is just too busty!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[900255] = {
	feeling1 = "You Showa-born brat!",
	feeling3 = "If you don't have a plan to end a war, then you'd better not start one to begin with!",
	lose = "So this what it must have felt like to suffer through the Battle of Dan-no-ura...",
	propose = "You still got a long way to go to earn my respect! ... Hehehe, so that's why I better stick by you? 'Til you're too good even for me.",
	expedition = "Without robust logistics, even the mightiest fleets will turn into a disorderly mob.",
	win_mvp = "Through righteousness comes prosperity. Such is the will of the heavens.",
	home = "Excellent! The scales of war are tipping in our favor!",
	mission = "Hmm, I'm in charge of today's fleet operations? Very well... the fate of our country rests... mmf! ... Why aren't you letting me speak?",
	touch2 = "You'd like me to be your dance partner at the next banquet? ... I-I suppose I have no choice...",
	voice_key_2 = -1,
	skill = "Let every ship do her utmost!",
	drop_descrip = "Shikishima-class battleship number four – Mikasa.",
	mail = "No matter how many medals and honors I receive... Ehehe~?",
	touch = "Even the most hardworking people sometimes have lapses of judgment. It is my duty to admonish you in times like these.",
	profile = "I am Mikasa, a Shikishima-type battleship, and last of the Six-Six Fleet shipbuilding program. I served as the flagship of the Combined Fleet, and won a glorious victory that honored the name of our country across the world.",
