_G.pg.base.ship_skin_words[900257] = {
	feeling1 = "*Sigh* Seems like you must learn it the hard way.",
	feeling3 = "Though I speak of being refined at all times, you need not force yourself, Commander. Your normal self is the most charming, after all.",
	lose = "Victory and defeat are commonplace among those who fight, and it is we that have all the time in the world!",
	propose = "Aha, look how nervous you are. You can't convey your feelings to a lady when you're this nervous. However, your feelings have definitely reached my heart... I would happily oblige.",
	expedition = "Having completed numerous commissions is a sign of glory. May I suggest rewarding those girls?",
	win_mvp = "The warm sun and the cool breeze: a brilliant victory.",
	home = "Commander, may I offer you some warm tea? We can drink it as we review your battle.",
	mission = "Commander, we have been entrusted with new missions. Please look through them.",
	touch2 = "Commander, you should understand the consequences of disrespecting a lady... Are you prepared?",
	voice_key_2 = -1,
	skill = "Elegance is not just for show.",
	drop_descrip = "Admiral-class battlecruiser - Hood, Hull Number 51!",
	mail = "It's unopened... Commander... It would be ungentlemanly to ignore the messages of others.",
	touch = "Appropriate contact is indeed essential. Shall we dance?",
	profile = "Indeed, the glory of the Royal Navy now stands before you. Being able to maintain an air of elegance at all times is the hallmark of royalty. The Denmark straits? Soldiers know of victory and defeat alike. It was no more than a temporary setback.",
	mission_complete = "With glory comes rewards. Please do not forget about the latter.",
	feeling4 = "Hm? I'm too close? A lady must be elegant, but they must also seize the initiative towards the targets of their own affection.",
	unlock = "Are you the commander? Greetings and well met. I am the glory of the Royal Navy: Hood. Wherever I go, victory follows.",
	feeling5 = "\"Shall I compare thee to a summer's day? Thou art more lovely and more temperate... So long as men can breathe, or eyes can see, so long lives this, and this gives life to thee.\" ... A beautiful verse. Commander, could you read it out loud to me?",
	main = "An outstanding commander must have an in-depth knowledge of tea.|This word is... ah, so I read it wrong. Sorry, my eyes fail me.|Listen more, speak less. You should listen to the opinions of others, but also retain your own judgment.",
	battle = "May glory be with us today.",
	upgrade = "Your efforts will definitely be rewarded.",
	voice_key = 20403,
	headtouch = "",
	feeling2 = "Commander, it's such a great afternoon. Shall we have a chat? ... Hm, alright... I'll talk about the times when I was with Renown.",
	login = "Welcome back, Commander. Care for a cup of tea?",
	vote = "",
	hp_warning = "Even I am slightly angered.",
	id = 900257,
	detail = "Feel free to admire the glory of the Royal Navy to your heart's content.",
	couple_encourage = {
