_G.pg.base.ship_skin_words[900258] = {
	feeling1 = "You can't compare with the destroyers, Commander...",
	feeling3 = "I thought you were finally going to have me Court Martialed, Commander! I'm grateful to finally be recognized by you. It's nothing to be ashamed of? Commander, I, Ark Royal, will follow you forever!",
	lose = "Damn, trapped!",
	propose = "I'll take care of all the destroyers from now on! No one can touch Commander or my destroyers. No one!",
	expedition = "Commissions have been completed, Commander. If there are any cute destroyers in the fleet, allow me to welcome them back myself.",
	win_mvp = "An enemy who loses their ability to steer will be doomed!",
	home = "Is it time for a break? I'm going to see my destroyer sisters then!",
	mission = "Commander, it's a soldier's duty to complete missions!",
	touch2 = "Eh... Commander... please don't... Why are you doing this?!",
	voice_key_2 = -1,
	skill = "It's time for you to leave!",
	drop_descrip = "Aircraft carrier – Ark Royal, Hull Number 91!",
	mail = "Do you need to me read out your mail, Commander?",
	touch = "Your warm hands keep me energized to keep fighting, Commander!",
	profile = "",
	mission_complete = "Commander, to leave your rewards unclaimed is disrespect to the mission.",
	feeling4 = "G-good grief... If you were the same size as those destroyers, Commander, I wouldn't be so embarrassed... I was fine with doing this with the little ones... but with you...",
	unlock = "Ark Royal, reporting in for duty! I am confident in all manners of battle. Why, it was I who managed to destroy Bismarck's rudder!",
	feeling5 = "If I were closer to you, Commander, I could get closer with the destroyers too... Of... of course, that can only happen with your approval. I'm more than happy to help you with destroyer inspections! Is that all right, commander?",
	main = "",
	battle = "Is that it? Hah! Swordfish squadron, prepare for battle!",
	upgrade = "Oh! oh! oh! Allow me to protect you, my destroyer friends!",
	voice_key = 20702,
	headtouch = "",
	feeling2 = "I... I'm going to say this in advance, but... those destroyer girls... u-um... I kid of... I mean... I kind of hold them dear... I know how to mind my manners... It's not... it's not a crime!",
	login = "Ready for orders, Commander. I am confident in any kind of battle!",
	vote = "",
	hp_warning = "If only a destroyer would give me a hug!",
	id = 900258,
	detail = "Ark Royal, ready for inspection!",
	couple_encourage = {
		{
			{
				1
