_G.pg.base.ship_skin_words[900262] = {
	feeling1 = "I favor those of character, and those who can cook. Commander, you are neither.",
	feeling3 = "How's that, commander? Are you impressed by my cooking abilities? Here, have as much you desire. Seeing you enjoy my food pleases me.",
	lose = "Do not be demoralized. Neither victory nor defeat are decided by a single battle.",
	propose = "They say that \"the quickest way to one's heart is through their stomach,\" but you've managed to win over both at once. Commander, shall we share all our meals together from now on?",
	expedition = "There's some commotion by the port...? Oh, it seems to just be the commission team returning.",
	win_mvp = "Make no mistakes. I shall ensure both victory and the safety of all my comrades.",
	home = "Commander, did you thoroughly enjoy the battle?",
	mission = "New missions, eh? It would be ideal if we got something a bit more challenging.",
	touch2 = "Ohh? I wasn't aware that you possessed such audacity, Commander.",
	voice_key_2 = -1,
	skill = "The glory of the sun that never sets shall not fade!",
	drop_descrip = "King George V-class battleship – King George V.",
	mail = "A letter, huh? Now then, is this a challenge, or a love letter?",
	touch = "Why do I have a mountain of snacks before me? Isn't it obvious? One cannot move on an empty stomach.",
	profile = "",
	mission_complete = "Supper tastes best after the day's missions are all complete. Wouldn't you agree, Commander?",
	feeling4 = "Commander, so you're learning how to cook? Hmm, colour me impressed. I look forward to trying the dish that you're making for me.",
	unlock = "So this is my new battlefield. Ahh, how I've long awaited this... By the way, are you my commander? You are in the presence of King George V – do use me well.",
	feeling5 = "My greatest hobbies in life are food and fighting. While I am more than capable of fighting alone, dining by myself is quite difficult and lonesome. To be able to find someone who can share both of these things with me is truly a joyous thing.",
	main = "",
	battle = "Let us go forth and plant our banners!",
	upgrade = "Hmm... I suddenly feel like having a lavish feast.",
	voice_key = 20505,
	headtouch = "",
	feeling2 = "By the way, Commander, are you a good cook? Hmm? Despite my appearances, I've spent many hours honing my skills to sate my own appetite.",
	login = "Commander, did you already partake of supper?",
	vote = "",
	hp_warning = "Hmph, how interesting!",
	id = 900262,
	detail = "My standing within the Royal Family? Hmm... If I had to draw a comparison, I'd say \"Knight Commander\" would be the most fitting... Hahaha...",
	couple_encourage = {
		{
			{
				20506
			},
			1,
			"Wales, you'd better not suddenly leave me again!",
			0
		},
