	propose = "Thank you for your sincerity, Commander. I will gladly be yours. I won't ask of you to share all your joys and sorrows with me, as I'm more than happy with just being by your side. Ah, that didn't sound like what I would say, did it? Well, hehehe~",
	expedition = "Do you need someone to escort the commission team home? I'm quite the experienced escort, I'll have you know.",
	win_mvp = "Heheh, I'm in top shape today!",
