	mail = "We've received what looks to be mail addressed to you.",
	touch = "Do save the massage for later. I'm not tired yet.",
	profile = "Prior to my being sent to the Pacific, I always worked side by side with George. But aside from the one time we escorted our Sardegnian friends, I suppose I don't have too many notable feats to my name.",
