	battle = "Heheh, there'll be no mercy for you!",
	upgrade = "Phew... I'll return your gesture with valour on the battlefield, Commander.",
	voice_key = 20509,
	headtouch = "Hm...?",
	feeling2 = "\"Shape the world into God's vision\" – if there is a God, what is his ideal world? It can't be one of perpetual war, that's for sure.",
	login = "How nice to see you. Now, let's get to work on today's tasks.",
	vote = "",
