_G.pg.base.ship_skin_words[900311] = {
	feeling1 = "You're pretty amazing to have gotten on my bad side! But I won't get angry just to appease you! Haha! Enjoy your emptiness!",
	feeling3 = "I'll let you in on a little secret. My little sister keeps telling people that she's smarter than me. But truth is, she's dumber! I try to be nice and let her feel good about herself, like a big sister should. Ha!",
	lose = "So why am I on the battlefield anyway, purin?!",
	propose = "As a simple Bulin, I'm meant to just help strengthen your other ships... But you gave me this ring... You're a strange one! I like you! Come, let's raise our hands together and say purin~ purin~!",
	expedition = "Yaaaay~! Commander! The girls who went out on a commission have come back! Let's drill something to celebrate!",
	win_mvp = "Purin~! I'm the strongest!",
	home = "Let's run around and relax! Purin~!",
	mission = "Purin~! The next mission has been chosen for you!",
	touch2 = "Purin~ purin~! (Prototype Bulin MKII continues to spin faster)",
