	skill = "My drill is the drill that will pierce the heavens!",
	drop_descrip = "Prototype Bulin MKII. Can be used to limit break all Super Rare ships.",
	mail = "Purin! Secret skill: Drill Translation!",
	touch = "Purin~ You can't catch me!",
	profile = "Hahaha! It's your lucky day now that you've met me! We can purin together from this day forward! What for? To make everyone stronger, obviously! How do you purin? Like this! Purin~! Purin~!",
	mission_complete = "I'm just heading out to fetch your rewards, purin! I promise I won't break them!",
	feeling4 = "Whee~! I'm flying! So~ high! Hey, don't move! You'll have to catch me if I fall!",
	unlock = "Purin~! The herald of good fortune has arrived! Are you ready? Raise your hands and follow me... Purin~ purin~!",
	feeling5 = "You're not an average commander if you managed to conquer my heart. But I won't be shy or blush! Instead I'll give you a growl! Graaaah!",
	main = "Purin~! It's so big in here! There's so much room to run around!|Oh right, it's not my job to just run around, is it? Purin~!|Purin~? I'm too loud? Hmph, who cares what you think!",
	battle = "Purin~! Don't stop until they kneel and cry!",
	upgrade = "[Cannot be enhanced]",
	voice_key = 10001,
	headtouch = "",
	feeling2 = "My sister is so dumb. When people talk about our colors, it's not about our hair, it's about ra... rari... ah, now I remember! Reality TV!",
	login = "Righty tighty, Lefty loosey, Stay calm and Purin on!",
