_G.pg.base.ship_skin_words[9701010] = {
	feeling1 = "I give up... You are an untrustworthy Commander.",
	feeling3 = "Hm? You're here just to see me? You didn't have to – I'm well used to lonesome returns... Regardless, thank you.",
	lose = "Even the hunter becomes the hunted in due time...",
	propose = "Mh. I understand your feelings. If you don't mind a pitiable soul, I'd like to be with you until my final threat is felled... No, even beyond that, I want to walk beside you.",
	expedition = "The commission team is back. Those lassies – you can count on them.",
	win_mvp = "Henceforth we face the real threats. Be on your guards.",
	home = "You're back. In one piece, I presume? Then relax and rest your weary bones.",
	mission = "New missions, eh? Who will you pit me against this time?",
	touch2 = "I don't understand the point of this...",
	voice_key_2 = -1,
	skill = "Rest in peace.",
	drop_descrip = "Greetings, Commander. I'm Hunter. I hunt, as you might've surmised. Is this place... my new base?",
	mail = "You have a new letter. Read it, lest crucial information pass you by.",
	touch = "Weary, are you? Go on and rest. I'll watch your back.",
	profile = "I'm a hunter, and I'm under your command. Give me orders as you see fit. What do I hunt, exactly? You'll see, sooner or later.",
	mission_complete = "Another mission completed. Be that as it may, the hunt is not over.",
	feeling4 = "It feels almost like... my body and soul rejuvenate when I return here. I think this base has become my sanctuary...",
	unlock = "Greetings, Commander. I'm Hunter. I hunt, as you might've surmised. Is this place... my new base?",
	feeling5 = "Whew... I've never overslept anywhere but here before. Either my sense of danger is waning, or I'm losing my touch... but I doubt it's either. Perhaps I'm just... at peace.",
	main = "Not everyone can calmly deal with a sudden threat. But you lead us all, Commander. You must stay composed no matter what.|Ah... Is this the paper you're looking for? I've memorised the spots you routinely use – as any hunter would.|What's this? Tea and biscuits? Whew... I've seldom tasted such lavish food, nor have I sat idly in one place for this long.",
	battle = "I'll take the lead. Someone must.",
	upgrade = "My weapons grow sharper... Good.",
	voice_key = 970101,
	headtouch = "",
	feeling2 = "So this shall be my base... Alright. It's not so bad, having a place to rest and resupply.",
	login = "Oh, it's you. Resuming the perpetual cycle of paperwork? Good luck to you.",
	vote = "",
	hp_warning = "Gah... I must calm myself!",
	id = 9701010,
	detail = "Should I ever become a monster... put a swift end to my life. Please.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9701020] = {
	feeling1 = "Please get away from me...! I, I'm so sorry, I don't know if I can control myself...",
	feeling3 = "If the goddess of fortune truly exists, there are so many things I do not understand that I'd want to ask her... But in reality, whether or not those questions can be answered means so little to me now...",
	lose = "No, no... It shouldn't have been like this... How could this be? How could this be?!",
	propose = "I'm so sorry... that I am accepting your ring in this pitiful form of mine... But, I'm also so thankful that you still accepted who I am despite all that! Commander, being able to meet you is truly the happiest event on the trajectory of my fate.",
	expedition = "It appears that a commission has been completed... Unfortunately, I don't think I'll be able to help you in my current state, sorry...",
	win_mvp = "Did fortune favor me, or perhaps...",
	home = "Another mission completed successfully. Commander, it appears that the trajectory of your fate seems to extend to a more fortuitous future...",
	mission = "Commander, um... Just in case you forgot... There are still missions we have not yet completed...",
	touch2 = "Mmgh... Is this... yet another trial imposed upon me by fate...?",
	voice_key_2 = -1,
	skill = "P-please forgive me...",
	drop_descrip = "Well met, Commander. My name is Fortune. Please don't worry about these ch-chains... They're there to... keep my power in check.",
	mail = "Commander, there's new mail waiting for you... Um, unfortunately, I cannot hand it to you myself...",
	touch = "Umm, if these interest you that much, I suppose it's fine for you to touch them... I am capable of restraining myself...",
	profile = "I was given the name of \"Fortune,\" but in the end, it was I who was dragged down by fate... Um, if you insist on asking about these chains... They're, um, a self-imposed failsafe so that I do not harm those close to me...",
	mission_complete = "Mission complete... I'm sure everything will be fine from now on...",
	feeling4 = "Whenever I am with you, Commander, I can feel the wheels of fate turning, taking me in a new direction... It's a light, airy feeling I cannot describe well, but it also fills me with warmth...",
	unlock = "Well met, Commander. My name is Fortune. Please don't worry about these ch-chains... They're there to... keep my power in check.",
	feeling5 = "I now entrust my future and my fate to you, Commander. Even if I veer away from the correct trajectory, you'll be there to guide me back, right? Um, is it really alright for me to stay at your side?",
	main = "Fate is said to both be immutable, but also something you carve out with your own two hands... What, then, is truly the nature of fate?|This uncontrollable power... is surely a trial imposed upon me by fate. It is not something I can allow to flow freely...|Commander, do you ever get the inclination that something is destined to happen to you? Oh, um, that was just my curiosity speaking, nothing more...",
	battle = "Is there no other way...?",
	upgrade = "My control... seems to be improving...",
	voice_key = 970102,
	headtouch = "",
	feeling2 = "Our meeting surely must have been ordained by fate... right? I wonder where the winds of fortune will take me this time...",
	login = "Commander... Umm, welcome back...? That is the proper way to greet you, right?",
	vote = "",
	hp_warning = "Don't make me... use this power...!",
	id = 9701020,
	detail = "There's no need for you to worry yourself over me... More importantly, um, thank you very much...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9702010] = {
	feeling1 = "If you intend to close your heart to me, then what happens to you is no longer of any concern to me.",
	feeling3 = "Even if I can see everything, too often I cannot grasp any of it... I never wish to experience that sorrow again. Commander, I'm sure you'll be able to succeed where I failed.",
	lose = "How could I have overlooked something? I don't understand... Very well, so be it.",
	propose = "This symbol represents that we will never be separated, or betray each other... Mm, this I know. I have finally found peace of mind... So always, forever, eternally... remain by my side.",
	expedition = "SG has informed me that your friends will be returning soon. Let us prepare to greet them, Commander.",
	win_mvp = "The red dots on the radar... have all been eliminated.",
	home = "Where did you go, Commander? I'll know whether or not you're lying~",
	mission = "Commander, your missions will not disappear just by simply leaving them alone. Do finish them diligently.",
	touch2 = "I knew... you'd think twice about doing that.",
	voice_key_2 = -1,
	skill = "I've found you~ ",
	drop_descrip = "Were you looking for me? I am willing to lend you my power – provided that you promise not to hide anything from me.",
	mail = "You have new mail. Let me help you open it.",
	touch = "If you wish to use my powers, you must first tell me why.",
	profile = "Brooklyn-class light cruiser, Helena. As for what I'm good at, let's just say it's knowing a little more about you than the other girls.",
	mission_complete = "These are the mission rewards? ...Seems rather lackluster.",
	feeling4 = "Even though I have all the information I could ever want at my disposal, why does my heart waver so... I see now... What I know the most, is also what I least understand... and that is you.",
	unlock = "Were you looking for me? I am willing to lend you my power – provided that you promise not to hide anything from me.",
	feeling5 = "Only your gentle voice can wash away my anxiety and distrust... How would I be able to live without you... Never go anywhere, Commander, stay by my side.",
	main = "Commander, call out for me, bare your heart to me, quell my turmoil, erase everything that I cannot comprehend...|Commander, looking for someone? I know much more than just what happens around the office. I see everything that happens at this port.|Knowing too much can also be a curse, if you only know but are powerless to act.",
	battle = "SG, tell me where my enemies are hiding this time.",
	upgrade = "Greater power... but at what price?",
	voice_key = 970201,
	headtouch = "",
	feeling2 = "Of course I like to smile. As long as you can maintain a smile on your face, your heart will always remain opaque to others.",
	login = "I knew exactly when you'd come back, Commander.",
	vote = "",
	hp_warning = "Don't resist. I know exactly where you are!",
	id = 9702010,
	detail = "My SG tells me exactly where you are, but I wish it also told me what you're thinking...",
	couple_encourage = {
		{
			{
				10502,
				10504,
				10508
			},
			1,
			"There are some things... I will never let go of...!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[9702020] = {
	feeling1 = "No matter what form you may take, I will always support you. That's my sworn duty.",
	feeling3 = "I found this yesterday while I was out shopping. Thought it'd make for a nice gift, so here you go. Well? Do you feel happy? As happy as I was when I got a special gift from you?",
	lose = "We can still trial and error our way to success, Commander. Everything's just fine – chin up and cheer up.",
	propose = "I haven't felt an emotion this strongly in who knows how long... Thank you, Commander. Supposing I one day forget what this passion feels like, you'll remind me, won't you?",
	expedition = "Seeing as the commission team's back, we'd better get going... You know the drill, Commander.",
	win_mvp = "Look at that, we won. Hm? I am happy about this, even if I don't look like it.",
	home = "Nice work. Want a soda? Don't say it – I already know which ones you like... Heehee, I know you inside and out, remember?",
	mission = "HQ sent us a new mission. I added it to your schedule.",
	touch2 = "Aww, feeling lonely, Commander? ...It's a small comfort knowing you have moments like that too...",
	voice_key_2 = -1,
	skill = "Unknown variables... are to be purged immediately!",
	drop_descrip = "I'm Memphis. You may not know me, but I know you and I know you well. Don't you worry, I'm not a threat – you can trust me. Today I assume the role of your right hand and bodyguard.",
	mail = "There's a letter for you... Huh, you look happy. So it's good news, I assume?",
	touch = "Yeah? Uh, is something the matter?",
	profile = "I'm Memphis, Omaha-class light cruiser. I doubt this brief introduction will make you well-acquainted with me, but I promise you this – I will always stand with you, come hell or high water.",
	mission_complete = "Mission complete. All in a day's work.",
	feeling4 = "Do you feel like the satisfaction of completing a mission diminishes with each one, Commander? ...Sorry, that was an odd question. Let's get back to work.",
	unlock = "I'm Memphis. You may not know me, but I know you and I know you well. Don't you worry, I'm not a threat – you can trust me. Today I assume the role of your right hand and bodyguard.",
	feeling5 = "I'll do everything in my ability to assist you, Commander. Exactly the same as yesterday. The same place, the same work, the same you and I... I hope tomorrow will be no different.",
	main = "My way of handling documents is awfully similar to yours? Huh... I'd simply chalk that up to coincidence.|The port is running smoothly, our resources are well-distributed, and our personnel is deployed in strategic positions... Everything's going swimmingly.|Our synergy is so perfect it's like we can read each other's minds. I'd say we were born to work together, don't you think?",
	battle = "You're in the Commander's way. Disappear.",
	upgrade = "I feel the power... Thanks.",
	voice_key = 970202,
	headtouch = "",
	feeling2 = "What shall I start with today? Draft the next operation? A commission? A sortie? Whatever the case, I'll do a good job. Just give me the order, like always.",
	login = "Here's your schedule for today. Let's get some good work done, like we always have.",
	vote = "",
	hp_warning = "I've taken damage... but it's still within acceptable limits!",
	id = 9702020,
	detail = "Yeah, Commander? ...I'm perfectly fine. Right as rain even. There's no need to worry about me.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9702030] = {
	feeling1 = "I will never aim my gun at my friends... until they cease to be such. Please keep that in mind.",
	feeling3 = "Master, have you gotten used to working with me yet? If not, you'd better keep working at it.",
	lose = "Don't go dying in front of me. Hurry!",
	propose = "Those who threaten the ones I love shall be greeted by the peal of my gunfire. So... Master, what kind of ending do you want for this ceremony? If your goal was to throw me off-kilter and see my vulnerable side... you've accomplished just that.",
	expedition = "Commission complete. What, are you planning to leave your hardworking companions out to dry at the piers?",
	win_mvp = "The ring of my gun's muzzle tells us everything you need to know, Master.",
	home = "Was the operation successful? ...I see. Seems like you are capable of a thing or two.",
	mission = "Crack on. We've been notified of our next mission.",
	touch2 = "Fix your ways, or you'll end up a pest yourself one day.",
	voice_key_2 = -1,
	skill = "Playtime's over.",
	drop_descrip = "So you're the Commander... in other words, my Master. Alright, got it. The name's Sheffield, and the game's pointing my gun at vermin – Ah, please disregard that little gesture I made just now.",
	mail = "Who sent you this letter, I wonder? You'd better take a look.",
	touch = "The safety lock is in place, so you can take a look if you want.",
	profile = "I am Town-class light cruiser, Sheffield. My specialities are cleaning, marksmanship, and infiltration. What's wrong? These are basics every Royal Maid must know. Why are you acting so surprised?",
	mission_complete = "Do you really need me to remind you to collect your mission rewards?",
	feeling4 = "Are you concerned about me? Of course I'm glad to hear that– in your wildest dreams. Stop getting hot and bothered over a simple maid if you don't want others looking at you strangely.",
	unlock = "So you're the Commander... in other words, my Master. Alright, got it. The name's Sheffield, and the game's pointing my gun at vermin – Ah, please disregard that little gesture I made just now.",
	feeling5 = "There is nothing more foolish than becoming enraptured with a maid who often disappears without a word, goes on dangerous missions, and has a terrible personality to boot. But, that foolishness is precisely what I love about you.",
	main = "No abnormalities here... Hmm? Don't mind me. I'm just performing a routine security inspection of your office.|A maid must always take proper care of her weapon, be it gun or broom. Master, you will regret it if you let your \"weapon\" go rusty. Please do not forget to do your due diligence.|What's the matter, Master? You heard the sound of gunfire? That was just a blank. I do apologise for disrupting your sleep.",
	battle = "Now, let us begin our \"cleaning.\"",
	upgrade = "My next shot will find its mark even more flawlessly.",
	voice_key = 970203,
	headtouch = "",
	feeling2 = "If you fail to clean out pests, they will find a way of inflicting harm on you at unexpected times. Master, your compassion is a compromise that will lead only to your misery.",
	login = "I've finished cleaning up your office, so please get started with work. ...What's the matter? Do you find it strange that I am holding a broom and mop?",
	vote = "",
	hp_warning = "Am I being pinned down? ...What a pain in the arse.",
	id = 9702030,
	detail = "Even if we may never exterminate all pests, someone still has to do the job. Keeping your room tidy is the same. I'm sure you don't think that cleaning your room is unnecessary simply because it will get dirty again, right?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9702040] = {
	feeling1 = "Looks like your head might belong on the chopping block soon.",
	feeling3 = "You seriously called me over just to chat, and you don't have any work for me? Okay, you pick a topic then. I'd better not, 'cause it'll just be a gruesome story.",
	lose = "Like hell I'm gonna accept this humiliating defeat... Your days are numbered! Make no mistakes – I'll be back!",
	propose = "You really sure? 'Cause if you're ready and willing to go to hell with me, I'll gladly be with you. Burning down anything that stands in our way – I'll do that for you any day of the week.",
	expedition = "The commission team's brought back goodies. You mind if I smash up their cargo crates? Ahahah! I was just kidding♪",
	win_mvp = "I put 'em out of their misery. All of 'em.",
	home = "Making an executioner take care of a guard's job? Ugh, kill me already...",
	mission = "A new mission? Lemme see... Maaan, it's just sorting paperwork. That's so lame...",
	touch2 = "You're one of those who's too fun to execute, Commander. Yeah, I'll let you off with a verbal warning this time♪",
	voice_key_2 = -1,
	skill = "Burn in hell!",
	drop_descrip = "I'm La Galissonnière, the shipgirl from hell! I've come for your soul! ...Wow, didn't even flinch. Guess it's true that you don't fear death. Heheh, let's see if I can get a more interesting response out of you next time~♪",
	mail = "You've got a new letter. I'm curious who sent it...",
	touch = "Word of advice? Keep your hands off. My weapon, if that wasn't obvious.",
	profile = "I'm La Galissonnière, the shipgirl from hell! Don't ask questions about hell, or my job as an executioner. The only thing you need to know is that I'm damn handy to have around.",
	mission_complete = "Mission complete! Fighters get enemies to butcher, while office workers get papers to sort. Right people in the right place, like they say.",
	feeling4 = "Heard there are some girls in this port who like harassing you... Heheh. I know what you're thinking, but no, I'm not plannin' on taking action. I'm just wondering what exactly they did to get on your nerves of steel♪",
	unlock = "I'm La Galissonnière, the shipgirl from hell! I've come for your soul! ...Wow, didn't even flinch. Guess it's true that you don't fear death. Heheh, let's see if I can get a more interesting response out of you next time~♪",
	feeling5 = "We were practically made for each other, so why don't we stay together forever? Working with someone you can trust sure beats roaming the universe alone without a goal, too♪ Promise you won't ditch me one day, Commander?",
	main = "The most efficient way to solve a problem is to get rid of what's causing it. Isn't that literally what weapons are for?|I leave the planning to the people who are good at it and simply follow their orders. Speaking of, Commander, made your plans for today yet?|You can make mousse cake, AND it tastes pretty okay? ...Guess I don't know you as well as I thought...",
	battle = "Who wants a peek of hell itself?",
	upgrade = "Now that I'm stronger, how 'bout letting me see some action?",
	voice_key = 970204,
	headtouch = "",
	feeling2 = "Butchering the foes in front of me and passing judgment on criminals – my job is as simple as that. How to put my skills to use, that's for you to figure out.",
	login = "Commander, mind finding something for me to do, just like usual?",
	vote = "",
	hp_warning = "C'mon! Struggle more for me!",
	id = 9702040,
	detail = "Here I thought there'd be something fun to do in this world, but apparently there isn't. Oh well, guess I'll treat this as a vacation♪",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9703010] = {
	feeling1 = "This place, too, gives me anxiety...",
	feeling3 = "Have you ever experienced reoccurring nightmares, Commander? How did you get rid of... Ah, no, you don't have to tell me if you don't want to...",
	lose = "It's time to fall back. We cannot be eliminated so easily.",
	propose = "I thought it was all an extravagant pipe dream, yet it became reality... This is --- Commander, whenever you have a bad dream, come to me and I will sing a soft lullaby for you~",
	expedition = "A commission has been completed. Shall we go thank the brave team that did it?",
	win_mvp = "Victory... belongs to us!",
	home = "Nngh! Ugh... Another awful vision... Oh, don't worry about me~ I just lost my bearings for a moment, that's all. Anyway, would you like a meal to replenish your strength?",
	mission = "We have new missions. Keep at it, Commander. I'll assist you.",
	touch2 = "Heehee. I'll indulge you just a teensy bit.",
	voice_key_2 = -1,
	skill = "Focus on the battle!",
	drop_descrip = "I am heavy cruiser Trento, and I will be your assistant. The best thing I could ask for is that my support helps you achieve your goals.",
	mail = "You have a new letter. Make sure you save it if it's something important.",
	touch = "You want a hug? Um... There? Ah, sorry, I squeezed too tight...",
	profile = "I'm heavy cruiser Trento. Please task me with whatever you may need, be it on the frontlines or backlines. Why am I here, you ask? Because I'm a shipgirl whose job it is to assist you, of course.",
	mission_complete = "A mission has been completed. Way... Way to go, Commander~",
	feeling4 = "Is there anything in your life you want to change? You can tell me anything... Oh, you're more concerned with me? Heehee, please don't be. I feel much better than I used to, and it's all because you're doing so well, Commander.",
	unlock = "I am heavy cruiser Trento, and I will be your assistant. The best thing I could ask for is that my support helps you achieve your goals.",
	feeling5 = "I had a wonderful dream. It was a peaceful day, and everyone including you had gathered to enjoy my cooking... Heehee, thinking about it now, you've pretty much already made that dream a reality. Say \"ahh,\" Commander. I'm going to feed you~",
	main = "Our minds tend to wander when we're bored, don't they? Confusingly, it can be easier to focus when you have something to do.|Hesitation can mean death for those who make decisions. Still, the fact remains that we're all tied down by our own emotions.|Are you tired? Ah, then please hold on just a minute. I'll make you something quick to eat.",
	battle = "Mgh... I can't afford to get distracted, not now...!",
	upgrade = "May this new power serve you and all our friends...",
	voice_key = 970301,
	headtouch = "",
	feeling2 = "You think I look ill? Ahah, I'm fine. I just had a somewhat unpleasant dream...",
	login = "I'm relieved that you're right on time. Do you want to review today's schedule before we start working?",
	vote = "",
	hp_warning = "It's n-not over just yet...!",
	id = 9703010,
	detail = "Being with you puts my mind at ease. It scares off all the awful visions that haunt me... You have a strangely potent aura, Commander...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9703020] = {
	feeling1 = "*sigh*, old-fashioned people just don't understand what true joy is. What a shame...",
	feeling3 = "\"Possessed by the Devil\"... That's merely an excuse for one's self-centered behavior. Say, have you ever used a trite phrase like that to lie to yourself, Commander?",
	lose = "Chagrin, anger... I see, so this is the taste of defeat? How delicious. Heehee♪",
	propose = "To tell you the truth, this is far from enjoyable; it brings me great pain. It's not the exchanging vows part that hurts, it's not knowing how long I have to wait for you. Heehee♪",
	expedition = "Commission completed. Shall we have a look at the rewards? You might be pleasantly surprised.",
	win_mvp = "There's no fun to be had in an effortless victory~",
	home = "Judging by your look, you didn't enjoy your last battle. Were your foes too feeble? Maybe the mission went too smoothly for your liking?",
	mission = "A mission? Why spend time on that when it could be spent on your own pleasure?",
	touch2 = "If pleasure cannot be rejected, why don't you just embrace it? Heehee♪",
	voice_key_2 = -1,
	skill = "I never gave you permission to flee~",
	drop_descrip = "You must be the Commander. I am the heavy cruiser Algérie. So, what pleasures can I experience here? I do hope you won't disappoint me. Heehee~",
	mail = "You've received a new letter. Isn't it fun to look forward to the unknown?",
	touch = "That look of yours when you're holding yourself back from acting on an urge – it's quite exciting.",
	profile = "I am heavy cruiser Algérie, and I live to enjoy. Enjoy what, you wonder? Heehee. If I had to say... to enjoy anything and everything.",
	mission_complete = "Completing a mission is more satisfying than the rewards that follow.",
	feeling4 = "From what I've noticed, you do know what pleasure is, but meaningless little things inhibit your drive to pursue it. Now, come to me... I will teach you the essence of human nature. Heehee♪",
	unlock = "You must be the Commander. I am the heavy cruiser Algérie. So, what pleasures can I experience here? I do hope you won't disappoint me. Heehee~",
	feeling5 = "Ah, yes, you're a great and virtuous hero – you cannot be with a wicked devil. You need only ask, though, and I'll spoil you whenever you please. Nobody has the right to shame you for seeking just a moment of pleasure.",
	main = "Caring only about your own pleasure gets you labeled as \"selfish.\" To that, I say, name-calling is low-grade enjoyment.|You seem to be struggling. Need a hand? ...Heehee. I mean, wouldn't you offer to help if you saw a kitten in need?|Pain is a kind of pleasure. It doesn't matter whether you inflict it or receive it... Do you get what I mean? Heehee.",
	battle = "Fighting, by itself, is enjoyable.",
	upgrade = "Whew. I needed to stretch my muscles a bit.",
	voice_key = 970302,
	headtouch = "",
	feeling2 = "I enjoy fighting not just because slaying my foes is satisfying, but because fighting itself is fun. To really make them suffer, or make it quick and painless... I always let my whims decide what to do.",
	login = "What brings you here this late? Surely you've not wasted time elsehere?",
	vote = "",
	hp_warning = "Yes! Yes! Now you're doing it!",
	id = 9703020,
	detail = "The opposite of fun is not pain, but boredom. Knowing that, won't you fill this gaping void with something... enjoyable?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9704010] = {
	feeling1 = "These were the only \"commands\" you could come up with? What a joke.",
	feeling3 = "You seem to be quite drawn to me. I'm not sure what about me would warrant your fancy, so I don't know if you're stubborn or just a simpleton.",
	lose = "Withdraw? Haha... Ahahaha! ...It hasn't ended yet, so why are we to withdraw?",
	propose = "If you're prepared to go to these great lengths for me, then I shall accompany you to the very end. I'm becoming more and more curious – just how far will you be able to go by my side? ...Yes, I cannot allow you to leave until we've traversed the very bowels of hell. Are you ready?",
	expedition = "The commission rewards? Ahh, what an enviable logistics department you have.",
	win_mvp = "Indeed, it is wreckage and ruins that put my heart at ease.",
	home = "Rest is for the dead. I'll do the rest myself if you so desire.",
	mission = "Cumbersome paperwork will only hinder your ability to fight.",
	touch2 = "Such a crass hobby... But whatever makes you happy.",
	voice_key_2 = -1,
	skill = "Everything is as planned.",
	drop_descrip = "You're... the Commander, right? In other words, the one with the authority to control me. Though I have no interest in you as an individual, I will still obey your orders... At least for the time being.",
	mail = "Just a friendly reminder: you still have unopened mail.",
	touch = "What's wrong? Can't make up your mind?",
	profile = "I am the Iron Blood battleship, Gneisenau. I've heard that you are an excellent commander, so surely you know how to operate a precise and efficient instrument of war?",
	mission_complete = "Your duties end here. Mine, on the other hand, persist eternally...",
	feeling4 = "You're commanding me... to take a break? Do you even know what you're asking me to do? ...Very well. I did say I'll obey your orders.",
	unlock = "You're... the Commander, right? In other words, the one with the authority to control me. Though I have no interest in you as an individual, I will still obey your orders... At least for the time being.",
	feeling5 = "You are quite an interesting person, trying to treat me as an ordinary human and integrate me into life at this port. I suppose I ought to try saying \"thank you.\" ...I wonder if this is the first time I've uttered those words.",
	main = "Only with exacting precision can you eliminate your enemies in a single fatal blow, thus ending the battle quickly.|...Leave me to my own devices, and your job will be much smoother... Though it doesn't seem like you're interested.|It may take some time... until I am used to an ocean devoid of war.",
	battle = "To fight... is to fulfill this life's purpose.",
	upgrade = "Now that my armament has been strengthened, the next step is... Ahahaha!",
	voice_key = 970401,
	headtouch = "What... is the meaning of this?",
	feeling2 = "A machine's efficiency comes from its accuracy, lack of hesitation, and tirelessness. As ships, we must be the same.",
	login = "So you came after all. Not that it matters to me either way.",
	vote = "",
	hp_warning = "Pain... is nothing more than a catalyst for madness...",
	id = 9704010,
	detail = "The more you suppress your emotions, the more rationally you can fight. Let the battlefield wash over you, and immerse yourself in the scent of steel.",
	couple_encourage = {
		{
			{
				40501
			},
			1,
			"Bismarck, I never thought I would fight by your side once more...",
			0
		}
	}
}

_G.pg.base.ship_skin_words[9704020] = {
	feeling1 = "A weakling such as you isn't fit to command a fleet.",
	feeling3 = "There must be some people here who strive to push their limits. Introduce me to them, would you?",
	lose = "This isn't over! I will NOT retreat!",
	propose = "There's no guarantee I'll forever stay by your side. That said... I will lend you every ounce of my strength to realize your ideal world. I, Scharnhorst, will fight for you.",
	expedition = "The commission team has come back. I'll send down a stand-in since we're both preoccupied here.",
	win_mvp = "Such is the inevitable fate of all raving shitheads who oppose me.",
	home = "We are most prone to carelessness after a hard-fought battle. Stay sharp, Commander.",
	mission = "Why do you need more people on this mission? You don't think I'm capable enough, huh?!",
	touch2 = "You disgust me... Ugh!",
	voice_key_2 = -1,
	skill = "There is no compassion in war!",
	drop_descrip = "I'm Iron Blood battlecruiser Scharnhorst. I am keen to join forces with a Commander as talented as you. Don't let my expectations of you be misplaced.",
	mail = "Here, a letter for you. I've underlined the important parts of it.",
	touch = "Exhausted, you say? A break is just around the corner. Don't let up until then.",
	profile = "I'm Scharnhorst. Never back down, no matter what – that's my doctrine. I'll state it upfront: I'm headstrong, and might even defy your orders from time to time.",
	mission_complete = "Good news – mission complete. I went ahead and claimed the rewards, too.",
	feeling4 = "I'm well used to life at this port by now. While I'm still pushing my limits as always, I do feel like I've started to... loosen up a bit.",
	unlock = "I'm Iron Blood battlecruiser Scharnhorst. I am keen to join forces with a Commander as talented as you. Don't let my expectations of you be misplaced.",
	feeling5 = "What is this feeling of inner peace which I've lacked for so long...? What will happen when it goes away? ...You won't let it go anywhere? Usually I'd call that an empty promise, but when it's YOU making that promise... I must just believe it.",
	main = "Aircraft carrier shitbags... I hate to admit, but they outclass me when it comes to information and long-range warfare.|Wounds of the body heal in due time. Wounds of the mind... They don't often fade so easily.|The Ugly Sisters... Hahah. What an unforgettable nickname. The spite of your enemies is the most potent affirmation you can ask for.",
	battle = "I've had enough of your bullshit. There'll be nothing left of you when I'm finished!",
	upgrade = "Time to assess my new strength with a cannon volley.",
	voice_key = 970402,
	headtouch = "Stop wasting your time on infantilizing me!",
	feeling2 = "I never flee the battlefield, but I know when to make concessions.",
	login = "Now that you're here, it's time to get cracking. Start by reading these documents.",
	vote = "",
	hp_warning = "I will make you suffer for your persistence!",
	id = 9704020,
	detail = "My every scar is proof of a brush with Death survived.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9704030] = {
	feeling1 = "Don't lose all hope. While you've steered a bit off course, the fact remains that we're allies. So, I'll take it upon myself to lead you back in the right direction!",
	feeling3 = "When you get time to rest, take it – don't work yourself to death. You never know when there might come a day you'll never rest again.",
	lose = "We retreated before it was too late, securing the strength to fight another day... I hope.",
	propose = "I don't feel I've got much appeal, so the thought that you don't want me held me back so long. It takes bravery to pop the question, and I'll show the same bravery with my answer... Heehee, my answer's \"yes,\" obviously!",
	expedition = "The commission team is back. Don't forget to give those weary girls a pat on the back, Commander!",
	win_mvp = "Yeah! We won!",
	home = "Phew... Glad you made it back alive. You may think a safe return is business as usual, but I can never take it for granted.",
	mission = "New missions, eh? Wonder if any of them let me leverage all my experience...",
	touch2 = "For your own sake, don't try anything funny.",
	voice_key_2 = -1,
	skill = "You're all under my protection!",
	drop_descrip = "I'm Repulse, Renown-class battlecruiser. I've been through a lot... but that's in the past. Now, I'm a part of this port. Whenever you're in a pinch, come see me.",
	mail = "You've got a letter. Isn't it wonderful having someone who cares about you? Remember to write back to them.",
	touch = "Concerned about me? Don't be, I'm feeling great. Cheers.",
	profile = "Repulse, Renown-class battlecruiser. Me and my sis have seen some things... That's a story for another day, though. I must say... this calm, peaceful port is ideal for a place to rest.",
	mission_complete = "That mission's done and dusted! That gives us some time to be with our friends.",
	feeling4 = "You've not worn yourself out today, have you? Good. Shame these missions keep coming in, one after another... Guess it'll be a long while before the weight on your shoulders will finally come off.",
	unlock = "I'm Repulse, Renown-class battlecruiser. I've been through a lot... but that's in the past. Now, I'm a part of this port. Whenever you're in a pinch, come see me.",
	feeling5 = "Commander, you're my closest friend and most beloved person, and I hate to see your health suffer because of your workload. If you ever feel you've had enough of it all, just toss it out the window. I'll support you from start to finish.",
	main = "Whew... Oh, need something? You caught me getting lost in the scenery out the window. Sorry about that.|Life is short. We should be kind to our friends and treasure every moment we get with them.|A Royal Knight? Sure, I've heard a few fables about knights in my time... Anyway, stay focused – don't forget about your work.",
	battle = "Come on, we're sortieing – let's hear some excitement!",
	upgrade = "I hope there'll come a day when I'll have no use of this rigging anymore...",
	voice_key = 970403,
	headtouch = "",
	feeling2 = "Having chats with friends, taking a leisurely stroll, and napping on a bench when you get tired... that's what life at this peaceful port is all about. Here's hoping it always stays that way.",
	login = "Yup, you're as committed to your job as ever.",
	vote = "",
	hp_warning = "I'm only... getting started!",
	id = 9704030,
	detail = "When seasoned heroes grow tired of fighting and start seeking peace of mind... will the world welcome them back?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9704040] = {
	feeling1 = "You're our leader, so it won't do for you to stay in this sorry state. I shall take responsibility for whipping you into shape and guiding you.",
	feeling3 = "I used to believe I would continue fighting tirelessly alongside my friends until the end of time... When did I dare to start dreaming of peaceful days...?",
	lose = "My apologies. I was unable to follow through with your orders...",
	propose = "I can scarcely believe you prepared this many candles and even went through the trouble of shaping them into a heart... Of course I know how you feel. Even if you hadn't gone through all this trouble, my answer would still be... B-by the way, Commander, do I look too giddy right now...?",
	expedition = "Commander, the commissions have been completed. Let us thank our allies before tallying up the results.",
	win_mvp = "No matter how much the vicissitudes of war wear away at me, I shall not fall as long as my resolve holds strong!",
	home = "The sight of my allies returning home safely never fails to put a spring in my step.",
	mission = "Is there a new mission? I'm not sure if I'll be of any assistance, but...",
	touch2 = "This behaviour is inappropriate considering your position, Commander.",
	voice_key_2 = 9704043,
	skill = "Don't let your guard down!",
	drop_descrip = "Salutations to you, Commander. I am battlecruiser Renown. I hope that this battle-worn blade can become your power.",
	mail = "Here's some mail, Commander. Why don't you take a short break to confirm the contents?",
	touch = "Instead of worrying about me, you should be worrying about things more worth your time.",
	profile = "I am battlecruiser Renown. I've been through countless missions and operations with Repulse at my side... I am very fortunate to have found a place to take refuge in this world.",
	mission_complete = "Now that you've completed your missions, you can take it easy for the time being.",
	feeling4 = "This question may be inappropriate, but... Commander, have you ever considered life after retirement? To live life not as a warrior, but as a normal human... How magnificent would that be?",
	unlock = "Salutations to you, Commander. I am battlecruiser Renown. I hope that this battle-worn blade can become your power.",
	feeling5 = "Commander, I am eternally grateful to you for giving me the opportunity to share many precious moments with you. Our meeting, the time we've spent together... all of it is engraved in my heart. ...Ah, don't worry, I'm not planning on going anywhere! I'm sorry if I've caused any misunderstandings. And, umm... I will always stay by your side, Commander!",
	main = "...Oh, my apologies. I got sidetracked looking out the window... Repulse does the same thing from time to time? I see...|I've come to love this port. My heart feels lighter whenever I think about what I've become a part of since coming here.|You think the other Renown looks cute when she's serious about something...? Yes, I do think she would be happy to hear that from you. Allow me to give you my thanks on her behalf then— Oh...",
	battle = "Get into formation! It's time for us to attack!",
	upgrade = "So this... is what's needed to maintain one's strength?",
	voice_key = -1,
	headtouch = "",
	feeling2 = "I fear neither scars nor death.. but the heartbreak that war brings is far worse than both combined...",
	login = "Commander, your diligence will one day be duly rewarded.",
	vote = "",
	hp_warning = "The dawn... is within our grasp!",
	id = 9704040,
	detail = "\"I'm so tired,\" huh... Hmph. Those aren't words I can throw around so freely.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9705010] = {
	feeling1 = "There is nothing more I can do for you at this point, Commander...",
	feeling3 = "Are you... concerned about me, Commander? You have no reason to be. I pray to the gods each day so that they bestow us all with their blessings and protection.",
	lose = "This curse cannot be lifted... Then so be it.",
	propose = "If this is what you desire... then I shall accept. I know not whether this ritual will ultimately bring us blessings or misfortune, but I will continue praying for your happiness, Commander.",
	expedition = "You command a whole fleet of shipgirls who'll fight with all their might for you, Commander... Please, do cherish them.",
	win_mvp = "May you slumber eternally and find solace, far from the turmoil of the sea...",
	home = "You cannot let your duty come before sleep, lest it ultimately consume you, Commander. Please, care for your own well-being.",
	mission = "A mission, you say? I shall pray for the fulfillment of your wishes, no matter how small.",
	touch2 = "Commander...? Has something strange possessed you?",
	voice_key_2 = -1,
	skill = "Slumber eternally.",
	drop_descrip = "I am battleship Fusou. I have come to bring peace to this world's tormented souls. Commander, do you seek blessings... or redemption?",
	mail = "You've received a letter, Commander. I urge you to read it at the earliest convenience.",
	touch = "I pray for you, Commander, and hope that the gods are listening.",
	profile = "The missteps and misfortunes of the past are now all but forgotten phantoms... Only by guiding these drifting souls towards the light can I accomplish my mission.",
	mission_complete = "A mission has been completed. The gods have heard our prayers.",
	feeling4 = "I've seen far too many lost souls stricken with grief and remorse. Commander, when one day you look back upon your whole life, I want you to be able to smile, and say your life was a good one.",
	unlock = "I am battleship Fusou. I have come to bring peace to this world's tormented souls. Commander, do you seek blessings... or redemption?",
	feeling5 = "Before I met you and everyone else here, all I could do was pray. I had lost all motivation to sing hymns or even lead lost souls to the light. But now, seeing all your smiles, I feel I've... rediscovered my purpose in life.",
	main = "Commander, do you ever wish you could return home? Do you have anyone in your heart who you are unable to let go of?|Until we have finished our respective duties... May we not pry excessively into each others' affairs.|I will keep praying to the gods, for as long as it takes, until the curse placed on Yamashiro and me can be permanently lifted.",
	battle = "Is this the only way to cleanse their impurities? Then so be it.",
	upgrade = "So many catastrophe-stricken souls still await their salvation.",
	voice_key = 970501,
	headtouch = "",
	feeling2 = "How may I be of use to you, Commander?",
	login = "Commander, I have been waiting for you.",
	vote = "",
	hp_warning = "I have already offered so many prayers... but is it still not enough...?",
	id = 9705010,
	detail = "Conflict throws all souls into chaos... I pray the gods may guide them to peace...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9705020] = {
	feeling1 = "I know you can hear me, Milord. Come out of hiding and own up to your mistakes like a decent person!",
	feeling3 = "Why does at least one girl always call it quits partway through our training? And why do you always stick up for the quitters, Milord? The whole fleet will stagnate if people keep dropping out...",
	lose = "What went wrong? Please don't tell me one of you wasn't even trying...",
	propose = "Is this... proof of your adoration, Milord? Oh, I feel truly blessed! Henceforth, please allow me to assist by taking on more and more work, or anything else you want done! I promise I'll be of great use!",
	expedition = "Taking on commissions is a form of training. Milord, please mix up your commission rosters so everyone gets a turn!",
	win_mvp = "With enough rigorous training, victory becomes almost a certainty. Isn't that right, Milord?",
	home = "Trai-ning♪ Trai-ning♪ Let me think about what I'm gonna drill into your head today~♪",
	mission = "New missions have come in. Knowing you, you'll breeze through them!",
	touch2 = "Milord... Fondling me without warning is a punitive deed. The punishment is quite severe, I'll say.",
	voice_key_2 = -1,
	skill = "Keep going, don't let up already!",
	drop_descrip = "Are you this fleet's Commander, Milord? I see. You have great potential, but your skills need some refinement. I wonder what's the best way to train you... You'll see soon enough – stay alert until then!",
	mail = "Milord, I suggest you read your new mail when you have the time.",
	touch = "Does anyone here wish to become stronger? Step forth and let me train you!",
	profile = "I'm battleship Yamashiro, Fusou's sister. I've learned a lot through my training, and I'd happily impart that knowledge to you. Would you like to learn, Milord?",
	mission_complete = "Oh, you've completed a mission? Then you should get yourself a cup of tea and enjoy a break!",
	feeling4 = "I'll admit, I've been too strict with those girls... No, no, please don't say that. I understand why you feel that way. Those girls can stop if they wish, but your training, Milord, will stay as rigorous as ever!",
	unlock = "Are you this fleet's Commander, Milord? I see. You have great potential, but your skills need some refinement. I wonder what's the best way to train you... You'll see soon enough – stay alert until then!",
	feeling5 = "Astounding, Milord! You've seen through your most rigorous training yet! With someone like you, maybe my bad luck won't be such a... N-no, I didn't say anything! Anyway, the next session will be arduous – please give it your all!",
	main = "You mustn't let your mind wander while on the clock, Milord. Also, I've brought new paperwork for you!|Life is awfully laid-back at this port... Your girls will never grow into fine soldiers in this environment!|Oh no! The vase! ...Phew! That was a close one... Through my training, I've developed the reflexes to react quickly to imminent mishaps like this!",
	battle = "Show them the fruits of your training~ Hehehe~",
	upgrade = "I'm afraid this isn't nearly enough power. I need more...",
	voice_key = 970502,
	headtouch = "",
	feeling2 = "Do you wish to strengthen your fleet, Milord? Then allow me to be of service! I know the way to draw out latent potential!",
	login = "I've sorted your documents and made you green tea. Strap in, Milord – it's going to be a long day!",
	vote = "",
	hp_warning = "Aww, just my luck...",
	id = 9705020,
	detail = "You look bored, Milord. Was your training perhaps too easy?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9705030] = {
	feeling1 = "You should stay away from me after all. Otherwise, it'll only end up with your friends getting hurt...",
	feeling3 = "You don't have horrible dreams when you're around me? Really? Um, it's not that I don't believe you, but...",
	lose = "If only I could do it all over again...",
	propose = "You're willing to always stay by my side and watch over me? *sobs*... Oh, I'm so sorry... I just, can't stop the tears from flowing... Commander, I believe you. You are the only safe harbor for my heart...",
	expedition = "The commission team has returned. Go welcome them together? Never mind, I'll just be a hindrance anyway....",
	win_mvp = "Is victory... something worth celebrating?",
	home = "Um, while you were gone, all the lights in the office seem to have gone out again... I'm sorry for inconveniencing you once again.",
	mission = "Do you still have missions left? I'll try to help out in whatever way I can...",
	touch2 = "Is this... some kind of punishment?",
	voice_key_2 = -1,
	skill = "Let it all end!",
	drop_descrip = "I am Arizona... This may be improper of me, but is it really alright for me to stay here? ...Very well, Commander. If that is what you've decided...",
	mail = "Commander, there's a letter addressed to you... I'll go ahead and leave it on your desk.",
	touch = "S-sorry! If you touch me without warning, I... Huh? You're not hurt? Thank goodness...",
	profile = "If there are parallel worlds out there, would \"I\" exist in them as well? If that's the case... I pray that I could have met you earlier, and spend a life free from tears...",
	mission_complete = "We finished the missions without any major issues... Phew, I'm glad it went well.",
	feeling4 = "Peace of mind, and comfort... When I am by your side, Commander, those feelings seem to be slowly coming back to me... But, I'm scared of losing this happiness again...",
	unlock = "I am Arizona... This may be improper of me, but is it really alright for me to stay here? ...Very well, Commander. If that is what you've decided...",
	feeling5 = "Commander, you who rescued me from the abyss of despair and suffering... You are my last hope. I'll strive to do even better. Someday, I'll show you that I can overcome these dark emotions! Until then... Commander, would you please wait for me?",
	main = "\"Arizona's Tears\"... Does that refer to me? Maybe I was seen in a moment when I could not control my emotions. I'm sorry...|It is said that staying around me for too long will afflict you with tragic dreams. Huh? You don't mind? I, I see...|Oh, what was that sound just now? Did something break again because of me?",
	battle = "I pray this is the correct decision...",
	upgrade = "I hope this will make a difference...",
	voice_key = 970503,
	headtouch = "",
	feeling2 = "Would you mind keeping a safe distance from me? Oh, no, I'm not trying to push you away. \"Our\" Vestal warned that something terrible will happen if you don't...",
	login = "Welcome back. When you are here, Commander, the office does not seem as bleak.",
	vote = "",
	hp_warning = "No! At this rate, I...",
	id = 9705030,
	detail = "If given the chance, I'd like to do it all over again... But even if that were possible, wouldn't the same things just play out again? What do you think, Commander?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9705040] = {
	feeling1 = "It's fine. Consider this our own mistake for not being more selective. Go and do what you want; you may no longer be our servant.",
	feeling3 = "Are you still struggling to swear your fealty? Hah, your queen understands that the most talented folk fashion themselves leaders rather than followers. Do your job as you wish, but we expect your aid when it is needed.",
	lose = "All forces, retreat! We will not permit any unapproved sacrifices!",
	propose = "Must we still tell you what needs to be done?! Take our hand and swear that you will never betray us! ...Hmph, you belong to your queen now, so you are no longer permitted to shoulder every burden on your own! If you try to escape us, you'll be the subject of our ire forevermore!",
	expedition = "Servant, tend to the girls who just returned from their commission.",
	win_mvp = "Hmph. Did you think such foes stood a chance at stopping us?",
	home = "Finally returned? Good. We order you to rest. You may not continue working until your queen says you may! Understood?",
	mission = "Missions? See them done, and done well. We will not tolerate you shaming our name.",
	touch2 = "Pervert! Shameless lecher! Servants who don't know their place ought to be beheaded!",
	voice_key_2 = -1,
	skill = "Consider this a gift from your queen!",
	drop_descrip = "So you are the Commander? Very well. From this point forth, you will use your courage and intellect for our purposes! ...We don't have all day, now. You are our servant, so this won't go anywhere until you swear your fealty.",
	mail = "Mail for you, hmm? What's so wrong with us asking what it says?! Of course, we do mean to respect your privacy.",
	touch = "You are a fearless one, laying hands on our body without express permission!",
	profile = "We are the super-dreadnaught, Queen Elizabeth. We welcome any who wish to become our subject. Member of the Royal Navy or otherwise, we protect all those who follow us! Come, Servant; if you have any questions, ask now before our mood changes!",
	mission_complete = "Mission rewards? We have no interest in such trifles. You take them, servant.",
	feeling4 = "Hm? Are you surprised that we would come here? Is it wrong for a queen to worry about her servants? Actually, why aren't you worried about us?! ...N-Not to say that's all there is to it...",
	unlock = "So you are the Commander? Very well. From this point forth, you will use your courage and intellect for our purposes! ...We don't have all day, now. You are our servant, so this won't go anywhere until you swear your fealty.",
	feeling5 = "Your work isn't bad, but you focus too much on working out minor trifles! In other words... Umm, focus yourself on other things! For example, erm... Your queen...",
	main = "If you wish to pray, pray to your queen instead of the empty sky! We will bless and protect you!|We will prove that charisma is more than just one's physical size... Nobody shall impugn our stature ever again!|A port full of harmony and beauty... Is this your desire, servant? ...Don't worry. We were just a little happy for you.",
	battle = "What a grand welcome. Do they mean to roll out the red carpet for us?",
	upgrade = "It is good to see that you pay adequate attention to us.",
	voice_key = 970504,
	headtouch = "Servant, do you not find your actions extremely rude?",
	feeling2 = "Pretty yet empty words will not be proof enough that we have done our job as queen. Servant, if you have any doubts about us, we will ascertain and rectify them.",
	login = "What took you so long, servant? Are you not aware that you are making us wait?",
	vote = "",
	hp_warning = "This isn't funny! Your queen does not approve of this!",
	id = 9705040,
	detail = "What's the matter? Are you in such awe that you cannot utter so much as a word? Hmph... Servant, if you're thinking of anything rude, you will pay dearly!",
