_G.pg.base.ship_skin_words[9706010] = {
	feeling1 = "What a gutless Commander you are...",
	feeling3 = "...My eyepatch? Don't worry, it's no impediment in battle.",
	lose = "This is unacceptable! I'll crush you all next time!",
	propose = "Commander, you're making a promise to me...? Heh, ahahaha... Sorry, it's not that this doesn't make me happy, it's just... I don't know how I'm supposed to feel or respond... Right, I can just answer the way I'm used to: by defeating your enemies for you.",
	expedition = "A commission's been completed? Let's see... Wow, that's a pretty good haul.",
	win_mvp = "Hehehe, that was a good fight. Let's just leave it at that.",
	home = "You've returned. Good, let's start planning for the next battle.",
	mission = "We've received some missions. If any of them concern the Sirens, leave them to me.",
	touch2 = "What are you trying to say? That I have no charm? ",
	voice_key_2 = -1,
	skill = "Ahahahaha! Die, die!",
	drop_descrip = "Ahahahaha! The fact that you've chosen me means you clearly have a discerning eye. So, what now? Where's the enemy you need me to sink?",
	mail = "Here, Commander. Your mail.",
	touch = "What, got any new info on the Sirens?",
	profile = "Name's Hiyou, aircraft carrier of the Hiyou-class. I'm considered a light aircraft carrier along with Junyou, but I don't mind if you treat me as you would a standard aircraft carrier. Don't worry, I won't let you down.",
	mission_complete = "All right, mission complete!",
	feeling4 = "Your job is to lead our way, Commander. My job is to eliminate any obstacle that tries to stop us. Perfect, isn't it?",
	unlock = "Ahahahaha! The fact that you've chosen me means you clearly have a discerning eye. So, what now? Where's the enemy you need me to sink?",
	feeling5 = "Commander, just do whatever you'd like and go wherever you'd like. As long as I can be by your side and fight together with you, I don't need anything else.",
	main = "Junyou? ...I'm doing just fine. No need to worry about me.|The best defense is a good offense. Take them out before they can get to you. Don't you agree?|Doing paperwork dulls my blade, Commander. When's our next battle going to be?",
	battle = "Yeah! Throw them into disarray!",
	upgrade = "Got any targets I could wipe out for a warm-up?",
	voice_key = 970601,
	headtouch = "Keep this up for a few more seconds, and I won't be able to guarantee your safety.",
	feeling2 = "Battles are simple. Just crush all of your enemies, and live to tell the tale.",
	login = "I can't sit still anymore! Commander, I'm all ready to head out!",
	vote = "",
	hp_warning = "Tis but a scratch...!",
	id = 9706010,
	detail = "I can't just sit on my ass all day! Commander, don't you have any information about where the Sirens will pop up next?!",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9706020] = {
	feeling1 = "I'm a grown woman now. It's time to put my childhood behind...",
	feeling3 = "Commander... How do you feel about lifelong friends? Err, I mean, in the context of fictional stories... and things like that...",
	lose = "Whatever comes next, I've made my peace...",
	propose = "Thank you, Commander. This proves to me that our relationship is real – that it has ALWAYS been real – and not some figment of my imagination... I want to be with you, now and forever.",
	expedition = "A commission has been completed. Do you mind if I go see them on your behalf...?",
	win_mvp = "One tiny little victory... won't be enough...",
	home = "Hello. Good to see you... back in one piece.",
	mission = "We should strive to complete our missions.",
	touch2 = "Whuh?! I'm... I'm not...!",
	voice_key_2 = -1,
	skill = "Out of my way!",
	drop_descrip = "I'm... Junyou. Please give me your orders... Commander.",
	mail = "There's mail for you. Please check it as soon as you can.",
	touch = "I don't understand what you want...",
	profile = "I'm not sure what you want to hear from me... but ask me about my past, and I'm afraid you'll be disappointed... Because I simply have no answers.",
	mission_complete = "Mission complete. Don't you think... we work astonishingly well together?",
	feeling4 = "What if... Just speculating, of course, but... What if you and I had known each other since long ago...? Things would be a lot different to how are they now... wouldn't they?",
	unlock = "I'm... Junyou. Please give me your orders... Commander.",
	feeling5 = "We may not be genuine lifelong friends, but that doesn't matter anymore... We've been through so much that we've grown as close as best friends like you see in fiction! ...I mean, right?",
	main = "I see Hiyou hasn't changed... She still revels in war.|Focus on yourself. Focus... Ah, um, I'm meditating. Please leave me alone for a while...|These shikigami planes are my weapon of choice against the Sirens. Only I can control them. No one else may touch them... No one...",
	battle = "Here I come!",
	upgrade = "Thank you.",
	voice_key = 970602,
	headtouch = "Ahh... *blushes*",
	feeling2 = "Oh, uh... S-sorry, I didn't mean to stare... I'm just thinking about what-ifs and what-could-have-beens...",
	login = "You're back. Are you about to start working? I promise I won't be a nuisance.",
	vote = "",
	hp_warning = "An approach this direct is bound to fail...!",
	id = 9706020,
	detail = "How would you react... if I told you we've been lifelong friends, and... N-never mind. Please forget I said anything.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9707010] = {
	feeling1 = "Leave me alone.",
	feeling3 = "On the battlefield, even a moment's hesitation can invite total destruction. Thinking about nothing other than how to defeat the enemy - that's my fighting style.",
	lose = "Sister... I'm sorry...",
	propose = "This is... the proof of your oath... I understand. If you will continue to value me as your blade, I will not turn my back to you. ...Though, my comparatively uncomely and unpleasant self will give you a hard time. Hehehe.",
	expedition = "It's good to count your blessings for the fortune of having plenty in the present moment. One day, it'll just be a wistful memory.",
	win_mvp = "Such a small victory is not worth celebrating...",
	home = "Don't worry about me. Simply stay focused on what it is you need to do.",
	mission = "These are all just trifling matters...",
	touch2 = "Hah?! ...Hmph! ...Next time, I'll assault you back with my blade.",
	voice_key_2 = -1,
	skill = "I'm all fired up!",
	drop_descrip = "I'm getting all fired up! The name's Hiryuu, Hiryuu from the 2nd CarDiv. As a member of this fleet, I'll obey your orders. I do hope that you are qualified to lead us.",
	mail = "Please take this, Commander. It's your mail.",
	touch = "If you have something to say, just spit it out. If you fuss over it too much, you're just going to end up not saying anything.",
	profile = "I'm the aircraft carrier, Hiryuu. ...Right now, I am naught but a single soldier. That's all you need to know about me.",
	mission_complete = "Though they're all just trifling matters, they're still missions proper. I'll report back to you when I finish receiving the rewards.",
	feeling4 = "Would you keep challenging strong foes you have no chance of defeating? ...For the sake of those you wish to protect? Since it's you, I can see that you've given it plenty of thought. I support that sentiment.",
	unlock = "I'm getting all fired up! The name's Hiryuu, Hiryuu from the 2nd CarDiv. As a member of this fleet, I'll obey your orders. I do hope that you are qualified to lead us.",
	feeling5 = "This unwavering conviction, that if it's you, there will be a way... Hmm, I guess I've still got a naive side to me... It's nothing. Commander, as your blade, I will continue to pledge myself to your service.",
	main = "Enterprise? Whether as a rival or an ally, there's no doubt that she's an existence to be respected.|Hanafuda...? Now's not the time to be indulging in entertainment.|My usual training regimen isn't designed to show off my skills, but rather to protect my allies and defeat my enemies. Am I mistaken?",
	battle = "Quick, let's get started! Come forth, my planes!",
	upgrade = "...What a shame.",
	voice_key = 970701,
	headtouch = "",
	feeling2 = "Right now, I'm merely a soldier. I simply follow your directives, and that's all there is to it.",
	login = "Guide my blade. Where do my enemies lie?",
	vote = "",
	hp_warning = "",
	id = 9707010,
	detail = "I'd rather you pay attention to the others. ...If you're going to keep idling around here...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[9707020] = {
	feeling1 = "Let me offer a word of advice, if you'll even listen: turn around and leave while you still can, Commander.",
	feeling3 = "A ship who's lost her way is fated to go under. The same is true for people. Do you have the strength to keep yourself on the right course, Commander?",
	lose = "Don't bet on all future battles ending in your safe escape.",
	propose = "Is this for me? Ah... I understand. Then on this day, I vow to follow wherever you go. I'm eager to see what awaits us at the end. Hahaha!",
	expedition = "Our companions risked much to bring back those resources. They deserve acknowledgement. Let us go see them, Commander.",
	win_mvp = "Flee to the ends of the world if you so want, I will still hunt you down!",
	home = "Have no fear. I am always ready for orders!",
	mission = "One of your most important duties is to accomplish the missions assigned to you. Don't forget that, Commander.",
	touch2 = "This is not the time nor place for this kind of behaviour...",
	voice_key_2 = -1,
	skill = "You cannot escape me!",
	drop_descrip = "Aircraft carrier Ark Royal, at your service. I hereby vow to lend you my strength for as long as you harbour honourable ambitions!",
	mail = "You've received a new letter? Best to read it now, then. Do not live in ignorance of the latest happenings.",
	touch = "I see no resolve in your eyes! Shape up! ...There, that's better. Hahaha.",
	profile = "We are both soldiers, you and I. We fight to protect our loved ones. Whatever desolate wastes the streams of fate carry you to, never forget your duty.",
	mission_complete = "A mission's been completed. Excellent.",
	feeling4 = "Your outstanding expertise and determination are truly awe-inspiring. I have no doubt you can lead this fleet to places nobody would've expected.",
	unlock = "Aircraft carrier Ark Royal, at your service. I hereby vow to lend you my strength for as long as you harbour honourable ambitions!",
	feeling5 = "Put your mind to rest, Commander. Wherever your destination may be, I will follow you to it. Be they towering waves or colossal icebergs, whatever obstacles we encounter, I will tear them down!",
	main = "One should protect their loved ones, that is abundantly clear. In the case of the little destroyers, even more so.|My strengths lie in outranging the opponent. But, of course, I am no slouch in close-range combat either.|Developing new tactics for the fleet, are you? Do you need my expertise?",
	battle = "Show them no mercy!",
	upgrade = "I need to become stronger to protect what I must!",
	voice_key = 970702,
	headtouch = "",
	feeling2 = "You need someone to escort the little destroyers, do you? I can certainly do it, but I could just as well do any other mission. I'm ready to sortie at all times.",
	login = "Ready to face another day? Splendid!",
	vote = "",
	hp_warning = "I will not be defeated!",
	id = 9707020,
	detail = "Peace is something worth protecting at any cost.",
	couple_encourage = {
		{
			{
				1
			},
			3,
			"Have no fear. I guarantee your safety.",
			1
		},
		{
			{
				20706
			},
			1,
			"Together we stand! For the glory of the Royal Navy!",
			0
		},
		{
			{
				97
			},
			2,
			"Once more... the fire rises!",
			3
		}
	}
}

_G.pg.base.ship_skin_words[9707030] = {
	feeling1 = "When danger approaches, don't wait until you regret it. It'll be too late by then.",
	feeling3 = "Hanafuda? That's a word I haven't heard in a while... If you're interested, I don't mind playing a round with you after work.",
	lose = "We don't have much time left...",
	propose = "How unlike you to get so flustered. –Wait, this is... I see, I get it now. Hehe, why are you worried then? My answer... has been set in stone long ago, yes?",
	expedition = "The commission supplies have arrived at port. Examine them thoroughly and take stock of all costs, gains, and losses.",
	win_mvp = "A quick and decisive victory. Exactly what we needed.",
	home = "Why don't we reflect upon the battle? It may be troublesome, but well worth the effort.",
	mission = "It is your duty as commander to complete your missions. Go forth.",
	touch2 = "*sigh*... There's no cure for you, is there...",
	voice_key_2 = -1,
	skill = "I have no time to waste!",
	drop_descrip = "I am Souryuu of the Sakura Empire's 2nd CarDiv. Let's skip the formalities and get to work right away.",
	mail = "There's new mail, I left it on your desk. If it's from Hiryuu, I would've shown it to you directly.",
	touch = "I'd like to believe that you have a good reason to call for me...",
	profile = "I am Souryuu of the 2nd CarDiv. I shall look after you so that you may become an exemplary commander.",
	mission_complete = "Here are your mission rewards– You can go take a break and leave the rest to me.",
	feeling4 = "You're using hanafuda as an excuse to get closer to me, right? Hehe... sure, let's go for another round. In the meantime, I'll explain to you where you fall short.",
	unlock = "I am Souryuu of the Sakura Empire's 2nd CarDiv. Let's skip the formalities and get to work right away.",
	feeling5 = "You are now able to calmly and rationally devise a solution even in the face of the most desperate and critical situations. However, I'll continue to keep an eye on you, so don't let your guard down, alright?",
	main = "Hiryuu... She's off training alone again, and she's still as strict on herself as ever. Commander, don't you think you should learn from her example and cultivate a bit more self-discipline?|The past cannot be changed. All that matters is that we live in the present.|Spacing out again? Haven't I already told you? Not a single one of your actions escapes my gaze.",
	battle = "Let's finish this quickly.",
	upgrade = "My strength has increased? I appreciate your effort.",
	voice_key = 970703,
	headtouch = "",
	feeling2 = "In the future, your carelessness will become a fatal flaw in the face of a fearsome foe. If you cannot be strict and resolute with yourself, then I shall do it for you.",
	login = "Commander, now that you're here, let's cut to the chase. Here are the documents that need your attention.",
	vote = "",
	hp_warning = "Calm down and look for an opening to break through–",
	id = 9707030,
	detail = "Can you take pride in the duties you've fulfilled as commander? If you cannot say \"yes,\" then you must reflect upon yourself.",
	couple_encourage = {
		{
			{
				9707010
			},
			1,
			"2nd CarDiv, sally forth!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[9708010] = {
	feeling1 = "I think we should go our separate ways. You do your thing, and I'll do my thing. We're both square, and that's that.",
	feeling3 = "If you just vanished one day, you'd betray the trust of everyone at this port. You wouldn't walk away on your near and dear, would you, Commander?",
	lose = "That's enough. We don't need to push ourselves any longer. I've shed tears over fallen friends too many times already.",
	couple_encourage = "",
	expedition = "The commission team is back. You promised you'd welcome them, remember? C'mon, get going!",
	win_mvp = "A win is a win~",
	home = "You're back? While you were gone, I may have issued a few orders in your name. Teehee♪",
	mission = "You've got new missions. It's none of my business, but won't you be worse off if you don't take care of them?",
	touch2 = "Let me guess... You do this all the time, right? Teehee~",
	propose = "You do know how much promises mean to me, right? This is your last chance to back out. Commander... Do you swear on your life that you won't betray me, that this won't end in tragedy? Promise?",
	skill = "Don't take this personally~♪",
	drop_descrip = "U-556, the Parzival of the Seas, has arrived! Let's see if there's really anything I can help with here. Seeing as I'll be staying here – nice meeting you♪",
	mail = "You've got a letter! I picked it up on the way here.",
	touch = "I don't have time for games, alright?!",
	voice_key_2 = -1,
	profile = "Of course I remember my promise to Lord Bismarck. I just don't repeat it constantly, or I'd annoy her. Besides, she specifically asked me to continue on by myself... Anyway! I'm not forgetting about my promise anytime soon.",
	mission_complete = "Mission complete. I'll fetch the rewards, just 'cause I feel like it♪",
	feeling4 = "Do you think an on-your-life promise is a childish fantasy, or just plain silly? Teehee~ I knew you'd say no♪ You're a good person, after all~",
	feeling5 = "I used to want to be Parzival the Careless, playing in the sea all day with no goal or concern in the world. But I'm okay with who I am now. At least this way I got to meet you, whom I can share my heart with... Right?",
	main = "What does it mean to be an adult? Not having the time to play all day anymore? Heehee. No, it can't be THAT simple♪|What to do for a fun break... I know! I'll ask around the port if anyone needs help with something♪|Hey. Teehee. Whatever promises you've made to these girls, just don't forget about them.",
	unlock = "U-556, the Parzival of the Seas, has arrived! Let's see if there's really anything I can help with here. Seeing as I'll be staying here – nice meeting you♪",
	upgrade = "There's a limit to what you can achieve by getting stronger...",
	voice_key = 970801,
	headtouch = "Hm? Hmm? What'cha doing?",
	feeling2 = "Here comes the Parzival of the Seas♪ Teehee~ Does anyone need my help today? And Commander, do I have permission to give out favors in your name?",
	battle = "No hard feelings, but we're enemies after all~",
	login = "Welcome back~ Got promises to fulfill? 'Cause if someone has dibs on you, I'll take my leave♪",
	hp_warning = "Stop getting in my way!",
	id = 9708010,
	vote = "",
	detail = "Promises... You've made a lot of 'em, haven't you? Were you able to keep them all? There must be some you were forced to give up on..."
}

_G.pg.base.ship_skin_words[9712010] = {
	feeling1 = "You are ill, Commander. Gravely ill. However, you may yet be cured if you cooperate with my treatment.",
	feeling3 = "Commander, can you make some time for a physical exam? People, like ships, need regular upkeep. And just because you don't feel ill doesn't mean everything is fine.",
	lose = "We'll be in a tight spot if we suffer any more casualties...",
	couple_encourage = "",
	expedition = "The commission team has returned with goods. I can stock up on medical supplies.",
	win_mvp = "Any casualties? No? Good.",
	home = "Are there any wounded from your last battles? I'll examine all the girls, just to make sure.",
	mission = "You still have many missions to accomplish, but please, don't bite off more than you can chew.",
	touch2 = "Overdependence on the kindness of others is a sickness of its own, Commander.",
	propose = "I will answer \"yes\" if you can promise me one thing – to take better care of your body from now on. Remember, the fleet isn't alone in needing you – I do, too.",
	skill = "You must take your doctor's advice.",
	drop_descrip = "I... assume you're the Commander? Don't worry, I can see that you're in good health. I'm Vestal. Bring your sick to me, and I should be able to assist with treatment and repairs...",
	mail = "A letter from afar... I suggest reading it at once, Commander.",
	touch = "Do you want me to examine you?",
	voice_key_2 = -1,
	profile = "I am the repair ship Vestal. You may think of me as a doctor for shipgirls. I will, of course, also try to help if sickness should befall you, Commander.",
	mission_complete = "Mission complete. You should give yourself some time to breathe now, Commander.",
	feeling4 = "You can bottle up your troubles, but they will come bursting out one day. Commander, when someone confides in you, listen to them. I will do the same for you, if you ever need it.",
	feeling5 = "Care for you forever? You certainly are an oddball. I've never heard of anyone wanting to be nursed around the clock... But, since I enjoy looking after you, I suppose I will.",
	main = "The most annoying thing for a doctor is when a patient lies about their health. An illness will turn grave if you let it fester.|Huh? You should set your eyes on more important things than worrying about me.|It is a doctor's job to save lives. Even when I get hurt in the line of duty, I have no regrets. Of course, I know I mustn't throw my life away. I take whatever precautions are necessary.",
	unlock = "I... assume you're the Commander? Don't worry, I can see that you're in good health. I'm Vestal. Bring your sick to me, and I should be able to assist with treatment and repairs...",
	upgrade = "May this strength let me help more people.",
	voice_key = 971201,
	headtouch = "",
	feeling2 = "While, yes, medicine is not your domain, you always lend an ear and a shoulder to the girls here who need it. In that way, I could see why someone would regard you as a doctor.",
	battle = "Please, safety first.",
	login = "Welcome back. I've sterilized your office, so it may smell a little odd... I hope it's not too distracting.",
	hp_warning = "It's alright. A little bit of first-aid, and I'll be fine.",
	id = 9712010,
	vote = "",
	detail = "A flower, once withered, will not bloom again; a life, once lost, will not return. The weight of a life cannot be simply measured with a scale."
}

_G.pg.base.ship_skin_words[10100010] = {
	feeling1 = "Huh? What was that? I can't hear you, I've got bananas stuck in my ears.",
	feeling3 = "I've got an idea! Commander, you should visit Planeptune sometime! I'm sure everyone would love to meet you!",
