	expedition = "Hey! Everyone's back! Shouldn't we head out and welcome them?",
	win_mvp = "Justice will always win! Just kidding...",
	home = "Oh, the pudding is calling out to me...! We gotta get back home!",
	mission = "Me, do some missions? I'll help if you give me 5 servings of pudding, how's that? ...I'm just kidding! Let's get out there and finish it!",
