	main = "Heheh! How's my rigging look? It's all so Azur Laney! Looks good on me, don'tcha think?|Nep nep♪ Nep nep♪ Nep nep neppynep♪|I'm hungry... Go get me some pudding, Commander!",
	battle = "Witness the might of a protagonist!",
	upgrade = "Chala-la-la-laaaa!",
	voice_key = 1010001,
	headtouch = "",
	feeling2 = "Going out for some exercise every now and then isn't so bad! Hey, Commander! What do you say we go for a walk together next time?",
	login = "Welcome back! Let's give it all we've got, nep!",
	vote = "",
	hp_warning = "Nep?! It's not time to panic just yet!",
