_G.pg.base.ship_skin_words[10100020] = {
	feeling1 = "Could you please just get out of my sight already?",
	feeling3 = "A friend of mine would like to have lunch with you next time. You don't mind, right? I'll be there too, of course. I mean, someone has to be there to make sure you don't get ahead of yourself and do anything weird.",
	lose = "I will never forget this defeat. And that is why I will grow stronger.",
	propose = "What?! This isn't just a prank, is it...? This can't be, I thought you hated me for sure... Why are you looking at me like that? That means my answer is: OK! You should be able to tell that on your own, idiot!",
	expedition = "It seems a commission has finished... Thank goodness, looks like nobody's been hurt.",
	win_mvp = "Hah, what child's play. It'll take more than this to satisfy me.",
	home = "Well done. I consider relaxation to be a legitimate training method.",
	mission = "You should check for missions at regular intervals.",
	touch2 = "L-listen here... If you don't stop it right now then I will get angry.",
	voice_key_2 = -1,
	skill = "Leave this to me!",
	drop_descrip = "Are you the commander? Hmm... Very well. I'm Noire. The CPU of Lastation. You can put your mind at ease now that I'm here.",
	mail = "It seems mail has arrived.",
	touch = "Noir...! Keep your hands off me!",
	profile = "I'm Noire, the CPU of Lastation. I wonder if I'll be able to make many friends in this new world... B-but more importantly! Give me a report on the current state of the war.",
	mission_complete = "If we get any rewards we can't use then I'll inform the higher-ups for you.",
