	unlock = "Are you the commander? Hmm. Very well. I'm Noire. The CPU of Lastation. You can put your mind at ease now that I'm here.",
	feeling5 = "Hey... When I'm together with you, my heart feels like it's gonna burst. How do you feel about me? ...Actually, don't tell me. I already know the answer...",
	main = "You're not neglecting my maintenance are you? Of course equipment is important, but our motivation also affects our performance, so pay attention to it.|The dresses these girls wear are quite cute. A-and I'm not just saying that because I want to try them out or anything.|Hmhhmhmmn♪ Hmmhm♪... Huh? Since when did you get here...?",
	battle = "Watch and see what happens when I get serious!",
	upgrade = "I'm going to set my sights higher.",
	voice_key = 1010002,
	headtouch = "",
