_G.pg.base.ship_skin_words[10100050] = {
	feeling1 = "I never thought you would disappoint me this badly...",
	feeling3 = "Oh, it's you. You came at just the right time. There's a stage I can't clear in this game and I was hoping you could help me with it.",
	lose = "Everyone else ends up suffering just because I'm so powerless...",
	propose = "I see the time has finally come. I'd grown so tired of waiting! Do you understand what giving this to me means? It means you will be my partner in gaming from this day onward. I'm looking forward to it, Commander.",
	expedition = "The commission team has returned. Should I offer them some assistance?",
	win_mvp = "It's only natural we'd win.",
	home = "That was a splendid workout. How about some time to take a break?",
	mission = "Missions, huh... It seems the things a commander and a CPU do are not so different.",
