	voice_key_2 = -1,
	skill = "Feel the power of a CPU!",
	drop_descrip = "I am Purple Heart, the CPU of Planeptune. And you must be the commander. I will follow your orders from now.",
	mail = "It seems some mail addressed to you has arrived. You should read it now before you forget to.",
	touch = "Ahh...! Listen, if you want my attention then you could just ask for it.",
	profile = "I'm Purple Heart, the CPU of Planeptune. People always tell me they're amazed by how different I am in HDD form. How rude. This form is exhausting to be in, so I don't transform unless I have to.",
	mission_complete = "Mission completed. I'm curious about what rewards we'll receive.",
	feeling4 = "I don't know why but recently I've been unable to concentrate when I'm playing games with you. Is this what it feels like to... Just to make sure you'll have to play with me some more!",
	unlock = "I am Purple Heart, the CPU of Planeptune. You must be the commander. I will follow your orders from now on.",
	feeling5 = "I've grown accustomed to this world, and it's all thanks to you. So, grab my hand and come with me! I say we go on a date for a little while.",
	main = "I am relieved everyone here is so kind. I will have no issue fighting with all my strength.|I could really use something to drink... Would there happen to be any custard pudding around here?|Oh, Commander? Could you tell me something I should know about your world?",
	battle = "I will destroy every last one of them.",
	upgrade = "To protect the commander and everyone I know... I have to become even stronger.",
	voice_key = 1010005,
	headtouch = "",
	feeling2 = "Such nice weather today. Do you know of any places in this world worth visiting?",
	login = "Welcome back. Shall we sortie? Do some exercise battles? Or perhaps... have some pudding?",
	vote = "",
	hp_warning = "I am Purple Heart and I will not be looked down on!",
	id = 10100050,
	detail = "If you're so interested in me, why don't you come closer?",
	couple_encourage = {
