_G.pg.base.ship_skin_words[10100070] = {
	feeling1 = "I don't want to see your sorry mug at all!",
	feeling3 = "Even though you're an unreliable commander, I still have some expectations for you.",
	lose = "If you hold me back again... I'll end you.",
	propose = "This is... for me? Are you for real? I see... so you are. Understood, I'll accept your feelings. I'll become even stronger, so I can continue to be your shield!",
	expedition = "A commission team has returned. Why don't we welcome them back?",
