	touch = "Commander, I won't say anything mean, so please stop trying to remove my headband. Not even I know what will happen to this place if you do!",
	profile = "Hello! I'm Kizuna AI! I've somehow ended up in the world of Azur Lane, a game I've been streaming... But, like always, I'll do my best while following the VTuber mindset of \"making a living doing what you like\" here too!",
	mission_complete = "Our rewards are here! It's important to have capital, so let's accept it right away!",
	feeling4 = "What's the matter, Commander? You came up with a new project? Let's have a look... Whoah! This is great! I think you might be a genius!",
	unlock = "HAI DOMO! Kizuna AI here! Are you the commander I've heard rumors about? It's a pleasure to meet and work with you!",
	feeling5 = "I think I can create even better content working together with you! I'll probably be here for a while... so, how about making your YouTube debut with me?!",
	main = "You're so cute, Laffey! Come here, my little contrarian, I wanna play! Let me give you a big hug!|Don't run away, Bulin! Hold on just a sec! I need just a tiny little Limit Break from you!|I have this job because I want to connect with people all over the world, but what got you into your job, Commander?",
	battle = "I'll show you the power of an intelligent super A.I.!",
	upgrade = "Installation complete! Combat plugins added! I've powered up!",
