	main = "Ahhh~ those candied apples look so good! But, I don't think I'm able to eat... Huh? Wait, if I'm here, then maybe... Ah- Yuudachi-chan already ate them all!? |If I'm already wearing a Sakura-style outfit, I also should match it with a set of animal ears! Benson-chan, lend me yoooours~! |I have to admit though, it's really hard to move around in a yukata... That's right! Prinz-chan, teach me the secret to fighting in this outfit~!",
