	expedition = "I have pressing information. The commission team has returned. Let us swiftly head out to receive them!",
	win_mvp = "Gotta hand it to myself: I'm perfectly suited for combat, too!",
	home = "Phew... Kinda tiring to act refined and all... Huh?! Commander?! H-how long have you been here...? My tone of voice sounded odd? No, not all, you must be imagining things! Ohohoho!",
	mission = "Commander, a new mission has appeared. Let us begin on our preparations at once!",
	touch2 = "You are guilty. There is no room for alternate interpretations. You are guilty.",
	voice_key_2 = -1,
	skill = "I shall end this gorgeously!",
