	mail = "Mail has arrived. It may be of urgent importance, so please do read it immediately.",
	touch = "Please, do you not know uncouth it is to touch a lady nonchalantly?",
	profile = "I am the embodyment of cuteness and etiquette! Please, enjoy the splendor of this smarter and more refined Kizuna AI!",
