	unlock = "Well met. I'm Kizuna AI, the new addition to your base. I will do all in my power to be at least of some use. It is a pleasure meeting you, Commander.",
	feeling5 = "It is thanks to you that I have matured so much! I sincerely believe it would not have been possible without your help! ... Thank you so much!",
	main = "Commander, Hood invited me to a tea party. Would you perhaps like to attend it as well?|Formal attire certainly aids one's composure... Belfast, if you don't mind, would you kindly teach me the Royal Navy's etiquette?|Commander, would it be agreeable with you if I uploaded videos from this base? I am quite talented at video making, you see.",
	battle = "Please, everyone take care as to not be injured.",
	upgrade = "Installation complete! Pardon, I meant to proclaim that I have become smarter.",
	voice_key = 1040002,
	headtouch = "",
	feeling2 = "I make strenuous efforts each day to be a mature A.I. so I may relate to everyone.",
	login = "Welcome back, Commander. Soon it will be time for our scheduled meeting. Let's get a lot of work done today.",
	vote = "",
	hp_warning = "Something as trivial as this... will not defeat an intelligent super A.I.!",
	id = 10400020,
