	feeling5 = "I've learned so much and gained experience I never would've otherwise by watching you work. I feel my horizons have expanded to the point I can come up with novel new strategies!",
	main = "Oops. Sorry for spacing out, Commander. I'm juggling several things at once right now...|It's good we all came here together, but that means things are as hectic as ever... Hey! Ami! Mami! Get back here! What are those shovels for?!|If we spruce up our choreography a bit, it should take our performance to the next level. Let's do it! We'll rehearse it for our next show!",
	battle = "Everyone, let's stay sharp!",
	upgrade = "Steady progress! Everything is going exactly according to plan!",
