	unlock = "Welcome to our celebration, Commander. At this breathtaking venue, I, Neptune, shall be the one to show you around, rather than the Royal Maids. Heehee~♪",
	feeling5 = "",
	main = "Allowing some other girl to attend you instead of choosing me? That simply won't do, Commander... Just kidding♪ I'll be waiting right here, so make sure you say hello to everyone~|Commander, have you forgotten the magic words when you want me to take you somewhere? \"Please, Mistress Neptune.\" Remember?|Charybdis' demeanor seems rather out of place compared to the rest of the Royal Maids... Say, Commander, how would you like it if I tried to act extra high-and-mighty to get you to do all sorts of stuff for me?",
