_G.pg.base.ship_skin_words[299020] = {
	feeling1 = "Are you saying that I am inferior to them?!",
	feeling3 = "Love needs no repayment. No matter how much the Royal Family neglects me, my loyalty to them is unwavering.",
	lose = "Am I... being discarded yet again?",
	propose = "Even if the world no longer needs me, you will always need me. That is more than enough for me... Hahah, perhaps I was materialised with the sole purpose of meeting you. Even if so... I am happy.",
	expedition = "I wonder what efforts it took to materialise me... Hmph, regardless, I will see to it they are repaid in double.",
	win_mvp = "Heed my words: depend on me! I will always win!",
	home = "That was a marvellous welcome. Hmph, were I the only one returning, would anyone welcome me at all...?",
	mission = "Let me handle this mission. I shall prove my excellence!",
	touch2 = "Do not fall victim to those degenerate habits of theirs.",
	voice_key_2 = -1,
	skill = "Not even the Queen's orders can subdue me!",
	drop_descrip = "Battleship – Monarch.",
	mail = "You've received mail regarding the war. You would do best to check it.",
	touch = "Is my presence needed, Commander?",
	profile = "I am the battleship named Monarch, one of the rejected King George V-class designs. Hmph, though I was once forgotten, now I live and breathe...",
	mission_complete = "For as long as I exist, it isn't over. I am excellence itself, therefore I must exist.",
	feeling4 = "So, they can still laugh together... Perhaps I wasn't discarded for nought, then... I have never felt this way before.",
	unlock = "We meet for the first time. I am the battleship Monarch. Hmph, once I was discarded, but now I am needed; how ironic... Is this how low the Royal Navy has sunk?",
	feeling5 = "Commander, to me, you are the most special, most dear person in existence. You always have, and always will be...",
	main = "Wales and York... I despise them for bereaving me of my existence, but I cannot resent them for succeeding me.|A younger sister? If I have one, her name would be... Prince of Wales... That has a rather nice ring to it.|I will make the world understand how foolish it was not to choose me.",
	battle = "Depend on me! I will make sure this fleet returns home without as much as a scratch!",
	upgrade = "Hmph, sure enough, I am the most excellent of the King George V class.",
	voice_key = 29902,
	headtouch = "",
	feeling2 = "I only survived in that dark world by believing that I am excellence itself, and thus irreplaceable...",
	login = "Splendid; you're back. I, Monarch, am superior to the likes of Wales and York. Wouldn't you agree, Commander?",
	vote = "",
	hp_warning = "If Wales were me, she would probably have sunk long ago.",
	id = 299020,
	detail = "You are the one and only being who matters to me... Until I met you, there was nary a single soul who believed in me.",
	couple_encourage = {
		{
			{
				20506
			},
			1,
			"I am George, Elizabeth, and Edward... but I will never be \"Wales\"!",
			0
		},
		{
			{
				20507
			},
			1,
			"In another world, perhaps I would've been your real big sister.",
			0
		}
	}
}

