_G.pg.base.ship_skin_words[499012] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "I can see the commission team all the way from up here. Well? Are you heading out to greet them?",
	win_mvp = "Heehee... Now that's what I'd call a good \"break\"~",
	home = "Welcome back! Let's give you a nice, waaarm hug♪",
	mission = "",
	touch2 = "Go on – we're all alone here~♥",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "It's so nice getting away from the bustling party hall and being alone with you, Commander. I'm eager to see what we'll do now as your idea of a... \"break\"~",
	mail = "",
	touch = "Oh, you're back already? Then please, come here and let your heart be soothed♪",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "It's so nice getting away from the bustling party hall and being alone with you, Commander. I'm eager to see what we'll do now as your idea of a... \"break\"~",
	feeling5 = "Ah, so this is what you meant by \"a break.\" It certainly is a cure for boredom, and I am happy to have some alone time with you, buuut... (I know you're trying to keep me in check, and you're going to pay for that♥)",
	main = "While I like vistas as much as the next person, I'm awfully fed up with the port's scenery at this point. Battlefields differ in that regard... Ahh... I'll never tire of seeing them.|Heehee~ Don't you worry, I'm not going anywhere. Why would I, when it's you who brought me here?|Since we have access to a piano, could you help me work on my singing? I'm starting to feel restless from sitting around for too long... Heehee~",
	battle = "How DARE you ruin my special moment with the Commander!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Good timing, actually – the party was starting to bore me. Thanks for pulling me out, Commander~",
	vote = "",
	hp_warning = "",
	id = 499012,
	detail = "Mainz's favorite coffee is a nice party drink, though I think I still prefer Iron Blood beer. What do you prefer, Commander?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[899010] = {
	feeling1 = "My sisters in arms here may be righteous, but not you. Prepare to face divine punishment, sinner.",
	feeling3 = "I see my sisters in arms smile every day as if without a worry in the world. Perhaps this is their Canaan...",
	lose = "My Lord, why have you abandoned me...",
	propose = "This I do swear. Your joy is my will, your victory is my glory, and the place that I can call home, is by your side... Blessed be the Lord who has brought me together with you - my commander, my love, and... my light.",
	expedition = "Commander, my sisters in arms have returned from their commission.",
	win_mvp = "Ashes to ashes, dust to dust...",
	home = "Suffering is the brand of a warrior. Everyone, I'm proud of you for making it through.",
	mission = "Commander, it may not be the will of God, but you do have new missions issued from headquarters.",
	touch2 = "Commander, your self-respect...",
	voice_key_2 = -1,
	skill = "God's love is boundless.",
	drop_descrip = "Heavy cruiser – Saint Louis.",
	mail = "Commander, does it not matter if these letters remain unopened?",
	touch = "I fight so that there may be peace. That is the single role that I can play.",
	profile = "Because ruination befell my homeland, I was returned to nothingness before I was born. As I am now, I am but an illusion, a manifestation of an ideal. But as long as you continue to lead my way, I shall in return clear all obstacles standing before yours.",
	mission_complete = "While rewards may certainly be nice... I have no interest in them.",
	feeling4 = "I feel like I have earned the acceptance of the fleet. However, is this truly the land that I was promised? ... No, I do not mean to cast doubt upon anyone. I merely feel that... I may yet have a deeper purpose.",
	unlock = "It is an honor to meet you at last - my prophet, my leader. I am Saint Louis, brought to your side by God's will. As long as it is justice that guides your hand, then this humble spear shall be yours to wield.",
	feeling5 = "I finally understand now, Commander. What I experience now is the same as my sisters in arms - nay, perhaps even more fulfilling. Being a part of this fleet, by your side... is truly my Canaan.",
	main = "Commander, your time should not be squandered here. Leave the chores to me. |If there are any disputes within our ranks, allow me to handle the arbitration. That is my specialty. |Just winning the battle alone is enough to satisfy me, but you, Commander, ought to look far beyond that.",
	battle = "You shall all be purged equally!",
	upgrade = "For the sake of the role that we all must play...",
	voice_key = 89901,
	headtouch = "",
	feeling2 = "So this is the land that I was promised... Tell me, will this place be Sodom, or Canaan?",
	login = "Bonjour, Commander. Please instruct me, what should we do next?",
	vote = "",
	hp_warning = "This too... is God's trial...!",
	id = 899010,
	detail = "Commander, have you come here to offer your prayers to God?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[899011] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "",
	win_mvp = "",
	home = "I would much rather wield my spear upon the seas of battle than sit up here like a statue, Commander.",
	mission = "",
	touch2 = "",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "With all due respect, Commander, this finery and this throne are not fit for one such as myself. Despite the hallowed name I have inherited, I am nothing more than a warrior. —However, if such an arrangement pleases you, then I shall hold my objections.",
	mail = "",
	touch = "My weapon is always within reach. Should you will it, I am ready to sortie at any time.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "With all due respect, Commander, this finery and this throne are not fit for one such as myself. Despite the hallowed name I have inherited, I am nothing more than a warrior. —However, if such an arrangement pleases you, then I shall hold my objections.",
	feeling5 = "As a servant of God, there is no need for vanity— Having that said, as the recipient of your love, you are free to make any arrangements that please you. After all, great and permissive is God's love.",
	main = "So I've managed to capture your gaze? Your eyes are... Nevermind, it doesn't bother me.|My arbitration is needed? ...Very well, please excuse me for a moment. I will make sure to hear them out.|As the one guiding this fleet forward... Commander, you are the one best suited to this throne.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Commander, making me sit up here waiting for you by myself is a tribulation in its own right.",
	vote = "",
	hp_warning = "",
	id = 899011,
	detail = "I have no serious objections to sitting up here, but... there is one thing I cannot figure out. Are you perhaps deriving pleasure from seeing me up here like this?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[899012] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "Commander, our comrades-in-arms have returned from their commission. Let us take over their responsibilities so that they may enjoy the Spring Festival.",
	win_mvp = "",
	home = "God witnesses all your deeds. The trials you endure today will surely bear fruit in the future.",
	mission = "Here are today's assignments. Let's work together to finish them quickly.",
	touch2 = "A-ahem!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Commander, regarding your next appointment... Ah, hard work is one of the highest virtues of the Iris's holy knights. On weekdays or vacations, in knights' armor or the Dragon Empery's attire, there can be no pause to my prayer, my training, or my duties as the administrator of your will.",
	mail = "",
	touch = "",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Commander, regarding your next appointment... Ah, hard work is one of the highest virtues of the Iris's holy knights. On weekdays or vacations, in knights' armor or the Dragon Empery's attire, there can be no pause to my prayer, my training, or my duties as the administrator of your will.",
	feeling5 = "",
	main = "The Dragon Empery's Spring Festival... the celebration of a new year seems quintessential to all. Please rest well after completing your work.|La Galissonnière... seems to be thoroughly enjoying this holiday. Rather, that girl seems to be able to find enjoyment in just about anything. Quite broad-minded of her.|The greatest joy is to be able to have a life of peace. If everyone can act in accordance with God's will, then there would be no need for justicars.",
	battle = "Be cleansed in the Iris's light!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Bonjour, Commander. Please determine the duty you would like to fulfill first today.",
	vote = "",
	hp_warning = "",
	id = 899012,
	detail = "Let us also give our utmost this coming year, as to not squander the preparations everyone has painstakingly made.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[199010] = {
	feeling1 = "Hm? My party? You're not invited, so be a good commander and get back to work.",
	feeling3 = "I love throwing parties, but I'm not gonna FORCE anyone to show up to 'em. But I guarantee anyone who does show up is gonna have a heckin' good time, even the super-introverts!",
	lose = "Man, if only we'd brought more firepower~",
	propose = "Okay, I'm 100% ready for this! Oh, and needless to say, I love you too, Commander! I wouldn't invite you to go drinking if I didn't~ So, back on topic... There's one more thing we gotta do today besides partying – it's go on a date! Dee-ay-tee-ee!",
	expedition = "Yo, commission team's done, Commander. We oughta go give 'em a snack or something!",
	win_mvp = "Victoryyyy! Let's throw a big party when we get back!",
	home = "Fighting's important and all, but you gotta take regular breaks, Commander!",
	mission = "New missions! We need more manpower up in here!",
	touch2 = "Listen, if you did that on purpose, then consider my gears grinded!",
	voice_key_2 = -1,
	skill = "Let's get some hype up in this place!",
	drop_descrip = "Light cruiser – Seattle.",
	mail = "Commander, you've got new mail! Hell, it might be an invite to a party!",
	touch = "Commander, you wanna do some dance practice? You'll rise on the girls' popularity lists if you can dance well!",
	profile = "Heyoooo! The name's Seattle– Err, I don't technically have a real name, but just call me Seattle! Seriously, don't sweat the small stuff! Anyhow, I was one of the prototypes for the Worcester class, and as an improvement on the Atlanta class, AA is my A-game! Just leave anything with wings to me!",
	mission_complete = "Mission complete! Aren't you gonna celebrate, Commander?",
	feeling4 = "Glad you finally understand the magic of parties, Commander! That magic being: you can make friends with anyone if you just hang out with them! As an example: me and you are best buds now!",
	unlock = "Sup! You the one who woke me up? Alrighty then~ The name's Seattle! Nice meeting you!",
	feeling5 = "Hey, we're BFFs, so tell me who's your crush and I'll give you some hot tips~ Heheheh~ ... It's me? Wait, hold up, you serious? Y-y-you really mean it?!",
	main = "Hey, Commander... Isn't it kinda lonely with just one secretary? Whaddya say we liven it up and get some more peeps in here?|You free once you're done with work today, Commander? Listen, I'm throwing a cool party later! You can drop by any time if you want!|I've got zilch combat experience on paper, but with everyone teaching me stuff, I'll catch up in no time!",
	battle = "All right, let's gang up on 'em!",
	upgrade = "I feel like I could snipe a mosquito out of the air!",
	voice_key = 19901,
	headtouch = "",
	feeling2 = "Mi amigo, you oughta let up on your jabberwocky mission talky and just live a little sometimes. Listen, I'm throwing a party later, so stop by and have some fun, alright?",
	login = "You eat yet, Commander? If not, would you like me to whip something up real quick?",
	vote = "",
	hp_warning = "C'mon, team, we can do better!",
	id = 199010,
	detail = "I've got a party, tea time, girls meetup, and drinking get-together to attend... Okay! My schedule is PACKED! Guess that's not really a bad thing, though!",
	couple_encourage = {
		{
			{
				10206,
				10207,
				10208
			},
			1,
			"Hey, you girls wanna come to my party once we're done here?",
			0
		},
		{
			{
				30402
			},
			1,
			"I wanna know more about these Sakura Empire banquets you throw!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[199011] = {
