	expedition = "",
	win_mvp = "",
	home = "",
	mission = "",
	touch2 = "Eek! Hey pal, I think you might be a little tipsy there.",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Hey! Great to have you here, Commander! I've gotta ask, whaddya think of my dress? Looking real gorgeous, right? ...Phew, awesome! I was worried my dress didn't look nice and might be dragging down the party mood, that's all!",
