	feeling5 = "As much as I love me a hype party, I totally get the appeal of the occasional formal banquet like this. This way I can have some alone time with my sweetheart, y'know? Oh man, I'm feeling pretty dang drunk right now... Mmhh, shleepy...",
	main = "What kind of drink do ya want, Georgia? Ah, an Oxycola sour on the rocks? So the usual, then? You got it!|So like, you know parties are a group activity, right? Let's get you away from your drinking-alone corner and out in front of some friends!|I spy with my little eye a few peeps who don't party much... Just gimme a few minutes. I'm gonna go hit 'em up!",
	battle = "Heheh! Let's totally rock this place!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Hey! Welcome to my fabulous party, Commander! We're the life of the party tonight, you and I! Well, kinda.",
	vote = "",
	hp_warning = "",
