	main = "So this \"Momotarou\" pops out of a peach! What an amazing little guy!|Seattle, I got an invite to this party or something. Any idea for a talent show? It has to be something better than the \"Georgia Beam\"!|Commander, I just finished my new drink - mixing cola with tea! Come on, try it!",
