	feeling5 = "",
	main = "As long as you predict the movements of the goldfish in advance, there is nothing difficult about this game. |Since it's a holiday, we can afford to take it easy today... But starting tomorrow, we'll have to redouble our efforts! Got it, Commander? |Commander, since you've been kind enough to explore the festival with me, I'll share some of my food with you. Would you like some candied apple? Or how about some taiyaki?",
	battle = "",
	upgrade = "",
