_G.pg.base.ship_skin_words[399033] = {
	feeling1 = "",
	feeling3 = "",
	lose = "C-crap... Now everyone will see through my tricks...",
	propose = "",
	expedition = "",
	win_mvp = "Very well! Let us celebrate by pulling some party poppers!",
	home = "If you are getting bored backstage, how about playing a game of pop-up pirate with me? Heh heh, Kitakaze does not intend on losing!",
	mission = "",
	touch2 = "Wait, hold on! I'm not hiding anything over there! I bet you're doing this on purpose!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Mm, preparations complete. If I keep it up, the production will surely be a great success. The doves have been on their best behavior too. Commander, what do you think about Kitakaze's magic show?",
	mail = "",
	touch = "Know of any new magic tricks, Commander? Hurry up and tell me!",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Mm, preparations complete. If I keep it up, the production will surely be a great success. The doves have been on their best behavior too. Commander, what do you think about Kitakaze's magic show?",
	feeling5 = "",
	main = "I am well versed with this magic box! You put a person inside, and then it is totally fine to chop it to pieces! Commander, hop inside and let us give it a try! ...Hm? That's not quite right?|Hanazuki, please select one of these cards... Um, these are just regular poker cards, so there's no need to be so nervous...|Magic tricks with doves are a dime a dozen. I wonder if there's anything else small enough for me to use in my performance... Oh, I got it! Commander, I'm going to see if Suzutsuki will let me borrow Pooky!",
	battle = "Heheh, behold the elegance with which I run circles around my enemies.",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Commander, you've come at just the right time! Want to help me catch all these doves that are flying around? *sigh*... Why did they decide to act up all of a sudden?",
	vote = "",
	hp_warning = "",
	id = 399033,
	detail = "Commander, do you wish to assist me in my disappearing act? I, I do not enjoy being in that dark box, alone...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[399040] = {
	feeling1 = "Commander, I'm worried about you... You can do better, can't you?",
	feeling3 = "I'd like to get to know the other Sakura girls, and the others besides. What do you think of holding a mixer...? I could provide... the refreshments! Hehehe.",
	lose = "We lost... How will I tell the Commander...?",
	propose = "Now that I understand your feelings, Commander, I will offer you all that I am, body and soul... Phew... Saying that out loud is as embarrassing as I thought it would be. Hehehe.",
	expedition = "The girls you sent out on commission have returned. Would you like me to inspect the rewards for you? Commander?",
	win_mvp = "This was the result of everyone's hard work. I was merely part of the team.",
	home = "Welcome home. Commander, I have tea, snacks... and a massage chair here for you. Why not take a load off?",
	mission = "Is it a very difficult mission? I can help.",
	touch2 = "Commander? There's a time and a place...",
	voice_key_2 = -1,
	skill = "It's now my turn~",
	drop_descrip = "Large cruiser – Azuma.",
	mail = "I got the mail. Please look it over.",
