	feeling5 = "",
	main = "C-could you stop staring at me like that? You're starting to weird me out...|Hahah, seems like this manjuu needs some more practice if it's struggling with these meager waves!|*sigh*... I'm not feeling satisfied yet. Guess I'll go for another swim...",
