_G.pg.base.ship_skin_words[699010] = {
	feeling1 = "If not for your position, I would've sent you away to... Never you mind. Hmph!",
	feeling3 = "You possess insight and views superior to those of commonplace boors. But, as it stands, you could use some more... well, ambition.",
	lose = "You wretches... I will inflict this humiliation back at you a hundred times over!",
	propose = "A woman with great aspirations doesn't let commitments bind her. But... for you, I'll make an exception. And don't you dare vanish on me until your ambitions are realized!",
	expedition = "The commission team has returned. Take it from me, you really ought to venture out with them to see the sights of the world more often.",
	win_mvp = "They're surrendering already? So... We won? What pathetic adversaries we have.",
	home = "I believe the secretary should have the power to issue commands. Only while you're away, of course.",
	mission = "New missions? Be magnificent and get them done in a jiffy, okay? Chop-chop.",
	touch2 = "Tsk! Such boorish behavior...",
	voice_key_2 = -1,
	skill = "Bow before my might!",
	drop_descrip = "Battleship – Marco Polo.",
	mail = "A letter of surrender from our enemies? Then allow me to establish our terms.",
	touch = "For what have I been summoned?",
	profile = "I am Marco Polo, Sardegnian battleship. Compare me with Veneto if you so wish, but just for the record: I could do her job much better. Ohohoho!",
	mission_complete = "You've finished those chores? Magnificent! Now we can focus on more important matters.",
	feeling4 = "You command a whole fleet of ships, and you don't even try to use them to spread the Empire's– I mean, your own glory? It truly baffles me.",
	unlock = "I hope you know what you're in for, now that you've awoken me. Hehehe... You look to be a commander of valor and culture. Magnificent! I am Marco Polo. Now, come! Our first order of business is to spread the Sardegna Empire's glory through the world!",
	feeling5 = "You! What is the deal with you? I never said you should \"spread the glory of Marco Polo's name!\" You... You... You're too ambitious for your own good!",
	main = "All things of value are bound to fall into someone's hands, sooner or later. Better it be yours than someone else's.|The golden Dragon Empery... I have countless stories of it to share if you'll only lend me an ear!|Looking at the map... This port is unbelievably small. Has the thought of expanding it never crossed your mind?",
	battle = "Soldiers, weigh anchor! For the glory of Sardegna!",
	upgrade = "The greater one's strength, the more privileges one is entitled to. You know this, yes? Magnificent!",
	voice_key = 69901,
	headtouch = "",
	feeling2 = "Oh? You're approaching me? Instead of keeping me at arm's length, you wish to get to know me? Then by all means... Hehehe!",
	login = "So you've come prepared to sacrifice a portion of your time on this mortal coil in the name of productivity? Magnificent!",
	vote = "",
	hp_warning = "Danger is an opportunity! Have at you!",
	id = 699010,
	detail = "I don't mind you acting as my own Rustichello. In fact, I adore having someone who chronicles my life. Oh, but please do omit my mistakes!",
	couple_encourage = {
		{
			{
				60501
			},
			1,
			"A leader who second-guesses herself is no leader at all.",
			0
		},
		{
			{
				6
			},
			5,
			"For the glory of the Empire!",
			3
		}
	}
}

_G.pg.base.ship_skin_words[699011] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "The commission team has returned. Someone must receive them, but who?",
	win_mvp = "Acting on the Commander's behalf, I raise a toast to this victory!",
	home = "Where, oh where is my master who refuses to delegate work to a maid? Here, I've taken these duties upon myself in your stead.",
	mission = "You've been given new missions. Fascinating how announcing that is part of a maid's duties...",
	touch2 = "Hwaaah?!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Me? Serve as your maid? Oho! That's more like it, Commander! How magnificent and ambitious of you! ...Only temporarily? And you're content with that?",
	mail = "I've left your letter right over there. It's as easy to reach as possibly can be.",
	touch = "Routine tasks, making meals, greeting guests, filing paperwork, hatching plans, doing battle... I can perform anything you require!",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Me? Serve as your maid? Oho! That's more like it, Commander! How magnificent and ambitious of you! ...Only temporarily? And you're content with that?",
	feeling5 = "",
	main = "Interested to learn a trick, Anchorage? Watch this card... Tadah! It's gone! Oh, silly Commander. A magician never reveals her secrets.|I wonder how many maids our port has... And of them, how many are assigned to the Commander's office and personal quarters... Stop it, Marco! There's no point in pondering that question!|Is it not a maid's duty to issue a slap on the wrist when her master procrastinates? Hehehe! How magnificent that you understand!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Hm-hm~♪ Have you no orders for your maid? You're hardly the authoritative master I'd imagined.",
	vote = "",
	hp_warning = "",
	id = 699011,
	detail = "I've been told many desire to be in a position where they can give you hands-on assistance – like a maid does. Which is to say: I am envied by everyone around me. Hehehe, hehehehe~",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[299050] = {
	feeling1 = "Rejoice, dear Commander, for you can still turn to me for help now.",
	feeling3 = "I don't know too much about the Royal Maid Corps. Since I support you just as they do, there should not be much difference in our positions. Do you agree, dear Commander?",
	lose = "So this is the taste of defeat, Commander. How repugnant.",
	propose = "Rejoice, dear Commander! Starting today, I shall become your exclusive-use shipgirl! By exclusive, I mean special... Basically, I've become someone special to you, so can I stop looking after you today and just rejoice for myself? Heehee~",
	expedition = "A commission has been completed. Let us rejoice now, dear Commander.",
	win_mvp = "Victory is ours. Rejoice, dear Commander.",
	home = "Rejoice, dear Commander—I have come to bring you a full-course Sardegnian meal. ...It's too heavy, you say?",
	mission = "A new mission has arrived, Commander. Allow me to– Hmm? You're going to do it yourself?",
	touch2 = "Yes, do as you please with me. As long as it makes you rejoice, dear Commander.",
	voice_key_2 = -1,
	skill = "Please excuse me.",
	drop_descrip = "Light Cruiser—Plymouth",
	mail = "Rejoice, dear Commander, for new mail has arrived.",
	touch = "You'd like to hear me sing? Then, please tell me what you'd like to hear—if it's something I don't already know, I'm willing to learn.",
	profile = "I am the blueprint ship Plymouth, an alternate branch of the Edinburgh class. I give my thanks to you for manifesting me in this port. Please, use me as you see fit.",
	mission_complete = "The mission rewards are here. Let's open it—it'll be destroyed if I fire a shell at it? Understood.",
	feeling4 = "Rejoice, dear Commander, for I shall be assisting the Royal Maids today. ...With the assistance of my colleagues, I shall be able to support you to an even greater capacity –a reason to rejoice indeed.",
	unlock = "I offer my greetings to you who has manifested me, Commander. I am the blueprint ship, Plymouth. Starting here and now, I stand ready to execute your every order. May you rejoice in our blessed encounter.",
	feeling5 = "Commander, are there any wishes you'd like to have fulfilled today? I am no longer here just to support you. Should you desire, I shall assist you, serve you, and of course, love you... Rejoice, dear Commander, for there is nothing I will not do for your sake.",
	main = "Oh, do be careful now... Miss Edinburgh, it seems that the rumors of your clumsiness were... not greatly exaggerated.|Did you need some papers disposed of. *BOOM* ...There you go. Rejoice, for I have turned your troubles into a pile of ash!|Having trouble focusing on your work? Well, I suppose I could tell you a fairy tale. A long, long time ago...",
	battle = "I shall take you on.",
	upgrade = "Strength flows through me. Rejoice, dear Commander, for I have become \"easier to use.\"",
	voice_key = 29905,
	headtouch = "Your hand feels most pleasing upon my head. Thank you.",
	feeling2 = "You may rely on me more, Commander. After all, my duty is to help you help everyone.",
	login = "Rejoice, dear Commander, for this morning is most refreshing. How shall we start our day?",
	vote = "",
	hp_warning = "I'm ashamed to show you my unsightly side...",
	id = 299050,
	detail = "A pleasure to see you today. I hope to spend another wonderful day with you today, dear Commander. Mhm, quite the reason to rejoice.",
	couple_encourage = {}
}

