_G.pg.base.ship_skin_words[499070] = {
	feeling1 = "Get out of my sight. You're an eyesore.",
	feeling3 = "Hmph. I've taken a slight interest in you since I can see a smidge of potential within you. Then again, that much should be obvious given that I call you \"Commander.\"",
	lose = "You're horribly mistaken if you think you'll get away with this!",
	propose = "Marriage? What are you talking about? This is an act of insolence on your part, one-sidedly hoping I'll exchange vows with you. Obviously, it's my choice whether to accept or refuse... If you want my hand so badly, cry and plead for it one more time! And don't try to run away!",
	expedition = "The commission team has returned. I wonder what tributes they've brought me.",
	win_mvp = "Me being the MVP is such an obvious outcome I don't even feel happy about it.",
	home = "Look who's back. I suppose you have your moments as the Commander♪",
	mission = "Missions, eh... Do them yourself. I'm above all that busywork.",
	touch2 = "Eek! Don't touch me!",
	voice_key_2 = -1,
	skill = "Hahahaha! I'll squash you like bugs!",
	drop_descrip = "Battlecruiser – Prinz Rupprecht.",
	mail = "A letter... Nothing I'd care about, it seems.",
	touch = "What's that you're staring at? Hand it over. I want to see it for myself.",
	profile = "I'm Prinz Rupprecht, Iron Blood blueprint ship. It's my way or the highway. Hmph, obviously I get to act high and mighty because I AM high and mighty. I don't HAVE to follow your orders, they are merely suggestions to me!",
	mission_complete = "Mission rewards! I've claimed them in my na– What the hell! This is just a list!",
	feeling4 = "You belong to no one but me, Prinz Rupprecht. That should be obvious, seeing as how I have acknowledged you as \"Commander.\" Do you have a problem with being mine? Too bad – you've never had and never will have the right to object!",
	unlock = "Ooh, so you're the self-proclaimed Commander, huh... Hmph! Commander of what, exactly? From now on, I shall be the one issuing commands around here! Now, hurry along~♪",
	feeling5 = "You don't want to be mine? You have some nerve, you impudent cretin. You are mine, full stop. I don't give a damn what anyone else says! You belong to me, and that's that!",
	main = "A tea party? Who went and decided I have to spend my time on that? If anything, YOU should be spending time with ME♪|...Oh, this sweet candy? I got it from a destroyer. And no, you can't have any.|You can't even do this no-brainer work? And you seriously call yourself the Commander? ...Things would be better if I had your position.",
	battle = "Victory will be mine!",
	upgrade = "It's the obvious choice, because I am the strongest♪",
	voice_key = 49907,
	headtouch = "Blep!",
	feeling2 = "You should be thankful that someone such as myself would even deign to call a complete nobody like you \"Commander.\"",
	login = "You're late! What excuse do you have to keep ME waiting? Do you WANT me to send you packing?",
	vote = "",
	hp_warning = "How?! But, I'm the strongest...!",
	id = 499070,
	detail = "Tuning my rigging should just take a little... Whoa, calm down! Heed my damn command! ...You! Stop gawking and help me! It's only the obvious thing to do!",
	couple_encourage = {
		{
			{
				40304,
				49902
			},
			1,
			" That dummkopf is mine, you hear?!",
			0
		}
	}
}

_G.pg.base.ship_skin_words[499071] = {
	feeling1 = "",
	feeling3 = "",
	lose = "They... beat us? They beat ME?! There's no way...",
	propose = "",
	expedition = "",
	win_mvp = "Hmph! There's your victory! You'll obviously reward me for my efforts, yes?",
	home = "They've changed my port so drastically I don't know what's what anymore... I should've stayed home since the Commander's away... Whuah?! C-Commander?!",
	mission = "",
	touch2 = "D-don't you dare blame it on my dress!",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Woah, so this is the Dragon Empery's \"Spring Festival\" that I've heard so much about. But, why are they celebrating it in the middle of winter? And you, Commander – why are you helping with such a grandiose... Whuah?! What was that noise?!",
	mail = "",
	touch = "Where did that cretin bumble off to... Hyeep?! D-don't just sneak up on me out of the blue!",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Woah, so this is the Dragon Empery's \"Spring Festival\" that I've heard so much about. But, why are they celebrating it in the middle of winter? And you, Commander – why are you helping with such a grandiose... Whuah?! What was that noise?!",
	feeling5 = "You belong to me, which obviously means you have a duty to amuse me! Understood, simpleton? You're to give me a full tour of the port's Spring Festival makeover! Hold my hand and show me around! That's your job!",
	main = "Ägir mentioned a lion that dances in the air – I want to check it out... If I SAY it flies, then it FLIES, okay?! And you're going with me, obviously!|A red envelope? Are you that strapped for cash even though you run this place? ...Hm? You're giving it to me? I don't want it! Blep!|Here's what happens to idiots who don't pay attention to me! Hahaha! That's right, run in fear from my firecrackers!",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "So for the Spring Festival, a carp is needed as decoration, which then turns into a dragon... Doesn't make any sense to me. Besides, how in the world is a fish supposed to turn into... Whuah?! What the heck was that?!",
	vote = "",
	hp_warning = "",
	id = 499071,
	detail = "You are mine, and that means everything you make is mine as well! Nom! ...What'd you call this candied fruit thing? \"Tanghulu\"? It's sour yet sweet, and surprisingly tasty...",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[599010] = {
	feeling1 = "A soldier's failure dooms one, but a general's failure dooms the whole army. You're the Commander, so get your act together already!",
	feeling3 = "What do you do on your days off? I... like going out with my friends, I guess. Get some good food and drinks. It's a great change of pace! Oh right, since we have free time today, let's go do that right now!",
	lose = "Retreat now – I'll handle things over here!",
	propose = "Looks like you've already made up your mind. But, this venue isn't lively enough... Let's find an auspicious day and invite all our friends over for a huge banquet. I'm gonna invite everyone, so you better yell my name out to the world!",
	expedition = "Oh, it looks like our friends are back from their commission! Perfect timing, Commander, let's throw a welcoming banquet!",
	win_mvp = "Hmph, absolutely pathetic. Not even worthy of being my playthings.",
	home = "You must be tired from all that running around, right? Want me to help you relax? I can draw the bathwater for you, or give you a massage... You in?",
	mission = "Another job, huh? Just leave it to me. I'll have everything sorted out for you.",
	touch2 = "Oho? You've got guts. Real punchable guts.",
	voice_key_2 = -1,
	skill = "See how you like this!",
	drop_descrip = "Light cruiser - Harbin.",
	mail = "I picked up the mail for you on the way here. Hurry up and take a look!",
	touch = "If you have time to burn, wanna see one of my comedy skits? Hahaha, I've got quite a few little hobbies outside of fightin'.",
	profile = "The name's Harbin, light cruiser from the Dragon Empery. What, didn't expect to see me here? Ahaha, well, life is full of surprises. In any case, I don't plan on letting you down, and neither do my guns!",
	mission_complete = "Well done! I'll hand out the rewards, so you just worry about getting rested up.",
	feeling4 = "Commander, c'mon, let's get going! Go where, you say? Lemme think... Oh yeah, how about looking for some enemies to beat the crap out of? It's dangerous? Hah, not when I'm by your side!",
	unlock = "The name's Harbin, Dragon Empery light cruiser. You're the Commander of this joint? Hrmm... I like the look in your eyes, and your bod's not half-bad either... Good stuff! From now on, you're rollin' with me!",
	feeling5 = "I've been thinking, Commander. You should totally become mine. We'll go through heaven and hell together, get drunk off glory and riches together, and if you're ever in danger, I'll be there to protect you. Now that's what you call a whirlwind romance! Ahaha!",
	main = "Commander, want to cap off work with a bit of wine? Of course, you're free to drink something else. Gotta treat yourself right after a day of hard work, right?|Hai Tien's always sayin' stuff like \"you are what you eat,\" but she's always guzzling down those chilis like it's nobody's business. If you ask me, the best food is whatever fills your belly.|Chen Hai's out there doing divinations on the cosmos before she makes her move, but I'm the complete opposite. Hit first, ask questions later! Hahaha!",
	battle = "Everyone, follow me!",
	upgrade = "Hahaha! I'm itchin' for a fight!",
	voice_key = 59901,
	headtouch = "",
	feeling2 = "If you're not busy, want to step out for a chat? Haha, there's nothing to be embarrassed about. The best way to get to know someone is to have a nice, long chat with them, right?",
	login = "Mornin', Commander. Need help with anything today? There's no need to be shy - just say the word!",
	vote = "",
	hp_warning = "If you think you've got what it takes, come at me!",
	id = 599010,
	detail = "Commander, if there's anything on your mind, just lay 'em on me! Let's not beat around the bush.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[599011] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "The commission team just got back. How about we invite them along? The more, the merrier!",
	win_mvp = "",
	home = "Take a hot bath, and you wanna stay in there a bit longer. Go in the ocean, and you wanna start swimming. See what I mean? When people go places, it changes the way they feel.",
