_G.pg.base.ship_skin_words[599018] = {
	feeling1 = "",
	feeling3 = "",
	lose = "Heh... Even if I fall here, you're not laying a finger on my friends!",
	propose = "",
	expedition = "The commission team is back. Let's take a look... Alrighty! I've got everything I need to make some tasty snacks!",
	win_mvp = "A crushing victory! Let's celebrate with a banquet when we get back home!",
	home = "Geesh, just seeing you beaten and battered by the elements like that has me feeling bad for you, even if you don't think much of it. Hurry on in and take a warm shower, alright?",
	mission = "We've got another job coming up. Why not treat it as some light exercise? You'll get rusty if you sit at your desk all day.",
	touch2 = "Oho? If you're this enthusiastic, I suppose I'll take you up on it~",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Sorry to keep you waiting, Commander. So, how's my new look? It's got me a bit embarrassed... But, well, all that matters is that you like it.",
	mail = "",
	touch = "If you want me to stay here with you, know that I'm not going anywhere.",
	profile = "",
	mission_complete = "Another job done. The two of us make an unstoppable duo. Let's keep up the pace and pick up the rewards as well.",
	feeling4 = "",
	unlock = "Sorry to keep you waiting, Commander. So, how's my new look? It's got me a bit embarrassed... But, well, all that matters is that you like it.",
	feeling5 = "I heard that a \"date\" is a great way for two people to learn more about each other. Well, you choose the restaurant then, and I'll cover the bill. Let's treat ourselves to some kick-ass food and liquor! ...That's not it? Did I misunderstand something? I thought that's what it said in one of those novels...",
	main = "Even the most passionate romances eventually become tamed by time... No, no! That simply can't be! Commander, for our next anniversary, let's do something crazy!|Commander, I know we promised to go through hell and high water together, but I don't want to put you through hardships. What if you get hurt? ...Ugh, emotions really are so complicated.|What kind of food are you in the mood for? I'll take you out to somewhere nice tomorrow! You're my lover now, so how could I let you dine on anything but the finest? Ahaha!",
	battle = "I'll take up the front!",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "About to start on today's work? If you need any help, feel free to ask. We're practically family at this point, so whatever happens, we'll deal with it together.",
	vote = "",
	hp_warning = "",
	id = 599018,
	detail = "By the way, d'you reckon I'm any different right now compared to my usual self? For example... a little more feminine, or something?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[799010] = {
	feeling1 = "I'm actually curious as to how someone can keep failing over and over. You are an awful outlier.",
	feeling3 = "Ah! ...Another blackout. Yeah, it's a problem with my lab, not the port itself. All my tinkering has made the power really unstable. Just make yourself at home and wait for the lights to come back.",
	lose = "Tsk... I hate writing self-improvement reviews...",
	propose = "A ring, huh... So you'll be indebted to me if I accept it – is that right? Then I'll gladly take it. Sharing a special relationship with you works out nicely... because it makes it easier to examine your mind and body♡",
	expedition = "Commission complete. That's all she wrote. Nothing special.",
	win_mvp = "Done already? Then, let's get moving. We're not getting paid to stand around.",
	home = "Back safe and sound, I see. Here's the after-action report with all the data sorted out. I'll leave the debriefing to you.",
	mission = "Here are some mission instructions for you. I can do overtime if it's for science, but I'd rather not for this type of work.",
	touch2 = "Need to vent some stress, do you? Heehee♡",
	voice_key_2 = -1,
	skill = "How's this?",
	drop_descrip = "Aircraft carrier - Chkalov.",
	mail = "Letter for you, Commander. Be sure to give it a read.",
	touch = "What's up? Want me to get you some coffee?",
	profile = "I'm blueprint ship Chkalov, Project 71B aircraft carrier. I'll do a good job as long as you pay me, and if I ever ask for something, you can expect something in return. I hope we can have a mutually beneficial relationship.",
	mission_complete = "Mission complete. Maybe I'll get to return to my lab early today...",
	feeling4 = "You're more courageous than I took you for, Commander. What do I mean? Well, you know just how risky it is to be alone with me in this place... don't you?",
	unlock = "Introductions? Fine, fine... I'm Chkalov, Northern Parliament blueprint ship. That good enough? Let's get back to work then; it's a better use of time for both of us, right?",
	feeling5 = "I'll be frank with you. I find you fairly... no, VERY fascinating, Commander. You're the one who leads the shipgirls at this port. It's not often someone gets the chance to closely examine you from the inside and out, wouldn't you say? Heehee♡",
	main = "Ugh... Wish there was some vodka in here... Your office is so much stricter than my lab when it comes to rules and the like.|I'm curious – based on what criteria do you choose a secretary? Surely it's not just good looks? ...But if it is, don't be afraid to admit it♡|I'd appreciate it if you'd let me handle data analysis in addition to office work. Work is boring, but I can stick to it longer when it involves something I'm good at.",
	battle = "Sometimes, you have to get your hands dirty.",
	upgrade = "Well, that's one way of doing it.",
	voice_key = 79901,
	headtouch = "",
	feeling2 = "I sleep in my lab on most nights. There are some places to lie down, and for dinner you can always just order home delivery. Why don't you stay sometime, Commander?",
	login = "Oh, so you're a real workhorse. Suppose I'll really have to apply myself as your secretary then.",
	vote = "",
	hp_warning = "You're making this harder than it needs to be...!",
	id = 799010,
	detail = "You're not just here to chat, are you? If you've got something important to say, spit it out. Just don't expect me to respond right away because I'm busy.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[799011] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "The commission team has returned. Oh, looks like they're running over to their friends. Shouldn't you go see them, Commander?",
	win_mvp = "Will you let me examine your body later, as a reward? No?",
	home = "You look like you had a blast back there. I recommend getting some rest.",
	mission = "I hope inspiration will hit me as we go through these missions.",
	touch2 = "\"Come and give Ms. Chkalov a hug!\" Heehee♡",
	voice_key_2 = -1,
	skill = "",
	drop_descrip = "Oh? What made you come over here instead of heading down to the beach? Surely you didn't ditch your friends on a hard-earned day off just to see me? But, I don't mind. It's called a day off because you get to decide how to spend your time.",
	mail = "",
	touch = "I feel this occasion calls for a bottle of vodka.",
	profile = "",
	mission_complete = "",
	feeling4 = "",
	unlock = "Oh? What made you come over here instead of heading down to the beach? Surely you didn't ditch your friends on a hard-earned day off just to see me? But, I don't mind. It's called a day off because you get to decide how to spend your time.",
	feeling5 = "",
	main = "I've pinned down your swimsuit preferences after tracking your eyes and analyzing your phrasing when asked for feedback. Heehee.|Still hard at work? You're hardly treating this like a vacation day. No, no, I know it's for the sake of all of us. You can expect a little something from me later.|Seeing Northern Parliament girls take off their winter coats and put on skimpy swimwear must be a real treat. For you, that is.",
	battle = "",
	upgrade = "",
	voice_key = 0,
	headtouch = "",
	feeling2 = "",
	login = "Hanging out, basking in the sunset's glow together... It's pretty nice, wouldn't you say?",
	vote = "",
	hp_warning = "",
	id = 799011,
	detail = "I like the sea breeze, but the sun is a bit much for me. Life in the lab makes you sensitive to sunlight, you see. On that note, try not to spend TOO much time in your office, Commander.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[899030] = {
	feeling1 = "Your tale ought not to end here. Please regather yourself and press onward.",
	feeling3 = "The oracles of legend were said to be able to foretell the fates of humans. Even though I don't have that power, I've read your story up close, and believe that you have what it takes to become a true Champion.",
	lose = "Setbacks are a necessary component of any champion's tale.",
	propose = "To think that I, as a singer, would become part of my Champion's tale... What an unexpected plot twist. Heehee~ O Champion, shall we join hands and weave the paean to a more joyous tomorrow?",
	expedition = "Our friends have returned to us from their odyssey. I wonder what kind of stories they brought back with them?",
	win_mvp = "And thus, a new passage is inscribed in our Champion's paean––",
	home = "Our Champion returns triumphantly... I feel the inspiration for a new paean coming~",
	mission = "There's no need for haste, Champion. Keep it slow and steady, just as you always do.",
	touch2 = "Oh my... I suppose every champion's tale has indiscretions such as these~",
	voice_key_2 = -1,
	skill = "Thus exeunts the villains.",
	drop_descrip = "Large cruiser - Brest.",
	mail = "New mail has arrived.",
	touch = "Hmm...? Did you need my advice, Champion?",
	profile = "I am large cruiser Brest, born upon Iris Libre's hallowed ground. I love hearing all the tales spanning land and sea, and spreading my own tales through song and poem. I look forward to hearing the tales you are bound to weave, Champion.",
	mission_complete = "The mission rewards aren't going anywhere. There's no need for haste - we can always check them later.",
	feeling4 = "The bards of legend were said to travel the world, singing paeans of their champions. The paean I compose for your tale shall also be sung across the world one day.",
	unlock = "Are you our Champion? I am Brest of Iris Libre. Now that fate has brought us together, may our journey be blessed.",
	feeling5 = "The champions of legend accomplished feats that transcended time, but all mortals will succumb to fatigue. Should you ever feel tired, please make sure to rest. I shall nourish you with my finest song and verse.",
	main = "Why not stop to smell the roses on your odyssey forward? Take heed of nature's marvels and friends who cherish you – there are still many things here worthy of your attention.|Every life is a wonderful story – be it an epic akin to a turbulent storm, or a lullaby as calming as the gentle sea breeze. Everything is embraced by the land and the sea, and committed to memory.|What's my favorite type of tea? Umm, whatever you'd like. As for desserts... Well, I'm fine with just about anything...",
	battle = "Go forward with the Saintess of Victory's everlasting blessings.",
	upgrade = "A more harmonious timbre.",
	voice_key = 89903,
	headtouch = "Oh? Is this intended to bring me succor...?",
	feeling2 = "O Champion, I've heard a great many tales about you from many different people. Now, how goes the tale you narrate through your own eyes? How I wish to find out.",
	login = "O Champion, what tales of heroism will you weave into the annals of history today?",
	vote = "",
	hp_warning = "There's no need for haste. We have plenty of time still~",
	id = 899030,
	detail = "Phew... Oh my, I do believe our Champion has arrived. Why yes, I'm perfectly fine. I was just struck with inspiration for a new paean and simply must put pen to paper.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[899031] = {
	feeling1 = "",
	feeling3 = "",
	lose = "",
	propose = "",
	expedition = "The tide tells a tale... Ah, Champion, so the commission company has returned.",
	win_mvp = "",
