_G.pg.base.ship_skin_words[199040] = {
	feeling1 = "Your commanding ability has been evaluated... Simply following your orders is detrimental.",
	feeling3 = "Your individual tastes and interests... That's a good perspective. I'll ask my acquaintances for basic info later... For now, open your mouth. I made borscht, and this will help me determine your tastes. Come on, say \"ahh.\"",
	lose = "Combat appraisal complete. I shall maintain momentum while resuming formation, then launch a counterattack.",
	propose = "Confirming vitals all green. Hm? Oh, don't worry, I simply snuck a vital sensor onto you – a return gift for this ring you gave me. It's necessary to keep a regular check on your health, and to know when to come running when you need help. Makes sense, no?",
	expedition = "Confirming the commission team has returned. I'll go collect the goods.",
	win_mvp = "Combat appraisal complete. Moving on to the next stage of the operation.",
	home = "Welcome back, now have a breather. After-action review? Ah, right, you went on a sortie. Would it have been better if I'd joined you?",
	mission = "Confirming there are unfinished missions. If you won't do them, I'll remove them from your schedule as I see fit. You sure you want that?",
	touch2 = "How much intent is in this act you're committing?",
	voice_key_2 = -1,
	skill = "Freeze, then burst!",
	drop_descrip = "Aviation battleship – Kearsarge.",
	mail = "Confirming that a letter has arrived. Take a look.",
	touch = "Yes, I know you're here. What do you need?",
	profile = "I'm Kearsarge, Eagle Union blueprint ship given form. My design was a hybrid between battleship and aircraft carrier, giving me the ability to deal with almost any situation or battlefield. I hope you'll put my strength to good use, Commander.",
	mission_complete = "Confirming that rewards have come in. I'll go collect them.",
	feeling4 = "Though calling it a \"date\" is a misnomer, a date does present a great opportunity to learn your habits and savoir-faire. Here is your schedule for today. Give it a quick read, then we'll get started.",
	unlock = "Activation sequence complete. I am aviation battleship Kearsarge, Hybrid Idealization X given flesh and blood. Henceforth, I will serve you at this port. So, which division do I belong to, and what's my mission?",
	feeling5 = "I trust you, Commander, and I want to become intimately familiar with you. However, I'm unable to fully determine your feelings towards me due to my own ineptness... Do you trust me the way I trust you? Do you, as others would say, love me?",
	main = "Save the small talk for after work. I'm concentrating on my secretary duties, so don't disturb me.|It doesn't help to always look back on the past – keep moving forward, and don't stop. Even when you want to self-reflect, you must adapt to developments as they happen.|On occasion, I neglect your will and prioritize the here and now on the battlefield. While you are the Commander, sometimes you have to let your soldiers handle things – the sooner you accept this, the better.|(Kearsarge is sitting upright on the couch with her eyes closed. Is she asleep, or...?)",
	battle = "The advantage is ours! Strike!",
	upgrade = "Performance and fleet potential increase confirmed. Keep it up.",
	voice_key = 19904,
	headtouch = "...Hm? What are you doing?",
	feeling2 = "I've determined that establishing mutual trust between us is beneficial to my battlefield performance. So, without further ado, allow me to check your schedule... Hm? Is information-gathering not customary when getting to know someone?",
	login = "Ah, Commander. Pardon me for starting work without you. Pay me no mind and begin with your own tasks.",
	vote = "",
	hp_warning = "The operation is going awry... What is this?!",
	id = 199040,
	detail = "...I'm not sleeping, I'm just letting my brain rest a while. While, yes, I did leave the door wide open, you should at least knock before you enter next time, Commander.",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[399060] = {
	feeling1 = "Ever wonder what it would be like to get on a dragon's bad side? Surely you're not going to go out of your way to satisfy that curiosity... right?",
	feeling3 = "You still seem somewhat reserved around me. If you do not change your ways, then I have no choice but to treat you with greater dignity as well– (*gurgle*)... Th-that wasn't my stomach growling... it, it was the rumbling of thunder!",
	lose = "I've got a lot more bad vibes on me than I expected... Urgh...",
	propose = "Should we exchange vows, then an inseparable bond would form between us– indeed, this is both a blessing and a curse. Are you fine with that? ...I see. Heehee. In that case, what should we do next? A kiss? A hug? Or maybe...",
	expedition = "A military commission? I see. For the purpose of bringing me an offering, I presume?",
	win_mvp = "Worship me! Fear the raging Dragon God's storm! ...Ahaha, my shikigami have reverted back to soggy pieces of paper...",
	home = "Well done out there, Commander. Did you have a good fight? Oh, it's not like I had anything to do with it, so there's no need for that respectful tone.",
	mission = "Duties are to be fulfilled. Go forth and do your utmost, Commander.",
	touch2 = "Hmm... I wonder if this warrants a curse...",
	voice_key_2 = -1,
	skill = "Shikigami serpent, unleash your divine might!",
	drop_descrip = "Light cruiser - Shimanto.",
	mail = "Mail? Will someone drop by to deliver it...?",
	touch = "Got a prayer you want the Dragon God to hear? Want me to make it rain?",
	profile = "I am the Sakura Empire light cruiser, Shimanto. As a blueprint ship that embodies wishes given form and the unsealed dragon of lore, I shall hereby lend my assistance to your fleet, Commander– Oh, umm... You know, you're welcome to call me by my title of Dragon God...?",
	mission_complete = "All done with the mission? I see. Well done, then.",
	feeling4 = "Yes, that's right! You can chat with me and enjoy snacks with me as normal! Even if I am the Dragon God, right now, I'm just a regular friend who you can shoot the breeze with! And if you want, I can even go on a date with you! ...Umm, hey. I was totally serious about that, okay?",
	unlock = "Release the Seal of Denial; open your eyes and worship the great Dragon God– Heehee, don't worry about it. I am Shimanto, a fantasy given form through wishes embodied. Commander, don't be too hard on me, 'kay?",
	feeling5 = "I'm here to go on a date with you today, Commander, so there's no need to get hung up about that Dragon God thing. Come on, show me the ropes. This is my first time doing something like this, so I wouldn't be able to put on airs even if I wanted to– Heehee, you're getting a bit better at dealing with me, aren't you?",
	main = "What kind of offerings do I prefer? If you insist on knowing, your favorite snack will suffice... Err, ahem. I meant, anything will do.|You're not done with work yet, right? There's not much left, so keep at it. If you slack off, you might invite a curse upon yourself~|I can somewhat relate with the Guardian Fox's frustrations. Things are a lot better thanks to you, but being revered all the time can be kind of tiring... It's kind of embarrassing to be called the Dragon God all the time.|Perfect, all done. Oh, this isn't an ordinary paper airplane– it's a shikigami plane. Uhh, but, right now, it pretty much is just a paper airplane, just as you said... Mhm...",
	battle = "\"Ryuujin no hougeki wo kurae––\"",
	upgrade = "Can you make me even stronger? Then I suppose I shall use this power without reservation~",
	voice_key = 39906,
	headtouch = "Hmm...?",
	feeling2 = "How you conduct yourself and the attitude you exhibit towards me can only be one of two options– either you fear and revere me as the Dragon God lest I bring disaster upon you, or you trust and rely upon me, Shimanto, as shipgirl and Commander. The choice is yours; it matters not which you pick.",
	login = "Ahem. Commander, speak your wish to me. ...Hm? Why aren't you saying it? Do you want to give your secretary a day off?",
	vote = "",
	hp_warning = "Upon those who would lay hands on my scales, punishment descends––",
	id = 399060,
	detail = "Now then, set yourself free. This is your port– in other words, our home is now synonymous with the Dragon God's domain. Well, setting all that aside, just take it easy around me. There's no need for the formalities.",
	couple_encourage = {
		{
			{
				39905
			},
			1,
			" Keep a tight grip on that katana of yours. Heehee~",
			0
		},
		{
			{
				90103,
				80108,
				60110
			},
			1,
			" Do you hate green peppers that much...?",
			0
		}
	}
}

_G.pg.base.ship_skin_words[499080] = {
	feeling1 = "How boring- you're nothing more than dust on the windowsill. Ah, forget it, I'm not interested in you anymore. Hurry up and blow away in the wind already.",
	feeling3 = "Hmm, are you still not giving in to your urges? Do you have that much self-control, or are you just impotent? ... (Having that said, this degree of stubbornness is unusual... Am I doing something wrong? Or am I just not doing enough...?)",
	lose = "Th-there were a multitude of unforeseeable variables that contributed to this defeat... Ahem! If you understand, then I'll leave the rest to you!",
	propose = "How beautiful... this feeling of being acknowledged and accepted. It is a thousand times better than forcing trash to kneel before me... Why didn't I realize this sooner? Tell me~ ...Commander, let's fall deeper and deeper into the abyss together, just the two of us~♪",
	expedition = "The commission rewards have been collected and counted. So, how do you plan to repay me for using up my time and energy?",
	win_mvp = "These worthless bottom-feeders thought they could defeat me? Heehee.",
	home = "An acceptable job on your sortie. I suppose I wouldn't mind poking and prodding at the sensitive spots on your frail body– Ahaha, I wonder how soon you'll cry for mercy~♪",
	mission = "Too much stuff on your plate? Sigh, I suppose I can help this pitiful, impotent Commander. But, I do expect you to return this favor, okay?",
	touch2 = "Are you finally admitting that you have the same cranial capacity as a chimp? Heehee~♪",
	voice_key_2 = -1,
	skill = "You're a waste of ammo!",
	drop_descrip = "Destroyer - Felix Schultz.",
	mail = "You can't even get your own mail without me? Well, I suppose that's fine. I won't even ask you for repayment this one time.",
	touch = "Got the hots for me? Sure, feast those beady little eyes of yours on me, as much as you want~ Heehee, I wonder how long you'll be able to keep ogling me~",
	profile = "I am Felix Schultz, Iron Blood blueprint ship. Oh, you crave my power? Easy. Just use that rotten brain of yours to please me. You should be grateful I'm even willing to allow you to worship me instead of forcing you to submit unconditionally.",
	mission_complete = "Ohh? You actually managed to do your job. I suppose you aren't completely impotent, then. That earns you a few extra points of affection from me, Commander~♪",
	feeling4 = "(Now that I think things through, the Commander's actually a pretty good person... Wait, what am I thinking? If I acknowledge the Commander, it's all over for me... But...) Hmm? What is it? And how exactly are my personal thoughts any of your business?",
	unlock = "My, if it isn't the Commander. Good day. Though the fact that I've been summoned here by a human is a feat in itself, you will find that trying to bind me thusly is a foolish, Sisyphean endeavor. Indeed, I, Felix Schultz, shall make you kneel before me.",
	feeling5 = "*sigh*... I admit defeat. Not only did I fail to get you to kneel before me, I almost ended up acknowledging you. But... that only frees me up to go after you with any means necessary. Kneel before me, or become mine. I won't back down until you break.",
	main = "It's gonna be sunny tomorrow? Welp, that sucks. One fewer excuse to keep the Commander by my side.|Hmm? Did you say something? Can't hear you. Come a bit closer, and enunciate more~|(Hmm... Busy working again? ...There has to be some way of getting you to pay attention to me...) Hmm? Did you need something? I'm just minding my own business over here~?",
	battle = "Fail to show me my due respect, and I shall make you suffer.",
	upgrade = "Eheh~ That put me in a pretty good mood.",
	voice_key = 49908,
	headtouch = "You deemed it appropriate for someone of your position to touch my forehead? Well, I suppose I'll take pity on your ignorance and forgive you.",
	feeling2 = "Humans are nothing more than uppity beasts. I shall make you understand this, and you will kneel before me and wag your tail. Heehee~♪",
	login = "Did you miss me that badly? Heehee. Surely you didn't come all the way here just for some piddling chores?",
	vote = "",
	hp_warning = "S-stop staring and use that rotten brain of yours to figure something out!",
	id = 499080,
	detail = "I enjoy apples, especially the kind that's been chopped up into nice little bite-sized pieces. Yes, yes, just like that– Ahhn~ Mmgh~ Want some as well, Commander?",
	couple_encourage = {}
}

_G.pg.base.ship_skin_words[499090] = {
	feeling1 = "So be it. Our contract is now null and void. And one day, you will taste undiminished retaliation for your actions.",
	feeling3 = "So my summoning wasn't an officiated ordeal. It seems, then, that this was done by you as an individual with desires... Yes, it's fine to admit it. This way, I can be not just a shipgirl under your command, but Hindenburg, an individual.",
	lose = "Gritty adversaries we have. Come our next audience, please don't disappoint me again.",
	propose = "Our current contract isn't enough for you, and you want to take it even further? How cocksure you've become, Contract Binder... I shall grant your wish and give you what you desire. That is, if your body and soul are ready for the indulgence that is to come.",
	expedition = "Commission goods have arrived? Have someone else handle it. Doing everything by yourself is a waste of your limited time.",
	win_mvp = "Pain is the best teacher for the wretched.",
	home = "Your last battle is still on your mind, no? Were the foes interesting? Or was my performance perhaps unsatisfactory?",
	mission = "Do what you must do, Contract Binder... I'm referring to your missions.",
	touch2 = "I'm tempted to pound some decency into that body of yours, Contract Binder.",
	voice_key_2 = -1,
	skill = "Worms should bow their heads.",
	drop_descrip = "Heavy cruiser – Hindenburg.",
	mail = "Read your letter sooner rather than later, Contract Binder. I shouldn't have to point this out to you.",
	touch = "Speak now, before my interest in you goes away.",
	profile = "I am Iron Blood cruiser Hindenburg. Shipgirls such as I are apparently known as \"blueprint ships\"... a title I couldn't care less about. As long as you prove your might and don't bore me, I will obey the contract we've made.",
	mission_complete = "Mission complete. I don't remember making a contract with a human who grows excited over measly rewards, and yet here you are.",
	feeling4 = "You can try to manipulate a demon, but it's an undeniable possibility that the tables will turn on you. If you want the answer, seek it. I'll be waiting for you at the end of the line... No, I'm not daring you into anything. As the contract binder, this is your choice alone to make.",
	unlock = "Was it you who summoned me? You, a human, are my \"Commander\"? Very well. I'll temporarily allow this contract between shipgirl and human.",
	feeling5 = "How delightful you've made it this far, Contract Binder. How you did it is unimportant – all that matters is the end result, namely that you are now in my possession. Dismayed? Kneeling on the ground surely isn't THAT bad.",
	main = "Incidentally, what binds you and other shipgirls together? Is it trust? Money? ...Well, that's interesting.|Life here is so staggeringly boring. Contract Binder, relieve my boredom or I'll do it myself with your body.|Get me something to drink? How considerate of you to ask. I'll have coffee. Not too bitter, thanks.",
	battle = "Courage was your beginning, and it shall also be your end.",
	upgrade = "Don't forget to pursue your own growth, Contract Binder.",
	voice_key = 49909,
	headtouch = "My horns? Admire them all you want. Try to touch them, however, and I'm sure you already know what will happen.",
	feeling2 = "You wish to speak? Here I thought you were avoiding me out of fear... Very well. This is as good an opportunity as any to learn more about you.",
	login = "Forever toiling away for the sake of peace... Contract Binder, is this the fate you chose?",
	vote = "",
	hp_warning = "Seems I got a little overeager... Well played.",
	id = 499090,
	detail = "My wings? My tail? Do they really enthrall you that much? The inner workings of your mind elude me sometimes, Contract Binder.",
	couple_encourage = {
		{
			{
				49901
			},
			1,
			" You smell of danger.",
			0
		}
	}
}

_G.pg.base.ship_skin_words[999020] = {
	feeling1 = "It is the duty of Your ships to be commanded and to obey. This, I understand. Do not worry.",
	feeling3 = "You wish to go out with me? Very well. Allow me to equip the proper rigging... Hmm? There's no need for that? What, then, will we be doing? Just... playing outside? I see. If that is Your wish, then I shall accompany you, body and soul.",
	lose = "The defeated are deserving of their judgment. Please administer punishment upon me as You see fit.",
	propose = "You want me to do as I desire, even if it means leaving Your side? But, the fact that You've given this to me means that You don't really want me to leave... If that is what You desire, then I... I shall not do as You wish. I do not wish to leave Your side, Commander. If possible, I want to be with You forever...",
	expedition = "A new commission has been completed. May I check on the supplies?",
	win_mvp = "The proper thing to do after victory is... to celebrate? And in doing so, I am to make a \"V\" with my fingers?",
	home = "Congratulations on your triumphant return. Hmm? I knew not when You would return, thus have I been waiting here.",
	mission = "A new mission? Allow me to handle it. ...Hm? Commander, will you be coming along as well? Understood.",
	touch2 = "I understand. This is the sacred duty of \"consummation\" expected of all secretary ships... Am I wrong?",
	voice_key_2 = -1,
	skill = "Forgive me.",
	drop_descrip = "Battleship – Flandre.",
	mail = "It is my fault for not bringing You the mail in a timely manner so that You may check it... I am very sorry.",
	touch = "As You will, Commander.",
	profile = "Alsace-class battleship? The origin... of the shipgirl Flandre? I don't quite understand... My body, and the power hidden within it, serve no other purpose than to fulfill my sacred duties. You are the only being to who I submit, and thus, I can only become that which You desire.",
	mission_complete = "Mission complete. If I have fallen short in any area, please give me Your guidance and any punishment I deserve.",
	feeling4 = "If You are going to \"play\" today, I shall accompany You at all times– Hmm? Do I wish to \"play\" as well? I do not understand. If \"playing\" makes one feel better, there is no reason to object to it... Actually, would it be fine for me to \"play\" with You?",
	unlock = "Your will be done, Commander. I am battleship Flandre, Your ship, Your subordinate, Your servant. Bestow upon me Your orders.",
	feeling5 = "You want me to do what I want, not just obey You? But, Commander... whether it's \"playing,\" or making me feel better, all of that is only possible when I am at Your side, when I am serving You... I wish to remain with You. That is not blind obedience, but rather my true desire.",
	main = "Commandments and doctrines alike... are of little concern to me. All there is for me to do is obey Your orders.|You want me to... spread my wings like one of the birds outside? ...What do you mean by this? Are You asking me to offer you a treasure from far away?|My associates have been saying that they wish to become \"friends\" with me. What exactly is the nature of this \"friend\" relationship? Commander, do You also have \"friends\"...?",
	battle = "For victory, and for the Commander!",
	upgrade = "I humbly accept Your favor.",
	voice_key = 99902,
	headtouch = "What purpose... does this serve?",
	feeling2 = "Commander, what orders do You have for me today? If there is nothing for me to do, please allow me to wait nearby.",
	login = "Commander, please bestow upon me Your orders for today. I shall give body and soul to see Your will done.",
	vote = "",
	hp_warning = "My situation is less important than that of the enemy.",
	id = 999020,
	detail = "What is it that I wish to do? To obey Your orders, and fulfill Your wishes– such is the duty of us shipgirls, and such is my desire. Nothing else beyond that matters.",
	couple_encourage = {
		{
			{
				99901
			},
			1,
			" Those emotions... Are they all because of the Commander?",
			0
		}
	}
}
